INSERT INTO `competencias` (`id`, `competencia`, `titulo`, `subtitulo`, `IdEmpresa`) VALUES
(1, '01', 'Orientación a resultados', 'Alineamiento Empresarial', 1),
(2, '02', 'Comunicación y respeto a los demás', 'Relaciones Interpersonales', 1),
(3, '03', 'Trabajo En Equipo', 'Relaciones Interpersonales', 1),
(4, '04', 'Proactividad', 'Contribucion Personal', 1),
(5, '05', 'Autonomia', 'Contribucion Personal', 1),
(6, '06', 'Flexibilidad', 'Contribucion Personal', 1),
(7, '07', 'Compromiso con la Calidad', 'Gestión de la Operación', 1),
(8, '08', 'Gestión en condiciones segura', 'Competencias Funcionales y Técnicas', 1);
INSERT INTO `competencias_c` (`Fila`, `Competencia`, `Subtitulo`, `Texto`, `id`) VALUES
(1, 1, 'Orientación a resultados', 'Realizar en forma eficaz y eficiente las tareas que le conciernen dentro del proceso de fabricación que participa. Trabajar hasta alcanzar las metas o retos propuestos', 1),
(2, 1, 'Comunicación y respeto a los demás', 'Capacidad para entrar en Inter relación con otros en forma positiva', 2),
(2, 2, 'Trabajo En Equipo', 'Participar activamente en la consecución de una meta común, subordinando los propios intereses y considerando más importante el objetivo de todos que las circunstancias personales', 3),
(3, 1, 'Proactividad', 'Capacidad para actuar anticipándose a los hechos y a las necesidades futuras del proceso de fabricación que participa', 4),
(3, 2, 'Autonomia', 'Organiza eficazmente su puesto de trabajo, estableciendo las prioridades necesaria y utilizando el tiempo y los recursos de la manera más eficiente posible, resolviendo los problemas sin necesidad de la atención del superior', 5),
(3, 3, 'Flexibilidad', 'Capacidad para adaptarse a nuevas asignaciones consecuencia de imprevistos o cambios profundos de tareas. Capacidad para reconocer errores y modificar conductas.', 6),
(4, 1, 'Compromiso con la Calidad', 'Cumple con los procedimientos estipulados de la tarea que realiza, de manera de asegurar las especificaciones de calidad del producto. Cumplir y/o superar los objetivos de calidad requeridos, teniendo en cuenta la mejora continua de los procesos', 7),
(5, 1, 'Gestión en condiciones segura', 'Trabajar con conciencia de seguridad, minimizando los riesgos a nivel individual y grupal', 8);
