(777, '2018', 1, 12, 4, 68.75, 'B', 'Maria tiene poca participación en generación de OT y propuesta de mejoras.\r\nRealiza un buen trabajo en su puesto preocupándose por la seguridad y calidad. Debe trabajar en proactividad y autonomía de manera de anticiparse y resolver problemas por si misma como así evitar los tiempos ociosos que se generan cuando la linea esta detenida.\r\n', NULL, NULL, NULL, NULL),
(778, '2018', 1, 12, 5, 66.25, 'B', 'Sandra deberia presentar mas compromiso cuando se solicita en algún caso excepcional que venga.\r\nComunicación: debe trabajar en la propuesta de mejoras.\r\nTrabajo en equipo: en oportunidades a mostrado disconformidad con realizar alguna tarea (al lider). Mantener las 5S de su sector y ayudar en el resto de la linea.\r\nProactividad: Debe trabajar en evitar los tiempos ociosos que se generan cuando la linea esta detenida.\r\nFlexibilidad: suele expresar disconformidad cuando se le asigna otra tarea.\r\nCalidad y Se', NULL, NULL, NULL, NULL),
(779, '2018', 1, 12, 15, 61.25, 'B', 'Orient. a result.:No trabaja con SGI, poca generación de OT y no participa en reuniones.\r\nComunicación: debe trabajar en la propuesta de mejoras y anormalidades. Es poco comunicativa.\r\nTrabajo en equipo: Poca participación en GB. Demora en el te.\r\nProactividad: No se anticipa a necesidades futuras. Debe trabajar en evitar los tiempos ociosos.\r\nAutonomía: No toma decisiones por si misma.\r\nFlexibilidad: se destaca en este aspecto salvo que debe alinearse con el sistema.\r\n', NULL, NULL, NULL, NULL),
