(782, '2018', 1, 5, 248, 75, 'B', 'Orientación a los resultados: poco compromiso en aprender nuevo equipo\r\n\r\nTiempos ociosos. Fumar fuera de horario con llamado de atención verbal realizado en varias ocasiones\r\nTrabajar en equipo no para criticar si no para mejorar juntos\r\nNo autonomo para gestionar su aprendizaje\r\nchicles y caramelos', NULL, NULL, NULL, NULL),
(784, '2018', 1, 5, 247, 76.25, 'B', 'Orientación a los resultados: poco compromiso en eficiencia de la linea. Ganar tiempos.  Uso de celular\r\nPrestar atención y cumplir con llenado de registros en general. Falsificar registros. \r\n\r\nTiempos ociosos. conversa demasiado. \r\n\r\nMuchos reclamos en entregas de turno. Lo que no hago yo lo debe hacer el otro por mi sobrecargándose de tareas que me correspondían\r\n\r\nAlta proactividad sin presencia de Líder. Baja la misma cdo hay líder\r\n\r\nCalidad también es 5S\r\n\r\nNo uso de Mascara al momento de intervenir ', NULL, NULL, NULL, NULL),
(785, '2018', 1, 5, 245, 71.25, 'B', 'Orientación a los resultados: preocupación por resultados y eficiencia de la linea\r\nPedir que se me capacite cuando no entiendo algo\r\nPoca participación en GB. Desinterés. No sentirse parte.\r\nPoca pro actividad. Espera a que le den ordenes o lo manden. No resuelve problemas por si solo.\r\nNo demostró preocupación por temas de calidad en muestreo de tetra .  \r\nTiempos ociosos en re proceso.', NULL, NULL, NULL, NULL),
(786, '2018', 1, 5, 47, 83.75, 'MB', 'Orientación a los resultados: compromiso limitado recargando al Líder\r\nTrabajo en equipo recargando al líder', NULL, NULL, NULL, NULL),
(788, '2018', 1, 12, 17, 67.5, 'B', 'Comunicación: debe trabajar en la propuesta de mejoras y anormalidades.\r\nTrabajo en equipo: Mantener las condiones de su sector y del resto de la linea.\r\nProactividad: Debe trabajar en evitar los tiempos ociosos. Mantener las 5S.\r\nCal y Seg: Realiza su trabajo respetando ambos aspectos.\r\n', NULL, NULL, NULL, NULL),
(795, '2018', 1, 12, 26, 41.25, 'NM', 'Orientación Result: Poca predisposición en las tareas que se le asignan, no participa en el GB y demuestra poco compromiso. Llegada tarde a la linea.\r\nCom. y resp.: formas de comunicarse poco amables. Falta de detección de anormalidades.\r\nTrabajo en eq.: demora en el horario del te.\r\nProactiv.: No se anticipa a necesidades futuras. Debe evitar tiempos ociosos.\r\nAUT: No resuelve problemas por si sola.\r\nFlexib: Poco flexible cuando se le asigna nva tarea. Aveces no reconoce sus errores.\r\nCAL/SEG: Anillos y ar', NULL, NULL, NULL, NULL),
(800, '2018', 1, 12, 33, 66.25, 'B', 'Orientación: Debe participar de manera activa en las reuniones del GB. Falta de compromiso en HHEE para con la linea (jornada y arranques). Debe trabajar en completar los registros (regla de oro).\r\nComunic: debe proponer mejoras. Mejor trato con sus pares.\r\nTrabajo en eq: trabajar con sus pares en mejoras. \r\nProact: 5S. Flexib. trabajar mas con sistema.\r\nCAL: Reforzar la carga de planillas.', NULL, NULL, NULL, NULL),
(803, '2018', 1, 12, 50, 78.75, 'MB', 'Orientación: Muy buen compromiso y preocupación por la linea.\r\nComunicación: comunicar cuestiones operativas.\r\nAutonomía: Debe mejorar la toma de decisiones cuando esta el líder en turno. Buen desempeño cuando el lider estuvo de viaje, tomo a la linea como propia.', NULL, NULL, NULL, NULL),
