(811, '2018', 1, 12, 53, 92.5, 'E', 'Olga es una excelente colaboradora siempre dispuesta a la tarea que se le asigna y a mejorar día a día. Se destaca en varios aspectos tales como trabajo en equipo, comunicación y respeto, flexibilidad y calidad.\r\nDebe trabajar en ser un poco mas segura en lo que realiza y confiar en ella misma.', NULL, NULL, NULL, NULL),
(813, '2018', 1, 12, 59, 73.75, 'B', 'Orientac: trabajar mas con el sistema.\r\nComunic: poca deteccion de anormalidades.\r\nTrab equipo: mantener las 5S en su sector como en el resto de la linea.\r\nProac: evitar tiempos ociosos. Proponer mejoras.\r\nSe destaca en su flexibilidad, reemplaza al operador de envasadora. Es muy respetuosa y trabaja bien con Calidad y seguridad.\r\n', NULL, NULL, NULL, NULL),
(815, '2018', 1, 12, 65, 56.25, 'NM', 'Orient result: Poca participación en el GB. Se muestra en la linea con predisposición pero poca aptitud en el manejo de equipos.\r\nComunic: no informa anormalidades e inconv del proceso.\r\nTrab equipo: trabaja bien con sus pares pero debe mejorar las 5S sin que se le pida y trabajar con el GB.\r\nProactiv: no se anticipa a necesidades futuras, no propone mejoras y debe trabajar en tiempos ociosos.\r\nAutonom: No resuelve por si solo, todo lo consulta.\r\nFlexibi: Debe adaptarse al sistema.\r\nCAL: completar registros', NULL, NULL, NULL, NULL),
(818, '2018', 1, 12, 67, 83.75, 'MB', 'Comunic y respeto: Debe mejorar en la comunicación con su supervisor de turno antes de que el coordinador de GB, reforzar este canal de comunicación ante anormalidades en la linea y/o proceso. Mejorar el trato con sus pares, tiene una buena imagen de líder pero este aspecto debilita las relaciones.\r\nFlexib: Adaptarse a la asignación de nuevo personal y a los cambios repentinos en la programación que se generan.\r\n', NULL, NULL, NULL, NULL),
(822, '2018', 1, 12, 71, 62.5, 'B', 'OaR: Mayor compromiso cuando se le solicite venir algún fin de semana.\r\nCom: Proponer mejoras, mejorar comunicación efectiva de anormalidades.\r\nTrabajo en equipo: Mejorar las 5S de toda la linea.\r\nProac: Anticiparse a necesidades futuras. Evitar tpos ociosos.\r\nFlex: Solicita no separarse de su compañera Castro C.\r\n', NULL, NULL, NULL, NULL),
