(832, '2018', 1, 5, 151, 66.25, 'B', 'Poca proactividad. Solo acata ordenes y espera\r\nPoca comunicacion efectiva del proceso\r\nMuchos llamados de atencion en seguridad por falta de EPP en tareas que deben usarse\r\nPocas veces resuelve tareas por si solo\r\nNo viene los fines de semana, no importa si la linea produce o no. Falta de compromiso.', NULL, NULL, NULL, NULL),
(833, '2018', 1, 5, 134, 77.5, 'B', 'Algunos llamados de atencion por falta de epp\r\nFalta mas compromiso con la linea en cuanto a los fines de semana y mas participan en GB. Poco interes\r\nCuesta reconocer errores\r\nTrabajar mas en proactividad', NULL, NULL, NULL, NULL),
(834, '2018', 1, 5, 84, 81.25, 'MB', 'trabajar mas activamente en GB\r\nAlgunos desvios en seguridad\r\nTrabajar mas en equipo con el personal. \r\nComunicar efectivamente problemas en linea o proceso\r\nTrabajar de manera mas intensiva en reparaciones junto con mecanicos\r\n', NULL, NULL, NULL, NULL),
