(841, '2018', 1, 5, 152, 85, 'MB', 'Debe trabajar mas en flexibilidad. Situaciones de cambios inesperados generan irritabilidad y conflicto. Esto genera impacto en orientación a los resultados.\r\nPoca participación en sistema. \r\n', NULL, NULL, NULL, NULL),
(842, '2018', 1, 5, 171, 77.5, 'B', 'Orientación a los resultados trabajar mas en GB. Poca participación. Poca participación los fines de semana cuando se necesitan hacer tareas(balancines y soudronic).\r\nFalta trabajar mas en equipo. \r\nCuesta reconocer errores. Trabajar mas en flexibilidad.\r\n\r\n', NULL, NULL, NULL, NULL),
(844, '2018', 1, 5, 172, 77.5, 'B', 'Trabajar mas en GB. Poca participacion. Poco aporte.\r\nTrabajar en proactividad.\r\nCalidad se observan desvios que se deben a no controlar por exceso de confianza(tapas marcadas en horno)', NULL, NULL, NULL, NULL),
(845, '2018', 1, 5, 177, 75, 'MB', 'Poca participacion en el GB. Aportes negativos.Dispersa reunion. \r\nPoco compromiso en el aprendizaje de equipos como consola y Dorado\r\nDesarrollar mas el trabajo en equipo. Tareas que el no realiza se le recargan al compañero\r\nDebe trabajar mas en proactividad. Mucha intervencion del supervisor en el manejo de la gente en tiempos ociosos. En sus tiempos ociosos no trabaja en apredizaje.\r\nAutonimia mejorar el manejo de los recursos optimizandolos. \r\nFlexibilidad trabajar mas. Pierde orientacion  a los result', NULL, NULL, NULL, NULL),
(846, '2018', 1, 5, 180, 55, 'NM', 'OAR Poca participacion en GB. Aportes negativos. Bajos indicadores personales. Poco aporte personal.\r\nPoca capacidad de escucha y no reconoce errores.\r\nNo modifica conductas. Maneras inapropiadas al momento de comunicarse o darse a entender. \r\nNo trabaja en equipo. Quejas constantes de las personas que trabajan con el de que no transmite conocomientos y cuando tienen problemas en la linea mira para otro lado\r\nEn tiempos ociosos no busca tareas. No desarrolla actividades por su cuenta. Espera ordenes.\r\nNo re', NULL, NULL, NULL, NULL),
