(848, '2018', 1, 5, 224, 56.25, 'NM', 'Poco interes al momento de realizar las tareas. No hay aporte personal. En el GB no hay participacion activa. Indicadores personales bajos.\r\nNo viene los fines de semana. Poco interés en la linea. Recarga al compañero con tareas por bajo compromiso.\r\nComunicacion inapropiada hacia el supervisor al momento de recibir una orden o un cambio de tarea.\r\nPoco trabajo en equipo. Muchos problemas con el compañero de trabajo. \r\nPoca proactividad. Tiempos ociosos no aprovechados. Espera ordenes. No trabaja por si sol', NULL, NULL, NULL, NULL),
