(863, '2018', 1, 12, 82, 63.75, 'B', 'OaR: Poca participación en GB. Falta de compromiso los fines de semana.\r\nCom: Mejorar comunic. de anormalidades y de proceso.\r\nTeE: No participa del GB.\r\nProac: No se anticipa a nec futuras. Falta proponer mejoras y evitar tiempos ociosos. Lleva tiempo en su puesto y no aprendió a operar el equipo. ZONA CONFORT\r\nAUT: No resuelve problemas por si solo, falta toma de decisiones.\r\nCAL: lavado de manos', NULL, NULL, NULL, NULL),
(865, '2018', 1, 12, 89, 70, 'B', 'Com: Mejorar comunicación de anormalidades.\r\nTeE: Poca participación en el GB. Mantener las condiciones de su sector.\r\nProac: Falta proponer mejoras y evitar tiempos ociosos. 5S en toda la linea.\r\nFLEX: Resistencia al cambio de turno y a separarse de su compañera Orellano R.', NULL, NULL, NULL, NULL),
(866, '2018', 1, 12, 90, 62.5, 'B', 'Orientación Result: No participa en el GB y demuestra poco compromiso. \r\nCom. y resp.: Falta de detección de anormalidades. Poca comunicación con el líder.\r\nTeE: Cuando la linea esta detenida, no ofrece ayuda. Demora en el horario del te. Poca participación GB.\r\nProactiv.: No se anticipa a necesidades futuras. Debe evitar tiempos ociosos. Proponer mejoras\r\nAUT: Pocas veces resuelve problemas por si sola.\r\nCAL: Uso de cadenas. ', NULL, NULL, NULL, NULL),
(867, '2018', 1, 12, 145, 72.5, 'B', 'OaR: Falta de compromiso los fines de semana.\r\nCOM: Mejorar algunas formas de comunicarse.\r\nPROAC: Evitar tiempos ociosos.\r\nFLEX: Resistencia a nuevos puestos o cambios de planta.\r\nSEG: Uso de EPP en autoelevador. Uso de celular.', NULL, NULL, NULL, NULL),
(868, '2018', 1, 12, 178, 75, 'MB', 'COM: Buena comunicación en anormalidades.\r\nTeE: Mejorar en mantener las condiciones de 5S de los sectores comunes.\r\nPROAC: Mejorar en la propuesta de mejoras. Evitar conversaciones en la linea.\r\nSEG: Uso de EPP (gafas) y cinturón.\r\nParticipar de manera activa en el GB.', NULL, NULL, NULL, NULL),
(870, '2018', 1, 12, 206, 65, 'B', 'OaR: Poca participación en la generación de tarjetas.\r\nCOM: En ocasiones se percibe una comunicación irónica que no es agradable.En varias ocasiones ha sido difícil encontrarlo en el turno. Falta de comunicación con el supervisor (comiendo en FEM).\r\nTeE: Mejorar en mantener las condiciones de 5S de los sectores comunes.\r\nPROAC: Mejorar en la propuesta de mejoras. Evitar tiempos ociosos (muy conversador). Mantener las 5S.\r\nFLEX: Resistencia a nuevos puestos o cambios de planta.\r\nSEG: Uso de EPP y cinturón.', NULL, NULL, NULL, NULL),
(872, '2018', 1, 12, 207, 66.25, 'B', 'OaR: Da continuidad a la linea. Particip poca activa en GB. Compromiso los fines de semana (llegadas tardes).\r\nCOM: Poco respetuosa con compañeros y Sup. Transfiere conoc.\r\nTeE: Trabajo entre pares buscando un obj común. Mejorar trab con compañeros nvos.\r\nPROAC: Buena propuesta de mejoras y trabajos en linea. Evitar tpos ociosos.\r\nFLEX: Resistencia a trabajar con nvas pers. Aprender a reconocer errores.\r\nCAL: Uso de guantes. Lavado de manos. Portón cerrado/SEG: No subirse sobre las estructuras.', NULL, NULL, NULL, NULL),
