(883, '2018', 1, 6, 137, 81.25, 'MB', 'Ricardo se destaca por su buena relación y comunicación con su equipo de trabajo. Se maneja con total autonomía tomando decisiones en su turno. Ha mostrado un gran compromiso por la seguridad propia y la de su equipo.\r\nDebe continuar mejorando en tomar el mismo compromiso y autonomía para su grupo base a cargo.', NULL, NULL, NULL, NULL),
(885, '2018', 1, 6, 275, 90, 'MB', 'Lorena se destaca por su gran compromiso por cumplir con los resultados propuestos, su buena comunicación en todas las direcciones y su proactividad y autonomía para actuar. En este período consiguió afianzarse como administradora del pilar Autónomo, debe seguir por ese camino apropiándose de los indicadores de gestión del mismo.', NULL, NULL, NULL, NULL),
(886, '2018', 1, 6, 358, 83.75, 'MB', 'Julieta viene creciendo como supervisora, mejorando constantemente sus habilidades de comunicación y reforzando su compromiso por los resultados y su flexibilidad para adaptarse a nuevas directivas. Aprende de su trabajo diario y eso le permite tomar decisiones en el turno con mayor fluidez siempre considerando la calidad del producto y del proceso. \r\nDebe seguir creciendo y aprendiendo en el puesto, trabajando además el compromiso con la seguridad de su equipo de trabajo, algo que viene mejorando últimamen', NULL, NULL, NULL, NULL),
(887, '2018', 1, 6, 215, 78.75, 'B', 'Fabio se destaca por el compromiso con la calidad de los trabajos que realiza y por trabajar con seguridad. Debe mejorar en proactividad para cumplir con el plan de trabajo a su cargo.', NULL, NULL, NULL, NULL),
