(915, '2018', 1, 9, 263, 88.75, 'MB', 'El colaborador mostró notablemente una mejoría en las competencias requeridas para el puesto. Mejoro en cuanto al trabajo en equipo, la flexibilidad con los requerimientos del puesto y la autonomía, tomando decisiones operativas que mantuvieron una eficiencia adecuada de las instalaciones.', NULL, NULL, NULL, NULL),
(916, '2018', 1, 9, 325, 86.25, 'MB', 'El colaborador tiene un muy buen desempeño y desarrollo de competencias con una clara tendencia a un perfil de lider de línea o como auxiliar de área. Toma decisiones adelantandose a los hechos futuros. Sin embargo, hay competencias en las que si bien se demuestra una mejoría, resulta necesario consolidar los cambios en el tiempo y sobre todo en situaciones de mayor exigencia como lo es temporada alta.', NULL, NULL, NULL, NULL),
(919, '2018', 1, 9, 447, 32.5, 'NS', 'El puesto requiere una alta proactividad que la colaboradora no demostró bajo ningun aspecto. Nula preocupación por indagar en los estándares y herramientas existentes, por lo cual tampoco se recibieron propuestas de mejora de las mismas, en lo cual pueda reflejarse un valor agregado de la gestión realizada.', NULL, NULL, NULL, NULL),
