(951, '2018', 1, 12, 267, 73.75, 'B', 'Orientación a resultados: no siempre cumple con tarea asignada.\r\nComunicación y respeto a los demás: respeto ok, en cuanto a capacidad de comunicación y escucha, no siempre pudo expresarse claramente en situaciones con las que tenía problemas, no sigue los canales adecuados.\r\nTrabajo En Equipo: no siempre va a las líneas donde el equipo de trabajo la necesita.\r\nProactividad: poco proactiva en general.\r\nAutonomía: no siempre resuelve problemas por sí misma.\r\nFlexibilidad:', NULL, NULL, NULL, NULL),
(954, '2018', 1, 12, 58, 77.5, 'B', 'Orientación a resultados: no siempre cumple con llegada a horario. Cmpromiso y participación de GB ok.\r\nComunicación y respeto a los demás: respeto ok, en cuanto a capacidad de comunicación , no siempre avisa al líder.\r\nTrabajo En Equipo: no cumplir recarga a los demás.\r\nProactividad: poco proactiva en general.\r\nAutonomia: ok.\r\nCompromiso con la Calidad: chicle.', NULL, NULL, NULL, NULL),
(955, '2018', 1, 12, 371, 63.75, 'B', 'Orientación a resultados: no siempre cumple con tareas asignadas, como mantener y ayudar con condiciones de planta.\r\nTrabajo En Equipo: falta buscar objetivo en común, ayudar en donde el turno lo necesite.\r\nProactividad: poco proactiva en general. No interesado en 5s, no aprovecha tiempos ociosos.\r\nFlexibilidad: poca facilidad para reconocer errores.\r\nCompromiso con la Calidad: chicle.\r\nGestión en condiciones segura: cinturón y gafas.', NULL, NULL, NULL, NULL),
(956, '2018', 1, 12, 382, 81.25, 'MB', 'Comunicación y respeto a los demás: puede mejorarse comunicación en paso de turno.\r\nTrabajo En Equipo: puede mejorarse comunicación en paso de turno.', NULL, NULL, NULL, NULL),
(958, '2018', 1, 12, 400, 81.25, 'MB', 'Gestión en condiciones segura: por largar no hay que dejar de tener en cuenta la seguridad.', NULL, NULL, NULL, NULL),
(960, '2018', 1, 6, 261, 68.75, 'B', 'Reynoso, es una persona muy flexible comprometido con la calidad y la gestión de trabajo seguro. El debe mejora su autonomía y proactividad para poder lograr mejores resultados en su trabajo.', NULL, NULL, NULL, NULL),
(961, '2018', 1, 6, 363, 80, 'MB', 'Ariel es una persona que es muy responsable resalta por su respeto a los demás y proactividad. Debe trabajar un poco mas en la comunicación para poder lograr un mejor trabajo en equipo.', NULL, NULL, NULL, NULL),
(962, '2018', 1, 12, 398, 78.75, 'B', 'Comunicación y respeto a los demás: puede mejorarse comunicación en paso de turno, mayor comunicación a la hora de trabajar en puesto nuevo.', NULL, NULL, NULL, NULL),
