(965, '2018', 1, 12, 274, 67.5, 'B', 'OaR: Tareas asignadas que no han sido cumplidas en tpo y forma. Seguimiento de tareas (limp 72hs, corte de prod, excederse del programa). Mayor participación en GB y jornadas. Uso de celular. No responde el handie. Sin asistencia fines de semana largos.\r\nCyR: Mejorar en com. de anormalidades y sobre proceso. Eficiencias.\r\nTeE: Ausencia durante el turno. Plantear mejoras y mantener las condiciones de la linea. Falta de insumos para el otro turno.\r\nProa: Falta de insumos en linea (bobin). 5S. Evitar tpos ocio', NULL, NULL, NULL, NULL),
(967, '2018', 1, 12, 300, 78.75, 'MB', 'CyR: Mejorar comunicación efectiva de proceso. Transmitir conocimientos.\r\nProactividad: 5S. Evitar tipos ociosos.', NULL, NULL, NULL, NULL),
(969, '2018', 1, 12, 62, 65, 'B', 'OaR: Poca generación de tarjetas. Se le asignan tareas que en ocasiones no quiere realizar. \r\nCyR: Comunicación poco constructiva.\r\nProac: No se anticipa a necesidad futuras. Proponer mejoras. Evitar tpos ociosos.\r\nAUT: Pocas veces resuelve problemas por si sola.\r\nFlex: No se adapta a nuevas tareas. Poca flexibilidad.', NULL, NULL, NULL, NULL),
(970, '2018', 1, 12, 414, 80, 'MB', 'Positivo: gran compromiso y  flexibilidad.\r\nComunicación y respeto a los demás: puede mejorarse comunicación en paso de turno respecto a si se deja algo fuera de condiciones o estado de autoelevador.\r\nTrabajo en equipo: condiciones del sector.', NULL, NULL, NULL, NULL),
