(996, '2019', 1, 14, 486, 0, 'B', 'Macarena demostró en todo momento interés por aprender y generar aportes a la gestión. Es una persona muy honesta y responsable en su trabajo', ' Macarena se destaca en su empeño y compromiso por las tareas asignadas. ', 'Macarena esta iniciándose en su carrera profesional y tiene mucho potencial para desempeñarse con éxitos en el área de Calidad si así lo quisiera. Para continuar en este camino deberá hacerse dueña de los procesos, analizar diferentes alternativas para lograr resolver y ejecutar sus propuestas de mejora', '', ''),
