(1008, '2019', 1, 5, 439, 0, 'MB', 'Falta desarrollar autonomía en el sector de Playa. El desempeño en el autoelevador es muy bueno, pero debe afianzarse mas en lo operativo de Playa', 'Alta flexibilidad y compromiso ante los cambios imprevistos de tarea. ', 'Muchas veces se tuvo que marcar la utilizacion de los EPP . Con el correr de la temporada esto fue mejorando.', 'Alto compromiso.', 'Reforzar capacitaciones en utilización de EPP.'),
(1009, '2019', 1, 5, 103, 80, 'B', 'Esta temporada el desempeño fue diferente. Si bien cumple con las necesidades del puesto, el año pasado fue mayor la orientación a los resultados y el compromiso con la producción. Se observa distracción y menor proactividad.', 'Trabajo en equipo ', 'Comunicación efectiva debilitada. Sabe de problemas en los equipos, pero la comunicación no es fluida para resolverlos.', '', 'Reforzar capacitaciones sobre calidad para seguir afianzando conocimientos. '),
(1011, '2019', 1, 5, 504, 0, 'B', '', '', '', 'Alto compromiso con los puestos en su desempeño', 'Trabajo seguro'),
(1013, '2019', 1, 5, 332, 67.5, 'B', 'Cristian debe mejorar aspectos de autonomía y toma de decisiones respecto de la operación. \r\nNecesita ser mas pro activo. \r\nFalta adquirir conocimientos del equipo aun, pero los mismos no han sido demandados.\r\n', 'Flexibilidad ', 'Muchos problemas operativos que debería poder resolver y todavía no se observa la capacidad para hacerlo.\r\nDebe trabajar mas en aspectos de comunicación. No recibí en toda la temporada reclamos por problemas en el equipo, el cual demostró tenerlos.', 'Alto', 'Aspectos de calidad. Reforzar. Aspectos de seguridad. Reforzar.\r\nTemas referidos a Operación de impresoras\r\nConocimientos técnicos'),
(1014, '2019', 1, 5, 350, 0, 'B', 'Jorge debe trabajar mas en la autonomia sobre el equipo. \r\nDebe trabajar mas en equipo. rtabaja de manera aislada sin saber que problemas se presentan en la linea. Solo observa los suyos.', '', 'No se observa ese plus necesario para los operadores que ocupan un puesto critico\r\nFlexibilidad.\r\nDebe mejorar en proactividad. Dene anticiparse a los problemas', '', 'Aspectos de calidad y seguridad.'),
(1015, '2019', 0, 0, 418, 0, 'B', 'Tiempos ociosos mal utilizados \r\nDesvíos en seguridad\r\n', 'Flexibilidad', 'Falta comunicacion efectiva del proceso\r\n\r\n', 'Alto compromiso', 'Reforzar temas de calidad, seguridad y 5S\r\nCapacitación en operación de Padovan.'),
(1016, '2019', 1, 5, 418, 0, 'B', 'Tiempos ociosos mal utilizados\r\nVarios desvíos en 5S marcados por el supervisor ', 'Flexibilidad ', 'Desvíos en seguridad\r\nDemoras en desayunador\r\nFalta de comunicación efectiva del proceso', 'Algunos desvíos de tardanzas pero en gral alto compromiso', 'Seguridad, 5S y operación de Envasado Aseptico Padovan'),
(1017, '2019', 1, 5, 306, 0, 'B', 'Falta compromiso con estándares y sistema\r\nAlgunos desvíos en seguridad\r\nFalta de 5 S en puesto de trabajo marcada por el supervisor ', 'Trabajo en equipo', '5S\r\n', 'Compromiso condicionado por cuestiones personales', 'Reforzar 5S, seguridad'),
(1018, '2019', 1, 5, 321, 0, 'MB', 'Desvíos en 5S marcados por el supervisor', 'Orientación a los resultados\r\nTrabajo en equipo', 'Flexibilidad condicionada\r\nPro actividad en tiempos ociosos', '', 'Temas de calidad para afianzar conocimientos'),
(1019, '2019', 1, 5, 483, 0, 'B', 'Tiempos ociosos mal utilizados\r\nFalta de 5S en el sector. Desvíos marcados por el supervisor', 'Flaxibilidad', 'Comunicacion', 'Alto', '5S/Temas referidos a Calidad y seguridad'),
(1020, '2019', 1, 5, 482, 76.25, 'B', 'En principio se observa poco compromiso y desinterés. Con el correr de la temporada se observa un cambio rotundo.', 'Flexibilidad', 'Autonomia', 'Alto', 'Temas referidos a Calidad y 5S.'),
(1022, '2019', 1, 5, 431, 0, 'MB', 'Alto compromiso y flexibilidad', 'Pro actividad y flexibilidad', 'Algunos desvíos ne seguridad', 'Alto', 'Seguridad\r\nTemas referidos a calidad\r\nSeguir capacitando en SIG'),
(1023, '2019', 1, 5, 405, 0, 'B', 'Tiempos ociosos mal utilizados. Conversa mucho\r\nDemoras en el desayunador\r\nDetenciones provocadas por falta de comunicación con operadores\r\nLuego de charla al respecto de los desvíos mejora el desempeño', 'Flexibilidad. ', 'Poca comunicación con el supervisor y los operadores. \r\nTrabajo en equipo', 'Alto en horas extras', 'Temas referidos a calidad y seguridad.'),
(1024, '2019', 1, 5, 403, 73.75, 'B', 'Demostró interés siempre en aprender. Se le da oportunidad de operar Mectra', 'Compromiso y Flexibilidad', '5S', 'Alto', 'Temas referidos a Operación de impresoras\r\n5S\r\nSeguridad \r\nCalidad'),
(1027, '2019', 1, 5, 302, 0, 'MB', 'Guillermo siempre tiene predisposición para aprender y trabajar en nuevos desafíos. \r\nTrabaja muy bien con las 5S', 'Comunicación\r\nTrabajo en equipo', 'Tiempos ociosos mal utilizados. Debe mejorar en proactividad. No esperar la orden del supervisor', 'Alto', 'Temas referidos a Calidad\r\nConocimientos técnicos para desarrollar mas habilidades'),
(1028, '2019', 1, 5, 352, 0, 'MB', 'Pablo tiene un alto compromiso con los resultados. Trabaja incansablemente hasta alcanzar los objetivos propuestos', 'Trabajo en equipo y flexibilidad', '5S', 'Muy alto\r\n', 'Temas referidos a conocimientos técnicos\r\nTemas referidos a calidad y seguridad'),
(1029, '2019', 1, 5, 353, 0, 'MB', 'Trabaja muy bien en aspectos de seguridad y calidad', 'Orientación a los resultados', 'Trabajo en equipo', 'Muy alto', 'Temas referidos a capacitación técnica en esterilización  y 5S'),
(1030, '2019', 1, 5, 370, 0, 'MB', 'Jorge tiene un alto compromiso con su trabajo y las tareas que se le asignan. Cambien muchas ganas de aprender y emprender nuevos desafíos. ', 'Flexibilidad, trabajo en equipo y orientación a los resultados', 'Autonomia', 'Muy Alto', 'Temas referidos a Calidad, Seguridad y conocimientos técnicos '),
(1031, '2019', 1, 5, 463, 62.5, 'B', 'Desarrollar autonomía', 'Flexibilidad', 'Poca proactividad. Debe trabajar en este aspecto. Debe aprender a desenvolverse sin recibir ordenes de superiores', 'Alto', 'Temas referidos a autonomía y conocimientos técnicos. '),
(1032, '2019', 1, 5, 506, 0, 'B', '', 'Andres es muy pro activo y demuestra mucho interés en aprender y desarrollar conocimientos.', 'Comunicación. Se mueve del puesto sin avisarle al Lider.', 'Alto compromiso', 'Temas referidos a conocimientos técnicos, temas de calidad respecto a latas y hojalata.'),
(1033, '2019', 1, 5, 265, 0, 'B', '', 'Mucha preocupación por la calidad ', 'Demoras en ingresar al turno. No se reciben correctamente las novedades, ', 'Alto compromiso', 'Capacitación en operación de Mectra y temas referidos a la autonomía del equipo. '),
(1034, '2019', 1, 5, 245, 0, 'NM', 'No se observa preocupacion por cumplir con la tarea desiganda. \r\nNo revisa las latas generando detenciones a causa de no cumplir con su tarea.\r\nLlega tarde al puesto de trabajo\r\nNo utiliza la faja. En reiteradas ocasiones debe marcarsele que debe usarla', '', 'Poca capacidad para reconocer errores', '', ''),
(1035, '2019', 1, 5, 336, 0, 'NM', 'Este año Ariel demostró poca preocupación por alcanzar los objetivos propuestos. No se nota el ímpetu que debe tener un operario en un puesto critico.\r\nPuentes en seguridades\r\nNo utiliza los guantes \r\nNo usas protección ocular para tareas de sopleteo y amolado\r\nPocas veces trabaja con proactividad.\r\n', '', 'Desempeño inestable. Por mementos bueno, por momentos malo.', 'No demuestra el compromiso necesario para desarrollar las tareas del puesto.', ''),
(1036, '2019', 1, 5, 516, 78.75, 'B', '', '', '', '', ''),
(1037, '2019', 1, 5, 464, 0, 'B', '', '', '', '', ''),
(1038, '2019', 1, 5, 509, 77.5, 'B', '', '', '', '', ''),
(1039, '2019', 1, 5, 92, 0, 'B', 'Este año trabaja pro activamente', '', '', 'Alto', 'Temas referidos a Calidad y seguridad'),
(1040, '2019', 1, 5, 167, 0, 'B', '', 'Orientación a los resultados', 'Comer chicle en planta ', 'Alto', 'Temas referidos a calidad, seguridad y 5S'),
(1041, '2019', 1, 5, 285, 0, 'NM', 'No se comunica de manera correcta. Usa formas y tonos inadecuados \r\nNo trabaja pro activamente. Siempre espera que la manden. \r\nEn reproceso utiliza el tiempo ocioso para conversar\r\nNo colabora los fines de semana cuando se le solicito venir\r\nCuestiona decisión de movimiento de personal. No es flexible\r\n\r\n', '', 'Debe trabajar en seguridad. Comete actos inseguros(cruzar cinta DA y no usar escalera)', 'Bajo compromiso', ''),
(1042, '2019', 1, 36, 97, 58.75, 'B', 'Orientación a resultados: poca demostración de interés en que la línea ande. Poca participación en el día a día a la hora de resolver problemas. No se ve compromiso con la línea.\r\nNo participa de todas las jornadas, y cuando lo hace, es poco eficaz.\r\nComunicación y respeto a los demás: poca capacidad de escucha, no se respeta el pedido del Jefe Producción sobre cómo trabajar en la temporada respecto a la flexibilidad, aprovechamiento de tiempos, autonomía y predisposición. \r\nTrabajo En Equipo: no se nota tr', '', '', '', ''),
(1045, '2019', 1, 36, 98, 60, 'B', 'Orientación a resultados: Poco empeño en tareas asignadas, como en reproceso. \r\nComunicación y respeto a los demás: poca capacidad de escucha, no se respeta el pedido del Jefe Producción sobre cómo trabajar en la temporada respecto a la flexibilidad, aprovechamiento de tiempos, autonomía y predisposición. Comentarios de compañeras.\r\nTrabajo En Equipo: es importante el trabajo con pares buscando un objetivo en común y manteniendo un buen clima de trabajo.\r\nProactividad: tiempos ociosos en detenciones de la l', '', 'Flexibilidad, formas de comunicación.', 'Compromiso con calidad del producto', ''),
(1046, '2019', 1, 36, 100, 0, 'MB', 'Orientación a resultados: mucho compromiso y empeño en las tareas asignadas.\r\nComunicación y respeto a los demás: comunicación efectiva de proceso en turno, muy al tanto de lo que sucede en su sector.\r\nTrabajo En Equipo: busca un objetivo en común en la línea y en el turno, se adapta y colabora desde cualquier puesto. Trabaja en pos de mantener las condiciones de 5s del sector.\r\nProactividad: aprovecha tiempos ociosos en detenciones de la línea. Como desafío: proponer mejoras en la línea / sector.\r\nAutonomí', 'Flexibilidad y compromiso.', '', '', ''),
(1047, '2019', 1, 36, 190, 51.25, 'NM', 'Orientación a resultados: poca demostración de interés en aprovechar el tiempo y cumplir tareas. Desaparece de la línea. Poca participación en el día a día a la hora de ayudar resolver problemas (como levantar latas, completar pallets). Se le plantea como se debe trabajar al comienzo de temporada y no se cumplen objetivos.\r\nComunicación y respeto a los demás: poca capacidad de escucha, no se respeta el pedido del Jefe Producción ni de supervisor sobre cómo trabajar en la temporada respecto a la flexibilidad', '', 'Orientación a resultados\r\nProactividad\r\nFlexibilidad\r\n', '', ''),
(1048, '2019', 1, 4, 525, 0, 'B', 'Notable crecimiento desde el inicio de la temporada hasta el fin. \r\nPotenciar la confianza en si mismo para demostrar todo el potencial de trabajo.\r\n', '', '', '', ''),
(1049, '2019', 1, 4, 491, 0, 'B', 'Excelente desempeño a lo largo de la temporada. Siempre buscando mejorar el sector y el trabajo en equipo con sus compañeros.', '', '', '', ''),
(1050, '2019', 1, 4, 449, 0, 'B', 'Visible mejora respecto a la temporada anterior respondiendo excelentemente al desafío de estar en fábrica de conservas. \r\nSe propone hacer mayor énfasis en trabajo en equipo con los aduaneros de los otros turnos para mejorar el sector. ', '', '', '', ''),
(1051, '2019', 1, 4, 413, 0, 'B', 'Visible mejora respecto al año anterior, asumiendo el desafío de estar en aduana  de conservas. Hacer foco en el trabajo en equipo con los aduaneros de los otros turnos para potenciar el sector.', '', '', '', ''),
(1052, '2019', 1, 4, 287, 0, 'B', 'Mejoró muchísimo respecto al año anterior, excelente coordinación y comunicación con sus compañeros en los otros turnos, hay que reforzar la confianza en si mismo para potenciar sus trabajos.', '', '', '', ''),
(1053, '2019', 1, 4, 484, 0, 'B', 'Excelente temporada siempre predispuesto a colaborar. Potenciar confianza en si mismo para mejorar aun más.', '', '', '', ''),
(1054, '2019', 1, 2, 96, 0, 'B', '', '', '', '', ''),
(1055, '2019', 1, 2, 284, 0, 'B', '', '', '', '', ''),
