(1062, '2019', 1, 36, 233, 55, 'NM', 'Orientación a resultados: poca demostración de interés en aprovechar el tiempo y cumplir tareas. Desaparece de la línea.\r\nComunicación y respeto a los demás: poca capacidad de escucha, no se respeta el pedido del Jefe Producción ni de supervisor sobre cómo trabajar en la temporada respecto a la flexibilidad, aprovechamiento de tiempos, autonomía.\r\nProactividad: excesivos tiempos ociosos se va de la línea a conversar. No aprovecha tiempos.\r\nFlexibilidad: Poca capacidad para reconocer errores y cambiar debili', '', '', '', '');
