(1063, '2019', 1, 36, 318, 0, 'B', 'Orientación a resultados: no cumple estándar de seguridad: regla de oro. Reclamos de no estar en la línea. Trabajo en equipo también.\r\nComunicación y respeto a los demás: poca capacidad de escucha, no se cumple pedido de uso de EPPs.\r\nFlexibilidad: Poca capacidad para reconocer errores y cambiar debilidades ya marcadas.\r\nGestión en condiciones segura: no cumple uso de EPPS.', '', 'Gestión en condiciones segura', '', ''),
(1064, '2019', 1, 36, 118, 0, 'B', 'Poca predisposición con reproceso.\r\nMejorar trabajo en equipo.', 'Calidad: uñas, maquillaje', '', '', ''),
(1065, '2019', 1, 5, 181, 63.75, 'B', 'La operaria mastica coca en el puesto de trabajo.', 'Siempre con ganas de aprender y superarse', 'Debe trabajar sobre aspectos de calidad, proactividad y orientación a los resultados', 'Debe mejorar el compromiso respecto a la orientación a los resultados.', 'Temas referidos a calidad '),
