(1135, '2019', 1, 9, 339, 0, 'B', 'Mauricio es un colaborador con una actitud muy positiva ante los desafios y requerimientos del puesto. Sin embargo, aun debe trabajar en el conocimiento técnico de las operaciones. Habiendo recibido capacitación oportuna, el colaborador aun debe ir fortaleciendo dichos conocimientos a través de la consulta diaria y la toma de decisiones necesarias y orientadas a los resultados esperados por el desempeño del sector.', 'Es un colaborador con excelente predisposición para la ejecución de las tareas que se requieren en el sector en tareas normales y mantiene el mismo nivel de compromiso ante situaciones extraordinarias que requieren mas esfuerzo y dedicación.', 'El colaborador debe trabajar en afianzar los conocimientos técnicos, conocer los objetivos del área, analizar variables y actuar en consecuencia en ello. Si bien es una persona que mostró un aumento de su autonomía, debe analizar mejor la calidad de los trabajos realizados, evitando la adopción de medidas provisorias enfocándose en medidas mas sustentables.', '', '- Capacitación técnica en manejo de planta de tratamiento fisico-químico y biológico.\r\n\r\n- Técnicas analíticas de laboratorio.'),
