(1188, '2019', 1, 5, 131, 48.75, 'NM', 'La operaria demuestra poco interés en cumplir con eficacia sus tareas. Hubieron muchos tiempos ociosos mal utilizados. Conversa con personal de remanejo. Mucha utilización del celular en horario de trabajo. Muy poca comunicación ante las situaciones de falta de latas y sus motivos. Errores operativos como mezclar abre fácil y sin abre fácil.\r\nNo hay preocupación al momento de que la maquina no anda o no van latas. No se pregunta ni averigua el por que. Desinterés habiendo 2 personas.\r\nNo va a reproceso, y c', '', 'Pro actividad\r\nMuy poca autonomía. No resuelve problemas por si sola.\r\nAutonomía. No resuelve problemas por si sola. (ej. lata en sensor y espejo doblado.', '', 'Temas referidos a Seguridad, Calidad conocimientos tecnicos del equipo.'),
