(1192, '2019', 1, 5, 251, 0, 'B', 'Gabriel acepta de manera constructiva la salida del puesto de operador de Tetra en el cual se lo estaba capacitando y no alcanzaba los requerimientos del mismo. Fue totalmente flexible y comprensivo al momento de recibir la devolución.', 'Flexibilidad\r\n', 'Comunicación y proactividad\r\nSeguridad\r\nEl operador no utiliza los epp de manera permanente. Se debe estar reforzando este tema.', '', 'Manejo de autoelevadores/Temas referidos a calidad y BPM y seguridad'),
(1193, '2019', 1, 2, 278, 83.75, 'MB', 'Se desempeñó muy bien en su cambio de tareas por el traslado a Choele Choel.', '', '', '', ''),
(1194, '2019', 1, 12, 70, 87.5, 'MB', 'Margarita es una colaboradora que se preocupa por cumplir los objetivos que se le plantean ademas tiene compromiso con la empresa siempre dispuesta a colaborar y se caracteriza por reconocer errores.', 'O a R: Margarita muestra un elevado compromiso y orientación a resultados. \r\nCom: Siempre comunicativa aún en situaciones poco favorables para ella. \r\nProact: Se anticipa a necesidades futuras (insumos)\r\nAut: Se desenvuelve bien gestionando sus propios recursos.', 'Proact: deberia trabajar un poco mas en la propuesta de mejoras.\r\nFlex: en ocasiones no se siente cómoda trabajando en otros turnos.\r\nSeg: Debe ser mas cuidadosa en la velocidad de circulación y maniobras peligrosas.', '', ''),
(1196, '2019', 1, 12, 4, 75, 'B', 'Maria tiene un buen desempeño siempre respetuosa y flexible a lo que se le solicita. Debe mejorar algunas competencias como propuesta de mejoras y trabajo efectivo con SGI. Este año se ha notado una diferencia en su comportamiento cuando la linea esta detenida!', 'Proac: Se ha notado una mejora en este año evitando tiempos ociosos. Debe trabajar mas proponiendo mejoras.\r\nFlex: Dispuesta a nuevas asignaciones y puestos.Siempre flexible a lo que se le solicite.\r\nCal: Se destaca en asegurar la calidad del producto.\r\nSeg: Buen desempeño!', 'Com: Es respetuosa pero debe lograr poder comunicar de manera efectiva anormalidades y mejoras.\r\nTrab en equipo: Debe poder integrarse  con sus compañeras y trabajar mas en mantener las 5S.\r\nAut: Debe conocer mejor los estandares de su linea. Pocas veces toma decisiones en su puesto.\r\n', '', ''),
