(1203, '2019', 1, 36, 16, 50, 'B', 'Le cuesta reconocer errores. Debe trabajar en flexibilidad\r\nPoco compromiso para con la linea. Conversa mucho y no se concentra en su trabajo.\r\n\r\nEl año pasado en la devolución se marcaron muchas posibilidades de mejora. Ninguna se tomó.\r\n', '', '', '', ''),
