(1214, '2019', 1, 36, 81, 0, 'B', 'Trabajar en resultados\r\nTrabajar en sistema\r\n', '', '', '', ''),
(1215, '2019', 1, 36, 84, 0, 'B', 'Trabajar en sistema. Poca participacion en grupo base\r\nTrabajar en las formas de comunicacion hacia el personal\r\nReforzar trabajo en equipo\r\nTrabajar fuertemente en calidad\r\nTrabajar en transmision de conocimientos a su equipo', '', '', '', ''),
(1216, '2019', 1, 36, 86, 62.5, 'B', 'Trabajar en compromiso con los resultados, evitar tiempos ociosos\r\nTrabajar mas en equipo\r\nTrabahjar en comunicacion con las formas de expresarse y reacciones\r\nPoco compromiso fines de semana.\r\nCasi nula participacion en sistema y en grupo base\r\ntrabajar mas en seguridad y utilizacion de eep', '', '', '', ''),
(1217, '2019', 1, 36, 88, 0, 'B', 'Trabajar en orientacion a los resultados. Poca preocupacion con el equipo los fines de semana.\r\nEsto afecta al trabajo en equipo\r\npoca participacion en grupo base\r\nTrabajar en proactividad con tiempos muertos\r\nTrabajar en aspectos de calidad. Muchos problemas en entregas de turnos por limpiezas mal hechas', '', '', '', ''),
(1218, '2019', 1, 36, 91, 48.75, 'B', 'Necesita mejorar formas de comunicarse\r\nMuy poca proactividad. Tiempos muertos ociosos mal utilizados\r\nMejorar en autonomía.\r\nProblemas para reconocer y cambiar actitudes\r\nPoco compromiso con los resultados\r\n', '', '', '', ''),
(1219, '2019', 1, 36, 105, 85, 'MB', 'Trabajar un poco mas en sistema\r\n', '', '', '', ''),
(1220, '2019', 1, 36, 126, 0, 'B', 'Trabajar en proactividad y orientación a los resultados\r\nTrabajar mas en autonomía respecto de los grupos bases', '', '', '', ''),
(1221, '2019', 1, 36, 134, 0, 'B', 'Trabajar mas en aspectos de seguridad y proactividad. Utilización de epp. Tiempos muertos ociosos\r\nTapas manchadas y decomiso\r\nPoca participación activa en grupos bases\r\nPoca colaboración fines de semana. trabajar mas en resultados', '', '', '', ''),
(1222, '2019', 1, 36, 151, 55, 'B', 'Trabajar en aspectos de seguridad. NO utiliza epp\r\nTrabajar mas en resultados. NO viene los fines de semana\r\nTrabajar en autonomía. NO resuelve problemas \r\nTrabajar en proactividad. Tiempos muertos ociosos \r\nTrabajar en grupo base. Muy poca participación.\r\nTODAS ESTAS COSAS SE HAN MARCADO CON ANTERIORIDAD, MEJORAR CAPACIDAD DE ESCUCHA', '', '', '', ''),
(1223, '2019', 1, 36, 152, 0, 'B', 'Trabajar en aspectos de resultados. Participar mas en GB \r\nReforzar trabajo en equipo. Trabajar en resolución de conflictos con compañeros con mejor comunicación\r\n', '', '', '', ''),
(1224, '2019', 1, 36, 171, 0, 'B', 'Debe trabajar mas en resultados. Poca colaboración los fines de semana. \r\nReforzar participación activa en GB. Muy baja.\r\nTrabajar en flexibilidad. Dificultad para reconocer errores', '', '', '', ''),
(1225, '2019', 1, 36, 172, 0, 'B', 'Trabajar mas en resultados. Poca participacion los fines de semana. \r\nTrabajar en proactividad. \r\nTrabajar fuertemenete en GB. Muy poca participacion.\r\nTrabajar en comunicacion. ', '', '', '', ''),
(1226, '2019', 1, 36, 174, 80, 'MB', 'Trabajar en las formas de comunicarse.\r\nTrabajar en flexibilidad. \r\n', '', '', '', ''),
(1227, '2019', 1, 36, 177, 0, 'B', 'Trabajar fuertemente en resultados. Poco compromiso con el GB. Casi nulo\r\nTrabajar en las formar de tratar al personal. Muchas quejas de las formas.\r\nReforzar trabajo en equipo en resoluciones de conflictos con compañeros mejorando la comunicación\r\nTrabajar en proactividad con tiempos ociosos sobre todo en limpieza y jornadas de autonomo. Transmitir conocimientos.\r\nTrabajar en aspectos de flexibilidad. Le cuesta reconocer errores y aceptar opiniones diferentes de superiores y compañeros.\r\nReforzar aspectos ', '', '', '', ''),
(1228, '2019', 1, 36, 180, 0, 'B', 'Trabajar mas en resultados respecto del GB. Mejorar la participación e indicadores personales\r\nTrabajar sobre aspectos de flexibilidad. Le cuesta reconocer errores.\r\nMejorar comunicación. Trabajar en las formas de dirigirse a los demás.\r\nMejorar proactividad trabajando en tiempos ociosos\r\n', '', '', '', ''),
(1229, '2019', 1, 36, 195, 66.25, 'B', 'Trabajar en aspectos de resultados participando activamente en GB \r\nTrabajar mas en el desarrollo del trabajo en equipo reforzando la comunicación y la flexibilidad para lograr el equilibrio. \r\nTrabajar en proactividad con tiempos muertos \r\nTrabajar en aspectos de calidad. No se pueden traer colgadas las llaves', '', '', '', ''),
(1230, '2019', 1, 36, 200, 67.5, 'MB', 'Trabajar en resultados respecto del GB. Participar mas activamente.\r\nTrabajar mas en comunicación respecto de los equipos \r\nTrabajar en tiempos muertos respecto de proactividad. Fumar fuera de horario\r\nTrabajar en BPM respecto de higiene personal\r\nTrabajar en aspectos de seguridad. No utiliza guantes y comete actos inseguros ademas de no usar los EPP', 'Compromiso\r\nFlexibilidad', '', '', ''),
(1231, '2019', 1, 36, 218, 45, 'NM', 'Casi nulo compromiso los fines de semana y participacion en GB e indicadores personales.\r\nEsto hace que el trabajo en equipo no exista, ya que alguien mas tiene que hacer su trabajo. Esto tb implica que no le importen los resultados, y cunado se le expresa esta parte de su desempeño se torna inflexible, no reconoce la situación y contesta de malas maneras impidiendo la comunicación en buenos términos. \r\nPor otro lado la proactividad es baja, ya que frecuentemente hay detenciones por problemas de comunicació', '', '', '', ''),
(1232, '2019', 1, 36, 223, 80, 'MB', 'Poca participacion en el GB. Esto hace que los resultados sean bajos. No hay compromiso para llevar adelante el PM. Trabajar mas en resultados.\r\nMucho tiempo ocioso mal utilizado. Trabajar en proactividad. Errores operativos por no ser pro activo.\r\nTrabajar en flexibilidad y comunicación. Le cuesta reconocer errores y contesta de malas formas. Debe mejorar el trato con pares y superiores.\r\nTrabajar mas en aspectos de seguridad.Comete actos inseguros y no utiliza EPP\r\n\r\n', '', '', '', ''),
(1233, '2019', 1, 36, 235, 70, 'B', 'Trabajar en aspectos de resultados. Trabajar fuertemente en participación activa de GB e indicadores personales.\r\nTrabajar mas en autonomía para poder resolver problemas. \r\nTrabajar en proactividad. ', '', '', '', ''),
(1234, '2019', 1, 36, 294, 82.5, 'MB', 'Trabajar mas en resultados. Tiempos ociosos mal utilizados.Usar esos tiempos para trabajar en sistema. \r\nTrabajar mas en aspectos de seguridad. Se utiliza demasiado tiempo el celular. Des concentración en la tarea.', '', '', '', ''),
(1236, '2019', 1, 36, 259, 48.75, 'B', 'Debe trabajar en aspectos de seguridad. Realiza actos inseguros con frecuencia como no utilizar EPP, no trabajar con permisos de trabajo, anular seguridades sin consensuar con el supervisor.\r\nEn calidad debe trabajar mas en conceptos y teoría. Desconoce muchos aspectos de calidad fundamentales para desarrollar las tareas con seguridad y así tomar buenas decisiones.\r\nLe cuesta mucho reconocer errores y modificar conductas. Siempre busca culpar al alguien mas y no se hace cargo de sus errores sean voluntarios', '', '', '', ''),
(1237, '2019', 1, 36, 236, 0, 'NM', 'No trabaja con resultados. Nulo compromiso con los equipos. Esto hace que tampoco trabaje en equipo recargando a compañeros de sus responsabilidades. \r\nSiempre rígido para reconocer errores y modificar conductas. \r\nLa proactividad en muy baja. Tiempos ociosos mal utilizados. Pocas veces se adelanta a situaciones que complican las tareas del dia a dia.\r\nAutonomía muy baja. No resuelve problemas o no quiere resolverlos?\r\nParticipación muy baja en el GB y bajos indicadores personales.', '', '', '', ''),
(1238, '2019', 1, 36, 237, 71.25, 'B', 'Buena actitud a la hora de hacer actividades no propias del puesto. Buena predisposición a colaborar.\r\nMejorar en proactividad y en participación en GB.', '', '', '', ''),
(1239, '2019', 1, 36, 245, 55, 'NM', 'Debe trabajar en resultados. Participación casi nula en GB, ademas de indicadores personales muy bajos. \r\nTrabajo en equipo y desempeño afectados por falta de compromiso. Recaen tareas en los demás. Ademas en tiempos ociosos no colabora. \r\nCasi nunca resuelve problemas por si solo. Muy baja autonomía. \r\nPro actividad muy baja. Tiempos ociosos mal utilizados. \r\nComunicación poca y no fluida respecto de aspectos de la linea a que contribuyan a mejorar el sector, rendimiento o eficiencia de la linea.\r\n', '', '', '', ''),
(1241, '2019', 1, 36, 260, 73.75, 'B', 'Mayor protagonismo en GB. En objetivos no tener en cuenta la velocidad, también la calidad.\r\nComunicar proactivamente anormalidades y necesidades del equipo.\r\nPoco uso de barbijo.', '', '', '', ''),
(1242, '2019', 1, 36, 248, 0, 'B', 'Trabajar en orientación a los resultados, con participación mas activa en GB y mejorando indicadores personales. \r\nTrabajar en autonomía desarrollando capacidades y conocimientos en las maquinas que posee a cargo, \r\neliminando la sobrecarga de tareas en los demás compañeros, y así mejorando el trabajo en equipo.\r\nFuma fuera de horario en muchas ocasiones dejando de lado los resultados. \r\nTrabajar en proactividad, ocupando tiempo ociosos en mejoras en puesto de trabajo y la linea que tiene a cargo. ', '', '', '', ''),
(1243, '2019', 1, 36, 247, 70, 'B', 'Autonomía se puede ganar más, algunas cosas siguen dependiendo del líder.\r\nBuena predisposición a los cambios de línea.\r\nCalidad: producción de PNC. Necesidad de estar sobre variables críticas del equipo. No producir con desvíos.\r\nSeguridad: intervención con máquina en movimiento, no se usan EPPs producto caliente.', '', '', '', ''),
(1244, '2019', 1, 12, 82, 62.5, 'B', 'En general Daniel tiene varias oportunidades de mejora. Se destaca su flexibilidad y trabajo con seguridad. Necesita involucrarse mas con su puesto, aprender y afrontar nuevos desafios. Con SGI su trabajo es nulo.', 'Flexibilidad: En general no ofrece resistencia a las nuevas asignaciones pero no se adapta a trabajar con el sistema.\r\nSeguridad: No se han observado situación de actitudes inseguras. Usa correctamente los EPP.', 'Orientación: No participa de las reuniones de GB. Muestra poco compromiso los fines de semana. \r\nComun: Ser mas proactivo en comunicar anormalidades y situaciones de su puesto.\r\nTrab: trabajar mas en 5S, agua en el piso, producto, etc. Integración en grupo base nula.\r\nCalidad: mantener el sector mas limpio, informar a frente a un desvio, limpieza de pallets antes de ingresar a ser consumidos\r\nProac: No propone mejoras, eviatr tpos ociosos, 5S.\r\nAut: Trabajar en la toma de decisiones y realizar autónomo a su', '', ''),
(1246, '2019', 1, 12, 5, 71.25, 'B', 'Tiene un buen desempeño. Debe mejorar algunas competencias como propuesta de mejoras y proactividad.', 'Orientación: Se destaca su iniciativa de mantener la linea en producción ayudando a asegurar la eficiencia. Poca participación en jornadas, no viene los fines de semana.\r\nCAL y SEG: se muestar siempre preocupación por estas competencias.', 'Trabajo: Mejorar 5S. Unificar y ser un unico equipo de trabajo.\r\nComunicación: Fortalecer la comunicación efectiva de anormalidades.\r\nProac: Aportar mejoras, anticiparse a la falta de insumos por ejm, evitar tiempos ociosos (conversar con hermano en linea).\r\nAut: Debe conocer mejor los estandares de su linea. Pocas veces toma decisiones en su puesto.\r\nFlexible: en gral cumple es flexible salvo ocasiones cuando se lo solicita el lider.', '', ''),
(1248, '2019', 1, 12, 15, 65, 'B', 'Silvia es una colaboradora que no se muestra. Necesita involucrarse mas en la linea de la que es parte como con sus compañeros. Debe aprender a resolver por si sola los problemas y ser mas proactiva. Se necesita un cambio en su desempeño por segundo año consecutivo.', 'Comunicación: Respetuosa y de trato cordial, debe mejorar en poder dar respuesta cuando se le pregunta algo de la linea.\r\nTrabajo en equipo: es una persona que tiene buena llegada en su lugar de trabajo pero necesita terner una participación mas activa.\r\nFlexibilidad: Siempre dispuesta a ocupar el puetso que se le asigne.\r\nSEG: Trabaja de manera segura.', 'Orientación: Debe tomar mas responsabilidad en su puesto de inspección de etiquetado. Controlar tiempos en el te. Debe estar mas atenta, evitar despistes.\r\nProactividad: Pocas veces se anticipa a necesidades futuras, falta proponer mejoras, evitar tiempos ociosos.\r\nAutonomia: debe involucrarse mejor en el puesto que ocupa, aprender y poder resolver por si sola. No realiza tarjetas.\r\nCAL: En ocasiones mastica chicle. Mayor atención en la inspección de etiquetas.', '', ''),
(1249, '2019', 1, 12, 17, 66.67, 'B', 'En general tiene un buen desempeño. Se destaca en su preocupación por darle continuidad a la linea aportando en la calidad del producto. Buena autonomia en los equipos que aun se puede mejorar. Trabajar en proactividad.', 'Orientación: buen desempeño, siempre preocupada por que la linea no se detenga. Cuando se da una orden la cumple. Poca participación en jornadas, no viene los fines de semana.\r\nComunicación: se destaca la comun. de anormalidades y cuestiones referentes a la linea.\r\nAutonomia: Resuelve en parte problemas de su linea. Debe conocer mejor los estandares de linea DP2.\r\nFlexibilidad: Ha mejorado bastante esta competencia en los ultimos años.\r\nCAL: se destaca su preocupación porque el producto salga en condiciones', 'Trabajo: Mejorar 5S. Unificar y ser un unico equipo de trabajo.\r\nProactividad: anticiparse a necesidades operativas, 5S cuando la linea este detenida, buscar a analista de calidad para evitar tiempos ociosos.\r\nSEG: Mejorar el no pasar por debajo de cintas, saltar traspasos de cintas, etc.', '', ''),
(1256, '2019', 1, 12, 33, 81.25, 'MB', 'Rafael tiene muy buen desempeño, tiene competencias que aun se pueden mejorar pero para trabajar de manera mas fuerte seria su compromiso con la linea cuando se soliciten tareas en horas extras. Debe poder controlar su temperamento.', 'Orientación: Se preocupa por realizar bien su trabajo y muestra preocupación cuando la linea esta detenida. Debe trabajar mas en su compromiso cuando hayan tareas en horas extras.\r\nComunicación: En general tiene buena comunicacion con sus pares salvo algunas ocasiones donde se vio superado haciendolo de manera poco amable. Comunica anormalidades de la linea y posibildiad de mejora.\r\nTrabajo: Trabaja con el fin de conseguir un objetivo en comun. Se preocupa por las 5S.\r\nProactividad: buen desempeño. Muestra ', 'SEG: reforzar uso de EPP.\r\n', '', ''),
(1258, '2019', 1, 12, 50, 77.5, 'MB', '', 'Orientación: Muestra gran preocupación por la linea, se destaca su compromiso. Debe mejorar en prestar mas atención.\r\nTrabajo: se desempeña bien trabajando en equipo en busqueda de un objetivo en común (limpieza de TK y circuitos, reemplazos del te)\r\nProactividad: Gralemente se anticipa a las limpiezas y necesidades de la linea, trabaja en 5S.\r\nFlexibilidad: Siempre dispuesto a colaborar con la empresa, hacer 12hs y aprender en nuevos puestos.\r\nCAL y SEG: buen trabajo en el uso de EPP!', 'Comunicación: Es una persona respetuosa y comunicativa aunque ésta ultima debe ser reforzada. Debe poder transmitir de manera clara lo que quiere comunicar.\r\nAutonomía: Debe trabajar en resolver inconvenientes por si solo sin necesidad de consultar varias veces, debe mostrarse mas seguro.', '', ''),
(1260, '2019', 1, 12, 53, 85, 'MB', 'Olga posee un muy buen desempeño. Es respetuosa y se preocupa por hacer bien su trabajo. Debe mejorar en ser mas segura y poder tomar decisiones por si sola.', 'Orientación: Preocupación por cumplir con lo que se leasigna. Gran compromiso con la empresa.\r\nComunicación: Se destaca por el respeto.\r\nTrabajo: Tiene buena interacción con sus pares, genera acuerdos y ayuda a sus compañeros.\r\nProactividad: Propone mejoras y en tiempos libres avanza con tareas de autonomo de las lineas en la que es administradora.\r\nFlexibilidad: Siempre dispuesta a las tareas que se le asignen.\r\nCAL y SEG: No es una dificultad para ella.', 'Autonomía: Respecto a su puesto se la ha notado en ocasiones duditativa, debe trabajar en resolver por si sola.\r\n', '', ''),
(1262, '2019', 1, 38, 275, 82.5, 'MB', 'Lorena es una referente en el área de producción, coordinando actividades vinculadas a la gestión de los recursos humanos. ', 'Trabajo en equipo. Clima. Comunicación. ', 'Proactividad y flexibilidad para adelantarse a los sucesos/escenarios futuros. Trabajar con las herramientas del sistema de gestión integral que permitan agregarnos valor en vías a solucionar problemas.  ', '', 'Metodologías (herramientas) del sistema de gestión integral. Conocimiento de indicadores operativos y el impacto de las acciones sobre los mismos. '),
(1264, '2019', 1, 38, 258, 0, 'MB', 'Ricardo es un referente en su rol de líder de grupo base concentradores, con fuerte inclinación en implementación del Sistema de Gestión Integral, pensando en escenarios futuros que nos permitan adelantar a los problemas potenciales. ', 'Autonomía, proactividad y orientación a resultados. ', 'Comunicación con los diferentes niveles/áreas de la empresa. Dificultad para convivir con escenarios ambiguos y/o fluctuantes. ', 'Gran compromiso durante temporada en garantizar continuidad en las operaciones y durante los  mantenimientos de los sectores a cargo de él y gestión de proyectos nuevos. ', 'Tratamientos térmicos. Métodos y conceptos de limpieza. '),
(1265, '2019', 1, 38, 215, 53.75, 'NM', 'Fabio es un colaborador que desempeña funciones, a nivel general tanto de pintura en planta cómo operaciones durante el turno. ', 'Oficio en tareas de pintura ', 'Autonomía, proactividad, actividades vinculadas a la calidad y seguridad, compromisos con planes de trabajo (pintura), cumplimiento con las BPM de planta. ', 'Tareas de pintura ', ''),
(1272, '2019', 1, 36, 255, 66.25, 'NM', 'Orientacion a resultados: no participa de jornadas ni de GB. No demuestra compromiso con la linea. Poca participacion en GB. Cuando se para la linea por revision de producto no conforme, es necesaria la participacion en la tarea.Mucho PNC en el turno debido a descuidos en calidad del producto.\r\nIntervenciones en maquina andando, contacto con producto caliente sin EPP', '', '', '', ''),
(1280, '2019', 1, 12, 59, 0, 'B', 'Liliana tiene buen desempeño, se destaca por su predisposión, respeto y trabajo en equipo.\r\nDebe mejorar ser mas comunicativa con el objetivo de ver mejoras en su linea, tener mas proactividad en tiempos de linea detenida.', 'Orientación: Se nota preocupación por hacer bien su trabajo. Se requiere mas participación en las jornadas de los sabados.\r\nTrabajo: Se destaca un buen trabajo en equipo, siempre atenta a que la linea no pare. Se debe reforzar 5S sobre todo limpieza de pisos de su sector.\r\nAutonomia: Pocas veces toma decisiones en su puesto pero se destaca en ser la unica que reemplaza al operador de envasadora.\r\nFlexibilidad: siempre dispuesta a las tareas que se le asignan.\r\nCAL y SEG: Gran compromiso con calidad y seguri', 'Comunicación: Es respetuosa pero poco comunicactiva, debe comunicar anormalidades y proponer mejoras.\r\nProactividad: Debe anticiparse a necesidades futuras como detenciónes de linea, falta de insumos.', '', ''),
(1281, '2019', 1, 12, 65, 0, 'NM', '', 'Flexibilidad: Siempre dispuesto a realizar la tarea que se le demande.\r\nSEG: Buen trabajo en materia de seguridad.', 'Orientación: Demuestra poca preocupación por la linea. En la mayoria de las veces realiza tareas de manera mecanica y rutinaria. \r\nComunicación: Es una persona respetuosa pero poco comunicativa, no propone mejoras y si se le pregunta por algo de la linea desconoce. Poca capacidad de escucha e interpretación (ultima devolucion).\r\nTrabajo: No demuestra interes por trabajar con sus pares en pos de un beneficio a la linea, viene al turno a cumplir un horario. Demoras en el te y idas frecuentes al baño.\r\nProacti', '', ''),
(1282, '2019', 1, 12, 67, 80, 'MB', 'En general es un colaborador con un buen desempeño, cumple muy bien sus funciones en la parte operativa pero tiene que mejorar el manejo de personal y flexibilidad.\r\nTrabajo: No genera buen clima laboral. No habla como equipo sino individual. Efectiva participación en GB.\r\nSEG: Buen desempeño, reforzar uso de protectores auditivos.\r\nFlex: No se adapta a nuevas asignaciones en su linea, pocas personas cumplen con sus expectativas. Poca predisposición a trabajar en beneficio de otras lineas.', 'Orientación: Muestra preocupación por cumplir con la eficiencia de las lineas y cumplimiento de las tareas que se le asignan. Participa en GB y posee un gran compromiso con la empresa.Se solicita pasar eficiencia y no lo hace.\r\nProactividad: Se anticipa a necesidades futuras, trabaja con 5S y mantiene a su personal ocupado. Mejorar los tiempos ociosos.\r\nAutonomia: Muy frecuentemente resuelve problemas por si solo. Gran capacidad y conocimiento de las lineas.\r\nCAL: Buena gestion y compromiso con Caldiad.\r\n', 'Comunicación: Debe mejorar las formas de comunicarse y llegar a sus pares, en ocasiones el personal a cargo se siente intimidado por su forma de hablar y por los cuestionamientos que realiza, no trabajan de manera comoda. Dede asegurar una comunicación efectiva de estado de lineas y eficiencia cada 2hs con la supervisora. Controlar las expresiones gesticulares. En ocasiones se dirige a otros supervisores solicitando pedidos no respetando los canales. Lee msjs sin dar respuesta.\r\n', '', ''),
(1283, '2019', 1, 12, 71, 62.5, 'B', 'En general el desempeño es bueno pero con oportunidades de mejora. Debe ser mas proactiva anticipandose a necesidades y evitando tiempos ociosos. Su flexibilidad es practicamente nula cuando se trata de separarla de su compañera. No propone mejoras e ideas para la linea y no participa en horas extras en tareas de la linea.', 'Trabajo en equipo: Trabaja bien con sus compañeras, debe mejorar las 5S de su sector.\r\nTrabaja bien con Seguridad y Calidad.', 'Orientación: Muestra preocupación cuando la linea esta en producción pero tiene poco compromiso a participar en jornadas los fines de semana.\r\nComunicación: es una persona respetuosa pero poco comunicativa en proponer mejoras, en manejar información sobre la linea.\r\nProactividad: Poco proactiva a detectar necesidades en la linea, en detenciones de linea se queda conversando con compañeras si buscar actividad para hacer.\r\nAutonomia: Conoce poco los estandandares de su linea (DP), pocas veces resuelve problem', '', ''),
(1287, '2019', 1, 12, 89, 65, 'B', 'En general su desempeño es bueno con oportunidades de mejora. Necesita poder destacarse del resto, aprender mas de la linea y mejorar la proactividad.', 'Trabajo en equipo: Buen trabajo en equipo en su sector, debe mejorar las 5S. \r\nTrabaja bien con Seguridad y Calidad.\r\n', 'Orientación: Muestra preocupación cuando la linea esta en producción, pero tiene poco compromiso a participar en jornadas los fines de semana. Tampoco se ve interés a la hora del reproceso.\r\nComunicación: es una persona respetuosa pero poco comunicativa, debe mejorar proponiendo mejoras, informando anormalidades.\r\nProactividad: Poco proactiva cuando la linea esta detenida. Se queda esperando a que se le asigne una tarea. No se anticipa a eventos futuros.\r\nAutonomia: Conoce poco los estandandares de su linea', '', ''),
(1291, '2019', 0, 0, 89, 65, 'B', 'En general su desempeño es bueno con oportunidades de mejora. Necesita poder destacarse del resto, aprender mas de la linea y mejorar la proactividad.', 'Trabajo en equipo: Buen trabajo en equipo en su sector, debe mejorar las 5S. \r\nTrabaja bien con Seguridad y Calidad.\r\n', 'Orientación: Muestra preocupación cuando la linea esta en producción, pero tiene poco compromiso a participar en jornadas los fines de semana.\r\nComunicación: es una persona respetuosa pero poco comunicativa, debe mejorar proponiendo mejoras, informando anormalidades.\r\nProactividad: Poco proactiva cuando la linea esta detenida. Se queda esperando a que se le asigne una tarea. No se anticipa a eventos futuros.\r\nAutonomia: Conoce poco los estandandares de su linea (DP) y le cuesta tomar decisiones y resolver p', '', ''),
(1292, '2019', 1, 12, 300, 81.25, 'MB', 'En rasgos generales tiene un desempeño muy bueno, debe mejorar la competencia Proactividad para destacarse en su puesto.', 'Orient: Demuestra preocupación por la linea y compromiso. Buen resultado en tpos de limpiezas y actividades de autonomo.\r\nCom: Es respetuoso y deberia reforzar la comunicación. Debe informar antes de que se le pregunte.\r\nTrabajo: Se integra bien con sus pares. Mejorar condiciones del sector.\r\nAut: Conoce muy bien los equipos y resuelve problemas por si solo.\r\nCal y Seg: Buen desempeño. Evitar el uso del celular porque genera descuidos.', 'Proactividad: Debe evitar tpos ociosos asegurando 5S, proponiendo mejoras y evitando el uso de celular. Estar atento a los cambios de productos (conocer avance prod).\r\nFlex: En ocasiones muestra resistencia a reconocer errores pero siempre esta disponible a aprender de diferentes puestos y ser polifuncional.', '', ''),
(1293, '2019', 1, 12, 90, 0, 'B', 'Se ha observado una notoria mejora en su trabajo en planta. Se ve comoda en su puesto y ha podido integrarse al equipo. Debe trabajar mas en proactividad y compromiso en tareas que requieran extras.', 'Autonomia: en su puesto se ha notado una mejora en la toma de decisiones y conocimiento de equipos.\r\nFlexibilidad: se adapta a nuevas tareas y sabe reconoce errores.\r\nCAL y SEG: Buen desempeño', 'Orient: Demuestra preocupación por la linea cuando esta en producción pero no tiene compromiso cuando tiene que venir los fines de semana a hacerle mantenimiento.\r\nComun: Es respetuosa pero necesita tener una comunicación mas proactiva de proceso o mejoras.\r\nTrabajo: Tiene una buena integración con sus compañeros y sabe acompañar en las tareas de la linea. Debe mejorar los tiempos de demora en el te, son excesivos y al no venir los fines de semana recarga con tareas a sus compañeros.\r\nProac: Cuando la linea', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(1294, '2019', 1, 12, 145, 70, 'B', 'Se nota una mejora en su desempeño, mejor flexibilidad y comunicación. Debe mostrar mayor compromiso.', 'Comun: Ha mejorado sus formas de comunicarse y dirigirse a sus pares. Igual tiene sus dias.\r\nAut: Frecuentemente resuelve problemas por si solo, tiene conocimiento sobre los equipos. Buen trabajo en sistema.\r\nFlex: Se observa un avance en esta competencia, se le ha asignado nuevos puesto incluso en otras areas sin inconvenientes.\r\nCAL: buen desempeño. ', 'Orient: Demuestra preocupación por la linea cuando esta en producción pero no tiene compromiso cuando tiene que venir los fines de semana a hacerle mantenimiento. \r\nTrabajo: Al no venir los fines de semana recarga con tareas a sus compañeros. En el turno se integra bien con sus pares.\r\nProac: Se lo suele ver conversando. Debe proponer mejoras y cuidar las 5S de su sector.\r\nSEG: usar EPP cuando conduce autoelevador. Evitar el uso de celular', '', ''),
(1296, '2019', 1, 12, 178, 0, 'B', 'Su desempeño es muy bueno pero al no trabajar con sistema se ve disminuido. El colaborador debe entender que es fundamental cumplir con este requisito. Se muestra comprometido por mantener la linea en producción.', 'Orientac: Demuestra gran preocupación por cumplir bien sus tareas, compromiso para los arranques pero muy poco trabajo con sistema.\r\nComun: En ocasiones no se dirige bien cuando habla de sus compañeros y pero se reconoce un avance en la comunicación de anormalidades y aspectos de la linea.\r\nTrab: Se integra bien con sus compañeros en linea, se lo observa ayudar en tareas del sector. Debe mejorar en trabajar con SGI.\r\nCal: Se mostro preocupado por la calidad pero debe cumplir con cerrar el porton despues de ', 'Proact: Se lo ha visto realizar tareas en pos de sumar (recupero de pasta) y tambien anticipandose a arranques por ej. Debe proponer mejoras y evitar tiempos ociosos asegurando las 5S.\r\nAut: Si bien sabe desemvolverse bien en sus tareas con autonomia esto no se visualiza en el sistema, trabajo nulo.\r\nFlex: Siempre dispuesto a asumir las tareas que se le asignan pero al no trabajar con sistema esto se ve opacado.\r\nSEG: Asegurar el uso de EPP en el autoelevador, en varias ocasiones se marco este desvio.', '', ''),
(1297, '2019', 1, 12, 210, 0, 'E', 'Lopez es un excelente colaborador siempre preocupado por la linea y con un gran compromiso. Es respetuoso y se integra facilmente con sus compañeros. En la mayoria de los casos resuelve por si solo las cuestiones de la linea. Siempre flexible aceptando ocupar cualquier puesto y preocupado por las BPM (mameluco) y calidad del producto que elabora. Rara vez se lo ve sin realizar una tarea.', '', 'Comunicación: Es una persona muy respetuosa pero por intentar resolver los problemas por si solo muchas veces no comunica cuando tiene inconvenientes generando que se dilaten las detenciones o demoras de limpieza.\r\nSEG: Debe evitar actos inseguros en linea con el afan de resolver alguna situación.', '', ''),
(1299, '2019', 1, 12, 207, 0, 'B', 'A nivel general su desempeño es bueno con muchas competencias para mejorar. Este bueno puede pasar a un necesita mejorar si el proximo año no se revierte lo marcado. Se destaca por su conocimiento y expertiz para resolver problemas.', 'Trab: Se interesa en resolver los inconvenientes en equipo con el fin de facilitar las cosas cuando hay un problema. Igual esta competencia se ve disminuida por su poca participación en el GB y en no mantener en condiciones su linea. Varias entregas de turno no aceptables.\r\nAuton: Conoce muy bien su puesto y resuelve problemas por si solo, debe cuidar de no confiarse de sus conocimientos. Tiene buena generación de OT.\r\nSEG: Reforzar uso de EPP, en general buen desempeño.', 'Orient: Se destaca por su preocupación porque la linea no se detenga pero no toma dimensión de las perdidas que ocasiona su confianza. Muy poca participación en GB y bajo compromiso los fines de semana.\r\nComun: En ocasiones no se dirige de la mejor manera con sus compañero e incluso con la supervisora. Debe controlar su temperamento. Ademas se lo ha notado cambiar las versiones cuando se le consulta sobre inconvenientes que hubieron en la linea. Se destaca la propuesta de mejoras en la linea.\r\nProact: Propo', '', ''),
(1300, '2019', 1, 12, 252, 0, 'E', 'Diego es un colaborador excelente siempre preocupado por la linea, con gran compromiso con la empresa. Siempre flexible a nuevas asignaciones, cambio de turnos y HHEE. Posee un gran conocimiento de su equipo que capitaliza transfiriendolos a sus pares y solucionando problemas por si solo. Siempre pendiente y consciente de asegurar la calidad del producto. Es un buen compañero y respetuoso.', '', 'SEG: Si hay algo para mejorar es evitar los actos inseguros, mas precisamente referidos al uso de EPP.', '', ''),
(1301, '2019', 1, 11, 361, 0, 'B', '', '', '', '', ''),
(1302, '2019', 1, 11, 144, 0, 'B', '', '', '', '', ''),
(1303, '2019', 1, 11, 239, 0, 'B', '', '', '', '', ''),
(1304, '2019', 1, 11, 257, 0, 'B', '', '', '', '', ''),
(1305, '2019', 1, 11, 313, 0, 'B', '', '', '', '', ''),
(1306, '2019', 1, 11, 324, 0, 'B', '', '', '', '', ''),
(1307, '2019', 1, 11, 328, 0, 'B', '', '', '', '', ''),
(1308, '2019', 1, 11, 356, 0, 'B', '', '', '', '', ''),
(1309, '2019', 1, 11, 365, 0, 'MB', '', '', '', '', ''),
(1310, '2019', 1, 12, 216, 68.75, 'B', 'Es un colaborador con predisposición para afrontar nuevos desafios. Debe estar mas atento y evitar distracciones como tambien enfocarse mas en el GB. Posee un buen trabajo con sistema pero debe poder toamr decisiones por si solo.', 'Orient: Tiene buena predisposición para cumplir lo que se le solicite, presenta un compromiso bueno en temporada que se ve un poco disminuido este ultimo tiempo. DEbe mejorar su asistencia a las reuniones de GB y estar mas atento a las situaciones del dia a dia (distraido).\r\nComun: Debe evitar situaciones de discusión con sus compañeros (Romero) y superivisora. Propone mejoras y las comunica.\r\nTrabajo: Se integra bien con sus pares. No esta participando a las reuniones GB.\r\nFLex: Siempre dispuesto a reconoc', 'Proac: En varias ocasiones se lo ve conversando y en momentos de ocio, debe ser mas proactivo y aprovechar para mejorar su linea.\r\nAuton: Excelente generación de OT pero debe poder resolver por si solo los inconvenientes, pide ayuda y duda mucho.', '', ''),
(1312, '2019', 1, 12, 221, 0, 'B', 'Es un colaborador que realiza bien su trabajo pero que se limita a eso. Tiene oportunidades de mejora en varias competencias, necesita un cambio actitud.', 'Orientación: Cumple con los objetivos que se le solicitan, realiza un buen trabajo en su puesto. Debe asegurar cumplir cuando se compromete a venir el fin de semana.\r\nTrabajo: Genera un buen clima de trabajo, debe mostrarse mas interesado por mantener en buenas condiciones su sector.\r\nCal y SEG: Buen desempeño sobre todo en el uso de EPP.', 'Comun: Es respetuoso pero poco comunicativo, debe desarrrollar una comunicación mas proactiva.\r\nProactividad: Pocas veces se anticipa a necesidades futuras, debe evitar tiempos ociosos. Se le propuso ser capacitado como operador y no quiso.\r\nAuton: Toma algunas decisiones en su puesto pero tiene oportunidad de mejora en esto. Conoce los estandares.\r\nFlex: En general flexible aunque se lo ha notado en ocasiones molesto con algunas asignaciones. ', '', ''),
(1317, '2019', 1, 12, 261, 0, 'B', '', 'Orientac: Es un colaborador que muestra cierto interes por cumplir con lo solicitado. Muestra compromiso cuando se lo necesita.\r\nAut: Se muestra autonomo cuando su puesto es lubricador pero le cuesta cuando su puesto es otro.\r\nFlex: Siempre dispuesto a la tarea que se le asigne.', 'Comun: Es respetuoso pero poco comunicativo, debe aportar mejoras e ideas de manera mas proactiva.\r\nTrab: Se integra bien con sus compañeros pero debe sentirse parte de su sector y aportar en mantenerlo.\r\nProactiv: Se muestra poco proactivo, debe buscar actividades en caso de linea detenida y manetner las 5S.', '', ''),
(1318, '2019', 1, 12, 246, 93.75, 'MB', 'El desempeño es muy bueno. Siempre atento a cumplir con todo lo que se le asigna, excelente trabajo en sistema. Trabajo en equipo se observa una evolución respecto al manejo depersonal mostrandose mas seguro y con autoridad. Debe poder limar algunas cuestiones con sus pares lideres. Respecto a flexibilidad en algunas ocasiones se muestra resistente a quedarse operativo o si se le cambia alguna persona de la linea.', '', '', '', ''),
(1319, '2019', 1, 12, 274, 0, 'B', 'David es un lider en desarrollo que ha mostrado un gran avance en este utlimo tiempo. Debe trabajar en algunas competencias para distinguirse del resto.', 'Trabajo: Tiene buen caracter para el manejo de personal pero tiene que reforzar la autoridad. Mejorar el acompañamiento al operador en cambios ed bobinas y tareas del sector. Se lo ha notado mas enfocado en el GB.\r\nAutonom: Se destaca el conocimiento de envasado y como resuelve problemas en este sector y empaque.\r\nFlexib: En general flexible aunque en ocasiones no reconoce errores. No le gusta cuando le complican las cosas.', 'Orientación: Debe estar mas al tanto de algunas situaciones de la linea, se lo ha notado en ocasiones dudar o desconocer, es distraido (eficiencia, cumplimientos). Debe realizar mayor seguimiento al personal que tiene a cargo y formar su opinon de cada uno de ellos.\r\nComun: Ha mejorado pero debe tener el habito de informar el estado de la linea al supervisor asi como la eficiencia cada 2hs. Debe hacer el ejercicio de proponer mejoras y trabajos para la linea. Es respetuoso.\r\nProact: Debe estar mas atento a ', '', ''),
(1321, '2019', 1, 12, 305, 0, 'E', 'Es un excelente colaborador siempre atento a la linea comprometido con la empresa y la calidad del producto. Propone mejoras y se encarga de hacerlas. Siempre disponible para hacer HHEE en pos de cumplir objetivos. Buen compañero y comunicativo ante cualquier anormalidad. ', '', 'SEG: Evitar el uso de celular.', '', ''),
(1322, '2019', 1, 12, 433, 0, 'MB', 'El colaborador es muy respetuoso y comunicativo. Una vez definidos los objetivos se desenvolvia solo con el fin de cumplirlos. Siempre flexible y dispuesto. En comunicación tiene que mejorar el informar cuando realiza trabajos extras a los pactados. Mostró un buen tarabajo en equipo.\r\nOportunidad de mejora: Con el afan de hacer HHEE habian trabajos que los dilataba cuando podian hacerse en horas normales. Mejorar prolijidad en trabajos mas precisamente en soldaduras (CAL).', '', '', '', ''),
(1323, '2019', 1, 2, 106, 0, 'B', '', '', '', '', ''),
(1325, '2019', 1, 36, 66, 67.5, 'B', 'Poca participación en grupo base. No se tracciona GB desde el puesto de líder, sino que se respalda en el coordinador. Falta de compromiso fines de semana. Temporadas de lunes a lunes, sábados a la noche y domingos en la tarde incluidos.Comunicación efectiva de cambio de turno. Falta integración con sector pelado y molienda. Falta participación en GB.Falta anticiparse a aprovechamiento de tiempos ociosos de personal a cargo.Resuelve y gestiona muy bien, pero hay decisiones y comunicaciones del puesto que ti', '', 'Flexibilidad: Cuesta adaptación a nuevos roles del puesto.Esto incluye nuevos equipos y sistema.', '', ''),
(1327, '2019', 1, 36, 136, 0, 'MB', 'Grupo Base', '', '', '', ''),
(1329, '2019', 1, 32, 315, 87.5, 'MB', 'Gésica ha mejorado notablemente con su desempeño y desarrollo comunicacional y ha fortalecido sus competencias en general', 'Acredita decido carácter para desempeñarse en otras áreas y tiene conocimientos que la posicionan como cuadro de reemplazo.', 'Debe confiar en si misma y su capacidad para contribuir con mejoras en el ámbito de su desempeño, del área y animarse a nuevos desafíos', 'Se destaca la seriedad y profesionalidad de sus trabajos.Es una colaboradora constante capaz de seguir la agenda de tareas pendientes de manera autónoma.', 'Se aconseja la participación en las capacitaciones de la compañía en las competencias en que puedan participar los contribuidores individuales. Y además potenciar sus conocimientos técnicos sobre las ciencias económicas.'),
(1332, '2019', 1, 2, 290, 0, 'MB', '', 'Gran capacidad para adaptarse a los cambios.', '', '', ''),
(1333, '2019', 1, 2, 7, 0, 'MB', '', 'Flexibilidad ante cambios repentinos.\r\n', '', '', ''),
(1334, '2019', 1, 2, 20, 0, 'MB', '', '', '', '', ''),
(1335, '2019', 1, 2, 204, 0, 'MB', '', '', '', '', ''),
(1340, '2019', 1, 36, 21, 0, 'B', 'Orientación a necesidades de línea. Trabajo en equipo de remanejo, busca de objetivo en cpmún.\r\nProactividad en tiempos de máquina parada.\r\nResuelve muy bien sola.\r\nFlexibilizar en tareas de reproceso.', '', '', '', ''),
(1345, '2019', 1, 41, 325, 0, 'MB', 'Sergio ha demostrado gran compromiso con el sector, en cuanto a cumplimiento de tareas asignadas, investigación de procesos y resolución de problemas. ', 'Compromiso con el área\r\nParticipación activa en grupo base\r\nDemuestra alto interés para lograr mejoras en el sector\r\nRealiza tareas administrativas adicionales al puesto\r\nGran conocimiento técnico como analitico', 'A trabajar el seguimiento de trabajos o tareas pendientes para lograr una autonomía mayor.\r\n', '', ''),
(1346, '2019', 1, 41, 263, 0, 'B', 'Pedro demuestra alto compromiso en el sector. Ha brindado un gran soporte para el mantenimiento y puesta en CB de los equipos. ', 'Flexibilidad\r\nAlta predisposición\r\nCompromiso con el area\r\n', 'Pensar alternativas para la resolución de problemas\r\nFalta asumir riesgos en pos de resolver problemas\r\nFalta desarrollo que permita analizar los resultados analíticos o indicadores que toman', '', ''),
(1347, '2019', 1, 40, 63, 0, 'NS', 'Falta de comunicación a la hora de tratarse de informar cuestiones laborales que afectan al sector.\r\nEn la jornada no realiza tareas extras a los controles mínimos del turno, tales como tareas de mantenimiento correctivo o preventivo.\r\n', '', 'Trabajo en equipo\r\nNo se involucra en los mantenimientos\r\nComunicación\r\n', 'Falta de compromiso para cumplir con los objetivos del sector.\r\nBajo compromiso con 5S.\r\n', ''),
(1348, '2019', 1, 40, 241, 0, 'B', 'Gran mejora en la comunicación.\r\nFlexible para afrontar otros puestos.\r\nGran cantidad de problemas edilicios acumulados que se podrían haber resuelto. (desvíos entre las HR y el estado real)\r\nFalta de gestión de repuestos', 'Predisposición\r\nFlexibilidad', 'Muy correctivo, poco preventivo.\r\nFalta trabajo por sistema', 'Falta de compromiso en el cierre de OT rojas, verdes, susto.', 'Gestión de mantenimiento preventivo para oficiales, dictada por adm. de mantenimiento.'),
(1349, '2019', 1, 40, 79, 0, 'B', 'Demuestra interés en aprender y mejorar los sectores\r\nSe adapta a las exigencias del puesto\r\nPropone mejoras\r\nSe debe adaptar al trabajo por sistema\r\nDebe realizar seguimiento de tareas\r\n', 'Proactividad\r\nBúsqueda del aprendizaje\r\nCompromiso', 'Conocimientos técnicos, en desarrollo\r\nSistema\r\nSeguimiento de tareas', 'Gran compromiso por mejorar personalmente y al sector', 'Mantenimiento de válvulas en general\r\nMantenimiento de bombas\r\nGestión de mantenimiento preventivo (F. Roco)'),
(1350, '2019', 1, 40, 201, 0, 'B', 'Grandes conocimientos en servicios\r\nRelevamientos varios de mantenimientos\r\nCompromiso con los mantenimientos', 'Conocimientos\r\nProactividad\r\nTransferencia de conocimientos\r\n', 'Sistema\r\nRepuestos\r\nSeguimiento de tareas', 'Compromiso con los mantenimientos\r\n', 'Gestión de mantenimiento preventivo (F. Roco)'),
(1358, '2019', 1, 12, 206, 0, 'B', 'OaR: se nota mejoría respecto al año pasado.\r\nCom: formas, importantísimo comunicar siempre condiciones de autoelevador.\r\nTeE: Mejorar en mantener las condiciones de 5S de los sectores comunes.\r\nPROAC: se nota mejoría respecto al año pasado. Seguir trabajando en mantener las 5S, siempre hay algo para hacer en planta, aprovechar tiempos.\r\nSEG: Uso de EPP y cinturón.', '', '', '', ''),
(1360, '2019', 1, 36, 148, 0, 'B', 'OR: No se tracciona GB desde el puesto de líder, sino que se respalda en el coordinador. \r\nComunicación efectiva de proceso en turno, proactiva de anormalidades.\r\nTE: buena adaptación al equipo de trabajo. \r\nAutonomía se irá ganando con conocimientos de línea, al igual que la toma de decisiones, va bien.\r\nPara condiciones seguras es indispensable velar por las condiciones del sector.', 'OR: Compromiso.\r\nFlexibilidad y adaptación al puesto.', 'GB', '', ''),
(1361, '2019', 1, 5, 194, 0, 'B', 'Debe trabajar en proactividad. Tiempo ocioso mal utilizado. \r\nPoco trabajo en 5S. Siempre luego de una auditoria o patrulla. \r\nNo se le da importancia a trabajar con el sistema. \r\nSiempre se lo debe acompañar y buscar alguna alternativa para cumplir con las tareas asignadas.\r\nPoca participación en el grupo base. \r\nDebe trabajar en flexibilidad. Difícil adaptación a los cambios propuestos por la nueva gestion.\r\n', 'Alto compromiso con los trabajos de tornería.\r\n\r\n', 'Flexibilidad\r\nSistema\r\nProactividad', '', ''),
(1362, '2019', 1, 5, 1, 81.25, 'MB', 'Trabajar en 5S pro activamente. No esperar auditorias o patrullas.\r\nTrabajar organizando mejor los tiempos de mantenimiento y recambios\r\nReforzar trabajo en equipo y transmisión de conocimientos.', 'Trabaja con Calidad y Seguridad.\r\nAlta autonomía.\r\n', '', '', ''),
(1363, '2019', 1, 5, 52, 0, 'MB', 'Trabajar mas en 5S de manera proactiva en taller.\r\nTrabajar mas en equipo con mecánicos de BLc.\r\nAcotar tiempos de mant y recambio. Trabajar en desvíos y apuntar a mejoras.', 'Calidad, seguridad y autonomía.', '', '', ''),
(1364, '2019', 1, 40, 149, 0, 'B', '', 'Se adapta a las necesidades sin exponer resistencia a los cambios, y se muestra responsable y ocupado en resolver cada situación o demanda de mantenimiento.', 'La oportunidad de mejora debe darse en la comunicación, ej: ser constante con los mails de novedades, articular autonomamente con los repuestos, auto gestionar y mejorar las hojas de revisión de sus equipos para lograr un preventivo efectivo, desarrollar análisis por si solo.', '', ''),
(1365, '2019', 1, 40, 327, 80, 'MB', '', 'Se muestra analítico y con buen criterio para resolver problemas, y con muy buena predisposición para atacar las necesidades planteadas por distintas areas.', 'La oportunidad de mejora debe darse en la comunicación, ej: ser constante con los mails de novedades, articular autonomamente con los repuestos, auto gestionar y mejorar las hojas de revisión de sus equipos para lograr un preventivo efectivo, desarrollar análisis por si solo.', '', ''),
(1366, '2019', 1, 5, 242, 60, 'NM', 'Debe trabajar en o. a los resultados. poca participación en el grupo base. Debería ser activa, procurando trabajar sobre los desvíos. \r\nTrabajar fuertemente en pro actividad. Perdida de tiempo en computadora y utilización excesiva de celular. Mucho tiempo en fumadero fuera de horario\r\nTrabajar mas desarrollando trabajo en equipo y autonomía del personal de la linea. El autonomo trabaja solo y el mecánico solo interviene ante fallos. \r\nPoca pro actividad en los equipos que tiene a cargo. No planifica activid', 'Flexibilidad en horarios y cambios repentinos.\r\n', '', '', ''),
(1367, '2019', 1, 5, 35, 0, 'B', 'Debe trabajar en desarrollar a sus compañeros en autonomía. \r\nDebe trabajar fuertemente en sistema. No contesta correos. No cierra Hojas de revisión.\r\nTrabajar en desarrollo de hojas de revisión y cumplir con las existentes. \r\nTrabajar en flexibilidad \r\nTrabajar en comunicación. Comunicación poco positiva.\r\nDebe trabajar mas en seguridad. Viola las seguridades de la maquina. ', 'Pro actividad en la linea. \r\nBuen trabajo en equipo.', '', '', ''),
(1377, '2019', 1, 13, 357, 0, 'B', '', '+ Trabajo en equipo, buena relaciona con su turno en el par sup-control de proceso. \r\n+Reconoce debilidad ( fem, trap termicos, operaciones unitarias)', '- Comunicación de problemas, desmotivación ( no tranmite al area de calidad algunas cuestiones que siente).\r\n- Proactividad, incentivar aprender mas y desafiar sus conocimientos ( se le dio la posibilidad moi y la rechazo)\r\n-generar empatia con sus pares ( mas que nada con el area de producción)', 'Seguimiento por parte del jefe para mejorar sus competencias y las del jefe en torno a ella.', '-Operaciones unitarias, trat termicos, fem'),
(1378, '2019', 1, 13, 2, 0, 'B', 'Se rescata en Gloria su interés en el área, flexibilidad para adaptarse a las dificultades y contexto. Con ella hay que trabajar sobre el optimismo, que genere una actitud positiva para sobreponerse, y sobre la empatia hacia otras áreas.', 'Flexibilidad, compromiso, transparencia,resolución de problemas ', 'Reforzar proactividad, agregado de valor y entusiasmo. Trabajo con las herramientas del sistema, participación activa en los GBs y como colaborador referente en asuntos del SGI.', '', 'Operaciones Unitarias\r\nLiderazgo y Toma de desiciones'),
(1379, '2019', 1, 13, 3, 0, 'B', '', 'Resolución de problemas ( re actividad a las indicaciones)\r\nFlexibilidad\r\nTrabajo en equipo\r\nCapacidad de escucha\r\n\r\n', 'Proactividad\r\nTrabajo bajo el SGI, participación activa en el Pilar y en GBs\r\nInterpretación analitica\r\nToma de desiciones\r\n', 'Ir mas allá de la rutina del control de procesos e insumos. ', 'Office\r\nOperaciones Unitarias\r\n'),
