(1381, '2019', 1, 13, 256, 0, 'NM', 'No orienta su gestión a los resultados, no tiene metas claras ni planteo pro activos al área', 'Técnica\r\nEficiencia en resolver os problemas', 'Trabajo en equipo\r\nFlexibilidad\r\nProactividad\r\nEficacia en resolver los problemas\r\nSGI sin gestión 2019', '', ''),
(1382, '2019', 1, 13, 360, 0, 'MB', 'Le interesan los desafíos, tiene mucha capacidad técnica y de analisis, proactividad', 'Flexibilidad\r\nCritica / Simple/ resolutiva\r\nExcelente participación con el autónomo y en grupos de proyectos \r\nSe destacan los trabajos en planes de control y cargas ambientales encarados\r\nParticipación activa en GBs y en la utilización del SGI\r\nEmpatia, y buena llegada a la gente.\r\n', 'Autonomía ( segun su superior, consulta cada paso que da sobre aspectos que no son de su dominio). ', '', 'Liderazgo'),
(1383, '2019', 1, 13, 366, 0, 'MB', 'En su desempeño 2019, estuvo alejada de los resultados, con pendientes ( trabajo proveedores, clientes, GBs, SGI, reclamos, etc)', 'Compromiso\r\nRespeto\r\nCalidad humana\r\nProlijidad\r\nIntegración con otros pilares', 'Integración al equipo\r\nOrientación a resultados\r\nSGI\r\nReferente activo en GBs\r\nComunicación', 'Fortalecer autonomia, trabajo integrado en el pilar y orientado a los resultados\r\n', ''),
