(1394, '2019', 1, 38, 358, 0, 'MB', 'Julieta ha sido evaluado con el proceso de Gestión de desempeño en su etapa dentro de convenio. Estás competencias/evaluación cambiará en su etapa como supervisor formal. ', 'PROACTIVIDAD, LIDERAZGO, AUTONOMÍA, ORIENTACIÓN A RESULTADOS. ', 'Trabajar en la empatía y liderazgo cercano con los colaboradores. Carácter. ', '100%.', 'Procesos asociados a línea que coordina: puré. Limpiezas, tratamientos térmicos. '),
(1395, '2019', 1, 38, 363, 0, 'MB', 'ARIEL ES UN COLABORADOR QUE HA SIDO EVALUADO BAJO EL SISTEMA DE DESEMPEÑO DENTRO DE CONVENIO, PROCESO QUE CAMBIARÁ EN SU TRASPASO A SUPERVISOR FORMAL DE MANTENIMIENTO. ', 'CONOCIMIENTOS TÉCNICOS ORIENTACIÓN A SU ÁREA DE ENFOQUE: MECÁNICA. COMPROMISO. ENTREGA. ', 'ARIEL ES UN COLABORADOR CON GRANDES CAPACIDADES PERO DEBERÁ APRENDER A DELEGAR SUS TAREAS EVITAR ESTAR TANTO EN LO OPERATIVO DE RESOLUCIÓN DE PROBLEMAS PARA MIRAR LA GESTIÓN DESDE OTRO LADO. DEBERÁ INCLUIR MAYOR SISTEMATIZACIÓN Y METODOLOGÍA DEL SISTEMA DE GESTIÓN INTEGRAL.', 'ARIEL DEMOSTRÓ EN TODO MOMENTO GRAN COMPROMISO CON LA EMPRESA', 'TRATAMIENTOS TÉRMICOS, PROCESOS DE LIMPIEZA, HERRAMIENTAS/METODOLOGÍAS DEL SISTEMA DE GESTIÓN INTEGRAL. '),
(1397, '2019', 1, 13, 57, 0, 'B', 'Mejoro flexibilidad y compromiso con el equipo, se nota que se siente parte , se lo ve a gusto pero en reuniones no se hace siempre presente. Su intervención en el grupo es mas que nada para solicitar ayuda, toma de decisiones y marcar necesidades.', 'Compromiso, afán por hacer las cosas bien hechas.', 'Pro actividad, autonomía, interacción con el sistema, SGI', '', ''),
(1398, '2019', 1, 13, 460, 0, 'B', 'Se solicita mas comunicación, capacidad analítica de interpretación y pro actividad para alcanzar los conceptos que demanda para tener buen ejercicio de su desempeño.', 'Flexibilidad, compromiso, resolución operativa de problemas', 'Comunicación, empatia con otras áreas ( emisión de juicios)', 'Proactividad, desafiar sus conocimientos\r\nFortalecer su comunicación, no guiarse con supuestos y prejuicios - Encuentros de comunicación con RRHH ', ''),
