(1466, '2019', 1, 4, 362, 0, 'MB', 'María Inés se a adaptado a sus funciones y a los cambios imprevistos. Se maneja con total naturalidad, respeto y profesionalismo en sus tareas cotidianas. Creo que tiene mucho más para dar, pero lo demostrado hasta aqui es muy bueno.-', 'Proactividad - Trabajo en equipo - Profesionalismo', 'Falta de conocimientos más profundo en algunos aspectos referido al puesto de trabajo. ', 'Su compromiso es muy alto, permanentemente  está revisando cuestiones generales sin que se le indique, muy comprometida con la planta, el sector y su equipo de trabajo ', 'Capacitación en algunas funciones de JDE, Arcor BI'),
(1467, '2019', 1, 40, 243, 0, 'E', '', 'Javier posee una alta capacidad de respuesta ante imprevistos, apalancados por su experiencia y conocimiento técnico. Presenta competencias en negociación que le permiten un buen trabajo en equipo tanto en su pilar como con las demás áreas. Es un referente para el personal en la transmisión de conocimientos con escucha activa a las opiniones de los demás. Presenta una mirada global del negocio que le permite la toma de desiciones con autonomía.', 'Debe continuar trabajando en una mirada a largo plazo de los equipos a cargo, asentando pilares para mantener en el tiempo los desarrollos logrados basados en las herramientas de gestión. Es importante afianzar el liderazgo para lograr el desarrollo de oficiales.', '', ''),
(1468, '2019', 1, 40, 359, 0, 'MB', '', 'Federico presenta una alta capacidad de planificación, evidenciada por el profesionalismo con que gestiona sus actividades. Es versátil en el desarrollo de tareas distintas a su formación académica, investigando sobre el como hacerlas. ', 'Es importante una trabajar en una mirada a largo plazo de los trabajos implementados para lograr mantenerlos en el tiempo.\r\nDebe seguir controlando la comunicación cuando esta influenciado por las emociones.\r\nEs importante mantener seguimiento a sus gestiones desde la negociación para lograr el cumplimiento de las planificaciones', '', ''),
(1469, '2019', 1, 40, 157, 0, 'MB', '', 'Fabio presenta una gran disciplina operativa que le permite mantener los procesos en el tiempo, tiene alta capacidad de plasmar ideas en herramientas innovadoras para el pilar que permiten mejorar la gestión. ', 'Es importante orientar sus tareas al logro de resultados del sector, pudiendo desarrollar modelos de negociación para llegar a la implementación de las herramientas con sus pares.\r\nEs clave poder comunicar  las complicaciones que surjan en este avance si que sea consultado por este ultimo. Manteniendo un liderazgo en la gestión del pilar.', '', ''),
