(1517, '2019', 1, 36, 371, 67.5, 'B', 'Importancia de condiciones del autoelevador en comunicación y seguridad. No asumir riesgos, siempre chequeo.\r\nMayor colaboración con puesto de Mectra, tiempos ociosos, y condiciones de planta\r\n', '', '', '', ''),
(1520, '2019', 1, 36, 377, 0, 'MB', '', '', '', '', ''),
(1521, '2019', 1, 36, 382, 0, 'MB', 'Indispensable una buena comunicación. Mantener siempre al tanto a líderes de LTP. Siempre cuidar formas más allá de las presiones.\r\nNunca dejar de lado la seguridad.\r\n', 'Proactividad, autonimia, trabajo en equipo. Excelente adaptación al puesto.\r\n', '', '', ''),
(1522, '2019', 1, 36, 392, 0, 'B', 'Importancia de aprovechar tiempos ociosos.\r\nNecesidad de aprender lo básico de equipos, como armadora de cajas y rx.\r\nNo esperar siempre al líder para empezar actividades.', '', '', '', ''),
(1523, '2019', 1, 37, 465, 0, 'B', '', '', '', '', ''),
(1524, '2019', 1, 36, 414, 0, 'MB', 'Puede mejorarse comunicación respecto a equipos. La herramienta de trabajo debe estar en condiciones, no dejar pasar ningún detalle respecto al estado de los mismos. ', 'Muy buena predisposición y trabajo en equipo siempre', '', '', ''),
