(1527, '2019', 1, 36, 400, 0, 'MB', 'Mejoras en proactividad y aprovechamiento de tiempos ociosos.\r\nMejorar seguridad', 'Trabajo en equipo. Fexibilidad y adaptación', '', '', ''),
(1528, '2019', 1, 36, 398, 0, 'MB', 'Puede mejorarse aún más en comunicación, estado de equipo,avisar cuando algo no esté bien. No hacerlo andar con defectos. Relevando siempre actos y condiciones inseguras del puesto.\r\nPuesto clave en calidad, siempre ir un paso adelante', 'Proactividad y flexibilidad como fortalezas', '', '', ''),
(1529, '2019', 1, 36, 387, 0, 'MB', 'En la medida que se vaya aprendiendo se irá ganando más autonomía', 'Compromiso con la línea y ganas de aprender. Trabajo en equipo', '', '', ''),
(1530, '2020', 1, 36, 353, 74.29, 'B', 'En orientación a los resultados tener en cuenta que no es tan solo cumplir objetivo de máquina andando sino siempre seguir de cerca en que condiciones.\r\nMuy comunicador, pero a veces se pasan por alto detalles importantes.', 'Flexibilidad y buena predisposición en cualquier puesto de trabajo.\r\nProactividad', 'Autonomía y trabajo en equipo, hay actividades repetitivas que se pueden coordinar con los mismos compañeros en lugar de siempre depender del supervisor.\r\nTrabajo en equipo y comunicación entre turnos. Diferencias con compañeros.', '', ''),
(1532, '2020', 1, 36, 343, 70, 'B', 'En ocasiones se perdía de foco el objetivo del turno. Es un puesto con una gran exigencia y demanda de comunicación consola-molienda-concentrador, se ha logrado un buen equipo, pero aún falta pulir.', 'Flexibilidad y ganas a la hora de cumplir un objetivo o pedido', 'Proactividad en aprendizaje. Relevar necesidad de acompañamiento. Tomar siempre anotación de lo nuevo. Buscar apoyo para ir ganando autonomía.\r\nTener en cuenta el cuidado del recurso: agua', '', ''),
(1533, '2020', 1, 36, 321, 87.5, 'MB', 'Es un colaborador muy completo, con objetivos y formas de trabajar muy claras.\r\n', 'Gran orientación a resultados. Autonomía y proactividad muy marcadas.\r\nAtención permanente a aspectos de seguridad tanto para su puesto como para con el resto de sus compañeros.\r\nSiempre atento a la calidad de lo que se produce', 'Oportunidad de mejora: Comunicación en momentos de exigencia, aunque sea redundante', '', ''),
(1534, '2020', 1, 36, 418, 71.25, 'B', 'Se espera más. Más comunicación, mayor aprovechamiento de tiempos ociosos. Mayor inclinación a mantenerse ocupado y en permanente formación.\r\nEl equipo es el turno, buscar colaborar donde se lo necesite, sobre todo si hay tiempo', 'Interés en aprender, compromiso con la línea', 'Poca proactividad y autonomía a la hora de aprovechar tiempos. Fue algo que se marcó y sin embargo no se nota otra actitud', '', ''),
(1535, '2020', 1, 36, 306, 0, 'B', 'Se marca tema compromiso y no se ve mejora. Cuando no hace sus tareas, sobrecarga a otros miembros del equipo. Corre en planta, eso no es seguro', 'Calidad', 'Poca preocupación en que se cumplan objetivos. Falta de compromiso, más preocupado por irse que por asegurar que las cosas queden en condiciones.\r\nPoca preocupación de mantener equipos, se riegan motores, proactividad, no esperar a que se lo marquen', '', ''),
(1536, '2020', 1, 36, 352, 76.25, 'B', '', 'Interés en cumplir objetivos, trabajo en equipo. ', 'Compromiso y lo que implica no estar para el equipo', '', ''),
(1537, '2020', 1, 5, 308, 0, 'B', 'Comete actos inseguros. Trabajar en comportamientos seguros\r\nComunicarse mas fluidamente.\r\nTiempos ociosos mal utilizados.', 'Trabaja para crecer en autonomia.\r\nSe preocupa mucho por la calidad\r\nMucho compromiso con la linea \r\nTrabaja bien con SGI\r\n', 'Trabajar fuertemente en seguridad, comunicacion y proactividad.\r\n', '', 'Sistemas neumáticos. Conocimientos en neumática.\r\nParticipación en el mantenimiento anual del equipo para crecer en cocimientos mecánicos.\r\n'),
(1538, '2020', 1, 5, 408, 0, 'B', 'Trabajo en equipo\r\nResponsabilidad', 'Alto compromiso con el puesto\r\n\r\n', 'Trabajar en flexibilidad. Cuestan cambios profundos de tareas.\r\nTiempos ociosos mal utilizados.', '', 'Temas referidos a neumática \r\nTratamientos térmicos\r\n'),
(1539, '2020', 1, 5, 331, 0, 'B', 'Tiempos innecesarios en consola. La operación es en planta.\r\nOperación de equipos con poca autonomía. \r\nPoco compromiso para aprender. No propone. \r\nNo contesta cuestiones de parámetros. Pocas veces los supo.\r\nPoco compromiso con el puesto. Se retira temprano. Viene tarde, Falta sin aviso en ocasiones.\r\n', '', 'Flexibilidad. Le cuesta acatar decisiones de cambios profundos de tarea.\r\nComunicación. Le cuesta escuchar y comprender. Le cuesta expresarse y preguntar.\r\nPoca proactividad. No se adelanta a los problemas ni necesidades futuras de la linea. \r\nLa comunicación no es efectiva. Es vaga y poca.', '', ''),
(1540, '2020', 1, 14, 296, 0, 'B', '', 'Buena predisposición y compromiso en el trabajo y resultados.\r\nRespeto y trabajo en equipo', 'Anticiparse ante sucesos y/o posibles desvíos. \r\nMejorar la seguridad ante las toma de decisiones en busca de autonomía ', '', ''),
(1541, '2020', 1, 14, 298, 0, 'B', '', 'Trabajo en equipo. Buena predisposición ante cambios y necesidades de la empresa. \r\nBuena predisposición para realizar mejoras asociadas al toma muestra', 'Anticiparse ante sucesos y/o posibles desvíos. \r\nMejorar la seguridad ante las toma de decisiones en busca de autonomía.\r\nMejorar la comunicación con el resto del equipo de Calidad\r\n', '', ''),
(1542, '2020', 1, 14, 311, 0, 'B', '', 'Proactividad para realizar tareas que mejoren y faciliten el trabajo cotidiano, como así también los resultados del equipo de Calidad.\r\nFlexibilidad y predisposición para realizar diferentes actividades dentro del equipo de Calidad ', 'Mejorar comunicación con otras áreas ', '', ''),
(1543, '2020', 1, 14, 369, 0, 'B', '', 'Trabajo en equipo. Buena predisposición ante cambios y necesidades de la empresa. \r\nFlexibilidad para adaptarse a diferentes tareas dentro del quipo de Calidad', 'Anticiparse ante sucesos y/o posibles desvíos. \r\nMejorar la seguridad ante las toma de decisiones en busca de autonomía.\r\nMejorar la comunicación con el resto del equipo de Calidad\r\n', '', ''),
(1544, '2020', 1, 14, 544, 0, 'B', '', 'Trabajo en equipo. \r\n\r\n', 'Anticiparse ante sucesos y/o posibles desvíos. \r\nMejorar la autonomía.\r\nMejorar la comunicación con el resto del equipo de Calidad\r\n\r\n', '', ''),
(1545, '2020', 1, 14, 545, 0, 'B', '', 'Trabajo en equipo. Buena predisposición ante cambios y necesidades de la empresa. \r\n\r\n', 'Anticiparse ante sucesos y/o posibles desvíos. \r\nMejorar la seguridad ante las toma de decisiones en busca de autonomía.\r\nMejorar la comunicación con el resto del equipo de Calidad\r\n', '', ''),
(1546, '2020', 1, 36, 386, 0, 'NM', 'Poca orientación a resultados en LTP, si bien tiene compromiso en estar presente para la línea, no hay interés en aprender de los equipos. No pregunta, no consulta, no hay autonomía, no se muestra interesado ni entusiasta a la hora de participar para con la línea', '', 'Autonomía, comunicación, trabajo en equipo.\r\nCalidad, lubrica y deja los alemites sucios, no dandole importancia a donde puede ir a parar el sobrante de la grasa', '', ''),
(1547, '2020', 1, 5, 43, 72.5, 'B', 'Debe trabajar mas en proactividad. Tiempos ociosos mal utilizados en ocasiones.\r\nTrabajar en la comunicación efectiva del puesto.\r\nTrabajar fuertemente en autonomía para poder sumar de manera positiva en los mantenimientos autónomos. \r\nRespetar los horarios establecidos para el desayunador.\r\n', 'Trabajo en equipo', 'Conocimientos técnicos/Autonomía', '', 'Capacitación en conocimientos de envasadoras/Capacitación en temas referidos a calidad.'),
(1549, '2020', 1, 14, 530, 77.5, 'B', '', 'Trabajo en equipo.\r\nActitud positiva ante las diferentes circunstancias\r\nFlexibilidad y predisposición frente a diferentes tareas\r\n', 'Aumentar proactividad y autonomía\r\n', '', ''),
(1550, '2020', 1, 14, 423, 81.25, 'MB', '', 'Trabajo en equipo. \r\nActitud positiva frente a diferentes circunstancias\r\nFlexibilidad y predisposición frente a diferentes tareas', 'Aumentar proactividad y autonomía', '', ''),
(1551, '2020', 1, 5, 230, 66.25, 'B', 'No resuelve problemas por si sola. Debe trabajar mas en sistema. \r\nNo se observa interes en acceder a las maquinas.\r\nNo se observan conocimientos técnicos\r\n', 'Flexibilidad\r\nTrabajo en equipo.\r\nCalidad.', 'No hay autonomía desarrollada en equipos.\r\nDebe trabajar en proactividad y comunicacion efectiva\r\n', '', ''),
(1553, '2020', 1, 5, 229, 73.75, 'B', 'Debe trabajar en aspectos de 5S en el sector donde se desempeña\r\nTrabajar mas en autonomía. Falta desarrollar conocimientos específicos del equipo\r\nTrabajar mas en comunicacion efectiva del puesto \r\nRespetar tiempos de desayunador\r\nTrabajar mas en aspectos de orientación a resultados. Se observa preocupación, pero debe ser mayor el nivel de exigencia en esta competencia por el puesto ocupado.', 'Trabajo en equipo\r\nFlexibilidad\r\n', '', '', 'Conocimientos técnicos en dosificadora y remachadora. \r\nCapacitación sobre parámetros de procesos para toma de decisiones '),
(1555, '2020', 1, 5, 286, 80, 'MB', 'Se observa mucha preocupación por alcanzar los resultados\r\n', '', 'Trabajar en aspectos de calidad. Agua en tomate. Herramienta sucia introducida en tomate. Tomate colocado en latas desde chapas cubre\r\nTrabajar en aspectos tecnicos aplicados a los equipos para levantar autonomia\r\nTrabjar mucho en sistema.\r\nUtilizacion excesiva de celular.\r\nTiempos ociosos mal utilizados. Trabajar en aspectos de proactividad.\r\nDemoras en tiempos de desayunador. Respetar el tiempo estipulado.', '', 'Conocimientos de proceso de tomate respecto de parámetros para poder tomar decisiones.'),
(1557, '2020', 1, 5, 267, 73.75, 'B', 'Trabaja con preocupación en su tarea.\r\nTrabajar en cumplimiento d tiempos estipulados en desayunador.\r\nUtilizar los tiempos ociosos con proactividad en reproceso.', 'Flexibilidad , calidad y seguridad son aspectos afianzados', 'Debe trabajar en comunicacion efectiva\r\nDebe trabajar en proactividad.\r\n', '', ''),
(1559, '2020', 1, 5, 428, 72.5, 'B', 'Mejora su desempeño con el correr de la temporada. Se prueba en varios sectores hasta lograr parte del desempeño esperado.', '', 'Debe trabajar mas en afianzar conocimientos de calidad.\r\nDebe trabajar fuertemente en comunicacion efectiva y proactiva.\r\nDe trabajar en proactividad\r\nDebe trabajar en sistema. No se observa desarrollo en este tema.\r\nDebe trabajar en desarrollar el perfil de seguridad.', '', 'Parametros de proceso de tomate.\r\nCapacitaciones tenicas\r\nTemas referidos a seguridad'),
(1563, '2020', 1, 36, 370, 0, 'MB', 'Carácter a la hora de tratar con los camioneros', '', '', '', ''),
(1564, '2020', 1, 36, 354, 0, 'MB', 'Condiciones de autoelevador', '', '', '', ''),
(1565, '2020', 1, 36, 115, 0, 'B', 'Al informar un problema, uno no se desliga del mismo, sino que comparte la responsabilidad', 'Calidad y seguridad', 'Trabajo y comunicación con el equipo buscando objetivo en común, repetición de las mismas acciones sin reflexionar sobre errores anteriores. Poca capacidad de aceptar crítica', '', ''),
(1566, '2020', 1, 36, 101, 0, 'B', 'Se debe tener más proactividad cuando paran las máquinas. Tiempos ociosos no aprovechados.\r\nSe sigue dependiendo de líderes para resolución de problemas que podrían irse aprendiendo', '', 'Compromiso, al no venir se dejan de lado actividades o se sobrecarga a compañeros con doble de actividades', '', ''),
(1567, '2020', 1, 5, 470, 80, 'MB', 'muy buen desempeño. Alto compromiso.', 'Proactividad\r\nFlexibilidad', 'Trabajar en comunicacion efectiva\r\nTrabajar en sistema\r\nTrabajar en autonomia ', '', ''),
(1569, '2020', 1, 5, 471, 80, 'MB', 'Muy buen desempeño demostrado', 'Proactividad\r\nFlexibilidad', 'Trabajar en sistema. Generar mas autonomía\r\nTrabajar en comunicacion efectiva', '', ''),
(1571, '2020', 1, 5, 168, 0, 'B', '', '', '', '', ''),
(1573, '2020', 1, 5, 385, 80, 'MB', 'Muy buen desempeño demostrado\r\nPreocupación por alcanzar los resultados', 'Siempre demuestra ganas de seguir aprendiendo\r\nAlto compromiso\r\nMucha Flexibilidad\r\n', 'Debe trabajar mucho en comunicacion efectiva del puesto\r\nDebe desarrollar mucha autonomía\r\nDebe trabajar en sistema \r\n', '', 'Conocimientos técnicos neumáticos y mecánicos\r\nParámetros de proceso '),
(1574, '2020', 1, 5, 406, 0, 'B', 'El desempeño demostrado en los puestos ocupados es bueno. Si bien es bueno hay que trabajar bastante para seguir desarrollando las competencias.\r\nFundamental la orientación a los resultados, proactividad, autonomía. ', '', 'Calidad y seguridad. Trabaja con anillo.\r\nDebe trabajar en comunicacion efectiva.\r\nDebe trabajar en flexibilidad. Cuestan los cambios profundos de tareas\r\nDebe seguir trabajando en proactividad \r\nDebe mejorar su autonomía\r\nTrabajar en el desarrollo de sistema. Participación activa en GB', '', ''),
(1575, '2020', 1, 5, 317, 0, 'B', 'Mucha preocupación por alcanzar los resultados propuestos\r\nSe observa mucha autonomía\r\nDebe trabajar mas en sistema. ', 'Flexibilidad.\r\nSe observa mucha Autonomía', 'Debe trabajar en comunicacion. Problemas de comunicacion con compañeros. Debe aprender a resolver conflictos. Esto afecta al trabajo en equipo, competencia fundamental para lograr los objetivos.\r\nDebe trabajar en aspectos de calidad en lo personal\r\nEn seguridad se marcan algunas cosas como protectores y algunos actos inseguros. Debe mejorar en este aspecto.\r\nDebe trabajar mas en proactividad. Se observan tiempos ociosos mal utilizados.Se observa mejora con el correr de la temporada. Utilizar ese tiempo en c', '', 'Competencias técnicas orientadas a esterilización\r\nParámetros de proceso');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(1576, '2020', 1, 5, 333, 76.25, 'B', 'Se observa un buen desempeño a lo largo de la temporada, viendo una marcada mejora en el mismo a medida que se avanza. \r\nAlto compromiso. \r\nResponsabilidad.', '', 'Debe trabajar en comunicacion proactiva, avisando los desvíos antes de ocurran.\r\nDebe trabajar en autonomía. Debe auto gestionar soluciones a problemas.\r\nDebe trabajar en seguridad. Se le marcan desvíos en EPP en algunas ocasiones. Mejora con el correr de la temporada. \r\nDebe participar en el sistema y GB de choferes.', '', ''),
(1578, '2020', 1, 5, 439, 80, 'MB', 'Se observa un muy buen desempeño. Debe trabajar algunas competencias, pero en general el desempeño es el esperado.', 'Se esfuerza siempre por alcanzar los resultados.\r\nMucha flexibilidad.\r\nAlto compromiso y responsabilidad.\r\n\r\n', 'Debe trabajar en el sistema. Generación de OT, lups, jde. Debe trabajar mas en equipo.(ej, playa barro)\r\nDebe trabajar en comunicación efectiva. En ocasiones se observan algunos desvíos.\r\nTrabajo en equipo es fundamental para alcanzar los resultados. \r\nSe observan desvíos en seguridad sobre todo en la utilización de EPP en el autoelevador.\r\nDebe ser un poco mas pro activo. No esperar ordenes. Trabajar en conjunto con la autonomía.', '', ''),
(1580, '2020', 1, 5, 401, 82.5, 'MB', 'Muy buen desempeño a lo largo de la temporada. Se observa un alto rendimiento dado por la orientación a los resultados. ', 'El trabajo en equipo y las ganas de aprender, sumado a la proactividad y autonomía del colaborador. ', 'Trabajar en seguridad. Se observan desvíos en la utilización de EPP. Trabajar en comunicacion efectiva.', '', ''),
(1582, '2020', 1, 5, 467, 76.25, 'B', 'buen desmpeño logrado a lo largo de la temporada. Se observa interes en obtener los resultados.', 'La flexibilidad y calidad son aspectos a destacar', 'Debe trabajar mas en flexibilidad y calidad(parámetros de proceso.)', '', 'Calidad(parámetros de proceso)'),
(1584, '2020', 1, 5, 412, 77.5, 'B', 'Buen desempeño logrado en la temporada. Se observa un a mejoría en el mismo con el avance de la misma. \r\nFlexibilidad debe destacarse, así como también el buen desempeño en el autoelevador.', 'El trabajo en equipo y la orientación a los resultados son grandes fortalezas.', 'Debe trabajar en comunicacion efectiva.\r\nSe observan algunos desvíos en seguridad que se deben corregir como actos inseguros y falta de EPP que mejoran al ser marcados durante la temporada.\r\nDebe trabajar mas en sistema. \r\nPro actividad y autonomía deben trabajarse. Debe adelantarse todo el tiempo a los problemas. La autonomía debe ser parte de ello para no fallar en los objetivos.', '', ''),
(1586, '2020', 1, 5, 117, 80, 'MB', 'Se observa un muy buen desempeño a lo largo de la temporada. ', 'Pro actividad en la linea.\r\nLa orientación a los resultados es un aspecto a destacar.', 'Debe trabajar en seguridad y calidad. Se observa utilización de celular. \r\nDebe trabajar en flexibilidad. Cuestiona decisiones de lideres y supervisor. Cuestan los cambios profundos.\r\nDebe trabajar en comunicacion efectiva del proceso.\r\nTrabajar en proactividad con linea detenida. No esperar ordenes. \r\nDebe trabajar mas en autonomía y el desarrollo de conocimientos técnicos en los equipos que se desempeña.\r\nDebe trabajar mas en conocimientos técnicos del proceso en cuanto a aspectos de calidad.', '', 'Variables de proceso. Parámetros de proceso.'),
(1588, '2020', 1, 5, 341, 80, 'MB', 'Se observa un muy buen desempeño.\r\n', 'El trabajo en equipo, la responsabilidad, la autonomía son aspectos a destacar junto con la orientación a los resultados', 'Debe trabajar en aspectos de seguridad. (sensor puenteado)\r\nDebe trabajar en aspectos de calidad. Se observa en varias oportunidades maquina sucia luego de un atasco. \r\nParticipar activamente en el GB realizando aportes positivos para seguir creciendo en eficiencia.\r\nDebe trabajar en comunicacion efectiva del puesto.\r\nDebe trabajar en el desarrollo de autonomía respecto de los conocimientos técnicos del equipo donde desarrolla su tarea. \r\n', '', 'Sistemas neumáticos\r\n'),
(1590, '2020', 1, 5, 429, 80, 'MB', 'Se observa un buen desempeño a lo largo de la temporada.\r\n', 'Se observa un alto compromiso con la orientación a los resultados.\r\nMuchas ganas de aprender. ', 'Se observan problemas para trabajar en planta con el compañero de autoelevador. No hay buena comunicacion ni organización para poder cumplir con los objetivos. Debe trabajar en poder resolver conflictos que afectan a la linea. \r\nDebe trabajar en comunicacion efectiva en este aspecto. Se observaron problemas para cumplir con los objetivos.\r\nSe observan algunos desvíos en seguridad que van aminorando a medida que pasa el tiempo.', '', 'Conocimientos técnicos de operación y proceso en SIG y Tetra.\r\nParámetros de proceso.'),
(1592, '2020', 1, 5, 342, 80, 'MB', 'Se observa un muy buen desempeño, mejorando con el correr de la temporada. ', 'La responsabilidad, el compromiso, la orientación a los resultados y la proactividad son aspectos a destacar.', 'Debe trabajar mas en la comunicacion efectiva del puesto, Mejora a medida que avanza la temporada. \r\nDebe seguir desarrollando el trabajo en equipo para poder lograr los objetivos de manera mancomunada y no de forma personal. Esta situación mejora conforme pasa la temporada. \r\nDebe trabajar en flexibilidad. En algunas ocasiones se observa malestar en decisiones tomadas por el supervisor.\r\nDebe trabajar en autonomía, desarrollando conocimientos específicos de parámetros de proceso y variables, para poder tom', '', 'Parámetros de proceso.\r\nConocimientos técnicos en selectoras y peladora.'),
(1595, '2020', 1, 36, 403, 0, 'MB', 'Puede ganarse más autonomía', 'Flexibilidad, buena predisposición, compromiso y trabajo ene quipo', '', '', ''),
(1596, '2020', 1, 36, 192, 48.75, 'NM', 'Podría buscarse la forma de aportar a la línea desde su puesto, no hay colaboración en ningún otro puesto, se va al te sin importar que quede desatendido el puesto, aún cuando la planta está repleta sin importar las consecuencias de ello. Esto fue marcado el año pasado y no han habido mejoras', '', 'Poca orientación al resultado y no se ve que se ponga demasiado empeño en la tarea que realiza, latas tiradas, que luego traen complicaciones con las 5s del setor y podrían traer complicaciones en seguridad. Comunicación escasa con líderes respecto a como aportar en el turno y en el puesto, no hay comunicación del estado de envolvedora', '', ''),
(1598, '2020', 1, 36, 332, 0, 'B', 'Buen operador en el puesto, pero debe preocuparse por aprender aún más de su equipo, de baño maría, ir creciendo y ganando autonomía y conocimientos técnicos. Ser proactivo en la comunicación en cuanto a estado de equipo y ante tiempos muertos', '', '', 'Casi siempre', 'Video Jets'),
(1599, '2020', 1, 36, 404, 0, 'B', 'El operador venía pidiendo el espacio para aprender, pero eso implica mayor responsabilidad. La seguridad no pasa sólo por los EPP, sino por trabajar siempre pensando antes de actuar. Se requiere mayor manejo del puesto, para que de esa forma pueda ganarse anticipación a necesidades operativas', 'Flexibilidad', 'Proactividad y autonomía', 'Siempre', 'Parámetros y variables de producto, circuitos, cañerías, llaves de puesto de trabajo, equipos y conocimientos técnicos básicos.'),
(1600, '2020', 1, 36, 232, 0, 'B', 'El reproceso a veces es la tarea asignada y debe hacerse con el mismo esfuerzo que el que se requiere en el puesto de trabajo', '', 'Comunicación de la calidad del producto en cinta. La condición segura y el puesto que debe ocupar no es el que resulta más cómodo y por eso no quiere ocuparlo. La seguridad y la condición segura tiene que ir primero', '', ''),
(1601, '2020', 1, 36, 265, 0, 'B', 'Comenzó con mucha dedicación en la línea, no tiene que bajar ese rendimiento.\r\nLa comunicación con el líder y el aprovechamiento de tiempos muertos pueden mejorarse', 'Flexibilidad y compromiso.', 'Una distracción en el puesto implica un reclamo, es clave el puesto del pulmón', 'Siempre', 'Aprender más sobre equipo del que está a cargo, para así poder manejarse con más autonomía en el mantenimiento del mismo'),
(1602, '2020', 1, 36, 188, 0, 'B', 'Es importante que se aprenda a desenvolver mejor en el puesto y que se vaya ganando autonomía para cumplir objetivos', 'Muy positivo que haya pedido oportunidad en otro puesto y haya aprovechado cuando se le dio', 'Autonomía, debe ganarse la capacidad de resolver sin depender de manera permanente del líder', 'Bien', ''),
(1603, '2020', 1, 36, 95, 72.5, 'B', 'Ganar autonomía implica conocer mejor las tareas y poder cumplirlas, producir mejor, y de manera eficiente.\r\nSiempre buscar ir un paso adelante en la línea, desde el equipo y las condiciones hasta el manejo de tiempos', '', 'Autonomía, debe ganarse la capacidad de resolver sin depender del líder', '', ''),
(1605, '2020', 1, 36, 120, 0, 'B', 'Se ve que en su puesto se preocupa por resolver los problemas que se presentan. Aprender y ganar más protagonismo en mantenimiento preventivo de la línea', 'Preocupación en cumplir bien el rol de su puesto, y comprometida con la producción', 'Puede mejorarse el uso de tiempos muertos u ociosos, mejorar la participación en propuestas para la línea', 'Bien', ''),
(1606, '2020', 1, 36, 119, 0, 'B', 'Confianza vs respeto\r\n', '', 'Proactividad y aprovechamiento de tiempos. A veces la actividad cuando hay un problema es reproceso y hay que hacerlo con el mismo empeño.\r\nLas condiciones del sector son imprescindibles, clines limpia el sector, pero mantenerlo es nuestro trabajo', 'Bien', ''),
(1607, '2020', 1, 36, 131, 0, 'B', 'Buen cumplimiento y autonomía en su puesto de trabajo, el puesto tiene exigencias, y hay un ritmo que seguir para no parar línea.\r\n', 'Se maneja con autonomía en el puesto', 'En momentos en que la línea no demanda envases hay que aprovechar el tiempo, buscar tareas, comunicar que se está disponible por si el equipo la requiere en otra actividad', '', ''),
(1608, '2020', 1, 36, 350, 77.5, 'B', 'Colaborador muy metido en su puesto, resuelve y ayuda cuando el problema es mecánico, eso es indispensable para conocer el equipo y ganar autonomía. Es muy importante comunicar cuando hay desvios de valores de calidad, que otro turno haya producido así no nos habilita. Tener en cuenta que las condiciones del sector hacen a la seguridad', 'Autonomía', 'Trabajo en equipo y seguridad', 'Siempre', ''),
(1610, '2020', 1, 12, 282, 75, 'B', 'Es una colaboradora que demuestra su interes por el puesto que ocupa aunque se la ha notado mas desanimada que el año anterior. Responsable con el autonomo y comprometida con calidad y seguridad.', 'OaR: Siempre activa en su puesto de trabajo (pendiente si falta MP o envases). Muy comprometida con su puesto. Trabaja muy bien en el autónomo. TRAB EQUIPO: Se desempeña muy bien con sus pares. PROAC: Realiza limpieza en su sector y esta atenta a la producción, debe trabajar en evitar los tiempos ociosos. FLEX: Debe estar mas predispuesta a otras asignaciones.', 'COM: Es una persona respetuosa y con buena comunicación pero algo retraida, rara vez comunica anormalidades o cuestiones de su linea. AUT: Se destaca su comportamiento al realizar el mantenimiento en los equipos.', '', ''),
(1612, '2020', 1, 12, 191, 86.25, 'MB', 'La colaboradora presenta mucho interes y entusiasmo en el puesto que ocupa, siempre pendiente de la linea y la producción. Es una persona respetuosa siempre flexible para cualquier tarea que se le asigne. Se observo muy beun desempeño en el autonomo de su equipo y trabaja en equipo con sus pares para lograr un objetivo en comun.', 'OaR: Siempre preocupada por realizar su función de manera correcta y responsable. Presenta un elevado compromiso. COM:Siempre comunicactiva y proponiendo mejoras. TenE: Participación activa con sus pares. ', 'PROA: Debe mejorar su actitud frente a los momentos ociosos. Buen desempeño con linea en marcha (falta de latas, tomate revisión de latas bajo peso)', '', ''),
(1613, '2020', 1, 5, 109, 66.25, 'B', 'No se observa buen desempeño. Si bien en el global se logra una buena evaluación, debe trabajar en aspectos a mejorar.', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad', 'Se observa mucha perdida de tiempo conversando con la compañera, tanto en molienda como en 2da selección.\r\nSe pierde de vista el objetivo de la tarea por dicha distracción. La calidad y el trabajo en equipo se ven afectados por esta situación, ya que se pierde de vista la tarea que se esta desarrollando, y ademas se sobre carga a las compañeras por no trabajar al ritmo de la linea. Se observa trabajar con una sola mano.\r\n Demoras en el desayunador y baño\r\n\r\nTiempo ocioso mal utilizado. Espera a recibir una ', '', ''),
(1615, '2020', 1, 5, 112, 48.75, 'NM', 'No se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado. ', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad', 'Se observa mucha perdida de tiempo conversando con la compañera, tanto en molienda como en 2da selección.\r\nSe pierde de vista el objetivo de la tarea por dicha distracción. La calidad y el trabajo en equipo se ven afectados por esta situación, ya que se pierde de vista la tarea que se esta desarrollando, y ademas se sobre carga a las compañeras por no trabajar al ritmo de la linea. Se observa trabajar con una sola mano.\r\n Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una or', '', ''),
