(1618, '2020', 1, 5, 182, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\nSeguridad', 'Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1619, '2020', 1, 5, 108, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\nSeguridad\r\n', 'Se observa perdida de tiempo conversando con la compañera, tanto en molienda como en 2da selección.\r\nSe pierde de vista el objetivo de la tarea desarrollada por dicha distracción. La calidad y el trabajo en equipo se ven afectados por esta situación, ya que se pierde de vista la tarea que se esta desarrollando, .\r\n Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabaj', '', ''),
(1620, '2020', 1, 5, 169, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad sobre todo. Se realizaron muchos cambios de puestos a lo largo de temporada dando respuesta positiva a los mismos.\r\nCompromiso\r\nResponsabilidad\r\nSeguridad\r\n', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1622, '2020', 1, 5, 465, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado y afianzar las fortalezas. Se observan ganas de aprender y motivación.\r\n', 'Flexibilidad sobre todo. Se realizaron muchos cambios de puestos a lo largo de temporada dando respuesta positiva a los mismos.\r\nCompromiso\r\nResponsabilidad\r\nSeguridad', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. (Tarjetas,Lups)\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1625, '2020', 1, 36, 344, 0, 'MB', 'Colaborador con excelente compromiso y dedicación para el trabajo que se le asigna, toma nuevos desafíos y se adapta perfectamente a nuevos equipos de trabajo. \r\nSiempre da lo mejor de sí y se acopla a trabajar con líder proponiendo mejoras, aprendiendo y aplicando conocimientos', 'Autonomía, proactividad', '', 'Siempre comprometido con el puesto de trabajo', ''),
(1626, '2020', 1, 36, 431, 0, 'B', 'Trabajo en equipo en línea, más allá del puesto que se ocupa buscar cooperar en la línea completa, donde sea que se necesite.\r\nLa autonomía se va a ir ganando en la medida en que se vaya aprendiendo', 'Flexibilidad, y buena voluntad en cualquier puesto.\r\nMuchas ganas de aprender y de demostrar.', '', '', ''),
(1627, '2020', 1, 36, 181, 0, 'B', 'Colaboradora debe aprender y animarse más a trabajar con su equipo', 'Flexible y trabaja con empeño en todas las tareas que hace', 'Condiciones del sector implica seguridad del puesto, en tiempos muertos limpiar, si bien está cines, es importante se nos preocupemos por eso.\r\nCalidad con la que se produce, si no cumple especificaciones, no vale la pena producir', 'Bueno, participación en la línea cuando se la necesita', ''),
(1628, '2020', 1, 36, 107, 0, 'B', 'Cuando el equipo anda bien y se está produciendo con normalidad pueden aprovecharse tiempos, al igual que cuando el equipo para. No se ve actitud a la hora de haber un inconveniente en el sector, ni autonomía para resolver', '', 'Deben mantenerse las condiciones del sector, porque eso implica también trabajar con seguridad, corre en línea, siendo que se sabe que es un sector peligroso', 'Bien', ''),
(1629, '2020', 1, 36, 227, 0, 'B', 'Colaboradora con muchas ganas de trabajar y le pone empeño a todas las tareas que realiza.', 'Proactiva y muy atenta al proceso en todo momento. Trabaja en equipo buscando objetivo en común', 'Como oportunidad de mejora ir conociendo más los equipo para lograr mayor autonomía.\r\nMantener condiciones de sector aunque clines limpia, debe mantenerse sino se trabaja en un sector inseguro', 'Bueno', ''),
(1630, '2020', 1, 36, 164, 0, 'B', 'Colaboradora trabaja con muy buena predisposición en cualquier puesto', 'Proactiva y atenta a la línea. Trabaja en equipo y se preocupa por la eficiencia', 'Mantener las condiciones del sector para evitar accidentes, si bien clines limpia, complementar, y mantener el puesto', 'Bueno', ''),
(1631, '2020', 1, 36, 103, 0, 'MB', 'Colaboradora trabaja con buena predisposición y siempre muy atenta al puesto de trabajo', 'Proactividad, orientación a resultados y autonomía', 'Condiciones del sector, si bien clines limpia, velar por mantener el puesto y así evitar condiciones inseguras', 'Bueno', ''),
(1632, '2020', 1, 36, 281, 0, 'B', 'Muy activa en la línea, metida en el proceso', 'Proactiva, trabaja en equipo con Marcela y Gladys. Sabe de equipos y se interesa en aprender', 'Mejor aprovechamiento de tiempos y mejor mantenimiento de condiciones de sector, en ocasiones se pone en riesgo por hacer cosas apurada', 'Bueno', 'Oportunidad de crecer en algún equipo'),
(1634, '2020', 1, 12, 276, 77.5, 'B', 'Es una colaboradora que presenta compromiso con la empresa, realiza su trabajo a conciencia y presenta flexibilidad para cualquier tarea que se le asigne.', 'OaR: Buen desempeño en su puesto, se preocupa por cumplir con la producción asegurando los estandares. Presenta compromiso con el sistema. COM: Es una persona respetuosa pero debe fortalecer la comunicación de mejoras. TenE: Buen vinculos con sus compañeros, debe mejorar las 5S de su sector. AUT: Se muestra interesada por el autónomo de su equipo, presenta compromiso los fines de semana. FLEX: Siempre flexible para cualquier tarea que se le asigne.', 'CAL: Mastica chicle en la linea. PROAC: Ser mas proactiva cuando la linea esta detenida evitando charlas con sus compañeras. Mantener limpio su sector. Mostrar mas interes por la producción, demoras cuando esta la linea detenida.', '', ''),
(1636, '2020', 1, 12, 280, 0, 'MB', 'Presenta muy buen desempeño siempre atenta a cumplir con los estandares de calidad. Se comunica bien con los lideres y mecanico de turno en pos de mejorar cuando hay un desvio. Tambien se mostro interesada en el autonomo de los equipos de envasado.', '', '', '', ''),
(1637, '2020', 1, 12, 190, 0, 'NM', 'La colaboradora no muestra mucho interes en su trabajo. Se la nota en distintos puestos conversando. Falta proactividad en su puesto y se ausenta generando conflictos con sus compañeros. Se muestra muy interesada en venir los fines de semana para hacer HHEE pero debe cuidar sus actividades en horario normal.', 'Compromiso los fines de semana.', 'OaR: Cuando recibe un pallets algunas veces lo completa con latas. Cuando se cae una lata con el movimiento del autoelevador no se encarga de recogerla. COM: No avisa cuando se va de su puesto. TenE: Se ausenta de su puesto generando retraso de las tareas de los autoelevadoristas, acumulación de pallets en el sector que no ayudan las 5S.PROA: Se la encuentra en distintos puestos conversando con sus pares, se la ha observado dormitando en su puesto en vez de buscar una actividad como reproceso, limpieza, etc', '', ''),
(1638, '2020', 1, 36, 116, 0, 'B', 'Colaboradora baja mucho de su puesto de trabajo, si considera que necesita rotar, porque la actividad es monótona, se habla y se propone.', 'EPP', 'Trabajo en equipo, cuando alguien no está en el puesto, recarga a quienes si están o se dejan de cumplir requisitos de calidad. En tiempos ociosos buscar actividades y ponerles empeño', '', ''),
(1639, '2020', 1, 36, 155, 70, 'B', 'Mayor empeño en tareas de reproceso, mayor compromiso con la calidad del producto que estamos elaborando.\r\nAutonomía y proactividad en el día a día de trabajo', '', '', '', ''),
(1641, '2020', 1, 36, 170, 70, 'B', 'Tener en cuenta que en la temporada han habido muchos atascos en bombas y molinos de la línea por contaminantes. Es necesario avisar si la cantidad de tomate excede al proceso de selección, eso también hace a la comunicación proactiva', '', '', '', ''),
(1642, '2020', 1, 36, 302, 0, 'B', 'Participación en el grupo base, las reuniones son para buscar soluciones. \r\nTrabajo en equipo, reclamos de estado de turno tanto en auto como en dp.\r\nEn proactividad se tienen en cuenta las condiciones del sector', '', 'Autonomía se irá ganando en la medida que se vaya conociendo el equipo.\r\nSeguridad y velocidad de circulación, además de estándar de uso permanente de EPP', 'Poco los fines de semana, sólo para algunas actividades', ''),
(1643, '2020', 1, 12, 150, 57.5, 'B', '', 'CAL: Atenta al trazador. Variación de peso.\r\nSEG: En ocasiones no usa EPP para destrabar el DA.', 'OaR: Es una colaboradora que se interesa a medias que la linea este en producción, se la observó varias veces conversando mientras la linea estaba detenida sin mostrar interes por el problema. COM: En algunas oportunidades no muestra buenas formas para comunicarse. Falta comunicar mejoras. TenE: Se maneja bien con sus pares, debe mejorar la limpieza y estado de su sector. PROA: Pocas veces se muestran interesadas en buscar otra actividad cuando la linea esta detenida, incluso se la ha observado \"escondida e', '', ''),
(1644, '2020', 0, 0, 140, 0, 'B', 'No se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', '', 'Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en flexibilidad. Se la envío a puestos diferentes y siempre hubo mala predisposición para el cambio.\r\n', '', ''),
(1645, '2020', 1, 5, 140, 0, 'B', 'No se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n\r\n', '', 'Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar mas en flexibilidad. Se la envió a puestos diferentes al que ocupaba y no hubo buena predisposición', '', ''),
(1646, '2020', 1, 5, 322, 0, 'NM', 'No se observa un desempeño adecuado en las tareas que el colaborador ha realizado. Debe trabajar mas en lo señalado.\r\n', '', 'Se observa excesiva utilización del celular. Se pierde foco de la tarea asignada, dejando a la vista despreocupación por la calidad y la seguridad.\r\nSe observan en reiteradas ocasiones actitudes ociosas durante la producción. (pies arriba de baranda). Perdida de tiempo en el baño. Perdida de tiempo conversando en otros sectores cuando el equipo no estaba con latas. \r\nNo resuelve problemas por sus propios medios. Pocas veces da una solución a conflictos de la linea. \r\nDebe trabajar en proactividad. Pocas vec', 'Se observa un compromiso que no es incondicional. Fines de semana que se le pidió venir y no podía. También entre semana y no vino en toda la temporada.\r\nSe observa que al colocar ayudante hay', ''),
(1647, '2020', 1, 5, 184, 0, 'B', 'No se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\n', 'Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso en el que participa\r\nDebe trabajar fuertemente en autonomía. Se observa debilidad para tomar decisiones en el puesto. Se observa poco conocimiento desarrollado en el autonomo. \r\nDebe trabajar mas en calidad, sobre todo en parámetros de proceso.\r\nDebe trabajar en sistema. \r\nDebe trabajar mas en comunicación efectiva del proceso ', '', ''),
(1648, '2020', 1, 5, 468, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\n', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema.\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1649, '2020', 1, 5, 380, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\nTrabajo en equipo', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema.\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1650, '2020', 1, 5, 440, 0, 'NM', 'No se observa un desempeño adecuado en las tareas que el colaborador ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\n', 'Varios choques a maquinas y producto. Algunos no comunicados. Fue sancionado por eso. Debe trabajar en el desarrollo de la autonomía en el puesto.\r\nDebe trabajar mucho en el desarrollo del trabajo en equipo. No se pudo observar una organización correcta de las tareas con el compañero. Muchos errores operativos y detenciones de linea.\r\nDebe trabajar en flexibilidad. Se observan gestos fuera de lugar.\r\nDebe trabajar mucho en comunicacion. Se observan detenciones de linea que podrían haberse evitado si hubiera', '', ''),
(1651, '2020', 1, 5, 185, 0, 'B', '', 'Flexibilidad sobre todo. Se realizaron muchos cambios de puestos a lo largo de temporada dando respuesta positiva a los mismos.\r\nSeguridad\r\n', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1652, '2020', 1, 36, 92, 0, 'B', 'No se nota proactividad ni autonomía a la hora de resolver problemas. No se aprovechan tiempos ociosos. No se mantienen las condiciones de la línea, y lo que se descuida la seguridad de la misma. No se nota buena predisposición ante los pedidos del líder', '', 'Formas de comunicar y respeto al líder. Debe mejorarse el trabajo en equipo, y buscar el objetivo en común en el turno (concepto de que si alguien no lo hace, yo tampoco)', '', ''),
(1653, '2020', 1, 36, 285, 0, 'NM', 'Colaboradora deja la línea sin previo aviso, generando detenciones por complicaciones en empaque.\r\nOrientación a los resultados, poco interés en la tarea que se hace, no se ve compromiso con la línea ni preocupación ante detención de la misma. No se nota buena predisposición ante los pedidos del líder. No se observa proactividad ni autonomía a la hora de resolver problemas. No se aprovechan tiempos ociosos. No se mantienen las condiciones de la línea, y lo que se descuida la seguridad de la misma. ', '', 'Comunicación: debe darse aviso cuando se retire de la línea al líder. Así se organiza al equipo, sino se sobrecarga a compañeras. Debe mejorarse el trabajo en equipo, y buscar el objetivo en común en el turno (concepto de que si alguien no lo hace, yo tampoco)', '', ''),
(1654, '2020', 1, 36, 167, 0, 'B', 'Orientación a los resultados, poco interés en la tarea que se hace, no se ve compromiso con la línea ni preocupación ante detención de la misma. No se nota buena predisposición ante los pedidos del líder. No se observa proactividad ni autonomía a la hora de resolver problemas. No se aprovechan tiempos ociosos. No se mantienen las condiciones de la línea, y lo que se descuida la seguridad de la misma', '', 'Proactividad y compromiso por la línea.Debe mejorarse el trabajo en equipo, y buscar el objetivo en común en el turno (concepto de que si alguien no lo hace, yo tampoco)', '', ''),
(1655, '2020', 1, 36, 262, 0, 'MB', 'Proactividad a la hora de producir', 'Compromiso e interés para con la línea.\r\nBuena predisposición para trabajar y para aprender.', 'Oportunidad de Mejora: Ir conociendo más de equipos y resolver cada vez más sola', '', ''),
(1657, '2020', 1, 36, 226, 0, 'B', 'Orientación a los resultados, poco interés en la tarea que se hace, no se ve compromiso con la línea ni preocupación ante detención de la misma. No se nota buena predisposición ante los pedidos del líder. No se observa proactividad ni autonomía a la hora de resolver problemas. No se aprovechan tiempos ociosos. No se mantienen las condiciones de la línea, y lo que se descuida la seguridad de la misma. ', '', 'Debe mejorarse el trabajo en equipo, y buscar el objetivo en común en el turno (concepto de que si alguien no lo hace, yo tampoco)', '', ''),
(1658, '2020', 1, 36, 166, 0, 'B', 'Orientación a los resultados, poco interés en la tarea que se hace, no se ve compromiso con la línea ni preocupación ante detención de la misma. No se nota buena predisposición ante los pedidos del líder. No se observa proactividad ni autonomía a la hora de resolver problemas. No se aprovechan tiempos ociosos. No se mantienen las condiciones de la línea, y lo que se descuida la seguridad de la misma. ', '', 'Debe mejorarse el trabajo en equipo, y buscar el objetivo en común en el turno (concepto de que si alguien no lo hace, yo tampoco). Calidad del producto que se va a vender, no pueden llegar envases arrugados al cliente', '', ''),
(1659, '2020', 1, 36, 121, 0, 'B', 'Se busca una mayor comunicación y participación respecto a la calidad que se va a la línea', '', 'Trabajo en equipo, cuando alguien no está en el puesto, recarga a quienes si están o se dejan de cumplir requisitos de calidad. En tiempos ociosos buscar actividades y ponerles empeño', '', ''),
(1660, '2020', 1, 36, 165, 0, 'B', 'Tener en cuenta que en la temporada han habido muchos atascos en bombas y molinos de la línea por contaminantes. Es necesario avisar si la cantidad de tomate excede al proceso de selección, eso también hace a la comunicación proactiva', '', '', '', ''),
(1661, '2020', 1, 36, 271, 0, 'MB', '', 'Compromiso, proactividad y ganas de aprender. Flexibilidad', 'Uso de celular, seguridad en autoelevador', '', ''),
(1662, '2020', 1, 36, 336, 83.75, 'MB', 'Siempre aplicar los pedidos del líder. Buen proceso de aprendizaje e interés en el puesto', 'Proactivo y participativo en todas las líneas en las que trabajó', '', '', ''),
(1664, '2020', 1, 36, 303, 0, 'MB', '', '', '', '', ''),
(1667, '2020', 1, 12, 163, 0, 'MB', 'Presenta mucho interes y entusiasmo en el puesto que ocupa, siempre pendiente de la linea y la producción. Es una persona respetuosa siempre flexible para cualquier tarea que se le asigne. Se observo muy beun desempeño en el autonomo de su equipo y trabaja en equipo con sus pares para lograr un objetivo en comun. Debe mejorar los tiempos ociosos.', 'OaR: Siempre preocupada por realizar su función de manera correcta y responsable. Atenta a la falta de latas, insumos. Presenta un elevado compromiso. COM: Muy respetuosa. Siempre comunicactiva, debe mejorar proponiendo mejoras. TenE: Participación activa con sus pares, se maneja muy bien con sus compañeras en el autónomo.', 'PROA: Debe mejorar su actitud frente a los momentos ociosos. Buen desempeño con linea en marcha (falta de latas, tomate revisión de latas bajo peso).\r\nCAL: Levantar la mano cuando el producto que esta en la envasadora no cumple con las especificaciones de calidad. Mantiene su equipo limpio.', '', ''),
(1669, '2020', 1, 12, 97, 62.5, 'B', '', 'COM: Es una persona respetuosa pero no comunica estado de su linea, no propone mejoras. FLEX: Se le asigno el puesto de despalletizador y lo asumio sin complicaciones.', 'OaR: Se muestra poco interés en que la línea ande. Poca participación en el día a día a la hora de resolver problemas. No se ve compromiso con la línea. Cuando realiza reproceso no muestra mucho interes. Nada de compromiso los fines de semana. TenE: no se nota trabajo buscando un objetivo en común en la línea y en el turno. Al no venir al autonomo recarga a sus compañeros con las tareas que le corresponden. No ayuda en la limpieza de su sector. PROA: tiempos ociosos en detenciones de la línea, en limpiezas ', '', ''),
(1670, '2020', 1, 12, 186, 0, 'B', '', 'OaR: Se preocupa por su tarea auqnue en ocasiones han pasado objetos extraños. Se baja a abrir el agua cuando se atasca el tomate. Se ausenta en varias oportunidades. FLEX: SE dispone a hacer cualquier tarea que se le solicite. CAL: Trabaja bien pero deben informar cuando la cinta viene muy cargada.', 'COM: Se ausenta de la linea sin avisarle al operador de molienda. Ofrece poca opinion a mejoras. TenE: No ayudan en las 5S del sector. PROAC: Buscar actividades cuando la linea esta detenida.', '', ''),
(1671, '2020', 1, 12, 189, 0, 'B', '', 'OaR: Se preocupa por su tarea aunque en ocasiones han pasado objetos extraños. Se baja a abrir el agua cuando se atasca el tomate. FLEX: No le gusta hacer otras tareas que se le asignen como reproceso. CAL: Trabaja bien pero deben informar cuando la cinta viene muy cargada.', 'COM: Ofrece poca opinion a mejoras. TenE: No ayudan en las 5S del sector. PROAC: Buscar actividades cuando la linea esta detenida.', '', ''),
(1672, '2020', 1, 5, 139, 72.5, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad\r\nCompromiso\r\nResponsabilidad\r\nSeguridad\r\nTrabajo en equipo', 'Debe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en autonomía, desarrollando conocimientos generales del sector en que participa, para comenzar a resolver problemas por su cuenta.\r\n', '', ''),
(1674, '2020', 1, 5, 99, 62.5, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Compromiso\r\nResponsabilidad\r\nCalidad\r\nSeguridad\r\n', ' Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en autonomía, desarrollando conocimientos generales del sector en que participa, para comenzar a resolver problemas por su cuenta.\r\n', '', ''),
(1676, '2020', 1, 5, 469, 70, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad sobre todo. Se realizaron muchos cambios de puestos a lo largo de temporada dando respuesta positiva a los mismos.\r\nCompromiso\r\nResponsabilidad\r\nSeguridad\r\nTrabajo en equipo\r\nCalidad', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en autonomía, desarrollando conocimientos generales del sector en que participa, para comenzar a resolver problemas por su cuenta.\r\n', '', ''),
(1679, '2020', 1, 12, 400, 0, 'MB', '', 'OaR: Se desempeña en su puesto con conocimiento. Presenta buen compromiso. Mejorar la limpieza de su sector. COM: Respetuoso y comunicativo con sus pares. Debe ser mas proactivo proponiendo mejoras. TenE: Muy bien debe mejorar en las demoras en el refrigerio y en el reemplazo del compañero del BM. AUT: Buen desempeño en los estandares de su puesto. FLEX: Siemrpe dispuesto a escuchar y a realizar la tarea que se le solicita. CAL: Atento al fechado, latas oxidadas o con algun defecto.', 'PROA: Evitar tiempos ociosos. Conevrsa mucho con otros compañeros. Aproechar el tiempo cuando la linea esta detenida. SEG: Tomar algunos recaudos antes de actuar (Se sube a cinta de transporte, Sca pallets de atascos sin guantes)', '', ''),
(1680, '2020', 1, 12, 527, 0, 'B', '', 'OaR: Necesita aprender mas de su puesto pero tiene un desempeño acorde al tiempo que lleva. Se lo nota poco preocupado o confiado. Buen compromiso. Mejorar la limpieza de su sector. COM: Respetuoso. Debe ser mas proactivo proponiendo mejoras. TenE: Muy bien debe mejorar en las demoras en el refrigerio y en el reemplazo del compañero del BM. AUT: Buen desempeño en los estandares de su puesto.  CAL: Atento al fechado, latas oxidadas o con algun defecto.', 'PROA: Evitar tiempos ociosos. Conversa mucho con otros compañeros. Aprovechar el tiempo cuando la linea esta detenida. TenE: Debe mejorar en las demoras en el refrigerio y en el reemplazo del compañero del BM. FLEX: En ocasiones cuando el lider le da una orden intenta que lo haga otra persona.', '', ''),
(1681, '2020', 0, 0, 527, 0, 'B', '', 'OaR: Necesita aprender mas de su puesto pero tiene un desempeño acorde al tiempo que lleva. Se lo nota poco preocupado o confiado. Buen compromiso. Mejorar la limpieza de su sector. COM: Respetuoso. Debe ser mas proactivo proponiendo mejoras. TenE: Muy bien debe mejorar en las demoras en el refrigerio y en el reemplazo del compañero del BM. AUT: Buen desempeño en los estandares de su puesto.  CAL: Atento al fechado, latas oxidadas o con algun defecto.', 'PROA: Evitar tiempos ociosos. Conversa mucho con otros compañeros. Aprovechar el tiempo cuando la linea esta detenida. TenE: Debe mejorar en las demoras en el refrigerio y en el reemplazo del compañero del BM. FLEX: En ocasiones cuando el lider le da una orden intenta que lo haga otra persona.', '', ''),
(1682, '2020', 1, 12, 330, 80, 'B', '', 'OaR: Comprometido con la tarea y la empresa. En ocasiones no se lo encuentra en planta o es muy dificil de ubicarlo. Se detuvo la linea en varias oportunidades por falta de autoelevador. COM: Muy respetuoso y educado. Debe comunicar mas mejoras o ser mas proactivo en la comunicación. No hay forma de poder rastrearlo.  PROA: Siempre se lo observó realizando alguna tarea. FLEX: Siempre dispuesto a realizar la tarea que se le asigne.', 'TenE: Debe mejorar teniendo un ojo mas critico en las 5S de los sectores comunes. SEG: Evitar riesgos o velocidades elevadas en el autoelevador. Ser mas cuidado con los movimientos.', '', ''),
(1683, '2020', 1, 12, 318, 68.75, 'B', '', 'OaR: Comprometido con la tarea. En ocasiones no se lo encuentra en planta. Varias veces se detuvo la linea por falta de autolevador. COM: Debe comunicar mas mejoras o ser mas proactivo en la comunicación. Se ha notado circunstancias en las que miente o no es del todo claro. ', 'TenE: Debe mejorar teniendo un ojo mas critico en las 5S de los sectores comunes. Siempre expone los defectos de sus compañeros en vez de solucionarlos con las personas. (Mucha queja). PROA: Muchas veces se lo encuentra conversando o en otras lineas. Debe estar mas pendiente de las 5S. FLEX: En la mayoria de los casos que se le asigna una tarea busca que se la encarguen a otro compañero. Entiende que su unico puesto es autoelevadorista de planta y no es flexible a ocupar otros puestos. SEG: Evitar riesgos o', '', ''),
(1686, '2020', 1, 12, 283, 61.25, 'B', '', '', 'OaR: Poco empeño en reproceso y al resultado del trabajo diario. Deben trabajar con las dos manos y hacer un trabajo mas eficiente. COM: poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: la Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue con otra actividad. Si faltan latas bajar para colocar mano). AUT: ', '', ''),
(1687, '2020', 1, 12, 122, 0, 'B', '', 'OaR: Se muestra en su puesto un buen trabajo en la selección pero poco empeño en reproceso. En DP2 deben estar mas atentas a la linea y ofrecer mas interes.', 'COM: poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: la Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue con otra actividad. Si faltan latas bajar para colocar mano). AUT: en varias ocasiones no resuelve problemas por sí mismo, no gestiona sus propios recursos. Si en reproceso no le traen, no se hace na', '', ''),
(1688, '2020', 1, 12, 123, 0, 'B', '', 'OaR: Se muestra en su puesto un buen trabajo en la selección pero poco empeño en reproceso. En DP2 deben estar mas atentas a la linea y ofrecer mas interes. Deben continuar seleccionando en el cambio de turno.', 'COM: poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: la Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue con otra actividad. Si faltan latas bajar para colocar mano). AUT: en varias ocasiones no resuelve problemas por sí mismo, no gestiona sus propios recursos. Si en reproceso no le traen, no se hace na', '', ''),
(1689, '2020', 1, 12, 161, 0, 'B', '', '', 'Debilidades:\r\nOaR: Poco empeño en reproceso y al resultado del trabajo diario. Deben trabajar con las dos manos y hacer un trabajo mas eficiente. Deben continuar seleccionando en el cambio de turno. COM: poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: la Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue ', '', ''),
(1691, '2020', 1, 12, 183, 0, 'NM', '', '', 'OaR: Poco empeño en el resultado del trabajo diario. No selecciona de manera eficaz, trabaja con una sola mano y es muy lenta. Selecciona sin mirar la MP y conversando con su compañera. Deben continuar seleccionando en el cambio de turno. En reproceso no realzia la actividad con compromiso. COM: Nada de comunicación con la supervisora, canaliza información por el lider de tomate (pareja). Poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calida', '', ''),
(1692, '2020', 1, 12, 233, 0, 'B', '', '', 'OaR: Poco empeño en el resultado del trabajo diario. No selecciona de manera eficaz, trabaja con una sola mano. Selecciona sin mirar la MP y conversando con su compañera. Deben continuar seleccionando en el cambio de turno. En reproceso no realiza la actividad con compromiso. COM: Poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operat', '', ''),
(1693, '2020', 1, 12, 159, 0, 'B', '', 'OaR: Se muestra iniciativa para aprender en un puesto pero se muestra muy nerviosa. AUT: Compromiso en el autonomo y reuniones.', 'FLEX: Cuando se le solicito que fuera a despalletizador no le gusto preguntando porque siempre iba ella. PROA: Si no se le asigna una tarea no muestra predisposición. CAL: Ingresa a planta a fichar de civil sin respetar las BPM', '', ''),
(1694, '2020', 1, 12, 118, 0, 'B', '', 'OaR: Se muestra muy preocupada por cumplir sus actividades de manera eficiente. Se desenvuelve muy bien en su puesto. PROAC: se nota buena predisposición en los momentos en que la linea esta detenida. Ofrece poca opinion a mejoras. ', 'COM: poca generación de mejoras o ideas para la línea. \r\n AUT: Participan de las jornadas pero no se observo deteccion de anormalidades a traves de OT o realización de LUPS. FLEX: En ocasiones se le asigno alguna tarea en la que mostro disconformidad con gestos.', '', ''),
(1695, '2020', 1, 12, 100, 80, 'B', '', 'OaR: mucho compromiso y empeño en las tareas asignadas. COM comunicación efectiva de proceso en turno, muy al tanto de lo que sucede en su sector (pesos de latas). Debe proponer mejoras en la línea/sector. TenE: busca un objetivo en común en la línea y en el turno, se adapta y colabora desde cualquier puesto, reemplaza a sus compañeras.', 'PROAC: Debe aprovechar los tiempos ociosos en detenciones de la línea. Trabajar en mantener las condiciones de 5s de su  sector (suciedad y agua en el piso). FLEX: se adapta muy bien a nuevas asignaciones.\r\n \r\n', '', ''),
(1697, '2020', 1, 12, 414, 0, 'MB', 'Sergio presenta muy buen desempeño. Siempre predispuesto a cualquier actividad que se le asigne. Es una persona comprometida, responsable y trabajadora. Comunica de manera eficaz cuestiones operativas. No es necesario estar siguiendolo en la tarea que se le asigna, se desempeña con autonomia. SEG: Cuidar los movimientos con el autoelevador y velocidades.', '', '', '', ''),
(1700, '2020', 1, 14, 529, 0, 'MB', '', 'Flexibilidad y predisposición frente a diferentes tareas', 'Aumentar proactividad y autonomía', '', ''),
(1701, '2020', 1, 12, 382, 0, 'E', 'El colaborador presenta un gran compromiso y desempeño en su trabajao. Siempre atento y proactivo buscando dar el maximo. Se mueve con autonomia resolviendo problematicas operativas y de mantenimiento. Excelente desempeño en el registro de planillas y estandares de calidad y proceso. Algo para trabajar es su caracter en algunas circunstancias, forma de contestar. Debe poder consencuar o acordar con sus compañeros.', '', '', '', ''),
(1702, '2020', 1, 14, 531, 0, 'B', '', 'Flexibilidad y predisposición frente a diferentes tareas', 'Aumentar proactividad y autonomía\r\nAnticiparse a desvíos del proceso\r\n', '', ''),
(1703, '2020', 1, 12, 340, 0, 'MB', 'El colaborador presenta un gran compromiso y desempeño en su trabajo. Se mueve con autonomia resolviendo problematicas operativas y de mantenimiento. Se valora que muchas veces cumple la función de un pseudolider. Debe mejorar la carga de registros de detenciones, ser mas proactivo cuando la linea esta detenida asignando tareas a las personas que estan en la segunda selección o al menos solicitando que el lider lo haga. Evitar tiempos ociosos.Trabajar teniendo en cuenta la calidad considerando la cantidad d', '', '', '', ''),
(1704, '2020', 1, 14, 532, 0, 'B', '', 'Trabajo en equipo. \r\nActitud positiva frente a diferentes circunstancias\r\nFlexibilidad y predisposición frente a diferentes tareas\r\n', 'Inseguridad en la toma de desiciones', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(1705, '2020', 1, 14, 533, 0, 'B', '', 'Trabajo en equipo. \r\nActitud positiva frente a diferentes circunstancias\r\nFlexibilidad y predisposición frente a diferentes tareas\r\n', 'Aumentar proactividad y autonomía\r\nAnticiparse a desvíos del proceso\r\n', '', ''),
(1706, '2020', 1, 14, 542, 0, 'B', '', 'Compromiso y dedicación en las tareas\r\nFlexibilidad y predisposición frente a diferentes tareas', 'Mejorar la comunicación dentro del equipos y brindar comunicación frente a desvíos', '', ''),
(1707, '2020', 1, 12, 348, 85, 'B', 'Operador muestra preocupación y compromiso con su trabajo. Presenta ganas de trabajar y aprender, se nota un mejor desempeño frente a años anteriores. Es comunicativo con el líder y supervisora. De ser mas proactivo en las detenciones. Excelente en flexibilidad, siempre predispuesto a cualquier tarea. Debe ganar mayor autonomía a medida que conozca su equipo. Buen trabajo con CAL y SEG.', '', '', '', ''),
(1708, '2020', 1, 14, 534, 0, 'B', '', 'Flexibilidad y predisposición frente a diferentes tareas', 'Anticiparse a desvíos del proceso\r\nToma de acciones antes desvíos y comunicación de los mismos', '', ''),
(1709, '2020', 1, 12, 279, 0, 'E', 'El colaborador presenta un gran compromiso y desempeño en su trabajao. Siempre atento y proactivo buscando dar el maximo. Se mueve con autonomia resolviendo problematicas operativas y de mantenimiento. Muy buena comunicación y conocimiento de los equipos.', '', '', '', ''),
(1710, '2020', 1, 12, 398, 0, 'E', 'El colaborador presenta un gran compromiso y desempeño en su trabajao. Siempre atento y proactivo buscando dar el maximo. Se mueve con autonomia resolviendo problematicas operativas y de mantenimiento. Excelente desempeño en el registro de planillas y estandares de calidad y proceso. Flexibilidad para toda tarea que se le solicite. Se desempeña muy bien aun siendo un nuevo puesto.', '', '', '', ''),
(1711, '2020', 1, 12, 377, 91.25, 'MB', 'Operador muestra preocupación y compromiso con su trabajo. Presenta predisposición, ganas de trabajar y aprender. Es comunicativo y con excelente flexibilidad, siempre predispuesto a cualquier tarea. Se desesenvuelve con autonomia. Buen trabajo con CAL y SEG.', '', '', '', ''),
(1713, '2020', 1, 12, 326, 0, 'B', 'El colaborador desempeña bien su tarea y conoce sobre el equipo. Siempre respetuoso y flexible para cualquier actividad que se le designe. Realiza los controles de calidad como corresponde. Debe mejorar siendo mas proactivo proponiendo mejoras y realizando tareas en su sector. De ser mas comunicativo y evitar tiempos ociosos. ', '', '', '', ''),
(1714, '2020', 1, 12, 93, 65, 'B', '', 'Flex: Predispuesta a aprender y afrontar nuevos desafios.', 'OaR: Poco empeño en reproceso y al resultado del trabajo diario.Debe trabajar con las dos manos y hacer un trabajo mas eficiente. COM: poca comunicación proactiva de anormalidades en el puesto. TenE: Baja muy seguido de la cinta y se la ha visto dormitar en su puesto, recargando a sus compañeras. Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue con otra actividad). AUT: No gestiona ', '', ''),
(1716, '2020', 1, 5, 568, 0, 'B', 'Se observa un buen desempeño para la tarea a la que fue asignado en el paletizado de remanejo', 'El trabajo en equipo y la orientación a los resultados.\r\nCompromiso\r\nResponsabilidad', '', '', ''),
(1717, '2020', 1, 5, 565, 0, 'B', 'Se observa un buen desempeño para la tarea a la que fue asignado en el paletizado de remanejo', 'El trabajo en equipo y la orientación a los resultados.\r\nCompromiso\r\nResponsabilidad\r\n', '', '', ''),
(1718, '2020', 1, 5, 563, 0, 'MB', 'Se observa un muy buen desempeño para la tarea a la que fue asignado en preprador de jugo\r\n', '', '', '', ''),
(1719, '2020', 1, 5, 561, 0, 'B', 'Se observa un buen desempeño para la tarea a la que fue asignado en el paletizado de remanejo\r\n', '', 'Debe trabajar mas en proactividad.\r\nDebe trabajar mas en equipo. Sobrecarga a compañeros por demoras \r\nDebe desarrollar mas autonomía', '', ''),
(1720, '2020', 1, 5, 472, 75, 'B', 'Se observa un buen desempeño para la tarea a la que fue asignado en FEM despalletizador/envolvedor', '', '', '', ''),
(1721, '2020', 1, 5, 319, 0, 'B', 'Se observa un desempeño adecuado en las tareas que el colaborador ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad sobre todo. Se realizaron muchos cambios de puestos a lo largo de temporada dando respuesta positiva a los mismos.\r\nCompromiso\r\nResponsabilidad\r\n', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. No realiza Tarjetas ni Lups\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa.\r\nDebe usar los EPP en el autoelevador', '', ''),
(1722, '2020', 1, 5, 349, 0, 'B', 'Se observa un desempeño adecuado en las tareas que el colaborador ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad \r\nCompromiso\r\nResponsabilidad\r\nOrientacion a los resultados', 'Debe trabajar mas en calidad. Equipos rotos.\r\nDebe trabajar mas en seguridad. No usa siempre EPP y comete actos inseguros. (Tacho de peróxido)\r\nComunicación debe reforzar.Se va sin avisar. Comunicación efectiva. ', '', ''),
(1723, '2020', 1, 5, 381, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'El trabajo en equipo y la orientación a los resultados.\r\nCompromiso\r\nResponsabilidad\r\nFlexibilidad.', 'Tiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. \r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\n', '', ''),
(1724, '2020', 1, 5, 390, 0, 'MB', 'Se observa un muy buen desempeño en las tareas que el colaborador ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nOrientacion\r\nResponsabilidad\r\nCompromiso', 'Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema. \r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en autonomía, desarrollando conocimientos generales del sector en que participa, para comenzar a resolver problemas por su cuenta.\r\n', '', ''),
(1726, '2020', 1, 5, 493, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado. Debe trabajar mas en lo señalado.\r\n', 'Flexibilidad.\r\nCompromiso\r\nResponsabilidad\r\nCalidad\r\nSeguridad', 'Demoras en el desayunador y baño\r\nTiempo ocioso mal utilizado. Espera a recibir una orden. Debe trabajar con proactividad. Debe adelantarse a las necesidades del puesto y del proceso\r\nDebe trabajar en sistema.\r\nDebe trabajar mas en comunicación efectiva del proceso en que participa\r\nDebe trabajar en autonomía, desarrollando conocimientos generales del sector en que participa, para comenzar a resolver problemas por su cuenta.\r\n', '', ''),
(1727, '2020', 1, 5, 535, 0, 'MB', 'Se observa un buen desempeño para la tarea a la que fue asignado en playa\r\n', '', '', '', ''),
(1728, '2020', 1, 5, 536, 0, 'B', '', '', '', '', ''),
(1729, '2020', 1, 5, 550, 0, 'MB', 'Se observa un muy buen desempeño para la tarea a la que fue asignado en Manzini\r\n', '', '', '', ''),
(1730, '2020', 1, 5, 553, 0, 'MB', 'Se observa un buen desempeño para la tarea a la que fue asignado en concentradores/tomate/caldera\r\n', '', '', '', ''),
(1731, '2020', 1, 5, 566, 0, 'B', 'Se observa un desempeño adecuado en las tareas que la colaboradora ha realizado.\r\n', '', '', '', ''),
(1732, '2020', 1, 36, 537, 0, 'NM', 'Poca proactividad, pese a numerosas explicaciones no le presta demasiado interés al aprendizaje.', '', 'No se ve empeño en cumplir la tarea. No comunica cuando no tiene clara la tarea. No se ve interés en integración a grupo de trabajo. ', '', ''),
(1733, '2020', 1, 36, 538, 0, 'MB', 'Muy buen desempeño en FEM', '', '', '', ''),
(1734, '2020', 1, 36, 540, 0, 'B', 'muy rápido para aprender, al comienzo mucho interés, luego de unas semanas no apovecha tiempos, desaparece de la línea', '', '', '', ''),
(1735, '2020', 1, 36, 541, 0, 'MB', 'Muy buena predisposición, muy rápido para aprender. Autonomía e interés en generación de tarjetas. Proactivo', '', '', '', ''),
(1736, '2020', 1, 36, 558, 0, 'MB', 'Muy buena predisposición. Autonomía e interés en generación de tarjetas. Proactivo', '', '', '', ''),
(1737, '2020', 1, 36, 552, 0, 'MB', 'Muy buena predisposición. Autonomía e interés en generación de tarjetas. Proactivo', '', '', '', ''),
(1738, '2020', 1, 36, 570, 76.25, 'B', 'Ayudante de Manzini y segunda selección. Bien predispuesto, pero poco tiempo para medirlo', '', '', '', ''),
(1740, '2020', 1, 12, 371, 0, 'B', 'Se muestra compromiso y un buen desarrolo de su trabajo. Se desempeña con autonomia. Es una persona flexible para ocupar el puesto que se le asigne. En trabajo en equipo debe poder ayudar a sus compañeros de planta cuando tiene tiempos ociosos. Debe ser mas proactivo buscando tareas para realizar en su puesto.', '', '', '', ''),
(1741, '2020', 1, 12, 231, 0, 'B', '', '', '', '', ''),
(1742, '2020', 1, 12, 392, 0, 'B', 'Se nota preocupación por mantener la linea en funcionamiento. Muestra comrpomiso con la empresa. Buena comunicación con el operador sobre anormalidades y respetuosa. Cuando la linea esta detenida le ayuda al operador. Debe conocer mas sobre la linea para poder tomar decisiones. Muy flexible para cualquer tarea que se solicite.', '', '', '', ''),
(1743, '2020', 1, 12, 335, 72.5, 'B', '', 'OaR: Se nota preocupado por cumplir con las tareas que se le asignan aunque le cuesta su nueva asignación. Participa en las reuniones. COM: Comunica las anormalidades, muchas veces si se le consulta por alguna detención de otro sector desconoce. PROA: Propone mejoras, avisa si faltan insumos, para la linea y realzia actividades. FLEX: Siempre accesible a la tarea que se le asigne.cAL/SEG: Buen desempeño', 'TeE: Debe coordinar mas con sus pares, especificamente cuando haya una detención o arranque de linea. Fortalecer las 5S de su sector. AUT: Falta toma de decisiones para no depender tanto del lider. Debe trabajar mas con sistema.', '', ''),
(1745, '2020', 1, 12, 94, 0, 'B', 'Se interesa por la linea y esta comprometida con la empresa. Informa anormalidades y conoce sobre los problemas de la linea. Ayuda al operador falta realziar 5S en su sector.', '', 'PROA: Trabajar en momentos ociosos. Siempre dentro de la cabina cuando la linea esta detenida. No buscan actividades. AUT: DEberia trabajar mas en conocer la linea.', '', ''),
(1746, '2020', 1, 12, 405, 0, 'MB', 'Muy buen desempeño. Tiene capacidad de aprendizaje. Preocupado por cumplir con lo que se le solicita, muy flexible para cualquier tarea que se le asigne. La experiencia en su nuevo puesto le va a ir dando los conocimientos para la toma de decisiones.', '', '', '', ''),
(1747, '2020', 1, 12, 433, 0, 'MB', '', '', '', '', ''),
(1748, '2020', 1, 12, 559, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y aplicado. Trabaja muy bien con calidad siempre completando las planillas y respetando los estandares. Debe ser mas comunicativo respecto a mejoras en su sector, anormalidades o complicaciones. Debe evitar los tiempos ociosos y charlas en el puesto con sus compañeros.', '', '', '', ''),
(1749, '2020', 1, 12, 551, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y con ganas de trabajar. Siempre flexible para tomar cualquier tarea que se le encargaba. Muy proactivo evitando momentos de ocio. Se adapta bien a cualquier asignación y trabaja bien en equipo con sus pares.', '', '', '', ''),
(1750, '2020', 1, 12, 549, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y con ganas de trabajar. Siempre flexible para tomar cualquier tarea que se le encargaba. Se adapta bien a cualquier asignación y trabaja bien en equipo con sus pares. \r\n', '', '', '', ''),
(1751, '2020', 1, 12, 547, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y con ganas de trabajar. Siempre flexible para cualquier asignación. Se adapta bien a cualquier puesto y trabaja bien en equipo con sus pares. Tiene facilidad para aprender.', '', '', '', ''),
(1752, '2020', 1, 12, 543, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y aplicado. Trabaja muy bien en equipo y se adapta a cualquier puesto. Siempre predispuesto y con capacidad para aprender. Se nota sus ganas de trabajar!', '', '', '', ''),
(1753, '2020', 1, 12, 539, 0, 'MB', 'Se destaca por ser un colaborador comprometido con su trabajo. Realiza la tarea con responsabilidad, muy educado y aplicado. Trabaja muy bien en equipo y se adapta a cualquier puesto. Siempre predispuesto y con capacidad para aprender. SEG: Debe estar mas atento y evitar realizar las tareas de manera automatica.', '', '', '', ''),
(1754, '2020', 1, 12, 569, 0, 'B', 'Es un colaborador que realiza bien la tarea que se le asigna pero se muestra con poco interes. Debe mejorar la comunicación y ser mas proactivo en su puesto o buscando realizar tareas cuando la linea esta detenida. Siempre predispuesto a hacer la tarea que se le solicita.', '', '', '', ''),
(1755, '2020', 1, 12, 556, 71.25, 'B', 'Es un colaborador comprometido con su trabajo y con ganas de aprender. Realiza la tarea con responsabilidad. Se adapta bien a cualquier asignación y trabaja bien en equipo con sus pares. Debe evitar los tiempos ociosos de conversar con sus compañeros. El paso de turno debe ser mas efectivo. En ocasiones los lideres le solicitaron una tarea y pidio que la hiciera otro compañero.\r\n', '', '', '', ''),
(1757, '2020', 1, 41, 528, 0, 'MB', 'El desempeño de Cristian fue muy positivo. Mostro interes por poder aprender todo los temas relacionados a la planta. En muchas ocasiones se puso a investigar la causa de los problemas para encontrar solución. Se ocupo de entregar el turno limpio y ordenado. Su performance como operador supero las expectativas.', 'Rápida adaptación al puesto\r\nBuena comunicación\r\nRápidamente logro realizar lectura de contexto e identificar las problemáticas en planta de efluentes', '', 'Cristian mostro un alto compromiso por el área. Y por los resultados. Atendiendo a las fallas en los procesos para evitar desvios o valores fuera de parámetro.', ''),
(1758, '2020', 1, 39, 413, 0, 'B', '', '', '', '', ''),
(1759, '2020', 1, 39, 287, 0, 'B', '', '', '', '', ''),
(1761, '2020', 1, 12, 98, 0, 'B', '', 'OaR: Se muestra en su puesto un buen trabajo en la selección. Deben continuar seleccionando en el cambio de turno.', 'COM: poca comunicación proactiva de anormalidades en el puesto. No avisan cuando viene mucha cantidad de tomate o mala calidad. TenE: la Demoras en el té. PROA: tiempos ociosos en detenciones de la línea. Poca visión en necesidades operativas (si la línea está detenida mucho tiempo bajar y consultar si se sigue con otra actividad. Si faltan latas bajar para colocar mano). CAL: Compromiso con calidad del producto.', '', ''),
(1762, '2020', 1, 12, 409, 0, 'MB', '', '', '', '', ''),
(1763, '2020', 1, 12, 407, 0, 'MB', '', '', '', '', ''),
(1764, '2020', 1, 12, 562, 0, 'B', '', '', '', '', ''),
(1765, '2020', 1, 36, 387, 0, 'MB', 'Animarse más en equipos y en despiece de los mismos para ganar conocimientos.\r\nHorarios de llegada, buen paso de turno es clave', '', '', '', ''),
(1766, '2020', 1, 41, 555, 0, 'B', 'El desempeño de Lautaro fue muy positivo. Las tareas generales de campo fueron muy buenas, correcta detección de condiciones inseguras y respuestas al personal, buena disposición y adaptación rápida y a quien dirigirse en planta considerando la poca experiencia. Buen carácter para hacer frente en la profesión. Utilizó las herramientas del SGI para informar desvíos.\r\n\r\n', '', 'Como oportunidad de mejora, seria trabajar en las relaciones interpersonales, en la formalidad ante las solicitudes y trabajar en la empatía', '', ''),
(1767, '2020', 1, 2, 347, 0, 'MB', 'Raul tiene mucha predisposición, siempre activo con las tareas que se le asignan. ', 'Respeto, comunicación, trabajo en equipo.', '', '', ''),
(1768, '2020', 1, 2, 383, 0, 'MB', 'Emanuel es un operario que asume los cambio y nuevos desafios con mucho compromiso.', '', '', '', ''),
(1769, '2020', 1, 2, 394, 0, 'B', 'Sergio de a poco se va consolidando en sus funciones de bascula, para la próxima temporada debe terminar su proceso actual y buscar nuevos objetivos, es muy flexible.', '', '', '', ''),
(1770, '2020', 1, 2, 395, 0, 'B', 'Roberto esta temporada volvió al puesto de chófer, debe seguir en la busca de la mejora, creo que tiene mucho para dar, solo depende de el.', '', '', '', ''),
(1771, '2020', 1, 2, 301, 0, 'B', '', '', '', '', ''),
