(1776, '2020', 1, 2, 337, 0, 'MB', '', '', '', '', ''),
(1777, '2020', 1, 2, 396, 0, 'B', '', '', '', '', ''),
(1778, '2020', 1, 2, 416, 0, 'B', '', '', '', '', ''),
(1779, '2020', 1, 2, 435, 0, 'MB', 'En esta temporada a parte de manejar un autoelevador a José se le asigno una nueva tarea (Picking), la misma la llevo a cabo con mucha responsabilidad y autonomía.', '', '', '', ''),
(1780, '2020', 1, 2, 251, 0, 'B', '', '', '', '', ''),
(1781, '2020', 1, 2, 548, 0, 'B', '', '', '', '', ''),
(1782, '2020', 1, 41, 339, 0, 'B', 'Posee autonomía para resolver problemas, sin embargo se observa que se centra en dicho problemas y en ocasiones lleva a desatender el proceso de efluentes.\r\n', 'Demuestra conocimiento en la operación de la planta de efluentes, buena comunicación con el resto de las áreas y compañeros', 'Falta profundizar en el análisis de resultados de muestras analíticas, correcta carga de datos y análisis de las causas de problemas que van surgiendo en la operación. \r\nDebe trabajar en mantener el sector ordenado y limpio en todo momento.', '', ''),
(1783, '2020', 1, 14, 307, 0, 'B', '', 'Trabajo en equipo\r\nFlexibiliad y predisposición para adaptrarse a los cambios', 'Mejorar autonomía y anticiparse a los desvíos de Calidad', '', ''),
(1784, '2020', 1, 1, 560, 0, 'B', '', '', '', '', ''),
(1785, '2020', 1, 2, 96, 0, 'B', '', '', '', '', ''),
(1786, '2020', 1, 2, 297, 0, 'MB', 'Adrian es un colaborador que se adapto muy bien en la posición de facturador, pudo en este tiempo insertarse al equipo logrando alcanzar los objetivo propuestos, debe seguir por este camino, afianzando sus conocimiento y haciendo experiencia. ', '', '', '', ''),
(1787, '2020', 1, 5, 273, 85, 'MB', 'Se observa un gran desempeño a lo largo de la temporada en el puesto de trabajo, con un altísimo compromiso y una gran orientación a los resultados. Debe trabajar mas en 5S y reforzar sistema.\r\nTiempo ocioso mal utilizado. Conversa con el operador de empaque.\r\n', 'Compromiso incondicional', 'Trabajar mas en 5S y sistema.', '', ''),
(1791, '2020', 1, 5, 295, 82.5, 'MB', 'Se observa un desempeño adecuado para el puesto ocupado. Se observa a lo largo de la temporada una gran preocupación por lograr los resultados. ', 'Alto compromiso. Preocupación constante por superarse y capacitase. \r\n', 'Trabajar en resolución de conflictos y flexibilidad. \r\nTrabajar mas en comunicación. La misma mejora mucho con el correr de la temporada.\r\n', '', 'Conocimientos técnicos '),
(1792, '2020', 1, 1, 244, 80, 'MB', '', 'PREOCUPACIÓN E INTERÉS POR ALCANZAR LOS RESULTADOS Y FLEXIBILIDAD PARA ADAPTARSE A NUEVAS TAREAS', 'FALTA FORTALECER LA CAPACIDAD DE ANTICIPARSE A LAS NECESIDADES', 'MANTENER LOS ESTANDARES DE CALIDAD, SEGURIDAD, Y TRABAJO EN EQUIPO', ''),
(1793, '2020', 1, 12, 300, 85, 'MB', 'El colaborador posee muy buen desempeño, debe ser mas proactivo para destacarse en su puesto, evitando tiempos ociosos. ', 'Demuestra preocupación por la linea y compromiso. Buen resultado en tpos de limpiezas y actividades de autonomo. Es respetuoso. Se integra bien con sus pares. Conoce muy bien los equipos y resuelve problemas por si solo.\r\nCal y Seg: Buen desempeño. ', 'Debe evitar tpos ociosos asegurando 5S, proponiendo mejoras y evitando el uso de celular.\r\nEn ocasiones muestra resistencia a reconocer errores pero siempre esta disponible a aprender de diferentes puestos y ser polifuncional. Evitar el uso del celular porque genera descuidos.\r\nDeberia reforzar la comunicación. Debe informar antes de que se le pregunte.\r\n', '', ''),
(1794, '2020', 1, 12, 15, 63.75, 'B', 'Silvia es una colaboradora que no se muestra. Necesita involucrarse mas en la linea de la que es parte. Debe aprender a resolver por si sola los problemas y ser mas proactiva. Se necesita un cambio en su desempeño por segundo año consecutivo. Hace bien su trabajo pero se limita a cumplir con lo necesario.\r\n', 'Es una colaboradora que tiene buena relación con sus pares y es respetuosa. \r\nPor lo general dispuesta a ocupar el puesto que se le asigne. A veces disconforme con ello.\r\nTrabaja de manera segura.', 'Debe mejorar en poder dar respuesta cuando se le pregunta algo de la linea, no se involucra. Necesita tener una participación mas activa en la linea y Grupo Base. Debe estar mas atenta, evitar despistes.\r\nPocas veces se anticipa a necesidades futuras, falta proponer mejoras. No realiza tarjetas.\r\n', '', ''),
(1795, '2020', 1, 12, 274, 72.5, 'B', '', 'Tiene buen caracter para el manejo de personal pero tiene que reforzar la autoridad. \r\nSe destaca conocimiento en envasado, se mostró interesado en aprender en preparación.\r\nEn general flexible aunque en ocasiones no reconoce errores. Propone mejoras y trabajos para la linea. Es respetuoso.\r\n', 'Debe estar mas al tanto de algunas situaciones de la linea. Es distraido y por momento desconoce la situación de la linea (eficiencia, cumplimientos). Debe realizar mayor seguimiento al personal que tiene a cargo.Por ocasiones se desconoce donde esta y se lo observa mucho con el celular. Cuidar las 5S. Anticiparse a un corte de linea buscando tareas para el personal. Mejorar el acompañamiento al operador en cambios de bobinas y tareas del sector.\r\n', '', ''),
(1796, '2020', 0, 0, 15, 63.75, 'B', 'Silvia es una colaboradora que no se muestra. Necesita involucrarse mas en la linea de la que es parte. Debe aprender a resolver por si sola los problemas y ser mas proactiva. Se necesita un cambio en su desempeño por segundo año consecutivo. Hace bien su trabajo pero se limita a cumplir con lo necesario.\r\n', 'Es una colaboradora que tiene buena relación con sus pares y es respetuosa. \r\nSiempre dispuesta a ocupar el puesto que se le asigne.\r\nTrabaja de manera segura.', 'Debe mejorar en poder dar respuesta cuando se le pregunta algo de la linea, no se involucra. Necesita tener una participación mas activa en la linea y Grupo Base. Debe estar mas atenta, evitar despistes.\r\nPocas veces se anticipa a necesidades futuras, falta proponer mejoras. No realiza tarjetas.\r\n', '', ''),
(1797, '2020', 1, 12, 145, 77.5, 'B', 'Se nota una mejora en su desempeño, mejor flexibilidad y comunicación. Debe mostrar mayor compromiso.', 'Frecuentemente resuelve problemas por si solo, tiene conocimiento sobre los equipos. Buen trabajo en sistema.\r\nSe observa una mayor flexibilidad al asignarse nuevas tareas.\r\nBuen desempeño en calidad. \r\n', 'Demuestra preocupación por la linea cuando esta en producción pero no tiene compromiso cuando tiene que venir los fines de semana a hacerle mantenimiento. \r\nEn el turno se integra bien con sus pares. Debe ser mas proactivo y proponer mejoras y cuidar las 5S de su sector.', '', ''),
(1798, '2020', 1, 12, 252, 98.75, 'E', 'Diego es un colaborador excelente siempre preocupado por la linea, con gran compromiso con la empresa. Siempre flexible a nuevas asignaciones, cambio de turnos y HHEE. Posee un gran conocimiento de su equipo que capitaliza transfiriendolos a sus pares y solucionando problemas por si solo. Siempre pendiente y consciente de asegurar la calidad del producto. Es un buen compañero y respetuoso.', '', 'Debe ser mas cuidadoso en Seguridad, evitar subirse a estructuras y utilizar los EPP.', '', ''),
(1799, '2020', 1, 12, 210, 95, 'E', 'Es un excelente colaborador siempre preocupado por la linea y con un gran compromiso. Es respetuoso y se integra facilmente con sus compañeros. En la mayoria de los casos resuelve problemas por si solo. Siempre flexible aceptando ocupar cualquier puesto y preocupado por las BPM y calidad del producto.', '', 'Por intentar resolver los problemas por si solo muchas veces no comunica cuando tiene inconvenientes generando que se dilaten las cosas, especialmente en limpieza.\r\nEn Seguridad debe evitar actos inseguros en linea con el afan de resolver alguna situación.\r\n', '', ''),
(1800, '2020', 0, 0, 216, 0, 'B', 'Es un colaborador con predisposición para afrontar nuevos desafios. Debe estar mas atento y evitar distracciones. Debe tomar decisiones por si solo y no esperar a que alguien se lo resuelva. Mejorar en proactividad. Mantener las 5S de su sector.', 'Tiene buena predisposición. Presenta buen compromiso en temporada. Debe estar mas atento a las situaciones del dia a dia (distraido).\r\nSiempre dispuesto a reconocer errores y afrontar nuevos desaffios. Buen desempeño en Calidad y seguridad.\r\n', 'En varias ocasiones se lo ve conversando y en momentos de ocio, debe ser mas proactivo y aprovechar para mejorar su linea.\r\nDece ser mas autonomo y resolver por si solo los inconvenientes, pide ayuda y duda mucho.\r\n', '', ''),
(1801, '2020', 1, 12, 272, 81.25, 'B', '', 'Siempre dispuesto a producir con continuidad y con estándares asociados. Trabaja en equipo. Compromiso para asistir al mantenimiento autónomo y limpiezas de línea.', 'Debe mejorar su capacidad de resolución durante tiempos ociosos, aportando a la línea. ', '', ''),
(1802, '2020', 1, 12, 71, 73.33, 'B', 'En general el desempeño es bueno pero con oportunidades de mejora. Debe ser mas proactiva y evitar tiempos ociosos. No propone mejoras e ideas para la línea y no participa en horas extras en tareas de la línea DP.', 'Tiene buen trabajo en equipo con sus pares.\r\nTrabaja bien con Seguridad y Calidad.\r\nSe preocupa porque la línea no se detenga.', 'Tiene poco compromiso en participar en jornadas los fines de semana.\r\nEs poco comunicativa en proponer mejoras.\r\nPoco proactiva a detectar necesidades en la línea, en detenciones de línea se queda conversando con compañeras.\r\n\r\n', '', ''),
(1803, '2020', 1, 12, 89, 0, 'B', 'En general su desempeño es bueno. Se preocupa por la calidad del producto. Debe ser mas proactiva en su puesto de trabajo y mas cuando la linea esta detenida, evitar tiempos ociosos. Se lleva bien trabajando con sus pares.', 'Buen trabajo en equipo en su sector. Mejorar trabajo en equipo en temporada.\r\nTrabaja bien con Seguridad y Calidad.\r\nMuestra buen trabajo cuando la linea esta en producción.\r\n', 'Hubieron ocasiones donde ingreso palles de latas vacias que no se correspondian con el producto que se elaboraba, generando detención de línea. Debe ser mas conciente en su trabajo.', '', ''),
(1804, '2020', 1, 12, 90, 76.25, 'B', 'Se ve comoda en su puesto y ha podido integrarse al equipo. Trabaja muy bien con sus pares compartiendo tareas. Ha mejorado en proactividad, cuando la línea esta detenida busca hacer alguna tarea.', 'Se adapta a nuevas tareas y sabe reconoce errores.\r\nCAL y SEG: Buen desempeño\r\nHa mejorado en su compromiso cuando la línea produce los fines de semana.', 'Es respetuosa pero necesita tener una comunicación más proactiva de proceso o mejoras.\r\n', '', ''),
(1805, '2020', 1, 36, 16, 0, 'B', 'Ídem al año anterior.\r\nSe requiere mayor concentración a la hora de trabajar y mucho más compromiso con la línea. Debe aplicar posibilidades de mejora marcadas.', '', 'Orientación a resultados y empeño para cumplir tareas asignadas. Poca proactividad, autonomía y flexibilidad (contribución personal a la línea)', '', ''),
(1806, '2020', 1, 36, 224, 0, 'B', 'Ídem año pasado, trabajar en grupo base, aportar al equipo desde ahí, gestión por OTs. Importancia a la calidad de lo que ingresa al concentrador (autonomía trabajar con calidad)', 'Entender que las condiciones del sector hacen a la seguridad, cuidarse y cuidar al compañero de trabajo', 'Las posibilidades de mejora están en trabajar más en equipo con el GB, eso también es parte del compromiso. Aprovechar tiempos ociosos y ser flexible. ', '', ''),
(1807, '2020', 1, 36, 151, 0, 'B', 'Colaborador puede aportar más, no quedarse únicamente en lo justo y necesario. Ayudar a resolver problemas, aportar más desde el lugar que ocupa', 'Colaborador con buena predisposición para diferentes actividades. Autonomía y proactividad con la línea, las mejoras no son sólo responsabilidad de líder y coordinador', 'Flexibilidad para mejorar los puntos ya marcados en devoluciones anteriores.', '', ''),
(1808, '2020', 1, 36, 235, 71.25, 'B', 'Colaborador comprometido con el puesto que ocupa en línea SIG', 'Trabajo en equipo ', 'Desarrollar mayor autonomía y proactividad en aportes a línea, preguntar, siempre hay más para aprender', '', ''),
(1809, '2020', 1, 36, 260, 0, 'B', 'Este año, en los meses presentes, demostró mayor preocupación en objetivos planteados', 'Seguridad, trabajar y gestionar. Al medio ambiente se le debe dar la misma importancia', 'Participación en grupo base, las mejoras y soluciones tienen como punto de partida el grupo, importante trabajar en equipo', '', ''),
(1810, '2020', 1, 36, 245, 0, 'NM', 'Si bien no hay mala voluntad a la hora de ir a distintas tareas no se demuestra empeño en hacerlo. No hay aprovechamiento de tiempos ociosos y es algo que se había marcado con anterioridad.', '', 'Conocer y cumplir tarea asignada, se nota poca preocupación en lo que se hace, sino más preocupación por cumplir tiempo e irse (es algo que se marcó el año pasado)', '', ''),
(1811, '2020', 1, 36, 86, 48.75, 'B', 'El colaborador no trabaja con sistema, no participa en fines de semana, no hay compromiso', '', 'Participación en GB, generación de tarjetas. Seguridad personal, reiterados avisos no demuestra escucha ante estos. Aprovechamiento de tiempos', '', ''),
(1812, '2020', 1, 36, 126, 0, 'B', 'Tema portón automático, no acostumbrarnos a trabajar así, por una cuestión de calidad. Aprovechar tiempos ociosos ', '', '', '', ''),
(1813, '2020', 1, 36, 304, 0, 'E', 'Como oportunidad de mejora de acá en adelante: seguir gestionando a los recursos, exigir resultados y que vayan ganando autonomía', 'Buena adaptación a nuevos pedidos en el rol de líder', '', '', ''),
(1814, '2020', 1, 12, 70, 86.25, 'MB', 'Margarita es una colaboradora que se preocupa por cumplir los objetivos que se le plantean ademas tiene compromiso con la empresa siempre dispuesta a colaborar y reconocer errores. Trabaja bien en equipo, es buena compañera. Debe ser mas cuidadosa en el manejo del autoelevador.', 'Compromiso con la empresa y preocupación por cumplir con lo que se pide. Siempre comunicativa. \r\nSe anticipa a necesidades futuras (falta de insumos)\r\nSe desenvuelve bien gestionando sus propios recursos.\r\n', 'Es bastante proactiva aunque se la ha notado en ocasiones conversando con sus compañeros.\r\nDispuesta a nuevas asignaciones y puestos. En seguridad debe ser mas cuidadosa manejando el autoelevador.\r\n', '', ''),
(1815, '2020', 1, 12, 82, 0, 'B', '', 'Es respetuoso y trabaja bien con sus pares. En general flexible para cualquier tarea que se le asigne.', 'Poco comunicativo de mejoras y situaciones de la linea. No es proactivo, se limita a realizar las tareas normales diarias de manera rutinaria, no afronta nuevos desafios. \r\nAsegurar una limpieza correcta de los tambores cuando tienen hongos.', '', ''),
(1818, '2020', 1, 12, 4, 75, 'B', 'Maria tiene un buen desempeño, siempre respetuosa y flexible a lo que se le solicita. Debe proponer mejoras y trabajar mas con sistema. No participa en las jornadas de autonomo de los fines de semana. Cuando la linea esta detenida busca actividad para hacer.', '', '', '', ''),
(1819, '2020', 1, 12, 17, 78.75, 'B', 'Muestra preocupación cuando la linea esta en producción para que no se detenga. Darle mas importancia al reproceso. Trabaja bien con sus compañeras. Siempre muy atenta a la calidad del producto. Conoce bien los equipos de su linea. Debe mejorar en proactividad buscando actividad cuando la linea esta detenida. Debe ser mas comunicativa en mejoras sobre su linea y participar de las jornadas de autónomo de los fines de semana.', '', '', '', ''),
(1820, '2020', 1, 12, 5, 78.75, 'B', 'Muestra preocupación cuando la linea esta en producción para que no se detenga. Darle mas importancia al reproceso. Trabaja bien con sus compañeras. Siempre muy atenta a la calidad del producto. Debe mejorar en proactividad buscando actividad cuando la linea esta detenida. Debe ser mas comunicativa en mejoras sobre su linea y participar de las jornadas de autónomo de los fines de semana.', '', '', '', ''),
(1821, '2020', 1, 12, 59, 78.75, 'B', 'Muestra preocupación cuando la linea esta en producción para que no se detenga. Trabaja bien con sus compañeras y suele reemplazar en su puesto al operador de envasadora. Siempre muy atenta a la calidad del producto. Debe mejorar en proactividad buscando actividad cuando la linea esta detenida. Debe ser mas comunicativa en mejoras sobre su linea y participar de las jornadas de autónomo de los fines de semana. Tiene que darle importancia a las tareas de reproceso.', '', '', '', ''),
(1824, '2020', 1, 12, 221, 70, 'B', '', 'Cumple con los objetivos que se le solicitan, realiza un buen trabajo en su puesto pero se limita a eso. Participa en las jornadas de los fines de semana.\r\nBuen trabajo con sus pares. En seguridad, buen desempeño sobre todo en el uso de EPP. Conoce los estandares de su linea.\r\n', 'Es respetuoso pero poco comunicativo, debe desarrrollar una comunicación mas proactiva. Pocas veces se anticipa a necesidades futuras, debe evitar tiempos ociosos. Toma algunas decisiones en su puesto pero tiene oportunidad de mejora en esto.', '', ''),
(1825, '2020', 1, 12, 289, 0, 'B', '', 'Se muestra preocupado por cumplir con las tareas que se le asignan y asegurar la continuidad de la linea. Buen compromiso con la empresa y buen trabajo con sistema. Se desempeña bien con Calidad y Seguridad.', 'Mejorar las entregas de turno y las 5S en general. Trabaja muy bien con sus pares de playa pero debe poder comunicarse mejor con los operadores de Molienda y Consola. Debe evitar las reuniones dentro de la cabina de Playa. Aveces se muestra poco flexible cuando no se le dan los recursos que solicita. Debe anticiparse a los cambios de camión y abastecimiento de MP a planta.', '', ''),
(1826, '2020', 1, 12, 56, 48.75, 'NM', 'La colaboradora no muestra mucho interes por asegurar una producción contínua. Es algo flexible para las actividades que se le asignan. Debe mejorar en las demoras en el te y trabajar mas en conjunto con sus compañeras. Lleva poco tiempo en su puesto por lo que debe aprender mas de la linea. Poca efectividad en el reproceso. ', '', 'Demoras recurrentes. Falta compromiso con la producción y debe desarrollar su capacidad de trabajo en equipo', '', ''),
(1827, '2020', 1, 12, 50, 78.75, 'B', '', 'Es un colaborador que siempre esta preocupado por cumplir de manera correcta su trabajo. Presenta un gran compromiso por la empresa. Se preocupa por la Calidad y en Seguridad utiliza siempre todos los EPP. Es buen compañero y reemplaza a sus pares durante horarios del te. Buen trabajo con sistema.', 'En el afan de cumplir con su trabajo, en ocasiones presenta errores groseros. Cuando se le pide explicaciones sobre algo es poco claro. Debe mostrarse mas seguro al tomar decisiones y no consultar tanto. Es poco flexible cuando se le marca algun error. Es muy ansioso para resolver problemas, y eso en ocasiones lleva a errores o generar sobre-presiones en sus compañeros', '', ''),
(1829, '2020', 1, 12, 305, 96.25, 'E', 'Es un excelente colaborador siempre atento a la linea comprometido con la empresa y la calidad del producto. Propone mejoras y se encarga de hacerlas. Siempre disponible para hacer HHEE en pos de cumplir objetivos. Buen compañero y comunicativo ante cualquier anormalidad.\r\nDebe evitar el uso de celular.\r\n', '', '', '', ''),
(1830, '2020', 0, 0, 66, 0, 'B', 'Como lider operativamente cuando la linea esta en producción es excelente, posee gran conocimiento en la linea, resuelve problemas por si solo y se lleva bien con el personal a cargo. Lamentablemente al no asistir los fines de semana varias de las competencias se ven opacadas, recarga a sus compañeros y supervisora. No trabaja con sistema y esas cosas son fundamentales en un lider.', 'En producción es un lider muy preocupado porque la linea no se dentenga. Es comunicativo respecto al estado de la linea. Siempre resuelve problemas por si solo, posee gran conocimiento de la linea pero su autonomia se ve opacada por no asistir a las jornadas de los fines de semana. Siempre muy preocupado por la Calidad. ', 'Debe mostrarse mas interesado en el mantenimiento y la limpieza de la linea. Trabaja bien en equipo con sus pares, salvo que al no asistir los fines de semana recarga a sus compañeros. En seguridad debe ser mas cuidadoso.', '', ''),
(1831, '2020', 1, 12, 66, 48.75, 'NM', 'Es un lider que muestra preocupación cuando la linea esta en producción, posee conocimiento en la linea y resuelve problemas por si mismo. Al no participar en las jornadas recarga a sus compañeros y supervisora poniendo en riesgo el arranque de linea o demorando las tareas. Lamentablemente esta postura hace que se vea disminuido su desempeño en el resto de las competencias.', 'Siempre atento y preocupado porque la linea no se detenga. Posee gran conocimiento en los equipos y resuelve problemas por si solo. Siempre preocupado por la calidad del producto. Buen acompañamiento del personal a cargo.', 'No participa en la limpieza y autonomo de la linea retrasando actividades y recargando a sus compañeros. En seguridad debe evitar actos inseguros. No trabaja con sistema. En varias oportunidades dijo que asistia el fin de semana y no fue sin avisar previamente, lo que se observa como falta de respeto y compromiso', 'Falta de compromiso general con el mantenimiento autónomo', ''),
(1832, '2020', 1, 12, 148, 66.25, 'NM', '', 'Tiene buen trato con sus compañeros pero debe mostrar mas autoridad. Asistió a algunas jornadas pero en varias oportunidades donde se quería asistencia del lider para limpieza o producción el fin de semana no fue. Lamentablemente esto impacta en todas las competencias', 'En ocasiones cuando la linea estaba detenida se unia a conversaciones con las personas a cargo en vez de darles actividad. Debe estar mas informado en las situaciones de la linea cuando se le consulta. Debe saber separar su situación personal con el trabajo, no tiene por qué pedir explicaciones en cuestiones que involucran a su pareja ni hablar por ella. \r\nNo ha podido aceptar críticas constructivas y reconocer errores para mejorar su desempeño.', '', ''),
(1834, '2020', 1, 36, 134, 61.25, 'B', 'No hay compromiso por el equipo, no hay colaboración en findes de semana, y en ocasiones se va esté o no en condiciones de producir la línea. Alguna de las cosas que se han marcado están en la evaluación del año pasado y no se han  visto mejoras', 'Mejora aspectos de calidad y seguridad respecto a año anterior (aún así hay que entender que las condiciones del sector hace a la seguridad propias y de compañeros).', 'Se nota decrecimiento en proactividad y autonomía. En lugar de aumentar el poder de resolución, decrece. LLENADO DE PLANILLAS, no coincide lo que se completa con lo que pasa en la línea. PARTICIPACIÓN EN GB', '', ''),
(1836, '2020', 1, 36, 172, 73.75, 'B', 'Colaborador mejora aspectos de proactividad y participación. Es importante continuar mejorando, se nota que tiene potencial. Importante tema planillas y como eso influye en el equipo.', 'Autonomía, resuelve bien y aporta al equipo', 'Seguridad, las condiciones de seguridad dependen del estado del sector.', '', ''),
(1838, '2020', 1, 36, 236, 0, 'NM', 'La mayoría de las observaciones coinciden con las del año pasado (2019)', 'Presta atención a la calidad de lo que se produce', 'No conoce tareas a realizar, pese a que ya han sido explicadas. No se maneja con autonomía, pide manejar equipos, pero no resuelve. No es proactivo, no se adelanta a problemas. No se trabaja en equipo, se sobrecarga a compañeros', '', ''),
(1839, '2020', 1, 36, 171, 72.5, 'B', 'Importante continuar formación para cada vez saber más dele quipo y migrar a mayor autonomía. Compromiso los meses de ocupación de la linea, no puede irse sin informar ni concluir equipo. Colaborador con gran potencial', 'Buena proactividad y autonomía', 'Comunicación proactiva de lo que pasa en la línea y en el turno. Aporte al GB. Calidad y regulaciones para detectar desvíos. PLANILLAS, no se ve empeño en que refleje lo que realmente pasa', '', ''),
(1840, '2020', 1, 36, 44, 0, 'NM', 'En ocasiones deben repetirse los pedidos, ya que las tareas no se completan. No se nota predisposición para hacer más de lo justo y necesario. NO hay participación en GB. No hay trabajo en equipo, ni para con Soudronic, FEM ni otros sectores.', '', 'Seguridad y estado del autoelevador (siempre comunicar y respetar chequeos, pedir autprizaciñon). Uso de EPP', '', ''),
(1841, '2020', 1, 36, 218, 0, 'B', 'Puede seguir mejorando. Es muy importante avanzar con el grupo base, y gestionar desde ahí. El GB es parte de la orientación, de trabajo en equipo, de proactividad, de flexibilidad. Aún hay mucho para mejorar', 'Se nota mejor desempeño del operador luego de la devolución del año pasado. Esto demuestra capacidad de escucha y flexibilidad a la hora de reconocer las oportunidades de mejora', 'Compromiso, lo que lleva a no aportar a la línea ni al GB. Al no lavar dificulta las limpiezas.', '', ''),
(1842, '2020', 1, 36, 247, 0, 'B', 'Colaborador demuestra mayor autonomía y proactividad cuando está solo que con apoyo de líder. ', 'Varias pautas marcadas en la devolución 2019 fueron aplicadas en este año (autonomía, proactividad, calidad)', 'Seguridad: intervención con máquina en movimiento, no se usan EPPs producto caliente. Varias veces se lo encuentra frente a desvíos.', '', ''),
(1843, '2020', 1, 36, 13, 0, 'B', 'Varios puntos fueron marcados en evaluación 2019 y no han mejorado (autonomía, proactividad, seguridad) esto no demuestra flexibilidad', '', 'Uso de EPP. Al no aportar con autonomía y no aprovechar la antigüedad que se tiene en el puesto se recarga a líder o a compañeros', '', ''),
(1844, '2020', 1, 36, 21, 77.5, 'B', 'Aportar siempre a las necesidades de línea. Trabajo en equipo de remanejo, busca de objetivo en común.', 'Autonomía y comunicación', '', '', ''),
(1846, '2020', 1, 36, 237, 0, 'B', '', 'Trabajo en equipo y empeño en las tareas que se le asigna', 'Comunicación a la hora de relevar condiciones de equipo y de planta (portón azul por ejemplo)', '', ''),
(1847, '2020', 1, 36, 200, 77.5, 'B', 'Algunas pautas de 2019 se marcan nuevamente en esta devolución. Trabajar en calidad, 5s y GB', 'Empeño en lo que hace, flexibilidad y adaptación, autonomía y proactividad', 'Calidad, BPM. 5s (seguridad y proactividad)', '', ''),
(1849, '2020', 1, 36, 51, 66.25, 'B', 'Trabajar con sistema. Mejorar comunicación y aprovechamiento de tiempos', 'Colaboradora proactiva, autónoma y trabaja con calidad', 'Participación en GB y jornada. ', '', ''),
(1851, '2020', 1, 43, 142, 0, 'MB', 'Muy buen desempeño en el período, es el colaborador con mayor experiencia en el puesto y referente para sus colegas. Gran valor para el depósito.', 'Experiencia y liderazgo. Gran capacidad de resolución de problemas', 'Cierta demora o resistencia a adaptarse a cambios, se rescata que se termina haciendo de todos modos.', '', ''),
(1852, '2020', 1, 38, 275, 83.75, 'MB', 'Lorena es una referente en el área de producción, coordinando actividades vinculadas a la gestión de los recursos humanos, con buen manejo de la dotación. A partir del 15 de Marzo ingresó en periodo de licencia, retomando sus actividades en jornada reducida a partir del 15 de Junio. La evaluación se concentra en el periodo activo de ella. ', 'Trabajo en equipo. Clima. Comunicación. Manejo de dotación del turno. ', 'Al igual que el año pasado se comentó sobre proactividad y flexibilidad para adelantarse a los sucesos/escenarios futuros. Trabajar con las herramientas del sistema de gestión integral que permitan agregarnos valor en vías a solucionar problemas, Ej: Gestión del Pilar Mto. Autónomo: plan maestro, indicadores. Será importante durante el año en curso buscar el cumplimiento con los plazos y organización de prioridades acordadas para determinadas tareas. Trabajar de manera aún más cercanas y con las herramienta', 'Lorena siempre presentó compromiso para el desarrollo de tareas solicitadas, deberá adaptarse/evaluar las prioridades de actividades que se le presenten con los plazos estipulados.', 'Metodologías (herramientas) del sistema de gestión integral. Conocimiento de indicadores operativos y el impacto de las acciones sobre los mismos. '),
(1854, '2020', 1, 43, 462, 0, 'MB', 'Trabajando desde casa siempre fue un eslabón importante en el equipo. Siempre predispuesto a ayudar y cumpliendo con las nuevas tareas asignadas a lo largo del año. ', 'Gran autonomía y versatilidad para amoldarse a realizar nuevas tareas trabajando desde casa. ', '', '', ''),
(1856, '2020', 1, 5, 310, 0, 'MB', 'Si bien el lider tiene un gran desemoeño, debera trabajar un poco mas en lo que respecta a sistema(tsp, analisis) y trabajo en equipo con las otras areas y sectores en planta. Con sus compañeros trabaja muy bien, debiendo trabajar un poco mas con las otras lineas y sectores. ', '', 'Debera trabajar mas en comunicación con el supervisor. Si bien no lo tomo como una debilidad, si debe trabajar un poco mas para lograr una fortaleza mas. ', '', ''),
(1858, '2020', 1, 5, 288, 0, 'B', 'En general buen desempeño. Debe trabajar en algunas competencias para lograr mas fortaleza en las mismas.', 'Alta autonomia. ', 'Debe trabajar mas en comunicacion. \r\nDebe trabajar mas en proactividad y orientacion a los resultados. Debe anticiparse a los problemas y debe trabajar mas en sistema. Cuidado con el compromiso. En algunas ocasiones se le solicita un esfuerzo extra por situaciones particulares y no esta disponible. Tambien los fines de semana siempre busca reemplazo desobligandose de su responsabilidad.', '', 'Sistema.'),
(1860, '2020', 1, 12, 33, 0, 'NM', 'Rafael debe mejorar principalmente su compromiso con la producción, su poder de resolución de problemas en forma eficiente. Debe desarrollar su autonomía y colaboración con generación y cierre de OT.', 'Saludo cordial y respetuoso hacia sus compañeros', 'Debe prestar mayor colaboración con la línea, aportando su experiencia y conocimiento mecánico. En ocasiones no resuelve en forma autónoma y espera resolución del mecánico, generando tiempos muertos. ', '', ''),
(1862, '2020', 1, 12, 53, 0, 'B', 'Olga es una persona muy respetuosa con sus compañeros, siempre dispuesta a intentar resolver inconvenientes que se presenten. En ocasiones se requiere un mayor desarrollo de su autonomía para resolver. Colabora con la línea y está dispuesta a dar soporte siempre que se lo pide.', 'Colaboradora con la línea, carga y cierre de OT', 'Desarrollo de autonomía', '', ''),
(1863, '2020', 1, 5, 266, 0, 'MB', 'Se observa en general un muy buen desempeño con algunas competencias en vias de logro a lo largo del año.', 'Flexibilidad, clidad, seguridad', 'Se observan algunas competencias en vias de ser fortalezas. Debe trabajar un poco mas en comunicacion.\r\nEn trabajo en equipo debe trabajar mancomunadamente con las demas areas y loe demas lideres de otros sectores.\r\nDebe trabajar un poco mas en autonomia. ', '', 'Debe trabajar mas en su capacitacion en las maquinas que posee a cargo.'),
(1866, '2020', 1, 5, 250, 80, 'MB', 'En general buen desempeño. Debe trabajar mas en algunas competencias que se detallan,', 'Calidad, seguridad.', 'Debe trabajar mas en equipo con sus compañeros de turno y con las demás areas \r\nDebe trabajar de manera mas proactiva respecto de los problemas que se van suscitando a lo largo de los turnos. \r\ndebe trabajar fuertemente en sistema, siendo este ultimo una parte fundamental del desempeño.', '', ''),
(1867, '2020', 1, 12, 58, 0, 'B', 'Patricia es una colaboradora muy enfocada en la calidad y presta ayuda en jornadas de mantenimiento autónomo. Debe desarrollar su eficiencia en tareas de reproceso y su autonomía para evitar tiempos muertos de línea', 'Enfoque en calidad', 'Autonomía y eficiencia en reproceso/tiempos muertos', '', ''),
(1869, '2020', 1, 12, 65, 0, 'B', 'No trabaja en sistema. Debe desarrollar su proactividad en la línea y con el grupo base', '', '', '', ''),
(1870, '2020', 1, 5, 222, 78.75, 'MB', 'En general muy buen desempeño logrado. Debe trabajar un poco mas en algunas competencias qeu se detallan.', 'autonimia\r\nproactividad', 'Debe trabajar mas en aspectos de calidad \r\nDebe trabajar en aspectos de comunicación.\r\nDebe trabajar mas en sistema. Es un punto a mejorar.', '', 'Sistema.');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(1872, '2020', 1, 5, 215, 45, 'NM', 'Se observa un desempeño no adecuado a lo largo del año. Debe trabajar fuertemente para lograr un cambio en el mismo', 'Seguridad. ', 'Usa mal el barbijo.\r\nFalta de respeto al supervisor.\r\nManeja los tiempos. No es proactivo. Demoras en el desayunador y el baño. Conversa siempre cuando va algun sector fuera de la linea, Espera ordenes del supervisor y lider.\r\nNo trabaja en equipo. Sobre carga a sus compañeros si la tarea es en conjunto.\r\nNo se observa orientacion a los resultados.\r\nNo trabaja con sistema. No hay autonomia.\r\n', '', ''),
(1874, '2020', 1, 12, 67, 81.25, 'MB', 'En términos generales Daniel tiene un desempeño positivo en compromiso con la calidad, la producción y la seguridad. En gran cantidad de ocasiones resuelve problemas por sí solo. Debe ser más flexible y comprensivo en cuanto a cambios eventuales en la nómina. ', 'Autonomía. Compromiso con la producción, calidad y seguridad.', 'Debe mejorar su comunicación con sus pares para resolución de problemas. Debe ser más flexible a los cambios.', 'Excelente compromiso', ''),
(1876, '2020', 1, 5, 214, 0, 'B', 'Se observa un desempeño no satisfactorio que a lo largo del año va cambiando y llega a cumplir con los requerimientos del puesto. Se observa un cambio positivo en el desempeño.', '', 'De trabajar mas en orientacion a los resultados. Esto va de la mano de trabajar mas en sistema. Es una debilidad fuerte.\r\nDebe trabajar en seguridad. Se observan desvios como pasar debajo de cintas,el no uso e epp, actos inseguros, \r\nDebe trabajar mas en autonomia. Debe alimentar mas sus conocimientos tecnicos, \r\nDebe trabajar en proactividad. La misma mejora mucho, pero hay que lograr que la misma sea una fortaleza,\r\n', '', ''),
(1877, '2020', 1, 5, 211, 0, 'MB', '', 'Trabajo en equipo.\r\nFlexibilidad.', 'Debe trabajar en proactividad, Tiempos muertos pueden aprivecharse.\r\nUtiliza mucho el celular en el puesto de trabajo en produccion.\r\n', '', ''),
(1878, '2020', 1, 5, 138, 0, 'B', 'Se observa un desempeño acorde a las tareas que realiza, mejorando el mismo a lo largo del año', 'Compromiso y flexibilidad.\r\ntrabajo en equipo', 'Debe trabajar mas en sistema\r\nDebe trabajar mas en seguridad. Se observan actos inseguros.\r\nDebe trabajar mas en autonomia', '', 'Sistema'),
(1879, '2020', 1, 5, 36, 0, 'MB', '', '', '', '', ''),
(1880, '2020', 1, 5, 246, 0, 'MB', 'Se observa un desempeño adecuado para el puesto. Debe trabajar en algunas competencias.', 'Flexibilidad.\r\nSeguridad', 'Debe trabajar mas en autonomia. Debe crecer mas tecnicamente.\r\nDebe trabajar en comunicacion. En varias ocaciones la linea esta detenida mucho tiempo o con problemas y no se comunica con el supervisor.\r\nDebe trabajar mas en equipo. Debe aprender a resolver los conflictos y lograr el trabajo mancomunado,', '', ''),
(1881, '2020', 1, 5, 205, 0, 'B', 'Se observa un desempeño bajo que a lo largo del año va mejorando logrando alcanzar de a poco los requerimientos del puesto.', 'Flexibilidad', 'Debe trabajar mas en autonomia. Pocas veces resuelve problemas por si solo. Depende siempre de alguien mas.\r\nDebe trabajar mas en calidad y seguridad. Se le marca en varias ocasiones el uso de cadenas, el cual esta prohibido.\r\nDebe trabajar mas en equipo. Se observan saltos de candena de  mando con el Lider. Debe trabajar con el lider, el cual es el superior directo.\r\nDebe trabajar mas en proactividad. Se observan muchos tiempos ociosos mal utilizados a la espera de una orden pudiendo realizar alguna tarea ', '', ''),
(1882, '2020', 1, 5, 203, 0, 'NM', 'No se observa un buen desempeño a lo largo del año. Se observa que el colaborador no cumple con las tareas asignadas de manera eficiente. \r\n', '', 'No trabaja en sistema, No trabaja en equipo. Sobre carga a sus compañeros con sus tareas.\r\nNo se observa proactividad. Siempre espera una orden. tiempos ociosos mal utilizados.\r\nEl colaborador es conflictivo.\r\nNo hay compromiso con el puesto, No viene los fines de semana. \r\n', '', ''),
(1883, '2020', 1, 5, 202, 0, 'NM', '', '', '', '', ''),
(1884, '2020', 1, 5, 179, 0, 'NM', 'No se observa un desempeño adecuado para las tareas realizadas. El colbaorador debe trabajar para mejorar.', '', 'Muy poca autonomia. Pocas veces resuelve problemas por si solo. Ademas no trabaja con sistema. \r\nEs rigido para reconocer errores. \r\nSe observan desvios de calidad como colocar tapas no patas dentro de cajas de producto terminado.\r\nTiempos ociosos mal utilizados. No es proactivo, Esoera ordenes del lider o supervisor, \r\nNo hay un compromiso asumido para el puesto. No viene por lo general los fines de semana o cuando se lo necesita.\r\nEn comunicacion debe aprender a respetar las ordenes del supervisor o lider', '', ''),
(1885, '2020', 1, 5, 18, 0, 'B', 'El desempeño alcanza los requerimientos del puesto pero debe trabajar en algunas comptencias.', 'seguridad.', 'Debe trabajar en autonomía. Pocas veces resuelve problemas.\r\nDebe trabajar en equipo. Las diferencias afectan el desempeño de la líneas.\r\nDebe trabajar en proactividad. No debe esperar ordenes del lider. Tiempos ociosos mal utilizados.\r\nFlexibilidad a los cambios de puestos.', '', ''),
(1886, '2020', 1, 5, 73, 0, 'NM', '', '', 'Debe comunicarse de manera respetuosa hacia sus superiores y pares.\r\nDebe aprender a trabajar mejor en equipo. Situaciones de conflicto repercuten en el desempeño de la linea. \r\nDebe trabajar mucho en proactividad. Espera ordenes y mal utiliza tiempos ociosos. Perdida de tiempos conversando. \r\nDebe trabajar en autonomía. No resuelve problemas por si sola.\r\nDebe trabajar en flexibilidad. Le cuestan los cambiso profundos de tareas. La empresa trabaja actualmente de esta manera y deben tomarse con normalidad e', '', ''),
(1887, '2020', 1, 5, 78, 0, 'B', '', '', '', '', ''),
(1888, '2020', 1, 5, 240, 0, 'B', '', '', 'Debe trabajar mas en comunicacion con el lider y superiores. Linea detenida y no sabia el lider.\r\nTrabajar en las formas de expresarse.en algunas ocasiones no son las adecuadas.\r\nDebe trabajar mas en autonomia. Debe seguir adquieriendo conocimientos del puesto que ocupa para poder resolver los problemas por si solo. No se observa que trabaje fuertemente en sistema(Lups, ots)\r\nSe marcan los desvios de calidad. Deberia solo darse cuenta.\r\nNo utiliza epp. Parado arriba de palletizador', '', ''),
(1891, '2020', 1, 36, 80, 0, 'B', 'Trabajar con sistema. Mejorar comunicación y aprovechamiento de tiempos', 'Colaboradora proactiva, autónoma y trabaja con calidad', 'Participación en GB, gestion a traves de OT. Propuestas de mejora y apoyo en mantenimiento o avances de paso', '', ''),
(1893, '2020', 1, 42, 149, 0, 'B', 'Miguel te propongo seguir superándote, planteándote nuevas metas personales, capacitándote y mejorando cada día.', 'Compromiso y predisposición para adaptarse a las necesidades que la planta demande.', 'La oportunidad de mejora esta dada en analizar los fallos y retroalimentar el preventivo para mejorarlo y reducir la indisponibilidad', '', ''),
(1894, '2020', 1, 36, 102, 0, 'NM', 'Primero el NO, después el trabajo en equipo. Varios puntos fueron marcados en la evaluación 2019, pero no se notan cambios positivos', '', 'Proactividad, aprovechamiento de tiempos. No se ve que aporte a la línea. Se marcan cosas que no se aplican. Poca comunicación para resolver problemas, poca resolución de problemas.', '', ''),
(1895, '2020', 1, 42, 327, 80, 'MB', 'Ricardo, te invito a seguir en esta línea, mejorando y aprendiendo cada día, optimizando la performance de tus equipos a cargo ', 'Siempre se muestra proactivo y con una visión a mejorar sus equipos, y sistemas ', 'Oportunidad de mejora en análisis de fallos, gestión de repuestos y retroalimentación de los preventivos', '', ''),
(1896, '2020', 1, 36, 91, 62.5, 'B', 'Al ya estar establecido el lugar de trabajo es importante su participación en el equipo y aportes para el GB', '', 'Autonomia, y capacidad de ir conociendo equipo y resolviendo por si misma . Trabajar en comunicación y proactividad', '', ''),
(1898, '2020', 1, 36, 60, 0, 'NM', 'Se había notado una mejora en desempeño, pero nuevamente ha bajado', 'Calidad', 'Proactividad y autonomía. Poca participación en grupo base.\r\nNo trabaja con sistema.\r\nPoca preocupación por alcanzar los resultados', '', ''),
(1899, '2020', 1, 42, 571, 0, 'MB', 'Javier cuento con tu compromiso de seguir capacitándote, y mejorando con la premisa de optimizar la performance de tus equipos a cargo apuntando también a tu crecimiento personal y profesional.', 'Proactivo, predispuesto a trabajar en equipo, siempre adaptándose a las necesidades de planta. ', 'Oportunidad de mejora en análisis de fallos, gestión de repuestos y retroalimentación de los preventivos', '', ''),
(1900, '2020', 1, 36, 177, 0, 'B', 'Colaborador con gran compromiso y interés en la línea, pero poca participación en el GB.\r\nReforzar trabajo en equipo en resoluciones de conflictos con compañeros mejorando la comunicación, sobre todo en paso de turno', 'Autonomía y proactividad', 'Calidad, respetar estándares y velar por la calidad de nuestros productos', '', ''),
(1901, '2020', 1, 36, 294, 0, 'MB', 'Muy Buen desempeño anual, se nota madurez y crecimiento. Bien desempeñado el rol en reemplazo de líderes', 'Autonomía, proactividad, trabajo en equipo', 'Como oportunidades de mejora continuar trabajando en la sistematización de línea. Permanente \"estudio\" de los estándares, seguimiento de repuestos y de actividades de GB', '', ''),
(1902, '2020', 1, 36, 47, 0, 'B', 'Las demandas en el puesto son cada vez mayores y se nota adaptación a esto, y cada vez más aprendizaje a la hora de resolver sola. Se ha ganado autonomía respecto al año pasado, lo cual es muy positivo. ', 'Calidad y comunicación', 'Como punto de crecimiento y oportunidad de mejora se requiere un mayor conocimiento de procesos y equipos, lo que a su vez permitirá mayor resolución de problemas y mejor anticipación a necesidades del sector', '', ''),
(1903, '2020', 1, 36, 105, 0, 'MB', 'Colaborador muy constante con su desempeño. Su interés y ganas son una garantía para la línea y el equipo de trabajo', 'Autonomía y comunicación', 'La oportunidad de mejora es continuar trabajando con sistema. La línea está yendo cada vez a un sistema más autónomo y es importante el seguimiento de OTs, pedido de insumos/repuestos, seguimiento de actividades de GB', '', ''),
(1904, '2020', 1, 36, 180, 0, 'B', 'Gran mejora en desempeño respecto a año pasado. Lo marcado se va mejorando y esto muestra crecimiento y se ve reflejado en la línea', '', '', '', ''),
(1905, '2020', 1, 44, 241, 0, 'B', 'En líneas generales se desempeña bien en el puesto, puede con las exigencias y demandas del mismo.', 'Trabajo en el sistema, flexibilidad, relevamiento de problemas y manejo de la información. 5S. Trabajo en condiciones seguras.', 'Velocidad de respuesta ante algunos pedidos de trabajos.\r\nTrabajo en equipo.\r\nManejo de repuestos.', 'Generar equipos de trabajo para llevar a cabo tareas edilicias.\r\nPedidos de repuestos y codificación de los mismos.', 'Arreglo de morteros.'),
(1906, '2020', 1, 44, 201, 0, 'B', 'Gran conocimiento del puesto. Líder en el sector, muy fuerte en algunas competencias pero necesita mejorar en otras.', 'Conocimientos, flexibilidad horaria, seguridad. ', 'Comunicación, ya que se encuentra en un puesto crítico.\r\nEn ocasiones falta involucrarse más con las necesidades de planta.\r\nListado de repuestos, pedidos.', 'Codificar los repuestos de los equipos a cargo.\r\nMejorar la comunicación.', 'Seguridades de caldera.'),
(1907, '2020', 1, 44, 79, 0, 'B', 'Necesita mejorar muchos aspectos del puesto.', 'Flexibilidad, respeto en el trato, compañerismo.', 'Proactividad, debe tomar sus equipos asignados.\r\nNecesidad de aprendizaje.\r\nFalta involucrarse cuando hay problemas en planta.\r\nMejorar la comunicación.', 'Listado de repuestos de sus equipos.\r\n', 'Agua blanda. Bombas. Calderas.'),
(1908, '2020', 1, 44, 63, 0, 'NM', 'En casi todos los aspectos se aleja de los requerimientos del puesto.', '', 'Orientación a resultados. Trabajo en equipo. Proactividad. Compromiso. ', 'Realizar listado de repuestos de equipos asignados. Trabajar con sistema. Realizar mantenimiento a sus equipos.', 'Bombas. Sistema. Cloro.'),
(1909, '2020', 1, 5, 38, 0, 'NM', 'Se observa un desempeño que no es satisfactorio. Debe trabajar mucho para mejorarlo', '', 'Debe trabajar en comunicacion. No se logra una comunicacion fluida con el supervisor y lideres.\r\nDebe trabajar mas en equipo. Recarga a sus compañeros con sus tareas por no cumplir idoneamente con sus obligaciones. El supervisor debe pedir que reemplace por que al lider le dice que no puede teniendo tiempo.\r\nDebe trabajar en orientacion a los resultados. Se observa perdida de tiempos ociosos.(uso excesivo del celular) Demoras en en el te. \r\nDebe trabajar en flexibilidad. Se observan que cuestan los cambios ', '', ''),
(1910, '2020', 1, 5, 196, 0, 'MB', '', '', 'Debe trabajar mas en sistema. Solo se observa que realiza lups. Debe tener participacion activa en el grupo.\r\nDebe trabajar mas en autonomia. Debe desarroollas mas conocimientos tecnicos para poder profundizar el conocimiento tecnico sobre los equipos que opera.\r\nDebe trabajar en seguridad. Se observan algunos actos inseguros y la no utilizacion de epp siempre que deben ser usados.', '', ''),
(1911, '2020', 1, 5, 173, 0, 'B', '', '', '', '', ''),
(1912, '2020', 1, 5, 152, 0, 'MB', 'Se observa un muy buen desempeño. Debe trabajar mas en algunas competencias. ', '', 'Debe trabajar mas en flexibilidad. Se observan reacciones de incomodidad ante cambios imprevistos o radicales.\r\nDebe trabajar mas en sistema. Sigue siendo u punto debil.\r\nDebe trabajar mas en comunicacion y en las fomras de hacerlo. Se observa que ante situaciones limites la comunicacion cambia en su forma de ser transmitida.', '', ''),
(1913, '2020', 1, 43, 238, 0, 'B', 'Desempeño aceptable en un año de mayores exigencias que lo habitual. Se necesita mayor autonomía de los colaboradores de ese puesto para seguir progresando.', 'Gran compromiso con la seguridad y formando nuevos colaboradores.', '', '', ''),
(1914, '2020', 1, 43, 20, 0, 'B', 'Referente del puesto. Siempre mostró compromiso cuando se solicitó. Se apunta a tener mayor autonomía en el puesto para resolver problemas.', 'Compromiso con el trabajo, gran compañero.', '', '', ''),
(1915, '2020', 1, 43, 125, 0, 'B', 'Trabajó poco en el período evaluado, pero cada vez queda más relegado respecto a los colaboradores que cumplen la misma función.', '', '', '', ''),
(1916, '2020', 1, 43, 345, 0, 'B', 'Gran compromiso mostrado en el tiempo que estuvo en expedición. Cada vez queda más relegado con las funciones a desempeñar en el puesto hoy en día.', '', '', '', ''),
(1917, '2020', 1, 43, 147, 0, 'MB', 'Referente de su puesto, eficiente al realizar el trabajo y bajo presión. Se necesitan colaboradores cada vez más polifuncionales y se necesita trabajar en eso.', '', '', '', ''),
(1919, '2020', 1, 44, 1, 62.5, 'B', 'Gran capacidad para analítica, conocimientos técnicos, predisposición en el turno, pero falta compromiso con los objetivos de la compañía.', 'Conocimientos técnicos y experiencia.\r\nProlija al realizar intervenciones de equipos.\r\n', 'Flexibilidad. Gestión de OT. Mejorar la transmisión de conocimientos.', 'Mejorar el compromiso. Transmitir conocimientos.', 'Uso de herramental de precisión en remache.'),
(1920, '2020', 1, 44, 242, 0, 'B', 'En general buena predisposición. Falta mejorar en sistema, gestión de OTs, análisis de fallos.', 'Predisposición. Relación con compañeros. Transmisión de conocimientos.', 'Análisis de fallos. Gestión de OTs. Involucramiento en otras líneas. Conocimiento de regulaciones.', 'Generar estándares en la línea. 100% de Análisis de fallos asignados.', 'Balancines. Compuesto de cierre.'),
(1921, '2020', 1, 44, 35, 41.25, 'NM', 'Necesita mejorar en muchos aspectos.', 'Flexibilidad. Autonomía en cuanto a realizar las tareas de reparación asignadas.', 'Análisis de fallos. Gestión de OTs. Comunicación de la información. Estándares.', 'Generar estándares de la línea. Pedido de repuestos. Realizar el 100% de los análisis asignados.', ''),
