(1924, '2020', 1, 5, 72, 0, 'B', 'En general se se aprecia un desempeño adecuado para los puestos ocupados por el operador.', '', 'Debe trabajar mas en la comunicacion y las formas hacia el lider. Se observan en algunas ocasiones situaciones inapropiadas, asi como tambien saltos en la cadena de comunicacion.\r\nSe observa buna tendencia al trabajo en equipo. Debe mejorar mas sobre todo con el lider.\r\nDebe trabajar mas en proactividad. Se observa mejoria, pero debe seguir trabajando sobre todo en los tiempos ociosos y muertos.\r\nSe observa baja participacion en el GB. Debe trabajar fuertemente en el sistema. Debe trabajar involucrandose.\r\n', '', ''),
