(1937, '2020', 1, 5, 156, 76.25, 'B', 'Se observa un desempeño adecuado para los puestos ocupados por el operador', 'Seguridad y calidad son aspectos destacables', 'Debe trabajar mas en equipo, estando siempre atento a las necesidades de la linea y sus compañeros para poder cumplir con los objetivos mancomunadamente.\r\nDebe trabajar mas en autonomia, sobre todo en SIG que es el puesto en el cual esta realizando reemplazos.\r\nDebe trabajar mas en proactividad. No esperar ordenes del lider. Actuar anticipandose.', '', ''),
(1938, '2020', 1, 2, 198, 0, 'B', '', '', '', '', ''),
(1940, '2020', 1, 5, 146, 73.75, 'B', 'Se observa un desempeño adecuado para las tareas realizadas', 'Autonomia y flexibilidad.', 'Debe trabajar en proactividad. Se nota que al parar la tetra el rendimiento del operador cae y hay muchos tiempos ociosos mal utilizados. No debe esperar ordenes del líder o supervisor. Ej. olimpic.\r\nDebe seguir trabajando fuertemente en autonomía y poder trabajar en equipo transmitiendo los conocimientos adquiridos.', '', ''),
(1941, '2020', 1, 5, 84, 0, 'MB', 'Se observa un buen desempeño del colaborador a lo largo del año', '', 'Debe trabajar mas en flexibilidad. Cuastan los cambios \r\nDebe trabajar en equipo aprediendo a resolver las diferencias.\r\nDebe trabajar mas en proactividad. Se observa menos que el año anterior.\r\nDebe trabajar mas en sistema. La figura del lider debe tener incorporado el trabajo con sistema sin inconvenientes.\r\nDebe trabajar mas en calidad. Muchos desvios en 5s de linea no visado y algunos problemas de calidad como grandes reclamos por piel\r\nDebe trabajar fuertemente como mentor en el grupo de autonomo.', '', ''),
