(1945, '2020', 1, 5, 23, 0, 'B', 'Se observa un buen desempeño, adecuado para el puesto que la colaboradora ocupa.', 'Flexibilidad, trabajo en equipo.', 'En seguridad debe seguir trabajando. Se marcaron desvios en epp que a lo largo del año fueron mejorando.\r\nEn autonomia debe trabajar mucho para poder lograr un desempeño ajustado a las necesidades del puesto. \r\n', '', ''),
(1946, '2020', 1, 5, 10, 0, 'B', 'Se observa un buen desempeño, adecuado para el sector que trabaja', 'Calidad, seguridad.', 'Debe trabajar en las formas en las que transmite la comunicacion.\r\nDebe mejorar en trabajo en equipo. Le cuesta adaptarse al cambio de personal.\r\nDebe trabajar en flexibilidad. En situaciones de cambios profundos de tarea se observa incomodidad', '', ''),
(1948, '2020', 1, 36, 195, 72.5, 'B', 'Se nota una mejora adaptación al puesto de trabajo, mayor proactividad. Se puede trabajar más con el GB, en cuanto a propuestas de mejora, llevar OTs y darles solución, pero en gral interés por el puesto', 'Seguridad', 'Oportunidad de mejora en autonomía. Continuar aprendiendo de equipos y animarse a participar. Tema calidad e importancia', '', ''),
(1950, '2020', 1, 36, 270, 81.25, 'MB', 'Líder muy completo, trabaja con calidad, seguridad, casi siempre proactivo, con gran compromiso por la línea y por las tareas asignadas', 'Autonomía, orientación a resultados y gestión por sistema', 'La oportunidad de mejora está en la actitud y en como decir las cosas', '', ''),
(1952, '2020', 1, 36, 88, 0, 'B', 'Trabajar en orientación a los resultados, aporte al GB y compromiso con el equipo los fines de semana.\r\nEsto afecta al trabajo en equipo.\r\nMejorar comunicación ante anormalidades, evitar que se extiendan en el tiempo', '', 'Proactividad, notorios periodos de tiempo sin ocupación y sin interés en buscar tareas. ', '', ''),
(1954, '2020', 1, 36, 174, 0, 'MB', 'Gran trabajo y compromiso con FEM. Importante continuar creciendo como equipo en el sector (mep-aut)', 'Se destaca el compromiso, la proactividad y la autonomía con la que se ha trabajado en el año', 'Necesario trabajar en la flexibilidad, sobre todo cuando las cosas no son como se espera.', '', ''),
(1960, '2020', 1, 12, 178, 70, 'B', '', 'Actúa anticipándose a los hechos, alertando sobre desvíos o situaciones que deben resolverse. Dispuesto a hacer la tarea que se le pida y a hacerse el tiempo para llevarlas a cabo. Cumple con objetivos de 5S que se le asignan y sabe trabajar en equipo, aunque debe desarrollar estas aptitudes.', 'A veces inflexible cuando se le asignan tareas en simultáneo, que requieren mayor velocidad de resolución. Debe mejorar en su capacidad de comunicación con sus compañeros, y en sus expresiones.', '', ''),
(1963, '2020', 1, 12, 207, 0, 'B', '', 'Se anticipa a los hechos brindando soluciones a la operación con su conocimiento de algunos equipos. Colabora y trabaja en equipo cuando se le pide capacitar a un compañero. Siempre dispuesto a solucionar problemas de planta.', 'Debe mejorar su capacidad de comunicación con sus compañeros, en forma respetuosa y calmada. Debe desarrollar su proactividad apuntado a tareas de 5S y limpieza de planta. A veces opuesto a trabajar los fines de semana.', 'Siempre comprometido a realizar las tareas que se le pidan. Menos compromiso para venir los fines de semana a realizar tareas de limpieza en algunas ocasiones', ''),
(1964, '2020', 1, 12, 213, 0, 'B', '', 'Siempre dispuesto a trabajar con excelencia en la calidad. Frecuentemente puede resolver problemas por sí mismo y se ha interesado en capacitarse para abarcar mayor conocimiento mecánico. Respetuoso y siempre dispuesto a colaborar con la línea.', 'Debe desarrollar aún más sus conocimientos en Soudronic para alcanzar el nivel que se está solicitando a operadores. Debe trabajar más con sistema, generación y cierre de OT. ', 'Siempre comprometido con las tareas de mantenimiento autónomo. Debe comprometerse más con su aprendizaje en Soudronic. ', ''),
(1965, '2020', 1, 12, 216, 0, 'B', 'Calidad: el colaborador ha sido muy consciente a la hora de trabajar con los estándares establecidos y ha estado muy atento siempre a las condiciones de su equipo y del producto que abastece a las líneas.\r\nComunicación y Trabajo en Equipo: atento a las líneas a las que abastece y en comunicación con operadores para coordinación de cortes y arranques.', 'Capacidad de comunicación y trabajo en equipo. Muy interesado en trabajar con Calidad a consciencia.', 'Debe ser más proactivo indicando mejoras que pueden realizarse en concentradores, y en la generación y cierre de OT. ', '', ''),
(1967, '2020', 1, 12, 269, 0, 'B', '', 'Siempre dispuesto a asistir al mantenimiento autónomo. Siempre interesado en que la línea siga produciendo. Hace foco en calidad y en seguridad', 'Debe mejorar su capacidad de comunicación y escucha, para asimilar y trabajar errores. Debe mejorar su capacidad de trabajo en equipo. Debe colaborar más con generación y cierre de OT de la línea.', '', ''),
(1973, '2020', 1, 12, 261, 0, 'MB', '', 'Osiris se muestra siempre dispuesto a cambios de puesto, mostrando flexibilidad. Siempre presente en el mantenimiento autónomo y limpiezas de fin de semana. Siempre conectado con sus compañeros para resolver problemas', 'Debe trabajar más con sistema. Generación y cierre de OT.', '', ''),
(1974, '2020', 1, 36, 345, 0, 'B', 'Colaborador siempre bien predispuesto, y con ganas de aportar en la línea', 'Uso de EPP siempre correcto', 'Ganar cada vez más autonomía y aumentar siempre que se pueda la capacidad de resolución de problemas', '', ''),
(1975, '2020', 1, 36, 25, 0, 'MB', 'Colaboradora coopera en líneas tal como se le marcó el año pasado', 'Seguridad ', 'Oportunidad de mejora en comunicación, que nada bien que puede mejorar, propuestas desde ese lado. Proactividad a la hora de llevar como administradora el GB', '', ''),
(1976, '2020', 1, 36, 199, 0, 'B', 'Colaborador sabe mucho del puesto, le gusta el sector y le pone empeño a la tarea. Es importante lograr una mejor dinámica en aprovechamiento de tiempos, aportes al GB, trabajar siempre con sistema y mantener una comunicación fluida respecto a los desvios en el puesto', '', 'Proactividad se debe mejorar. Mucho tiempo ocioso sin ser aprovechado. Compromiso de venir cuando se compromete a hacerlo, o avisar ante inconvnientes', '', ''),
(1977, '2020', 1, 36, 554, 70, 'B', 'Buena predisposición, lo que falta aprender se irá ganando', '', '', '', ''),
(1979, '2020', 1, 36, 557, 0, 'B', 'Colaborador muestra flexibilidad para ir a diferentes puestos pero no toma acotaciones y hay que repetirle varias veces. Falta aprender', '', '', '', ''),
(1980, '2020', 1, 36, 76, 0, 'B', 'Debe trabajar mas en equipo, en la línea en que se lo necesite\r\nDebe trabajar en proactividad con tiempos muertos\r\nTrabajar en compromiso y orientación a los resultados. Se lo necesita los fines de semana con mas predisposición.\r\nIndispensable la seguridad en su puesto\r\nDebe trabajar mas en sistema. Participar activamente en el grupo base que le toque y reuniones de choferes.', '', 'Trabajo en equipo más allá de la línea Remanejo.\r\nMuy importante informar de manera permanente las condiciones del autoelevador con el que trabaja, no aceptar desvíos', '', ''),
(1981, '2020', 1, 36, 248, 0, 'B', 'Es importante trabajar con sistema y aportar al GB de la linea en la que se encuentre', '', 'Trabajar en proactividad, ocupando tiempo ociosos. Orientación a resultados y autonomia sobrecarga de tareas en los demás compañeros, y así mejorando el trabajo en equipo.', '', ''),
(1982, '2020', 1, 12, 223, 87.5, 'MB', 'En términos generales muy buen desempeño. Como oportunidad de mejora debe continuar su aprendizaje en la línea y debe desarrollar habilidades blandas de comunicación y empatía.', 'Excelente desempeño trabajando con pilares de Calidad y Mahpi. Bien anticipándose a problemas futuros y buena capacidad de resolución con autonomía. Buena predisposición a nuevos aprendizajes y excelente compromiso. Buen trabajo con sistema y trabajo en equipo con sus compañeros.', 'Debe desarrollar su capacidad de comunicación, y evitar enojos o dificultades de comunicación cuando las situaciones no son las más favorables. Cuando se realizan cambios con el personal de la línea usualmente existen reclamos, a veces no entendiendo que surge como necesidad de la planta. Se debe desarrollar la capacidad de entendimiento y comprensión de dichas situaciones. Trabajar la empatía.', '', ''),
(1984, '2020', 1, 11, 361, 82.5, 'MB', 'Desempeño muy bueno en niveles generales.', 'Predisposición y compromiso con el equipo', 'Análisis de fallos.', 'Llenado parte diario (90%)\r\nCierre de OT asignadas a su línea (90%)\r\nPreventivo (95%)\r\nAnálisis de Fallos (90%)', 'PLC\r\nInstrumentacion'),
(1985, '2020', 1, 11, 144, 0, 'B', 'El oficial tiene todos los conocimientos pero falta mayor compromiso con el equipo.', 'Conocimiento', 'Comunicación de trabajos realizados. Compromiso para asistir los fines de semana en horas extras.', 'Llenado parte diario (90%)\r\nCierre de OT asignadas a su línea (90%)\r\nPreventivo (95%)\r\nAnálisis de Fallos (90%)', 'Instrumentación\r\nPLC'),
