(1991, '2020', 1, 11, 356, 0, 'B', 'Buen desempeño', 'compromiso y conocimiento', 'Análisis de fallos', 'Llenado parte diario (90%)\r\nCierre de OT asignadas a su línea (90%)\r\nPreventivo (95%)\r\nAnálisis de Fallos (90%)', 'PLC\r\nInstrumentacion'),
(1992, '2020', 1, 11, 365, 0, 'MB', 'Muy buen desempeño.', 'Compromiso y conocimiento', 'Gestion del equipo de trabaja, no es una debilidad sino una oportunidad de mejora.', 'Llenado parte diario (90%)\r\nCierre de OT asignadas a su línea (90%)\r\nPreventivo (95%)\r\nAnálisis de Fallos (90%)', 'Inteligencia Artificial'),
(1993, '2020', 1, 38, 258, 0, 'MB', '', 'Ricardo es un colaborador con un perfil integral, conocedor de las herramientas de gestión y a nivel operación en lo que respecta a concentrados y envasados. Estuvo al frente de la auditoría y funcionamiento de Ing. Rossi.', 'Ricardo deberá trabajar fuertemente en conformación de equipos de trabajo tanto con sus nuevos compañeros, pares y supervisores. Siendo él un líder formador para con ellos. Asimismo fortalecer los vínculos comunicativos con los supervisores de turno y coordinar las decisiones que se tomen como compañeros de trabajo, en la asignación de recursos, prioridades de la línea, pedido de insumos, etc.', 'Ricardo es una persona muy comprometida en sus tareas, siempre y cuándo él esté a cargo o al frente de la tarea o proyecto.', 'Sus capacitaciones tienen que estar direccionadas en el trabajo en equipo, liderazgo, empatía y fortalecimiento de vínculos.'),
(1994, '2020', 1, 38, 529, 96.25, 'E', 'Ignacio es un colaborador que durante su curva de aprendizaje en un puesto de mucha exigencia, pudo desempeñarlo de una muy buena manera, por sus tiempos, velocidades de aprendizaje, manejo de gente, etc. Ignacio capitalizó los conocimientos rápidamente y pudo ponerse al hombre en reemplazo de Cecilia. Su foco en ser disruptivo, pensar diferente y hacer pensar diferente/desafiar a su equipo de trabajo será algunos de los frentes de trabajo. ', 'Autonomía, perseverancia, proactividad, respeto por los demás. ', 'Oportunidades de mejora: Comunicación con sus pares, generar acuerdos con los supervisores (calidad y mantenimiento) que poco a poco en su curva de aprendizaje y en la madurez del rol lo podrá realizar. La capacidad de asociar lo prioritario de lo urgente le permitirá tener otro enfoque en el cumplimiento de su actividades. ', 'Ignacio se demuestra como una persona muy comprometida en sus tareas y objetivos planteados, ', 'Metodologías de limpieza, microbiología, herramienta de Gestión, indicadores industriales. '),
(1995, '2020', 1, 5, 259, 0, 'B', 'Se observa un desempeño que alcanza por poco los requerimientos para el puesto de Lider. Debe trabajar mas en las competencias señaladas.', 'Voluntad y compromiso. Buena actitud.\r\n', 'Debe trabajar mas en orientación a los resultados. Falta conocimiento y eso lleva a no poder cumplir con sus obligaciones.\r\nFalta de proactividad. Demoras en set up, en manejo de personal, no va un paso adelante de los problemas de la linea.\r\nFalta de autonomía. Debe seguir capacitándose.\r\nDebe mejorar en seguridad. Puertas puenteadas en EDOS sin aviso al supervisor.\r\nMuchos problemas con calidad(latas mal fechadas, etiquetas cambiadas, semielaborado incorrecto.\r\nDebe trabajar en Liderazgo. Le cuesta enfren', '', ''),
(1997, '2020', 1, 6, 22, 80, 'MB', 'Martha ha demostrado gran compromiso con los objetivos definidos y por cumplir con las tareas encomendadas en tiempo y forma. Se relaciona con buena comunicación y gran respeto y trabaja en equipo.\r\nDebe trabajar con mayor autonomía en el cumplimiento con la metodología de gestión temprana y el uso de las herramientas del sistema.\r\n', 'Orientación a resultados, compromiso\r\nComunicación\r\nTrabajo en equipo', 'Autonomía\r\nMetodología de Gestión Temprana', 'Aprender y aplicar ,metodología de gestión temprana', 'Procedimiento de Gestión Temprana'),
(1999, '2020', 1, 40, 157, 0, 'MB', '', 'Fabio presenta una mirada sistémica de los procesos que le permite, junto a una marcada disciplina, mantener los procesos de gestión y entregables en fecha. Es muy creativo a la hora de plasmar en herramientas las ideas que puedan proponerles pares o el jefe directo, apalancado por su desarrollo en las herramientas de gestión. Esta convencido del uso del sistema como medio para el logro de resultados.', 'Fabio debe poder focalizar en aquellas actividades que quedan en agenda para poder dar celeridad de cierre y dar avance a la gestión, hoy el proceso de cambio del pilar exige tiempos mas exigentes. .\r\nEs importante poder generar el liderazgo desde la gestión para acompañar a sus pares en el logro de los resultados.', '', ''),
(2000, '2020', 1, 40, 425, 0, 'MB', '', 'Antonio esta transitando su primer año en el puesto y aprendiendo a una velocidad muy marcada, apalancada por su proactividad.\r\nPresenta una escucha activa y comunicación eficiente, que le permite interactuar de manera correcta con sus pares.', 'Antonio se encuentra en proceso de aprendizaje de los procesos. Como punto no critico, debe trabajar en ponerse plazos en su agenda para los entregables de tal manera que los cambios del día a dia no afecten estos procesos.', 'La compañia esta muy conforme con el desempeño de Antonio y que presenta un gran potencial para seguir creciendo.', ''),
