(2013, '2020', 1, 41, 263, 80, 'B', 'Demostró un alto compromiso en llevar adelante las actividades de mantenimiento en baja temporada.\r\nDemostró apertura e involucración por aprender temas nuevos. \r\nDemostró autonomía en varias ocasiones para la resolución de problemas', 'Trabajo en equipo, flexibilidad en cambios horarios, respeto y buena comunicación', 'Seguir fortaleciendo conocimientos analíticos, y conocimiento de repuestos y códigos de pañol para el mantenimiento.', '', ''),
(2014, '2020', 1, 41, 325, 80, 'MB', 'Demuestra compromiso por alcanzar los resultados del área. Organización y seguimiento del plan de mantenimiento.\r\nMuestra un gran conocimiento del área, y demuestra marcada intenciones de seguir aprendiendo.\r\n', 'Involucración y búsqueda constante de aprendizaje.\r\nOrganización y seguimiento de procesos de efluentes y tareas que lleva adelante', 'Compartir el conocimiento e información con sus compañeros.\r\nTrabajar la regulación de energía que por momentos interfieren en la obtención de resultados', '', ''),
