(2022, '2020', 1, 45, 357, 81.25, 'MB', '', 'Manejo del turno. Resolución de problemas y desvíos presentados en las líneas', 'Resolver problemas con una mirada preventiva.\r\n', 'Desafiar su capacidad para ir mas alla de lo que ofrece su rol de control de procesos.', ''),
(2023, '2020', 1, 45, 2, 81.25, 'MB', '', 'Compromiso, trabajo en equipo. Apertura en la transmisión de conocimientos a personal ', 'Debe comenzar a trabajar con una mirada mas preventiva e indagar sobre las dificultades  que se presentan \r\n', '', ''),
(2024, '2020', 1, 45, 3, 78.75, 'B', '', 'Siempre cumple en tiempo y forma con las tareas asignadas', 'Ser mas proactiva en la propuesta de nuevas ideas \r\nTrabajar alineados a los resultados ', '', ''),
