(2026, '2020', 1, 45, 212, 73.75, 'B', '', 'El respeto con el que se comunica y la flexibilidad ante cambios', 'Se requiere trabajar sobre la proactividad y en la seguridad para resolver problemas con autonomía \r\nDebe involucrarse mas con  SGI', '', ''),
(2027, '2020', 1, 43, 204, 0, 'B', 'Uno de los que más sabe del puesto, de los primeros en tomar nuevas tareas pero en el 2020 bajó un poco su nivel. Capaz de aprender más', 'Siempre predispuesto a cumplir las tareas indicadas, si se lo propone el más rápido en aprender nuevas cosas y ser de ejemplo para sus compañeros.', '', '', ''),
(2028, '2020', 1, 45, 256, 56.25, 'NM', '', 'Se reconoce sus iniciativas hacia la mejora, ese es el camino.', 'Integración al SGI. Debe comenzar a trabajar mas en gestión : PNC, reclamos, etc', '', ''),
(2029, '2020', 1, 45, 264, 48.75, 'NM', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita trabajar en la proactividad para proponer mejoras en el sector.\r\nNecesita mejorar sobre la orientación a resultados del sector\r\nbuena recepción a la hora de realizar cambios', '', '', '', ''),
(2030, '2020', 1, 45, 291, 51.25, 'NM', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita trabajar en la proactividad para proponer mejoras en el sector.\r\nNecesita mejorar sobre la orientación a resultados del sector\r\nTrabajar sobre la comunicación ', '', '', '', ''),
(2031, '2020', 1, 43, 206, 0, 'NM', 'Poco regular en su desempeño y prestancia, se necesita que este siempre activo y no siempre es así. ', 'Cuando se lo propone, muy bueno en su trabajo y experimentado. ', 'Muchos puntos bajos en su rendimiento, se necesita más regularidad.', '', ''),
(2032, '2020', 1, 45, 296, 81.25, 'B', '', 'Trabajo en equipo, comunicación. Capacidad de transmitir sus conocimientos a sus compañeros', 'Proactividad para proponer mejoras en el sector ', '', ''),
(2033, '2020', 1, 45, 298, 70, 'B', 'Trabajar sobre la comunicación con el equipo. \r\nTrabajar sobre proactividad y propuestas de mejoras al sector', '', '', '', ''),
(2034, '2020', 1, 45, 307, 75, 'B', '', 'Trabajo en equipo. Empeño y responsabilidad en el cumplimiento de las tareas asignadas.', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita trabajar en la proactividad para proponer mejoras en el sector.\r\n', '', ''),
(2035, '2020', 1, 45, 311, 0, 'B', '', 'flexibilidad para adaptarse a diferentes puestos ', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita comenzar a tener una mirada mas preventiva \r\n', '', ''),
(2036, '2020', 1, 45, 369, 0, 'B', '', 'Flexibilidad para adaptarse a los cambios. Comunicación y trabajo en equipo', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita desarrollar una mirada mas preventiva\r\n', '', ''),
(2037, '2020', 1, 45, 423, 70, 'B', '', 'Trabajo en equipo. Compromiso en cumplir con las tareas asignadas', 'Trabajar en la la seguridad para resolver problemas con autonomía\r\nNecesita trabajar en la proactividad para proponer mejoras en el sector.\r\n', '', ''),
(2038, '2020', 1, 45, 360, 0, 'MB', '', '', '', '', ''),
(2039, '2020', 1, 45, 460, 81.25, 'MB', 'Se reconoce el mérito en el reemplazo de Seg. Alim que desarrollo.', 'Autonomía, apertura al aprendizaje continuo. Buen manejo del turno, es lider en su grupo de trabajo.', 'Orientación a resultados, indicadores del área, trabajo en gestión de SGI.', 'Proactividad, impulsar su capacidad para ir mas alla de lo que le trae el rol de control de procesos.', ''),
(2041, '2020', 1, 45, 532, 77.5, 'B', '', 'Compromiso y sus ganas de cumplir con todas las actividades propuestas', 'Trabajar en  la seguridad para resolver problemas con autonomía\r\nNecesita trabajar de manera proactiva frente a desvíos', '', ''),
(2042, '2020', 1, 45, 542, 78.75, 'B', 'Mostro buen desempeño en su primera temporada. es muy ordenada, predispuesta al cambio y aprendizaje constante.', '', '', '', ''),
(2043, '2020', 1, 45, 544, 0, 'B', '', '', '', '', ''),
(2044, '2020', 1, 45, 545, 0, 'B', '', '', '', '', ''),
(2047, '2020', 1, 45, 366, 80, 'MB', '', 'Nivel de detalle a la hora de analizar desvíos\r\nBuena comunicación con el equipo', 'Trabajar en delegar a su compañera aquellas tareas rutinarias\r\n', '', ''),
(2052, '2020', 1, 45, 572, 0, 'MB', '', 'Nivel de detalle en cada labor que encara.\r\nCapacidad de relacionarse con su equipo primario de trabajo.', 'Organización de las tareas que demanden el análisis de resultados. \r\nInterpretación de resultados, y trabajar en delegar tareas básicas a su compañera de trabajo.', '', ''),
(2057, '2020', 1, 45, 402, 0, 'B', 'Se observa su crecimiento en poco tiempo de trabajo en su nuevo rol, es una persona con escucha activa y que constantemente se esfuerza por responder a los desafios que se le plantean.', '', 'Mejorar su autonomía y proactividad ( esta encaminado). Orientación a resultados.', '', ''),
(2058, '2021', 1, 46, 56, 0, 'NM', 'Reina es una colaboradora que no muestra preocupación por cumplir objetivos de producción y en general no resuelve problemas con autonomía. Sí trabaja con Calidad y Seguridad. Surgen algunos cuestionamientos cuando se le pide cambiar de puesto de acuerdo a una necesidad de planta', 'Respetuosa.', 'Le falta desarrollar orientación a resultados, proactividad y autonomía. Se generan inconvenientes debido a que no se completa la rotación higiénica con sus compañeras. Ningún compromiso con las tareas de mantenimiento autónomo y estándares de limpieza', '', ''),
(2059, '2021', 1, 46, 66, 0, 'NM', 'Oscar es un colaborador que podría dar mucho más de lo que ofrece en su puesto de trabajo actual. El valor agregado que podría ofrecerle a la línea debería ser mayor. Si bien ha mejorado en su puesto de trabajo, debe continuar enfocándose en la resolución de problemas con autonomía', 'Comienza a trabajar en equipo un poco más, colabora con el mecánico y lider de línea en la resolución de problemas. ', 'Debe desarrollar orientación a resultados y autonomía. Poco compromiso en su participación de jornada de mantenimiento autónomo y limpieza.', '', ''),
(2060, '2021', 1, 46, 295, 88.75, 'MB', 'Fabián es un colaborador que se interesa mucho por mejorar día a día. Acepta críticas y se interesa por conocer sus oportunidades de mejora. En general resuelve muy bien con autonomía. Muy buen trabajo en equipo con su par de línea, colaboradores y algunos líderes. Falta desarrollar trabajo en equipo con líderes de algunos sectores', 'Gestión de las personas. Trabajo en equipo. Muy buen trabajo con sistema y participación activa en Grupo base. Buena visión de mejoras y aporte de ideas ', 'Falta desarrollar trabajo en equipo con líderes de algunos sectores. Debe continuar desarrollando habilidades como Líder de Tomate, sobre todo habilidades técnicas. ', '', ''),
(2061, '2021', 1, 46, 398, 0, 'E', 'Darío es un colaborador muy respetuoso, flexible, proactivo y con gran capacidad de aprendizaje. Le gusta hacer bien su trabajo y para llevarlo a cabo trabaja muy bien en equipo.', 'Capacidad de aprendizaje, proactividad, orientación a resultados, flexibilidad', 'Debe estar más seguro en la toma de decisiones, y eso lo va a impulsar para resolver con aún más autonomía. Es algo propio de continuar desarrollándose en los nuevos puestos que se le asignaron.', '', ''),
(2062, '2021', 1, 46, 551, 0, 'NM', 'Alejandro es un colaborador con gran potencial para desarrollarse, pero en general cuestiones actitudinales no se lo permitieron. Se lo encontró durmiendo y usando el celular en repetidas ocasiones con fines personales. En algunos momentos no reconoció errores que provocaron detenciones de línea', 'Buena capacidad de aprendizaje', 'Faltó desarrollar trabajo en equipo, ser honesto al momento de reconocer errores. Se generó distracciones en el puesto de trabajo al utilizar el celular para fines personales, lo cual podría haber representado un accidente, un defecto de calidad o una detención de línea.', '', ''),
(2063, '2021', 1, 46, 693, 0, 'B', 'Lucas en general aceptó con flexibilidad los trabajos que se le asignaron, siempre dispuesto a aprender cosas nuevas y mejorar. Es una persona respetuosa. Le faltó afianzarse en los puestos en los que estuvo para poder desarrollar autonomía', 'Se capacitó en envasadora de Doypack 1 con discontinuidad. No pudo afianzarse por razones externas a él. Flexibilidad y respeto.', 'Debe desarrollar la autonomía para resolución de problemas que se le presentan. Actuar y resolver con mayor seguridad. En ocasiones se le marcó a él y su grupo de trabajo que debían actuar con mayor proactividad', '', ''),
(2064, '2021', 1, 46, 559, 0, 'E', 'Walter es un colaborador muy proactivo, siempre anticipándose a las necesidades futuras. Muy bien resolviendo cuestiones de seguridad cuando tenía tiempo libre, o bien aportando algún valor a la línea. Trabaja muy bien equipo. Ya está afianzado en su puesto de trabajo y se merece una oportunidad en un puesto de mayor responsabilidad', 'Proactividad, trabajo en equipo, respeto. Ganas de aprender y mejorar. Acepta e intenta mejorar cuando se le marca errores.', 'Debe continuar desarrollando la autonomía en la resolución de problemas. Desarrollar habilidades técnicas.', '', ''),
(2065, '2021', 1, 46, 289, 80, 'B', 'Daniel trabaja muy bien con Seguridad y Calidad. En general resuelve muy bien con autonomía, pero a veces su personalidad le juega en contra para negociar o llegar a acuerdos con otros colaboradores de la planta. En general se anticipa a necesidades futuras. Debe continuar desarrollando trabajo en equipo con sus pares de otros sectores y con el Operador de Consola de Tomate. Debe mejorar su capacidad de comunicación en situaciones de presión o de resolución de problemas', 'Se anticipa a los hechos y advierte de situaciones a resolver. Interviene activamente en situaciones de Seguridad, ya sea resolviendo o dando aviso. Se interesa activamente por trabajar de acuerdo a estándares de Calidad. Buena orientación a resultados', 'Desarrollándose personalmente puede llegar a resolver con mayor autonomía situaciones problemáticas. Debe desarrollar trabajo en equipo con todos sus pares. Debe gestionar el personal para seguir mejorando, en algunos casos se vio que colaboradores disminuyeron su desempeño. Cuando eso ocurra tal vez le sea más fácil delegar algunas tareas.', '', ''),
(2066, '2021', 1, 46, 527, 0, 'B', 'Maximiliano es un colaborador con potencial de mejora. Debe desarrollar mucho su proactividad y autonomía en la resolución de problemas. Debe dejar de utilizar el teléfono para fines personales y estar más concentrado en su puesto. Utilizar su tiempo libre para generar mejoras y mantener el orden y la limpieza.', 'En general interesado por cumplir objetivos de producción. Capacidad de escucha y aceptación de errores. En general respetuoso y flexible para aceptar nuevas asignaciones', 'Se le marcó en varias oportunidades que su sector no estaba en buenas condiciones de orden y limpieza. Debe desarrollar su proactividad y autonomía. Tuvo participación en eventos de fabricación masiva de PNC, debe estar más atento y concentrado en su puesto para que eso no ocurra. Mucho uso del teléfono para fines personales', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2067, '2021', 1, 46, 330, 0, 'B', 'Juan Pablo tiene un buen manejo del autoelevador y acepta con flexibilidad nuevas asignaciones. Bajo situaciones de presión o situaciones problemáticas tiende a cambiar el humor, lo cual puede mejorar. Debe desarrollar su autonomía en la resolución de problemas y tiene mucho por mejorar en cuanto a proactividad. En algunas oportunidades se le llamó la atención por manejar y hablar por teléfono. Debe utilizar siempre las gafas de protección ocular', 'En general respetuoso y con buena comunicación. Acepta con flexibilidad nuevas asignaciones. Trabaja bien en equipo con otros choferes', 'Debe desarrollar autonomía y proactividad. En sus tiempos libres no estar dentro de la garita de playa, sino viendo o preguntando qué trabajos se pueden llevar adelante. Debe trabajar con mayor Seguridad, no utilizar el teléfono para fines personales, y menos hacerlo mientras maneja. Debe desarrollar su templanza para no cambiar el humor en situaciones de presión', '', ''),
(2068, '2021', 1, 46, 335, 0, 'B', 'Kevin es un colaborador respetuoso, con ganas de aprender y mejorar. Ha logrado de a poco afianzarse en su puesto y comienza a resolver con mayor autonomía, pero en general todavía debe seguirse desarrollando. Debe continuar desarrollando autonomía en la resolución de problemas. Debe comprender en algunos casos que la línea necesita de él mayor compromiso y entrega para cumplir objetivos de producción. En general buen trabajo en equipo pero también se le ha marcado que debe mantener mayor comunicación y coo', 'Respetuoso, flexible para comprender errores. Siempre con ganas de aprender y mejorar. Compromiso en jornadas de autónomo. Comienza a afianzarse en el puesto', 'Debe desarrollar autonomía para poder liberar a Líder y Mecánico de algunas tareas que podría resolver por sí mismo. Falta celeridad en la resolución de problemas. Se le pide mayor compromiso y entrega cuando falta un compañero y hay que reemplazarlo, o en algunos casos particulares que se necesita que haga HHEE. Mejorar comunicación y coordinación con sus compañeros', '', ''),
(2069, '2021', 1, 46, 547, 0, 'B', 'Luciano es un colaborador atento a necesidades futuras. Flexible para reconocer errores, aspectos a mejorar y cambio de asignaciones. Debe desarrollar su autonomía en la resolución de problemas. Debería tener una posibilidad en un puesto diferente que le permita desarrollarse. Debe desarrollar aún más la proactividad para aprovechar momentos ociosos', 'Trabaja bien en equipo, es flexible para reconocer errores y muy frecuentemente se anticipa a necesidades futuras', 'Debe ser más proactivo para aprovechar tiempos libres. Desarrollar su autonomía en la resolución de problemas', '', ''),
(2070, '2021', 1, 46, 558, 0, 'NM', 'En general Lucas es un colaborador que debe desarrollar mucho su autonomía y proactividad. No se observaron casos en los que el colaborador se anticipara a situaciones futuras que se deba resolver. En general poca predisposición para las tareas de limpieza y para prestar ayuda en HHEE entre semana. En algunos casos se pudo observar que participó de \"arreglos\" con choferes de camión que les acercaban comida al puesto de trabajo (garita de playa). En ocasiones se observó que dejaba de realizar el trabajo en e', 'Respetuoso en el saludo y en la comunicación. En general trabajó en condiciones seguras', 'Debe desarrollar proactividad y autonomía. Mejorar conductas en el lugar de trabajo, asumiendo mayor responsabilidad y formalidad. Debe tener mayor participación en los trabajos en equipo, sin sobrecargar a sus compañeros. Tener mayor participación en tareas de limpieza y orden. Aprovechar mejor los tiempos ociosos', '', ''),
(2071, '2021', 1, 46, 381, 0, 'MB', 'Gabriela es una colaboradora flexible, predispuesta a desarrollarse en nuevos puestos y siempre aceptando nuevas asignaciones. Aceptó muy bien cambiar de líneas y tuvo buena participación operando envasadora de Tomate. Muy bien trabajando con sus compañeros y colaborando. En general muchas ganas de aprender y mejorar', 'Capacidad de aprendizaje, trabajo en equipo, proactividad, respetuosa. Flexible para aceptar nuevas asignaciones', 'Debe desarrollar su confianza para poder afianzarse en los nuevos desafíos que se le presentaron. Debe desarrollar su autonomía para poder solucionar problemas que están a su alcance con mayor celeridad', '', ''),
(2072, '2021', 1, 46, 392, 0, 'B', 'Delia no terminó de adaptarse con los resultados esperados en Tomate y se le asignó Doypack. A partir de ahí su desempeño fue en aumento. En general muy buena predisposición para nuevas asignaciones. Debe continuar desarrollando su autonomía y su proactividad para aprovechar tiempos ociosos. Muy buena participación en tareas de limpieza y autónomo', 'Buena participación en limpieza y autónomo. Muy buena predisposición a nuevas asignaciones', 'Debe desarrollar su autonomía y su confianza para poder resolver los problemas que se le presentan con mayor celeridad. A veces problemas que están a su alcance de resolución requirieron la intervención de Lider o mecánico.', '', ''),
(2073, '2021', 1, 46, 628, 0, 'B', 'Jorge es un colaborador muy respetuoso, siempre dispuesto a cambiar de puesto o a nuevas asignaciones que se le presenten. Inició un proceso de adaptación y aprendizaje como operador de cardboard packer tetra pero tuvo algunas limitaciones en cuanto a habilidades técnicas o bien de resolución de problemas. ', 'Siempre dispuesto a cambiar de asignaciones, respetuoso. Con ganas de aprender y mejorar', 'Debe desarrollar sus habilidades técnicas y autonomía para la resolución de problemas del puesto que se le asignó. Debe desarrollar proactividad para aprovechar tiempos ociosos. Por momentos se lo notó inseguro o con falta de confianza, lo cual puede ser propio de su breve tiempo en la planta.', '', ''),
(2074, '2021', 1, 46, 644, 0, 'B', 'Noelia es una colaboradora con buena capacidad de aprendizaje y ganas de mejorar. Tuvo participación en tareas de planificación, pedido de insumos y tareas del grupo base en colaboración con los líderes. Debe desarrollar proactividad para aprovechar tiempos ociosos o analizar el valor agregado que puede darle a la línea en esos momentos. En general muy bien resolviendo cosas nuevas para ella con autonomía.', 'Capacidad de aprendizaje. Buena aceptación y flexibilidad para cambios de puesto y nuevos desafíos. En general resolución con autonomía, pero en desarrollo debido a su breve tiempo en la planta. Operadora de envasadora, remachadora de tomate y dallargine. Bien en carga de Spac y decomiso', 'Tuvo participación de un accidente en el que terminó realizando un acto inseguro. Probablemente por desconocimiento de algunas cuestiones operativas industriales. A mejorar el criterio con el cual se realizan actos con Seguridad y observación de condiciones inseguras. A desarrollar su proactividad para aprovechar tiempos libres o con línea detenida.', '', ''),
(2075, '2021', 1, 46, 633, 0, 'B', 'Paola es una colaboradora con potencial de desarrollo, pero aún debe desarrollar mucho su proactividad y su autonomía. Aceptó con flexibilidad cambios de puesto. En muchas ocasiones un descuido o una distracción no le permitieron centrar su atención en la producción o en problemas a resolver con celeridad. Debe aprovechar mejor los tiempos libres para sumarle valor a la línea. Faltó trabajo en equipo, cuando sus compañeros resolvían algún problema en general no trataba de acercarse y sumar.', 'Flexibilidad para aceptar nuevas asignaciones. Inició un proceso de aprendizaje y adaptación como operadora de Remachadora de tomate. ', 'Llegó tarde en una oportunidad. A mejorar su responsabilidad y compromiso con la línea. A desarrollar su proactividad y autonomía. En algunos casos se observó que miraba mientras otro resolvía algún problema sin acercarse a prestar ayuda de alguna forma. A desarrollar trabajo en equipo', '', ''),
(2076, '2021', 1, 46, 593, 0, 'B', 'A Luis se le pidió cambiar de Latas Vacías a FEM porque en Tomate se necesitaba un chofer con otra dinámica, que pudiera lograr movimientos con mayor soltura y precisión. En FEM tuvo buena aceptación y desarrolló bien su trabajo. Bien trabajando con Seguridad. No se lo notó anticipándose a necesidades futuras y sí fue flexible para aceptar la nueva asignación que se le dio. Poca predisposición y compromiso para realizar HHEE cuando se lo necesitó', 'Respetuoso. Flexible para aceptar nuevas asignaciones', 'Faltó desarrollar proactividad y autonomía para anticiparse a situaciones a resolver y poder darle solución por cuenta propia. Poca predisposición y compromiso para hacer HHEE cuando se lo necesitó. Falta desarrollar habilidad de manejo en el autoelevador.', '', ''),
(2077, '2021', 1, 46, 318, 0, 'B', 'Sebastián es un colaborador que no trabaja con los EPP correspondientes a su puesto de trabajo. Se le pidió en reiteradas ocasiones hacerlo sin responder favorablemente. Es muy flexible y siempre dispuesto a aceptar nuevas asignaciones. Excelente trabajando en equipo y colaborando para cubrir el refrigerio o ayudando por una necesidad de la línea. En general siempre atento para alcanzar objetivos de producción y trabaja bien con aspectos de Calidad. Mucha experiencia y buen manejo del autoelevador. Falta de', 'Siempre dispuesto a ayudar en el puesto que sea, cumpliendo objetivos de producción. Buen manejo del autoelevador. Flexible para aceptar nuevas asignaciones. En general bien trabajando con 5S', 'Debe interesarse más por cuidar su Salud y Seguridad, utilizar siempre los EPP que corresponden a su puesto de trabajo. Debe continuar desarrollando el trabajo con 5S. Debe mejorar en cuanto a proactividad, evitando charlar y distraer a sus compañeros en tiempos libres.', '', ''),
(2078, '2021', 1, 46, 93, 0, 'NM', 'Myriam es una colaboradora respetuosa con buena comunicación con sus pares. En general no actúa anticipándose a situaciones futuras, debe desarrollar proactividad y autonomía. En general no aprovecha los tiempos con línea detenida por voluntad propia, siempre espera indicaciones de Lider o Supervisor. Demostró no estar interesada en la Calidad del producto que elaboramos, ya que se la vio ingresar con un alimento con TACC a Planta. Por lo general existen cuestionamientos cuando se le asigna una nueva tarea ', 'Respeto y comunicación', 'Falta desarrollar proactividad, autonomía, trabajo en equipo, orientación a resultados. Falta mejorar desempeño con Calidad. Debe ser más flexible cuando se le asigna una nueva actividad, distinta de la que realiza habitualmente', '', ''),
(2079, '2021', 1, 46, 100, 0, 'MB', 'Norma es una colaboradora respetuosa, que resuelve con autonomía los problemas que están a su alcance. Siempre acepta con buena predisposición nuevas asignaciones. En general aprovecha muy bien sus tiempos libres para aportar valor a la línea. Trabaja muy bien en equipo, cuando visualiza una necesidad de un compañero se la observa ayudando.', 'Respetuosa, orientación a resultados, flexibilidad, trabajo en equipo', 'Debe continuar desarrollando su autonomía para resolver problemas más complejos. Al tener un carácter reservado puede continuar desarrollando su capacidad de comunicación.', '', ''),
(2080, '2021', 1, 46, 183, 0, 'NM', 'Cristina es una colaboradora que debe desarrollar mayormente su orientación a resultados, autonomía y proactividad. Debe aprovechar mejor los tiempos libres aportando valor a la línea. En general no se la ve preocupada por cumplir objetivos de producción. En general no resuelve problemas sí misma. Sí se mostró abierta a cambios de puesto.', 'Se la vio aceptar con flexibilidad nuevas asignaciones. En general respetuosa', 'Debe desarrollar mayor proactividad para anticiparse a detenciones de línea y aportar valor en tiempos ociosos. Debe desarrollar mayor autonomía en la resolución de problemas de su puesto de trabajo. Debe demostrar mayor preocupación por cumplir objetivos de producción y hacerlo trabajando con Calidad. En su puesto (selección de tomate) muchas veces se la vio sin prestar atención. Uso del celular en su puesto de trabajo', '', ''),
(2081, '2021', 1, 46, 658, 0, 'B', 'Daniela es flexible para adaptarse a nuevas asignaciones. Aceptó bien cambios de puesto. En general tuvo inconvenientes para resolver con autonomía y para desarrollar proactividad, en parte puede ser por su breve tiempo en la planta. Tuvo un inconveniente al manipular un químico no adecuado para la tarea que estaba realizando, puede ser en parte por desconocimiento, debe trabajar su desempeño con Seguridad. En general respetuosa.', 'Respetuosa. Flexibilidad para adaptarse a nuevos puestos. Ganas de aprender y mejorar', 'En general debe desarrollar mayor autonomía y proactividad. Aprovechar momentos libres para aportar valor y solucionar problemas por cuenta propia. Debe mejorar desempeño con Seguridad, sobre todo teniendo criterio acerca de manejo de químicos y visión de condiciones inseguras.', '', ''),
(2082, '2021', 1, 46, 556, 0, 'MB', 'Esteban es un colaborador con ganas de aprender, mejorar y seguir creciendo. Demostró poder llevar adelante la Consola de Tomate y se posiciona como cuadro de reemplazo. Trabaja bien en equipo y es muy flexible para adaptarse a nuevas asignaciones. En general tiene herramientas para resolución de problemas y se mostró interesado en cumplir objetivos de producción', 'Muy bien trabajando en equipo, siendo flexible para aceptar nuevos puestos asignados y nuevas tareas. Siempre respetuoso, buen comunicador de cuestiones a solucionar. Buena orientación a resultados para cumplimiento de objetivos.', 'Debe seguir desarrollando autonomía para afianzarse en el puesto que se le asignó. Puede continuar desarrollando proactividad para aprovechar tiempos ociosos. Debe comenzar a desarrollar habilidades técnicas.', '', ''),
(2083, '2021', 1, 46, 639, 0, 'B', 'Nancy es una colaboradora que, en general, se interesó por cumplir objetivos de producción. Flexible para adaptarse a nuevas asignaciones. En general respetuosa y con buena comunicación. A desarrollar trabajo en equipo y autonomía. Por ejemplo, en el momento del refrigerio: coordinación con sus compañeras para no dejar las mesas de selección desprotegidas.', 'Orientación a resultados, flexibilidad, respeto, comunicación', 'A desarrollar trabajo en equipo y autonomía.', '', ''),
(2084, '2021', 1, 46, 326, 0, 'B', 'Roberto no tuvo resultados esperados como Operador de Baño María. Se requería un perfil con una dinámica distinta, con más habilidades técnicas, más proactivo y autónomo. Luego pasó a Tetra y su desempeño mejoró. Igualmente debe continuar desarrollando mayor proactividad y autonomía. En general afianzarse en el puesto para resolver problemas por su cuenta con celeridad.', 'Adaptación y flexibilidad para aceptar nuevas asignaciones. Respetuoso.', 'En general bien trabajando en equipo y resolviendo problemas con autonomía, pero debe continuar desarrollando estas competencias. También desarrollar proactividad para aprovechar mejor tiempos ociosos. Debe mejorar en las verificaciones que hace en la línea respecto a cuestiones de Calidad', '', ''),
(2085, '2021', 1, 46, 640, 0, 'B', 'Carolina trabajó interesada por cumplir objetivos de producción. Demostró interés por trabajar con Calidad y aceptó con flexibilidad nuevas asignaciones. Debe continuar desarrollando autonomía, proactividad y trabajo en equipo: principalmente en la coordinación con sus compañeras para el refrigerio sin dejar las mesas de selección desprotegidas', 'Carolina trabajó interesada por cumplir objetivos de producción. Demostró interés por trabajar con Calidad y aceptó con flexibilidad nuevas asignaciones', 'Debe continuar desarrollando autonomía, proactividad y trabajo en equipo: principalmente en la coordinación con sus compañeras para el refrigerio sin dejar las mesas de selección desprotegidas', '', ''),
(2086, '2021', 1, 46, 630, 0, 'B', 'Cristian es un colaborador  que, en general, trabajó bien para cumplir los objetivos de producción. Debe desarrollar mucho su autonomía y proactividad. Esto le permitirá resolver problemas por sí mismo sin ayuda y también aprovechar tiempos libres aportando valor a la línea. Le costó un poco adaptarse a nuevas asignaciones, tal vez por su breve tiempo en planta', 'En general preocupado por realizar bien su trabajo y cumplir objetivos. Respetuoso y demostró interés en trabajar en equipo', 'Le costó adaptarse a nuevas asignaciones. Le faltó afianzarse en el puesto. Debe desarrollar autonomía y proactividad. ', '', ''),
(2087, '2021', 1, 46, 597, 0, 'MB', 'Felipe estuvo 100% comprometido con la Calidad del producto. Siempre atento para trabajar en conjunto con producción para mantener los estándares. Siempre interesado por hacer eficaz y eficientemente su trabajo. Con visión de mejoras. Puede seguir desarrollando autonomía para resolver problemas por sí mismo. Siempre proactivo anticipándose a situaciones a resolver con la materia prima', 'Excelente con la Calidad. Muy bien anticipándose a situaciones a resolver en conjunto con el equipo de producción. Bien comunicado con el equipo de trabajo. Visión de mejoras. Con ganas de aprender y mejorar', 'Puede seguir desarrollando autonomía para resolver problemas por sí mismo. ', '', ''),
(2088, '2021', 1, 46, 405, 0, 'MB', 'Jorge es un colaborador bien orientado a resultados, concentrado en el cumplimiento de objetivos. No acepta tan fácilmente nuevas asignaciones, debe trabajar para flexibilizar y aperturar su forma de analizar los cambios de curso de la producción. Se anticipa muy bien a situaciones futuras. Resuelve con cierta autonomía, pero debe continuar desarrollándola. Debe continuar desarrollando habilidades técnicas', 'Bien orientado a resultados, concentrado en el cumplimiento de objetivos.  Se anticipa muy bien a situaciones futuras. Trabaja bien en equipo, fue creciendo en esta competencia. Respetuoso y buen comunicador de cuestiones a resolver', 'No acepta tan fácilmente nuevas asignaciones, debe trabajar para flexibilizar y aperturar su forma de analizar los cambios de curso de la producción. Resuelve con cierta autonomía, pero debe continuar desarrollándola. Debe continuar desarrollando habilidades técnicas. En general bien con Calidad y Seguridad, puede seguir mejorando. ', '', ''),
(2089, '2021', 1, 46, 625, 0, 'MB', 'Pablo es un colaborador siempre interesado por el cumplimiento de objetivos. Siempre respetuoso y buen comunicador de situaciones a resolver. Demostró poder trabajar en equipo en diferentes situaciones de producción. Se lo vio aprovechar muy bien los tiempos libres, aportando valor a su línea. Flexible para aceptar nuevas asignaciones. Debe continuar desarrollando autonomía y habilidades técnicas para poder resolver problemas por sí mismo. Se merece una oportunidad en un puesto de mayor responsabilidad.', 'Siempre interesado por el cumplimiento de objetivos. Siempre respetuoso y buen comunicador de situaciones a resolver. Demostró poder trabajar en equipo en diferentes situaciones de producción. Se lo vio aprovechar muy bien los tiempos libres, aportando valor a su línea. Flexible para aceptar nuevas asignaciones.', 'Debe continuar desarrollando autonomía y habilidades técnicas para poder resolver problemas por sí mismo. Puede seguir mejorando en su desempeño con Seguridad', '', ''),
