(2132, '2021', 1, 5, 428, 0, 'B', 'Debe trabajar en comunicacion de problemas\r\nDebe mejorar en resolucion de problemas(trabajar mas en equipo.\r\nMejorar en seguridad. \r\nElevar autornomia', '', '', '', ''),
