(2138, '2021', 1, 46, 631, 0, 'B', 'Nahuel debe desarrollar su proactividad y autonomía. En general cumplió con todos los trabajos que se le asignaron pero sin actitud superadora. Tuvo algunas faltas y llegadas tarde. En general flexible para adoptar nuevas asignaciones. En general bien trabajando con Seguridad y mejor con Calidad', 'Flexibilidad para trabajar en puestos distintos. Respetuoso al momento de comunicarse', 'Tuvo algunas faltas y llegadas tarde. Se quedó dormido. Faltó compromiso en ocasiones, cuando se produjo los fines de semana. Debe resolver con mayor autonomía, desarrollando habilidades técnicas. Debe desarrollar proactividad para aprovechar mejor los tiempos ociosos, aportando valor a la línea. Puede continuar mejorando aspectos de Seguridad y Calidad en su conducta laboral', '', ''),
(2139, '2021', 1, 46, 657, 0, 'B', 'Jonatan es un colaborador respetuoso, con ganas de aprender y mejorar. Se mostró bien predispuesto a nuevas asignaciones y comprometido siempre que se lo necesitó. Se lo observó trabajando bien en equipo e interesado por el cumplimiento de objetivos. Se lo vio un poco tímido, lo cual influyó en el desempeño de algunas competencias.', 'Respetuoso, con ganas de aprender y mejorar. Se mostró bien predispuesto a nuevas asignaciones y comprometido siempre que se lo necesitó. Se lo observó trabajando bien en equipo e interesado por el cumplimiento de objetivos', 'Al ser un poco tímido, desarrollando su capacidad de comunicación podría alcanzar mejor desempeño laboral. Debe continuar desarrollando proactividad para ayudar a sus compañeros en momentos de dificultad en la línea. Tal vez por su timidez no se animó a sumarse completamente a la resolución de problemas. ', '', ''),
(2140, '2021', 1, 46, 683, 0, 'MB', 'José es un colaborador muy flexible, siempre adaptándose a nuevas asignaciones para colaborar con la línea. Comprometido con el cumplimiento de objetivos. Proactivo para dar solución a problemas de la línea trabajando en equipo. Muy respetuoso, supo entender algunas situaciones/decisiones en las que no estuvo favorecido. Demostró actuar con autonomía en la resolución de problemas que estaban a su alcance', 'Muy flexible, siempre adaptándose a nuevas asignaciones para colaborar con la línea. Comprometido con el cumplimiento de objetivos. Proactivo para dar solución a problemas de la línea trabajando en equipo. Muy respetuoso, supo entender algunas situaciones/decisiones en las que no estuvo favorecido. Demostró actuar con autonomía en la resolución de problemas que estaban a su alcance', 'Debe continuar desarrollando habilidades técnicas. Se merece una oportunidad en un puesto de mayor responsabilidad.', '', ''),
(2141, '2021', 1, 46, 570, 0, 'B', 'Marcelo tuvo participación en eventos de fabricación masiva de latas con defecto de fechado. Se habló con él en varias oportunidades para mejorarlo, y hacer foco en los desvíos de Calidad. En general respetuoso, flexible para aceptar nuevas asignaciones.', 'En general respetuoso, flexible para aceptar nuevas asignaciones. Se lo observó con intenciones de trabajar en equipo y mayormente enfocado en objetivos de producción', 'Poco foco en desvíos o defectos de Calidad. Debe desarrollar proactividad y autonomía para resolución de problemas por sí mismo y para aprovechar tiempos ociosos, aportando un valor distinto.', '', ''),
(2142, '2021', 1, 46, 670, 0, 'B', 'Tomás es un colaborador que se mostró flexible para adaptarse a nuevas asignaciones. No tuvo una actitud superadora para el cumplimiento de objetivos y cuando se le pidió compromiso para producir los fines de semana. Llegó tarde y faltó en algunas ocasiones. Se lo observó muy bien trabajando en equipo. Falta desarrollar proactividad y autonomía para resolver problemas que están a su alcance por sí mismo y para aprovechar tiempos libres, aportando valor a la línea.', 'Se lo observó muy bien trabajando en equipo. Se mostró flexible para adaptarse a nuevas asignaciones.', 'No tuvo una actitud superadora para el cumplimiento de objetivos y cuando se le pidió compromiso para producir los fines de semana. Llegó tarde y faltó en algunas ocasiones. Falta desarrollar proactividad y autonomía para resolver problemas que están a su alcance por sí mismo y para aprovechar tiempos libres, aportando valor a la línea.', '', ''),
(2143, '2021', 1, 46, 282, 0, 'MB', 'Marcela es una colaboradora que tuvo un crecimiento en Temporada. Pasó de operar envasadora a operar remachadora de tomate. Lo hizo muy bien. Se mostró proactiva, trabajando en equipo. Puede continuar desarrollando autonomía para mejorar en la resolución de problemas de la máquina que opera y equipos asociados. ', 'Se mostró proactiva, trabajando en equipo. Aceptó muy bien el cambio de puesto y responsabilidad', 'Puede continuar desarrollando autonomía para mejorar en la resolución de problemas de la máquina que opera y equipos asociados. Muy bien con proactividad para solucionar problemas de su línea, puede mejorar en tiempos con línea detenida', '', ''),
(2144, '2021', 1, 46, 414, 0, 'MB', 'Sergio es un colaborador muy bien orientado a resultados, siempre intentando cumplir los objetivos. En su afán por cumplir los objetivos, a veces pierde la tranquilidad y baja su capacidad de comunicación y escucha, lo cual es un aspecto a mejorar. Muy bien el compromiso con la línea y el mantenimiento autónomo. Logró afianzarse en un puesto nuevo con nuevas responsabilidades. Siempre con ganas de aprender y mejorar. Habilidades técnicas en desarrollo. Bien trabajando con Calidad y Seguridad', 'Sergio es un colaborador muy bien orientado a resultados, siempre intentando cumplir los objetivos. Muy bien el compromiso con la línea y el mantenimiento autónomo. Ganas de aprender y mejorar', 'Desarrollar capacidad de comunicación y escucha trabajando bajo presión o resolviendo problemas de la línea. Mantener la calma. Puede continuar desarrollando implementación de 5S, orden y limpieza en su sector.', '', ''),
(2145, '2021', 1, 46, 429, 0, 'MB', 'Roberto ha logrado afianzarse en un puesto de gran responsabilidad. Siempre atento al cumplimiento de objetivos. Debe continuar aprendiendo aspectos técnicos para poder resolver con mayor autonomía y no incurrir en errores o fallos mayores de línea. Como parte de su proceso de aprendizaje tuvo participación en eventos de producción de PNC, por ellos deberá hacer mayor foco en Calidad. Se notan sus ganas de crecer y seguir mejorando/aprendiendo. Bien trabajando en equipo', 'Autonomía en desarrollo. Sigue aprendiendo cuestiones técnicas de máquina y también incursiona en resolución de problemas de gestión/sistema. Siempre ganas de aprender y mejorar. Siempre respetuoso y con capacidad de comunicación y escucha.', 'Debe continuar aprendiendo aspectos técnicos para poder resolver con mayor autonomía y no incurrir en errores o fallos mayores de línea.', '', ''),
(2146, '2021', 1, 46, 280, 0, 'MB', 'Yanina es una colaboradora muy respetuosa y con buena capacidad de comunicación de problemas a resolver. Siempre comprometida con la Calidad del producto. A veces, por estar preocupada por resolver los aspectos que ella controla, pierde de vista objetivos grupales del equipo. Puede desarrollar el acoplarse al equipo y evaluar en conjunto la solución de los problemas a resolver.', 'Muy respetuosa y con buena capacidad de comunicación de problemas a resolver. Excelente compromiso con la Calidad y Seguridad. Muy bien resolviendo con autonomía problemas referentes a su trabajo', 'A veces, por estar preocupada por resolver los aspectos que ella controla, pierde de vista objetivos grupales del equipo. Puede desarrollar el acoplarse al equipo y evaluar en conjunto la solución de los problemas a resolver. Desarrollando flexibilidad puede mejorar también su trabajo en equipo y orientación a resultados', '', ''),
(2147, '2021', 1, 46, 159, 46.25, 'NM', 'Teresa, en general, no demostró buena capacidad de comunicación y escucha. Se sucedieron algunos inconvenientes con el equipo de la línea que terminaron afectando el cumplimiento de objetivos. Se la observó utilizando el teléfono en el puesto de trabajo, lo que genera pérdida de concentración y riesgo de accidente. Deberá hacer mayor foco en la Seguridad. Muy inflexible a cambios de puesto, aceptando de mala gana.', 'Demostró interés por cumplir objetivos de producción', 'Debe desarrollar capacidad de comunicación y escucha. Desarrollar mucho su flexibilidad, entendiendo que cuando se le da una nueva asignación es por una necesidad de la Planta. Debe mejorar en trabajo en equipo, aprender a confiar en sus compañeras y mejorar la convivencia. Debe desarrollar proactividad para dar un aporte distinto a la línea cuando está detenida.', '', ''),
(2148, '2021', 1, 46, 150, 0, 'NM', 'Rosa no mostró el compromiso que se necesitaba con la línea. Solicitó una oportunidad para operar remachadora, se le dio la oportunidad, pero en algunas ocasiones no asistió a producir el fin de semana o faltó a las actividades de autónomo. Cuando tuvo que comunicar algún requerimiento o pedido personal recurrió al Delegado Gremial en lugar de poder charlarlo con Líderes o Supervisor. En ocasiones se mostró rígida y cuestionó cambios de puesto o asignaciones que se daban en la línea. En general no resuelve ', 'En general compromiso con la Calidad y la Seguridad. Cuando se le asignó una tarea distinta a la habitual la aceptó, aunque con cuestionamientos.', 'Debe desarrollar proactividad para aprovechar aquellos momentos con línea detenida, aportando valor a la línea. En ocasiones se la vio quedarse en el empaque de Doypack cuando la dotación del sector ya estaba completa. Debe mejorar comunicación con Líderes para poder estar informados sobre sus necesidades respecto a desarrollo o necesidades de la línea. Debe participar más con el grupo base.', '', ''),
(2149, '2021', 1, 46, 678, 0, 'MB', 'Jesica es una colaboradora muy activa en su puesto de trabajo, siempre atenta para resolver algún atasco y preocupada por cumplir objetivos de producción. Operó envasadora de Tomate. Respetuosa. En general flexible para aceptar nuevas asignaciones, se adaptó muy bien y rápido al nuevo puesto.\r\n', 'Buena capacidad de aprendizaje y adaptación. Bien en orientación a resultados, preocupada por el cumplimiento de objetivos. Mostró interés en trabajar en equipo, ayudando a sus compañeras cuando tenían algún inconveniente', 'Debe desarrollar autonomía, afianzarse en el puesto, ya que debido al tiempo breve no pudo resolver los problemas a su alcance con soltura y celeridad.', '', ''),
(2150, '2021', 1, 46, 382, 0, 'MB', 'Marcos es un colaborador que siempre se anticipa a necesidades futuras y está permanentemente interesado en el cumplimiento de objetivos. Siempre que se lo necesitó en la consola de Tomate prestó ayuda. Muy buenas habilidades mecánicas. En general, siempre resolviendo problemas por sí mismo.', 'Orientación a resultados, trabajo en equipo. Muy buenas habilidades mecánicas. En general, siempre resolviendo problemas por sí mismo.', 'Debe fortalecer y desarrollar los lazos de comunicación con personal de la línea, y con líderes de otros sectores. Puede seguir mejorando su desempeño en cuestiones de Seguridad. Puede seguir desarrollando su actitud cuando se le marca una cuestión a mejorar, entendiendo que siempre se hace desde lo constructivo.', 'Se dieron dos accidentes con baja en Molienda. Confío en Marcos para, de ahora en más, desarrollar una línea de trabajo más Segura en el sector. Se comprometió a hacerlo.', ''),
(2151, '2021', 1, 46, 672, 0, 'MB', 'Leandro tuvo buena aceptación en su desempeño como Balancinero. Supo adaptarse rápidamente al puesto, demostró ganas de aprender y mejorar. Puede seguir desarrollando autonomía y proactividad, esto puede deberse al tiempo breve que estuvo en planta. En general, interesado por el cumplimiento de objetivos. Puede continuar afianzándose en el puesto', 'Supo adaptarse rápidamente al puesto, demostró ganas de aprender y mejorar. Siempre aceptó muy bien nuevas asignaciones.', 'Puede seguir desarrollando autonomía y proactividad, esto puede deberse al tiempo breve que estuvo en planta.', '', ''),
(2152, '2021', 1, 36, 412, 0, 'MB', 'Muy buena temporada en playa. Equipo de trabajo sólido y resuelven varias veces aún sin líder presente, tomando el colaborador el liderazgo de la situación. Compromiso impecable. ', 'Trabajo en equipo, orientación a resultados. Seguridad, uso constante de EPP', 'Puede trabajarse más en comunicación. En ocasiones operativamente se logra largar a pesar de tenerse problemas, pero eso no implica que no haya que levantar la mano para encontrarle solución (consola)', '', ''),
(2153, '2021', 1, 36, 552, 0, 'MB', 'Colaborador tuvo una excelente temporada. Aprendió de consola y demostró un muy buen trabajo en equipo y proactividad. Demuestra potencial e interés para seguir aprendiendo', 'Trabajo en equipo, flexibilidad y facilidad al aprender. Proactividad (*uso de celular)', '', '', ''),
(2154, '2021', 1, 36, 541, 76.25, 'B', 'Buen desempeño. En playa se logra un buen trabajo en equipo. Es un colaborador con potencial, pero debe demostrarlo y no quedarse en hacer lo justo y lo necesario.', 'Trabajo en equipo', 'Falta mayor proactividad y orientación, lo cual se vio en temporada 2020 mucho más marcado que en 2021. Ir un paso adelante, siempre proponer mejoras para el puesto y no esperar a que se marquen.', '', ''),
(2155, '2021', 1, 46, 343, 0, 'NM', 'Enzo tiene mucho potencial para crecer pero características de su personalidad no le permiten desarrollarse. Se le marcó durante la temporada la necesidad de tener un cambio de actitud respecto a su puesto de trabajo. Colaborar más en tareas de limpieza y orden de la playa. En general bien orientado a cumplimiento de objetivos de producción, no así a objetivos de 5S y mejoras. Pasó reiteradas veces que se comprometió a venir días del fin de semana y no vino o llegó tarde, sin avisar. Muy poco proactivo, int', 'En general bien orientado a cumplimiento de objetivos de producción. Pidió una oportunidad para aprender en otro puesto, lo que demuestra sus ganas de crecer, pero con su desempeño actual no se le dio.', 'Colaborar más en tareas de limpieza y orden de la playa. En general bien orientado a cumplimiento de objetivos de producción, no así a objetivos de 5S y mejoras. Pasó reiteradas veces que se comprometió a venir días del fin de semana y no vino o llegó tarde, sin avisar. Muy poco proactivo, intentando demorar las tareas que se le asignaron para no hacerlas. Falta desarrollar autonomía para resolver problemas que están a su alcance o colaborar en la resolución de los mismos. En varias ocasiones recibió comida', '', ''),
(2156, '2021', 1, 46, 627, 0, 'MB', 'Enzo es un colaborador siempre dispuesto a aceptar nuevas asignaciones. Buenas habilidades mecánicas y metalúrgicas. Trabajó en mejoras para su línea. Se adaptó rápidamente a los dos puestos que se le asignaron en temporada', 'Buena capacidad de aprendizaje. Ganas de aprender y mejorar. Flexibilidad. Orientación a resultados. Respetuoso y buen comunicador de problemas a resolver', 'Puede seguir desarrollando proactividad y autonomía para aportar valor a la línea cuando está detenida, y para resolver problemas que están a su alcance por cuenta propia. Puede deberse al breve tiempo que estuvo en planta. Faltó terminar de afianzarse.', '', ''),
(2157, '2021', 1, 46, 696, 0, 'MB', 'Pablo es un colaborador respetuoso y buen comunicador. Se lo observó preguntar qué tarea se podía realizar con línea detenida. Se mostró interesado en cómo aportar en tiempos muertos. Se adaptó bien a los puestos que se le asignaron. En general se lo observó un poco tímido, tal vez por eso no se lo vio mucho desempeñando trabajo en equipo.', 'Respetuoso. Se adaptó bien a nuevas asignaciones. Se mostró interesado en cómo aportar en tiempos muertos. Mostró ganas de aprender y mejorar', 'Debe mejorar la dinámica de resolución de problemas a su alcance. En parte puede deberse a su breve tiempo en Planta. Debe terminar de afianzarse en los puestos que se le asignaron. Puede continuar desarrollando trabajo en equipo', '', ''),
(2158, '2021', 1, 46, 340, 85, 'MB', 'José es un colaborador bien orientado a resultados, interesado por cumplir objetivos de producción. Cuando se lo necesitó para soporte de la línea siempre estuvo, eso demuestra su compromiso y su consideración con el equipo. Resuelve bien por su cuenta, puede seguir desarrollando habilidades mecánicas. En ocasiones se le pidió más comunicación con Playa y Líderes de Tomate. Mejorando en limpieza y 5S.', 'Bien orientado a resultados, interesado por cumplir objetivos de producción. Cuando se lo necesitó para soporte de la línea siempre estuvo, eso demuestra su compromiso y su consideración con el equipo. Resuelve bien por su cuenta. Mejorando en tareas de limpieza y 5S.', 'Puede seguir desarrollando habilidades mecánicas. En general más comprometido con la producción que con la Calidad. Sí debe trabajar más equilibrado. Puede seguir desarrollando su capacidad de comunicar para poder resolver los problemas en equipo.', '', ''),
(2160, '2021', 1, 46, 539, 0, 'E', 'Alfredo es un colaborador muy comprometido con la Calidad, en la producción de todos los días. Y también con la Seguridad, bien atento en cada check de arranque a los desvíos que pudieran existir y se deban solucionar. Se mostró bien afianzado en el puesto. No dudó en ayudar a sus compañeros/as cuando la línea estuvo detenida por algún problema a resolver. Siempre dispuesto a nuevas asignaciones. Se merece una oportunidad en un puesto de mayor responsabilidad', 'Muy comprometido con la Calidad, en la producción de todos los días. Y también con la Seguridad, bien atento en cada check de arranque a los desvíos que pudieran existir y se deban solucionar. También actuando con Seguridad en tareas de Limpieza. Se mostró bien afianzado en el puesto. No dudó en ayudar a sus compañeros/as cuando la línea estuvo detenida por algún problema a resolver. Siempre dispuesto a nuevas asignaciones.', 'Puede continuar desarrollando habilidades mecánicas. Se merece una oportunidad en un puesto de mayor responsabilidad', '', ''),
(2161, '2021', 1, 46, 341, 0, 'MB', 'Abrahan es un colaborador con muy buenas habilidades mecánicas. Bien autónomo, resuelve por sí mismo los problemas que están a su alcance. Se lo observó ayudar a sus compañeros cuando había inconvenientes en otro sector de la línea. Bien orientado a resultados y objetivos de producción, pero faltó algunas jornadas de autónomo sin avisar. ', 'Muy buenas habilidades mecánicas. Bien autónomo, resuelve por sí mismo los problemas que están a su alcance. Se lo observó ayudar a sus compañeros cuando había inconvenientes en otro sector de la línea.', 'Puede seguir desarrollando compromiso con la línea y con el equipo participando activamente del Grupo Base y comprometiéndose más con las jornadas de autónomo. Debe mejorar su gestión con Seguridad, en ocasiones se lo vio operar sin algunas protecciones de elementos móviles (EDOS, Etiquetadora), sin dar aviso del desvío.', '', ''),
(2162, '2021', 1, 46, 190, 0, 'NM', 'Sonia es una colaboradora poco proactiva, no aprovecha los tiempos muertos y acostumbra a conversar y distraer a sus compañeros/as. Se la vio durmiendo en el puesto de trabajo (selección de molienda), y en ocasiones sus compañeros reclamaron que no llevaba adelante las tareas de las cuales participaba y los sobrecargaba (por ejemplo: lubricación de Baño María). En general nulo aporte a la línea además del trabajo de selección de tomate. Se mostró rígida cuando se le solicitó cambiar de puesto (de envolvedor', 'Se la observó bien comprometida con la Calidad, siempre dando aviso del Control de Piel en segunda cinta de selección', 'Poco proactiva, no aprovecha los tiempos muertos y acostumbra a conversar y distraer a sus compañeros/as. Se la vio durmiendo en el puesto de trabajo (selección de molienda), y en ocasiones sus compañeros reclamaron que no llevaba adelante las tareas de las cuales participaba y los sobrecargaba (por ejemplo: lubricación de Baño María). En general nulo aporte a la línea además del trabajo de selección de tomate. Se mostró rígida cuando se le solicitó cambiar de puesto (de envolvedor a selección de tomate), y', '', ''),
(2163, '2021', 1, 46, 409, 0, 'MB', 'Gastón es un colaborador respetuoso y buen comunicador de problemas a resolver. En general bien orientado a resultados pero en algunos puestos no con la dinámica ideal. Siempre mostró compromiso con la Calidad y la Seguridad. Bien colaborando con el equipo.', 'Respetuoso y buen comunicador de problemas a resolver. En general bien orientado a resultados. Siempre mostró compromiso con la Calidad y la Seguridad. ', 'Debe ser más proactivo durante tiempos ociosos para aportar valor en otro sector de la Planta. En general podría resolver con más autonomía y desarrollar habilidades mecánicas.', '', ''),
(2164, '2021', 1, 46, 688, 0, 'B', 'Ezequiel no maneja el autoelevador con soltura. Con el tiempo fue afianzándose pero le costó adaptarse al manejo en Planta. Esto provocó decomiso de ingredientes e incidentes. En ocasiones se lo necesitó en HHEE para hacer distintas actividades pero no mostró compromiso e interés por aprender. Por ayudar a otros choferes descuidó los objetivos de su puesto', 'Se observó trabajo en equipo. Bien enfocado en la Seguridad, dando aviso sobre desvíos del Autoelevador. Respetuoso y buen comunicador', 'Debe desarrollar su habilidad de manejo del autoelevador.  Debe ser más proactivo para colaborar con el orden y 5S de Planta por cuenta propia. Debe aprender a limitarse a cumplir y superar sus propios objetivos, y no perder la concentración. En general le costó mucho resolver problemas con autonomía, en parte posiblemente por su breve tiempo en planta y la dificultad para adaptarse.', '', ''),
(2165, '2021', 1, 46, 565, 0, 'E', 'José Luis es un colaborador que se adaptó muy bien a los dos puestos que se le asignaron (chofer de playa y planta). Rápidamente supo afianzarse en el manejo del autoelevador. Trabaja muy bien con Seguridad, siempre usando los EPP adecuados. Respecto a Calidad, todavía debe aprender a manejar mejor la disposición y ubicación de reprocesos. Trabaja muy bien en equipo, tiene excelente orientación a resultados. Siempre dispuesto a nuevas asignaciones y respetuoso para comunicarse.', 'Capacidad de aprendizaje y adaptación. Bien con Seguridad. Trabajo en equipo. Bien orientación a resultados. Respetuoso, buen comunicador. Muy buena autonomía en la resolución de situaciones problemáticas del puesto.', 'Debe continuar aprendiendo y mejorando la disposición de reprocesos. Llevar el puré a sectores de consumo de puré y salsas a sector de consumo de salsas, nunca al revés. Debe continuar desarrollando proactividad para mantener 5S de Planta.', '', ''),
(2166, '2021', 1, 46, 684, 0, 'B', 'Luis es un colaborador bien dispuesto a cambio de asignaciones. Colaboró en distintos puestos por diferentes necesidades de Planta. Respetuoso. Debe desarrollar proactividad para aprovechar tiempos con línea detenida para aportar valor. En general bien resolviendo problemas que están a su alcance. No estuvo en ningún puesto de mayor responsabilidad, bien podría tener la oportunidad. En algunas ocasiones se le pidió hacer HHEE para algunas tareas entre semana, pero no estuvo disponible.', 'Bien dispuesto a cambio de asignaciones. Colaboró en distintos puestos por diferentes necesidades de Planta. Respetuoso. En general bien resolviendo problemas que están a su alcance', 'Debe desarrollar proactividad para aprovechar tiempos con línea detenida para aportar valor.', '', ''),
(2167, '2021', 1, 46, 589, 0, 'MB', 'Walter es un colaborador comprometido con el cumplimiento de objetivos de producción. Respetuoso y buen comunicador. Buenas habilidades de resolución de problemas, puede continuar desarrollando habilidades mecánicas. Siempre bien predispuesto para nuevas asignaciones y cambios de puesto. Ganas de aprender y mejorar. Bien trabajando en equipo. Se merece una oportunidad en un puesto de mayor responsabilidad.', 'Comprometido con el cumplimiento de objetivos de producción. Respetuoso y buen comunicador. Buenas habilidades de resolución de problemas. Siempre bien predispuesto para nuevas asignaciones y cambios de puesto. Ganas de aprender y mejorar. Bien trabajando en equipo', 'Puede continuar desarrollando habilidades mecánicas. Puede mejorar en cuanto al aviso de desvíos de Calidad. Puede seguir desarrollando proactividad para sumar valor en su puesto de trabajo, y más aún cuando tiene tiempo libre. Tiene potencial para aportar más ideas de mejora. ', '', ''),
(2168, '2021', 1, 46, 549, 0, 'MB', 'Cristian es un colaborador muy trabajador. Afianzado en su puesto de trabajo. Se le dio una oportunidad en la Consola de Playa y anduvo muy bien. Respetuoso. Se lo observó trabajar en equipo. En ocasiones se le pidió hacer HHEE entre semana por una necesidad de Planta pero no estuvo disponible.', 'Ganas de aprender y mejorar. Afianzado en su puesto de trabajo. Respetuoso. Se lo observó trabajar en equipo.', 'Debe continuar aprendiendo habilidades mecánicas para poder resolver plenamente por su cuenta. Aprovechar mejor los tiempos libres para aportar valor.', '', ''),
(2169, '2021', 1, 46, 191, 0, 'MB', 'Marcela es una colaboradora comprometida con los objetivos de producción, siempre atenta a resolver atascos en transportes o en envasadora. Se la observó trabajando bien en equipo. Respetuosa y buena comunicadora de problemas a resolver. Puede mejorar en reproceso y en tareas de autónomo. Debe desarrollar proactividad y autonomía, para poder resolver problemas que están a su alcance y aprovechar los tiempos con línea detenida. En algunas ocasiones que se le solicitó cambiar de puesto por una necesidad de pl', 'Comprometida con los objetivos de producción, siempre atenta a resolver atascos en transportes o en envasadora. Se la observó trabajando bien en equipo. Respetuosa y buena comunicadora de problemas a resolver.', 'Puede mejorar en reproceso y en tareas de autónomo. Debe desarrollar proactividad y autonomía, para poder resolver problemas que están a su alcance y aprovechar los tiempos con línea detenida. Debe comprender que a veces se le pide cambiar de puesto o se le da una asignación distinta por necesidades que surgen en Planta.', '', ''),
(2170, '2021', 1, 46, 233, 0, 'B', 'Lidia no se observó muy interesada en el cumplimiento de objetivos de Producción, y de hacerlo con Calidad. En la selección de tomate no se ve el empeño. Se la vio conversando con sus compañeras, seleccionando con una mano y por lo general existieron demoras en el refrigerio. Demasiado interesada por las horas extras del fin de semana, al punto de generar peleas entre sus compañeras por quién asistía a realizar esas horas. En general no marca desvíos o cuestiones a resolver', '', '', '', ''),
(2171, '2021', 1, 46, 669, 0, 'MB', 'Gonzalo se adaptó muy bien al puesto que se le asignó. Supo tener la autonomía suficiente para llevar adelante la operación de la etiquetadora. Le faltó afianzarse en el puesto pero en términos generales lo hizo muy bien. Se le marcó en algunas ocasiones que estaba produciendo sin algunas protecciones de equipo, puede mejorar su gestión con Seguridad.', 'Buena capacidad de aprendizaje y adaptación. Buena autonomía. Aceptó con buena predisposición las nuevas asignaciones que se le dieron. Buena participación en jornadas de autónomo.', 'Debe afianzarse en el puesto para resolver con mayor autonomía. Puede continuar desarrollando habilidades mecánicas. Puede mejorar su gestión con Seguridad', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2172, '2021', 1, 46, 659, 0, 'B', 'Celina es una colaboradora que, en ocasiones, por querer cumplir con los objetivos de producción, actúa en forma imprudente. Tal es así, que tuvo un accidente por actuar rápidamente pero en forma insegura. Respetuosa y buena comunicadora. Un poco tímida en el trato. Mostró compromiso y señaló desvíos a solucionar en la línea. Debe continuar mejorando en su desempeño con Seguridad, entendiendo que es lo primero, y luego viene todo lo demás. Puede continuar mejorando autonomía para resolver problemas que está', 'Orientación a resultados. Respetuosa y buena comunicadora. Mostró compromiso y señaló desvíos a solucionar en la línea', 'Puede continuar mejorando autonomía para resolver problemas que están a su alcance sin necesidad de que el Operador de Molienda tenga que asistir. Debe continuar mejorando en su desempeño con Seguridad, entendiendo que es lo primero, y luego viene todo lo demás. ', '', ''),
(2173, '2021', 1, 46, 276, 0, 'B', 'Cecilia debe mejorar su autonomía para resolución de problemas que están a su alcance. En muchas ocasiones esperó a que Lider o Mecánico solucionaran un atasco en remachadora, en lugar de tratar de resolverlo primero por cuenta propia. Debe trabajar la proactividad para hacer más eficiente las tareas de reproceso, aprovechando mejor los tiempos con línea detenida. En general bien con Calidad y Seguridad, pero se observa que sigue utilizando maquillaje facial, lo cual va en contra de las BPM de Planta. Se ob', 'Capacidad de adaptación y aprendizaje. Ganas de aprender y mejorar. Respetuosa', 'Debe mejorar su autonomía para resolución de problemas que están a su alcance. En muchas ocasiones esperó a que Lider o Mecánico solucionaran un atasco en remachadora, en lugar de tratar de resolverlo primero por cuenta propia. Debe trabajar la proactividad para hacer más eficiente las tareas de reproceso, aprovechando mejor los tiempos con línea detenida. En general bien con Calidad y Seguridad, pero se observa que sigue utilizando maquillaje facial, lo cual va en contra de las BPM de Planta. Se observó us', '', ''),
(2174, '2021', 1, 46, 629, 0, 'B', 'Daniel no se mostró demasiado interesado en cumplimiento de objetivos, trabajó con una dinámica distinta de la esperada. No demostraba mayor esfuerzo cuando se requería que se prepare una bulada de ingredientes con mayor celeridad para no detener la línea. Respetuoso y comunicador de cuestiones a resolver. Colaborador cuando se le solicitó ayuda por algún problema a resolver. Se mostró bien predispuesto a nuevas asignaciones, aunque no fueran de su mayor agrado.', 'Se mostró bien predispuesto a nuevas asignaciones, aunque no fueran de su mayor agrado. Colaborador cuando se le solicitó ayuda por algún problema a resolver. Respetuoso y comunicador de cuestiones a resolver. Buenas habilidades técnicas', 'Mejorar la dinámica de desarrollo de tareas, para no desabastecer la línea. Debe desarrollar proactividad para aprovechar mejor lo tiempos libres, aportando ideas de mejora para su sector o algún otro. Demasiado pendiente de HHEE y puntualmente cuando se lo necesitó, no se comprometió.', '', ''),
(2175, '2021', 1, 46, 400, 0, 'E', 'Ramiro es un colaborador muy bien comprometido con el cumplimiento de objetivos de producción. Si visualiza un problema, aunque sea externo al equipo que él opera y la línea está detenida, acude a ayudar. Eso muestra su compromiso y ganas de trabajar en equipo. Muy respetuoso y acepta bien cualquier asignación que se le de. Cuando la línea está detenida trata de aprovechar el tiempo sumando valor con alguna tarea, o bien pregunta a dónde dirigirse para aportar. Puede seguir mejorando en su desempeño con Seg', 'muy bien comprometido con el cumplimiento de objetivos de producción. Si visualiza un problema, aunque sea externo al equipo que él opera y la línea está detenida, acude a ayudar. Eso muestra su compromiso y ganas de trabajar en equipo. Muy respetuoso y acepta bien cualquier asignación que se le de. Cuando la línea está detenida trata de aprovechar el tiempo sumando valor con alguna tarea, o bien pregunta a dónde dirigirse para aportar.', 'Puede seguir mejorando en su desempeño con Seguridad, evitando actos inseguros. En general comprometido con la Calidad, puede mejorar. A veces, sus ganas por cumplir objetivos de producción hace perder de vista los pilares de Calidad y MAHPI. Resuelve bien con autonomía, puede mejorar habilidades mecánicas', '', ''),
(2176, '2021', 1, 46, 679, 0, 'MB', 'Ximena supo adaptarse muy bien a los puestos que se le asignaron. Respetuosa. Puede mejorar el aprovechamiento de tiempo con línea detenida (reproceso). Puede continuar desarrollando autonomía para resolver problemas que están a su alcance, en parte puede ser por su breve tiempo en Planta', 'Capacidad de aprendizaje y adaptación. Compromiso con la producción los fines de semana y jornadas de autónomo. Flexibilidad para recibir nuevas asignaciones', 'Puede mejorar el aprovechamiento de tiempo con línea detenida (reproceso). Puede continuar desarrollando autonomía para resolver problemas que están a su alcance, en parte puede ser por su breve tiempo en Planta. Desarrollar la  capacidad de detección de necesidades de algún/a compañero/a para lograr resolver los problemas en equipo', '', ''),
(2177, '2021', 1, 46, 371, 0, 'B', 'Raul es un colaborador comprometido con el alcance de objetivos de producción. Hábil en el manejo de autoelevador y conocedor de los movimientos de Planta. En situaciones en las que tuvo que prestar colaboración con sus compañeros, se mostró rígido e inflexible. Por ej. en casos de rotura de autoelevador. Falta de fluida comunicación con sus compañeros, y rígido en el trato diario. En general bien con Calidad y MAHPI (correcto uso de EPP)', 'Comprometido con el alcance de objetivos de producción. Hábil en el manejo de autoelevador y conocedor de los movimientos de Planta. En general bien con Calidad y MAHPI (correcto uso de EPP)', 'En situaciones en las que tuvo que prestar colaboración con sus compañeros, se mostró rígido e inflexible. Por ej. en casos de rotura de autoelevador. Falta de fluida comunicación con sus compañeros, y rígido en el trato diario. Debe seguir mejorando la detección de desvíos de 5S y actuar proactivamente para solucionarlos. ', '', ''),
(2178, '2021', 1, 46, 566, 0, 'MB', 'Lucila es una colaboradora bien comprometida con Seguridad. Marcando desvíos y situaciones a resolver en su línea. Buen desempeño en reproceso, o realizando tareas de limpieza con línea detenida. Activa. Respetuosa y buena comunicadora de situaciones a resolver. Se observó una buena adaptación al equipo de trabajo', 'Lucila es una colaboradora bien comprometida con Seguridad. Marcando desvíos y situaciones a resolver en su línea. En general, buen desempeño en reproceso, o realizando tareas de limpieza con línea detenida. Activa. Respetuosa y buena comunicadora de situaciones a resolver. Capacidad de adaptación', 'Puede seguir mejorando su desempeño de Autonomía, para aportar al cierre de los desvíos que están a su alcance de resolución', '', ''),
(2179, '2021', 1, 46, 634, 0, 'MB', 'Silvia es una colaboradora muy respetuosa. En ocasiones no se mostró tan flexible a cambios de puesto, sin entender que eran por una necesidad de Planta. Se adaptó al grupo de trabajo. Bien en tareas de reproceso, limpieza y jornadas de autónomo', 'Muy respetuosa. Se adaptó al grupo de trabajo. Bien en tareas de reproceso, limpieza y jornadas de autónomo', 'Debe desarrollar autonomía para poder darle solución a problemas que están a su alcance', '', ''),
(2180, '2021', 1, 46, 694, 0, 'MB', 'Gonzalo supo adaptarse y aprender en puesto crítico, operando Manzini. Buena capacidad de adaptación y aprendizaje. Respetuoso y buen comunicador. Se mostró abierto y bien predispuesto a nuevas asignaciones. Trabajó bien en equipo', 'Buena capacidad de adaptación y aprendizaje. Respetuoso y buen comunicador. Se mostró abierto y bien predispuesto a nuevas asignaciones. Trabajó bien en equipo', 'Debe mejorar proactividad para agregar valor en tiempos ociosos. Aportar mejoras. Puede continuar desarrollando autonomía y habilidades mecánicas para resolver por su cuenta problemas que están a su alcance', '', ''),
(2181, '2021', 1, 46, 645, 0, 'B', 'Carolina se mostró comprometida con el cumplimiento de objetivos. En general respetuosa y no entró en conflictos con sus compañeras. Se la observó trabajar concentrada en la selección de objetos extraños en mesa de molienda. También colaboró con tareas de carga de Spac.', 'Comprometida con el cumplimiento de objetivos. En general respetuosa y no entró en conflictos con sus compañeras. Se la observó trabajar concentrada en la selección de objetos extraños en mesa de molienda. ', 'Debe mejorar proactividad para aprovechar tiempos ociosos aportando valor. Tener más participación en aviso de desvíos o cuestiones a mejorar.', '', ''),
(2182, '2021', 1, 46, 163, 0, 'MB', 'Estela es una colaboradora que no duda en agarrar una llave para hacer una reparación si así lo necesitara. Buenas habilidades mecánicas y autonomía para resolver problemas que están a su alcance. Siempre atenta a atascos en máquina. Puede mejorar la eficiencia de tareas con línea detenida y reproceso. Se la observó trabajar en equipo, y enseñar a sus compañeras nuevas. Mostró cierta resistencia cuando se le asignó Mectra Remanejo.', 'Buenas habilidades mecánicas y autonomía para resolver problemas que están a su alcance. Siempre atenta a atascos en máquina. Capacidad de trabajo en equipo y enseñar a sus compañeras.', 'Puede mejorar la eficiencia de tareas con línea detenida y reproceso. Estar mejor predispuesta y abierta a cambio de asignaciones, siempre es bueno continuar aprendiendo. Puede aportar a su línea trabajando activamente en la detección de desvíos y mejoras.', '', ''),
(2183, '2021', 1, 46, 638, 0, 'B', 'Luciana se mostró respetuosa, sin entrar en conflictos con sus compañeras. Tuvo buen desempeño orientado a cumplimiento de objetivos. Buena participación en producción los fines de semana. Debe mejorar en reproceso y tareas con línea detenida.', 'Respetuosa, sin entrar en conflictos con sus compañeras. Tuvo buen desempeño orientado a cumplimiento de objetivos.', 'Debe trabajar activamente en la detección de desvíos y mejoras para su línea. Puede mejorar desempeño con línea detenida, aprovechando el tiempo para agregar valor.', '', ''),
(2185, '2021', 1, 46, 646, 0, 'MB', 'Melisa se mostró bien predispuesta a cambios de puesto y nuevas asignaciones. Se la vio comprometida con el cumplimiento de objetivos. Le costó adaptarse pero demostró ganas de aprender y mejorar. Por su breve en tiempo en Planta, es posible que no se haya visto desarrollar por completo proactividad y autonomía. Para mejorar en aprovechamiento de tiempo con línea detenida (reproceso) y resolución de problemas que están a su alcance.', 'Bien predispuesta a cambios de puesto y nuevas asignaciones. Se la vio comprometida con el cumplimiento de objetivos. Ganas de aprender y mejorar', 'Desarrollar proactividad para aportar valor cuando la línea está detenida y autonomía para mejorar en la resolución de problemas con celeridad.', '', ''),
(2186, '2021', 1, 36, 418, 0, 'MB', 'Se nota una gram mejoría respecto a lo marcado el año anterior.\r\nLos puntos de autonimía, proactividad, aprovechamiento de etiempos, orientación a los resultados se ven muy bien trabajados', 'Compromiso, enseña a los compañeros. Autonomía. Muy buena comunicación de resultados de limpieza o anormalidades de ensuciamiento de equipo.', 'Como opertunidad de mejora, tomar un rol activo en GB, siempre proponer mejoras, otras maneras de hacer las cosas.', '', ''),
(2187, '2021', 1, 36, 648, 0, 'B', 'Colaborador se adapta bien al puesto y aprende rápido. Tiene que mostrar el mismo compromiso para las actividades que sí le gusta hacer como para las que no son tan desafiantes para el.', 'Rápido aprendizaje, no tan sólo se anima a aprender y a operar equipo, sino que lo hace bien en poco tiempo', 'Comunicación de equipo, proceso, estado y tiempos reales de las actividades.', '', ''),
(2188, '2021', 1, 36, 353, 0, 'B', 'Colaborador con compromiso marcado y gran flexibilidad. Se lo nota desmotivado tras cierto cansancio en el puesto. Se espera más de él, se entiende que tiene las capacidades para demostrar aún más.', 'Flexibilidad y buena predisposición en cualquier puesto de trabajo. Compromiso.', 'Se espera mayor conocimiento del equipo y más profundidad en el proceso que ocurre en el. Es operador de Manzini hace tiempo, y no se ve reflejado en sus conocimientos', '', ''),
(2189, '2021', 1, 36, 620, 0, 'NM', 'Colaborador con gran potencial de aprendizaje, pero de mala a muy mala relación con compañeros. No aporta desde el trabajo en equipo, sino que demuestra querer mostrarse como talento individual', 'Velocidad de aprendizaje', 'Colaborador no trabaja en equipo, ni tampoco se comunica correctamente cuando un líder o supervisor le pide que vaya a un puesto que no le gusta, o que haga alguna actividad de las que no prefiere', '', ''),
(2190, '2021', 1, 36, 499, 0, 'MB', 'Colaborador sumamente comprometido, con ganas de aportar al equipo y sumar en donde se lo necesite', 'Compromiso, proactividad, trabajo en equipo', 'Condiciones de seguridad y cumplimiento de estandares en autoelevador', '', ''),
(2191, '2021', 1, 36, 650, 0, 'MB', '', 'Predisposición, compromiso, trabajo en equipo', '', '', ''),
(2192, '2021', 1, 36, 652, 0, 'MB', '', 'Predisposición, compromiso, trabajo en equipo', '', '', ''),
(2193, '2021', 1, 36, 626, 0, 'NM', 'Colaborador poco receptivo, se le marcan varias veces actitudes a mejorar y no demuestra interés en hacerlo', '', 'No toma aspectos marcados con el líder, se desaparece de la línea sin avisar, llega tarde a puesto de trabajo, busca hacer lo justo y lo necesario', '', ''),
(2194, '2021', 1, 36, 643, 0, 'NM', 'Colaboradora hace las cosas a su tiempo, sin importarle los horarios definidos para refrigerio. No toma comentarios del líder', '', 'Colaboradora no toma pedidos del líder, no muestra flexibilidad ni capacidad de escucha. El puesto queda desatendido, y la colaboradora demuestra sentirse responsable de ello', '', ''),
(2195, '2021', 1, 36, 403, 0, 'MB', 'Colaborador muestra gran adaptación al puesto de molienda. Muy comprometido con el trabajo y buscando colaborar y dejar lo mejor en el turno. Aún hay mucho por aprender y se puede ganar autonomía.', 'Flexibilidad, buena predisposición, compromiso y trabajo en equipo', 'Importante, no como debiidad, pero sí para seguir trabajando, es el rol y el protagonismo en GB, tanto en molienda como en SIG', '', ''),
(2196, '2021', 1, 36, 165, 0, 'B', 'Colaboradora con muy buena predisposición de trabajar BIEN en cualquier puesto. Respetuosa y comprometida con su trabajo', 'Compromiso', 'Es necesario avisar si la cantidad de tomate excede al proceso de selección', '', ''),
(2197, '2021', 1, 36, 170, 0, 'B', 'Colaboradora siempre presente, y con gran compromiso en la línea, cumple con su trabajo y está atenta a su puesto', 'Compromiso', 'Es necesario avisar si la cantidad de tomate excede al proceso de selección. No siempre le gusta ocupar puestos que no sean a los que está habituada.', '', ''),
(2198, '2021', 1, 36, 637, 0, 'B', 'Colaboradora se adapta a equipo de trabajo. En algunos momentos hay que marcarle algunas maneras de trabajar, corrige los errores', 'Compromiso', 'Es necesario avisar si la cantidad de tomate excede al proceso de selección', '', ''),
(2199, '2021', 1, 36, 102, 75, 'B', 'Colaboradora muestra gran mejoría respecto a año anterior, y una buena actitud frente a debilidades marcadas. Se nota un mejor trabajo en equipo y más preocupación en la línea', 'Escuca y flexibilidad para mejorar aspectos de desempeño marcados', 'Aún puede seguir creciendo en autonomía, es una de las colaboradoras que más conoce y mayor potencial tiene. Muy importante comunicar y usar al sistema para aportar y generar mejoras en la línea y puesto de trabajo. Calidad y arrugar envases', '', ''),
(2201, '2021', 1, 36, 226, 0, 'MB', 'Colaboradora muestra un muy buen desempeño, logrando aportar a la línea, demostrando gran interés en calidad y en producción, proactiva, y comunicadora', 'Comunicación, trabajo en equipo', 'Arrugar envases cuando la cinta está muy llena. Continuar aprendiendo y ganar cada vez mayor autonomía y siempre llevar mejoras desde sistema', '', ''),
(2202, '2021', 1, 36, 167, 0, 'MB', 'Colaboradora muestra un muy buen desempeño, logrando aportar a la línea, demostrando gran interés en calidad y en producción, proactiva, y comunicadora', 'Comunicación, trabajo en equipo', 'Arrugar envases cuando la cinta está muy llena. Continuar aprendiendo y ganar cada vez mayor autonomía y siempre llevar mejoras desde sistema', '', ''),
(2203, '2021', 1, 36, 166, 0, 'MB', 'Colaboradora muestra un muy buen desempeño, logrando aportar a la línea, demostrando gran interés en calidad y en producción, proactiva, y comunicadora', 'Comunicación, trabajo en equipo. Compromiso', 'Flexibilidad a la hora de hacer tareas que no le gustan tanto. Arrugar envases cuando la cinta está muy llena. Continuar aprendiendo y ganar cada vez mayor autonomía y siempre llevar mejoras desde sistema', '', ''),
(2204, '2021', 1, 36, 608, 0, 'B', 'Colaboradora se adapta, pero debe mostrar mayor trabajo en equipo y tomar ejemplo y conocimiento de gente con experiencia para aprender de equipos y continuar mejorando', '', '', '', ''),
(2205, '2021', 1, 36, 624, 0, 'B', 'Colaboradora se adapta, pero debe mostrar mayor trabajo en equipo y tomar ejemplo y conocimiento de gente con experiencia para aprender de equipos y continuar mejorando', '', '', '', ''),
(2206, '2021', 1, 36, 586, 0, 'MB', 'Colaborador con muchas ganas y buena dinámica de trabajo. Si bien se ve que sabe manejar autoelevador, se comentiron varios errores. Lo bueno es que se ve que mejora a partir de los mismos. Se destaca su gran voluntad. Importante siempre comunicar estado de autoelevador', 'Compromiso y capacidad de adaptarse', 'Actitud permanente de quejas y reclamos. Aspectos de seguridad marcados varias veces, son de suma importancia en su puesto', '', ''),
(2207, '2021', 1, 36, 687, 0, 'B', 'Colaborador con buena predisposición, cuesta un poco la adaptación', '', 'Colaborador necesita ganar mayor autonomía y aprender más del sector que ocupa', '', ''),
(2208, '2021', 1, 36, 654, 75, 'B', 'Colaboradora activa, participativa, aprende y se adapta rápido. Buena participación fines de semana', '', '', '', ''),
(2209, '2021', 1, 36, 653, 75, 'B', 'Colaboradora activa, participativa, aprende y se adapta rápido. Buena participación fines de semana', '', '', '', ''),
(2212, '2021', 1, 36, 656, 0, 'NM', 'Colaboradora es poco proactiva, no le importa si su actividad o falta de esta perjudica al equipo. Maneras de comunicarse no apropiada, generando mal cclima de trabajo', '', 'Trabajo en equipo. Respeto. Entender que si no salen envases por la línea, la tarea es otra, y hay que ponerle empeño también, 5s hacen a seguridad y condiciones de línea. Envases arrugados a la salida del tunel', '', ''),
(2213, '2021', 1, 36, 623, 0, 'B', 'Colaboradora se adapta bien a puesto de trabajo. Debe aprender más de la línea y del puesto de trabajo', '', 'Falta proactividad. Calidad, tener en cuenta que se marca repetidas veces las condiciones de envases a la salida del tunel', '', ''),
(2214, '2021', 1, 36, 622, 0, 'B', 'Colaboradora se adapta muy bien a la línea, siempre demuestra actitud positiva y ganas de aprender', 'Comunicación y respeto, compromiso y actitud orientada al buen desempeño de la línea', 'Debe ganarse aún más autonomía, importante trabajar con calidad, no arrugar envases a la salida de la línea, y trabajar en proactividad y aprovechamiento de tiempos muertos', '', 'Colaboradora demuetsra interés en aprender de máquinas, y también autoelevador'),
(2215, '2021', 1, 36, 336, 0, 'MB', 'En seguridad ser muy cuidadoso en intervenciones con máquina en movimiento y producto caliente. Se ven buenas prácticas, pero siempre tener en cuenta riesgos asociados al puesto', 'Colaborador consolidado en puesto de envasado de DP, atento, receptivo a aprendizaje', 'No es una debilidad, pero siempre aprender más de sistema, siempre proponer desde ahí', '', ''),
(2216, '2021', 1, 36, 331, 0, 'B', 'Colaborador tiene que ganar mayor autonomía en máquina, se espera mayor capacidad de resolución, falta aprender algunas cosas que a esta altura deberían estar aprendidas. Se espera que si se siente inseguro pida formación.', 'El colaborador tiene las capacidades, sólo se necesita que tenga la dedicación de aprender con la profundidad que se requiere.', 'Intervenciones con máquina en marcha, manipulación de producto caliente. Importante aprender de errores, de desvíos marcados, máquina crítica en calidad, debe estar a la altura de lo que se necesita como operador.\r\n', 'Tiene que haber compromiso con la calidad y con aprender de los errores, tener mayor capacidad de escucha y flexibiliad para aprender de lo que ya salió mal. ', ''),
(2217, '2021', 1, 36, 377, 0, 'MB', 'Colaborador se adapta muy bien a puestos de trabajo. Se muestra alineado a las formas de trabajar de la línea y del sistema. Importante seguir conociendo y aplicando sistema a línea, comunicación proactiva de anormalidades, propuestas de resolución de las mismas\r\n', 'Compromiso, aprendizaje y voluntad', 'Falta ganar autonomía y seguir creciendo en conocimiento técnico. Derroche de agua en línea', '', ''),
(2218, '2021', 1, 36, 401, 0, 'MB', 'Buena adaptación a la línea y a la metodología de trabajo. Colaborador proactivo ', 'Colaborador resalta por su buena predisposición al aprendizaje y compromiso', 'Aún puede aprenderse mucho de la línea. Es muy importante la comunicación proactiva de anormalidades, y la proactividad a la hora de gestionar soluciones y proponer mejoras para la línea', '', ''),
(2219, '2021', 1, 36, 621, 0, 'MB', 'Colaborador se adapta muy bien a la línea y aprende muy rápido. Muestra excelente capacidad de resolución para el tiempo de preparación que ha tenido en planta, y una muy buena aplicación de lo aprendido', 'Compromiso, flexibilidad, ganas de aprender y capacidad de aprendizaje', '', '', ''),
(2220, '2021', 1, 36, 619, 0, 'MB', 'Colaborador aprende muy rápido, aprovecha tiempos, pone gran empeño en el día a día, aporta lo que puede en su línea y en otros sectores, demuestra gran trabajo en equipo y orientación', 'Compromiso, proactividad, trabajo en equipo. Propone soluciones a partir de analizar un problema', 'Importante el compromiso de estar a horario en la línea. importante uso de EPP permanente.', '', ''),
(2221, '2021', 1, 36, 695, 0, 'MB', 'Colaborador se adapta rápidamente al equipo de trabajo, aún estando en palletizado se preocupar po aprender y aportar lo mejor a la línea', 'Proactividad, trabajo en equipo, rápido aprendizaje', 'Atento con intervenciones con máquina en movimiento', '', ''),
(2222, '2021', 1, 36, 262, 80, 'MB', 'Colaboradora muestra buena integración en el equipo de trabajo de remanejo. Aún debe aprender más del equipo. Condiciones de la línea hacen a la seguridad.', 'Proactividad, comunicación, preocupación por la línea y compromiso', 'Importante tener en cuenta la criticidad que implica el puesto del pulmón', '', ''),
(2225, '2021', 1, 36, 265, 0, 'B', 'Colaboradora muestra buena integración en el equipo de trabajo de remanejo. Es importante resaltar que siempre se debe respetar la calidad con la que se produce. Condiciones de la línea hacen a la seguridad.', 'Autonomía y conocimiento de Mectra, comunicación.', 'Importante tener en cuenta la criticidad que implica el puesto del pulmón.', '', ''),
(2226, '2021', 1, 46, 632, 0, 'B', 'María de los Angeles es una colaboradora comprometida con el cumplimiento de objetivos de producción. Se la observó trabajar en equipo. Respetuosa. Se mostró predispuesta a nuevas asignaciones. Debe mejorar en el aprovechamiento de tiempo con línea detenida, aportando valor. Puede mejorar en cuanto a aportes de mejoras y trabajo con sistema. Debe seguir desarrollando autonomía para resolver problemas que están a su alcance', 'Comprometida con el cumplimiento de objetivos de producción. Respetuosa. Se mostró predispuesta a nuevas asignaciones', 'Debe mejorar en el aprovechamiento de tiempo con línea detenida, aportando valor. Puede mejorar en cuanto a aportes de mejoras y trabajo con sistema. Debe seguir desarrollando autonomía para resolver problemas que están a su alcance', '', ''),
(2227, '2021', 1, 36, 344, 0, 'E', 'Colaborador demuestra estar siempre a la altura de los desafíos que se le proponen. Es muy importante destacar su buena perdisposición, su autonomía, el excelente clima que genera y la dinámica de trabajo permanentemente alineada con el sistema', 'Orientación a resultados, compromiso, autonomía', 'Importante lograr dejar los inconvenientes de lado para evitar malas comunicaciones', '', ''),
(2228, '2021', 1, 36, 321, 0, 'MB', 'Colaborador demuestra muy buen resultado ante el desafío de nuevo puesto. Se adapta y logra formar un muy buen equipo de trabajo. Es importante seguir creciendo en la dinámica del grupo base, entender que la tracción a través del mismo es lo que permite cambios definitivos en la línea', 'Gran orientación a resultados, responsabilidad por conocer y cumplir tareas asignadas.', 'Comunicación bajo presión, formar equipo a 3 turnos, gestionar y crecer a partir de las diferencias con pares', '', ''),
(2229, '2021', 1, 36, 647, 80, 'MB', 'Colaborador demuestra adaptación al trueno, línea y sistema de planta en poco tiempo. Comprometido al puesto y al sector.', 'Trabajo en equipo, logra adaptarse y llevar de muy buena manera el equipo de trabajo. Se acopla muy bien a líderes y no tan sólo aprende de ellos, sino que aporta ideas creativas a la mejora. Muy rápido aprendizaje, flexibilidad', 'Seguridad, es importante que ante la duda se pregunte. Mantenimiento de condiciones de la línea hacen a la seguridad del sector. Como líder se es referente de muchas actividades. Especificaciones de producto, crítico el puesto (se hace cargo de desvíos).', '', ''),
(2231, '2021', 1, 36, 354, 0, 'MB', 'Colaborador muestra muy buen desempeño, muy afianzado con el equipo de playa y con su puesto de trabajo', 'Trabajo en equipo, compromiso, proactividad', 'Importante la comunicación respecto a autoelevadores, no NORMALIZAR el mal estado, y tener en cuenta la criticidad de manejar un equipo con desvíos deseguridad', '', ''),
(2232, '2021', 1, 36, 557, 0, 'B', 'Colaborador trabaja mejor en playa, se adapta a equipo. Muestra compromiso', 'Flexibilidad', 'Dinámica, mostrarse y aportar en todos los puestos que ocupa, no sólo en playa', '', ''),
(2233, '2021', 1, 36, 677, 0, 'B', 'Colaborador tiene algunas dificultades para adaptarse al puesto de trabajo, generando algunas detenciones en la línea.', '', 'Compromiso y participación fines de semana. Trabajar en proactividad y aportar en tiempos ociosos a otros puestos de trabajo. Seguridad, estado de autoelevador y desvíos en el mismo, uso de EPP', '', ''),
(2234, '2021', 1, 36, 594, 0, 'NM', 'Colaborador comienza la temporada con ganas, pero a medida que avanza, su desempeño cae rápidamente. Se mide com pares para ver que no hace el otro, para tampoco hacerlo el.', '', 'Poco proactivo, se le debe repetir varias veces lo mismo, no viene fines de semana, poco compromiso. No demuestra orientación a resultados, hace lo justo y necesario, o menos', '', ''),
(2235, '2021', 1, 36, 192, 0, 'B', 'Se nota un mejor desempeño respecto a años anteriores, lo marcado se mejora y se trabaja de manera más ocmunicativa y en colaboración con la línea', 'Compromiso y recepción de oportunidades de mejora marcadas en devoluciones anteriores', 'Orientación a resultados en otras líneas (doy pack), lo que también interfiere en trabajo en equipo. Conocer más de puestos, trabajar con sistema para lograr mayor autonomía. Comunicar anormalidades de equipos, son nuevos, pero eso no implica que no se deba mantener. Calidad (DP)', '', ''),
(2236, '2021', 1, 36, 115, 76.25, 'B', 'Colaboradora se muestra mejor adaptada al equipo de trabajo y contribuyendo mejor a la línea. Importante siempre duplicar ensayos ante desvío. No tomarse a mal sugerencia de personal que conoce de remachadora.', 'Se toma oportunidad de mejora de año anterior respecto a comunicación, más comunicativa y trabaja en equipo. ', 'Importante trabajar en tiempos de máquina detenida. Si bien es parte de su rol la carga en sistema, consultar cuando la línea no anda si se requiere su aporte en otro puesto o acividad.', '', ''),
(2238, '2021', 1, 36, 350, 0, 'B', 'Colaborador se nota cansado del puesto. Poco comunicador y proactivo. Equipo clave en cuanto a la calidad, la comunicación es importante', 'Conocimiento del equipo', 'Comunicación proactiva de anormalidades, propuestas en línea, demostrar dinámica de trabajo, aporte de soluciones, interés en la línea. Aprovechamiento de tiempos de línea detenida. Mantenimiento de las condiciones del sector, eso ahce a la seguridad', '', ''),
(2239, '2021', 1, 36, 595, 0, 'MB', 'Colaborador muy atendo, rápido aprendizaje y adaptación al puesto. Gana autonomía y capacidad de resolución, demuestar gran interés y compromiso', 'Compromiso, velocidad de aprendizaje. Atento a la calidad del fechado y comunicador', '', '', ''),
(2240, '2021', 1, 36, 404, 0, 'B', 'Colaborador muestra una actitud distinta a la que tenía años anteriores. Es importante que tenga en claro que tipo de desenlace tendrá en base a esto. Tiene que demostrar que realmente le interesa aportar al equipo, no elegir puesto. ACTITUD', 'Fines de semana demuestra un liderazgo y un interés que no se ve en la semana. Si a todas las actividades las hiciera con ese empeño, su resultado sería totalmente diferente.', 'Comunicación con líderes y respeto con ellos, actitud positiva en puestos, aunque no sean los esperados. Quejas permanentes y buscar el mínimo esfuerzo en las 8 horas.', '', ''),
(2241, '2021', 1, 36, 537, 0, 'B', 'Colaborador trabaja con mejor predisposición que el año anteriore. Aprende rápido de puesto de cubeteado y en baño maría, sin embargo, se muestra demasiado tranquilo, le cuesta adaptarse a la dinámica de trabajo del turno y de LTP', 'Es flexible', 'Necesita estar más atento y mejorar comunicación proactiva', '', ''),
(2242, '2021', 1, 36, 332, 60, 'B', 'Se marcan cosas el año pasado que no se notan  trabajadas: preocuparse por aprender aún más de su equipo, de baño maría, ir creciendo y ganando autonomía y conocimientos técnicos. Ser proactivo en la comunicación en cuanto a estado de equipo y ante tiempos muertos. Atención permanente en actividad. Se espera más de él', 'Compromiso', 'Tiene poca capacidad de resolución en un equipo que opera hace tiempo. No comunica como se espera, tiene que ser más proacrivo, tanto en comunicación como en aprovechamietno de tiempos', '', ''),
(2244, '2021', 1, 36, 283, 0, 'B', 'Se nota mayor empeño en comunicación de calidad del tomate. Buen trabajo y adaptación en control a la salida de remachadora', 'Buen aprendizaje', 'Aprovechamiento de tiempos, empeño en reproceso.', '', ''),
(2245, '2021', 1, 36, 120, 0, 'MB', 'Colaboradora demuestra adpatación al puesto y pese a no haber estado demasiado convencida del desafío que se le proponía, se adaptó muy bien.', 'Calidad, atenta a parámetros y a comunicar desvíos', 'Se puede seguir ganando autonomía, y aprovechamiento de tiempos de línea detenida', '', ''),
(2246, '2021', 1, 36, 164, 0, 'MB', 'Colaboradora trabaja con muy buena predisposición, muy atenta, y en equipo. Muy buena comunicación de problemas en el puesto', 'Trabajo en equipo, proactividad', 'Puede seguirse ganando autonomía y conocimiento del equipo', '', ''),
(2247, '2021', 1, 36, 119, 80, 'MB', 'Colaboradora muestra buena adaptación a la máquina, aprende mucho y gana autonomía', 'Empeño en la línea, interés en producir y en buscar objetivo en común. Compromiso', 'Formas de comunicación y referirse. Atenta a distracciones', '', ''),
(2248, '2021', 1, 36, 227, 0, 'MB', 'Colaboradora con muchas ganas de trabajar y le pone empeño a todas las tareas que realiza. Muy proactiva', 'Proactiva y muy atenta al proceso en todo momento. Trabaja en equipo buscando objetivo en común. Compromiso', 'Se puede seguir aprendiendo de equipos', '', ''),
(2250, '2021', 1, 36, 181, 0, 'B', 'Colaboradora mejora mucho su actitud respecto a animarse y trabajar en equipo', 'Compromiso, flexible', 'Autonomía, debe aprender aún más del equipo, es clave entender alarmas e ir interpretando fallas', '', ''),
(2251, '2021', 1, 36, 107, 0, 'B', 'Colaboradora conoce del equipo y aporta a la línea. ', 'Autonomía y comunicación de equipo', 'Mejorar aprovechamiento de tiempos y reprocesos', '', ''),
(2252, '2021', 1, 36, 103, 0, 'MB', 'Colaboradora trabaja con buena predisposición y siempre muy atenta al puesto de trabajo', 'Compromiso, proactividad, comunicación proactiva, autonomía y aporte al equipo', 'Formas de comunicación a pares, revisar', '', ''),
(2253, '2021', 1, 36, 121, 0, 'MB', 'COlaboradora muestra llevar muy bien el puesto de trabajo, e intentar contagiar a las compañeras del sector con esa actitud. ', 'Atenta a la calidad, y comunicadora al respecto. Buena voluntad en el puesto de trabajo', 'Compromiso fines de semana', '', ''),
(2254, '2021', 1, 36, 116, 0, 'NM', 'Colaboradora baja mucho de su puesto de trabajo, sin importar como esto impacta en la calidad del tomate que pasa a las líneas, ni en como queda el equipo de trabajo de 2da selección. Es algo que ya se ha marcado, sin embargo no se ha mejorado. Demoras en refrigerio', '', 'No muestra buena predisposición para ir a otros puestos. Compromiso bajo fines de semana, quiere venir, cuando se la cita, no cumple. Poca proactividad', '', ''),
(2255, '2021', 1, 36, 599, 0, 'B', 'Colaborador muestra capacidades de aprendizaje y potencial para crecer en la línea. Es importante que entienda la responsabilidad que implica su puesto y la comunicación correcta de las condiciones del mismo', 'Aprendizaje', 'Comunicación, formas y tiempos reales.', '', ''),
(2256, '2021', 1, 36, 306, 0, 'NM', 'Colaborador demuestra poco conocimiento del puesto de trabajo que ocupa. No se ve orientación a resultados, no se ve que conozca ni se interese por conocer la tarea que realiza. Espera que los demás resulelvan tareas y responsabilidades propias a su puesto de trabajo. Se espera otro desempeño de alguien que lleva este tiempo en un mismo puesto. No trabaja en lo más mínimo con sistema, y poco con calidad', 'Respeto', 'Autonomía, trabajo en equipo, proactividad, comunicación. Las tareas que no le gustan, son derivadas para que las haga otra persona. Se le marcan varias veces los mismos puntos a mejorar, se tienen numerosas charlas con el a lo largo de la temporada, no se preciben mejoras', '', ''),
(2257, '2021', 1, 36, 592, 0, 'B', 'Colaborador muy entusiasmado, con energía y ganas de aprender. El puesto que ocupa es muy demandante, por lo que es importante que la atención respecto a parámetrosd e calidad no baje', 'Ganas de aprender, trabajo en equipo, predisposición', 'Trabajar con el mismo empeño en todas las actividades (cañerías limpiezas fines de semana)', '', ''),
(2258, '2021', 1, 36, 636, 0, 'B', 'Colaboradora proactiva, con dinámica activa de trabajo. Muy buena predisposición', 'Predisposición, proactividad', 'Es flexible para ir al puesto que se la necesite, toma su tiempo el aprendizaje. Atenta a no correr en planta, es importante tener en cuenta aspectos de seguridad antes de enfocarse en producción', '', ''),
(2259, '2021', 1, 36, 352, 0, 'E', 'Colaborador demuestra un gran aprendizaje. Se marcaron muchas cosas a mejorar la temporada anterior. Esto fue tomado de la mejor manera, y se trabaja de manera integral, en equipo, preocupado oir dejar lo mejor en el turno y aportar sus conociemientos donde se lo necesite', 'Flexibilidad, comunicación y aprendijade de sus erorres. Compromiso, y como le enseña a compañeros. Trabajo en equipo', '', '', ''),
(2260, '2021', 1, 36, 616, 0, 'MB', 'Colaborador demuestra un muy buen desempeño, con gran proactividad, trabajo en  quipo, rápido aprendizaje, compromiso, autonomía, buena comunicación', 'Orientación a resultados, trabajo en equipo, compromiso, proactividad', 'Atento a seguridad, siempre primero pensar antes de actuar', '', ''),
(2261, '2021', 1, 36, 649, 0, 'MB', 'Colaborador proactivo, rápido aprendizaje, atento a la línea', 'Gran trabajo en equipo y aprovechamiento de tiempos. Compromiso', 'Siempre atento a la calidad, errores generan detenciones y PNC', '', ''),
(2262, '2021', 1, 36, 655, 0, 'B', 'Colaboradora demuestra temor al encarar actividades, tuvo un incidente en soudronic, lo que generó cierto rechazo a algunos puestos de trabajo, costando adaptarse a algunos puestos de trabajo', 'Trabaja bien en reproceso', 'Si no se comprende una tarea es importante para, entenderla, preguntar y luego encararla', '', ''),
(2263, '2021', 1, 5, 433, 0, 'B', '', '', '', '', ''),
(2264, '2021', 1, 5, 322, 0, 'B', '', '', '', '', ''),
(2265, '2021', 1, 5, 333, 77.5, 'MB', 'Ganas de aprender', 'Responsabilidad y comrpomiso', 'Trabajar en proactividad. No esperar orden.\r\nTrabajar en comunicación efectiva', '', ''),
(2266, '2021', 1, 5, 387, 0, 'MB', 'Uso de celular mas medido\r\nRespetar utilización de EPP\r\nTrabajar mas en GB. ', '', 'Trabajar en Comunicación\r\n', '', ''),
(2267, '2021', 1, 5, 342, 0, 'MB', 'Se observa un my buen desempeño, acorde a las necesidades el puesto.', 'Compromiso, dedicacion, responsabilidad.\r\n', 'Trabajar en afianzar el carácter y el apoyo de sus propias decisiones\r\nTrabajar en resolución de conflictos\r\nTrabajar en afianzar el trabajo en equipo\r\n', '', ''),
(2269, '2021', 1, 1, 573, 81.25, 'MB', 'LAS DEBILIDADES QUE SE OBSERVAN SON PROPIAS A TODO PERSONAL NUEVO EN LA EMPRESA', 'FLEXIBILIDAD PARA RECONOCER ERRORES, TRABAJAR EN CONDICIONES SEGURAS, TRABAJAR EN EQUIPO, RESPETO HACIA LOS DEMAS', 'ANTICIPARSE A LAS NECESIDADES,  RESOLVER PROBLEMAS POR SI MISMO', '', ''),
(2270, '2021', 1, 5, 317, 0, 'B', 'Excelente compromiso. Alta flexibilidad. \r\nAlta autonomía de maquina.\r\nSe observa un buen desempeño en general, pero debe trabajar en las competencias destacadas para mejorar.', '', 'Trabajar en proactividad. Tiempos ociosos de produccion mal gestionados. \r\nTrabajar mas en comunicacion. Linea detenida en muchas ocasiones sin ser informado. \r\nTrabajar mas en equipo y contacto con el Lider de salsa. El mismo debe gestionar la preparacion de salsa para abastecer su linea. \r\nTrabajar en autonomía del proceso.\r\nTrabajar en seguridad en lo que respecta a actos inseguros(escalera) y la utilizacion correcta de los EPP.\r\n\r\n', '', ''),
(2271, '2021', 1, 5, 117, 0, 'B', 'Se observa en general un buen desempeño. Debe trabajar en las competencias destacadas para mejorar el mismo.', 'Compromiso. Responsabilidad.', 'Trabajar en flexibilidad. Problema para reconocer errores. Problemas para cambiar de sector al generar polifuncionalidad.\r\nDificultad para acatar ordenes. \r\nTrabajar en clima laboral. Evitar situaciones de conflicto innecesario.\r\nTrabajar en el desarrollo de trabajo en equipo. Cuasta enseñar a las compañeras.', '', ''),
(2272, '2021', 1, 5, 349, 0, 'MB', 'Se observa un muy buen desempeño, debiendo esforzarse por seguir trabajando y desarrollando las competencias que aun no son fortalezas ', 'Trabajo en equipo/responsabilidad/', 'Debe trabajar mas en flexibilidad. Se observa malestar ante cambios de tarea.\r\nDebe trabajar mucho en sistema. Se observa poca proactividad en tareas asignadas.\r\nDebe trabajar mas en comunicación efectiva del sector.\r\nDebe trabajar en seguridad. Se observan desvios en la utilizacion de EPPs.\r\nDebe trabajar en proactividad. Se observan tiempos ociosos mal utilizados. Uso excesivo del celular. ', '', ''),
