(2279, '2021', 1, 5, 169, 0, 'B', '', '', 'Poca resolución de problemas en remachadora\r\nPoca autonomía.  \r\nLlenado de planillas incorrecto. \r\nNo se observa apredizaje.', '', ''),
(2280, '2021', 1, 5, 231, 0, 'B', 'Se observa un desempeño bueno.\r\n', 'Trabajo en equipo/Flexibilidad\r\nSe adapta a los equipos de trabajo. ', 'Trabajar en proactividad y autonomía', '', ''),
(2281, '2021', 1, 5, 230, 0, 'B', 'El desempeño no es el esperado. Debe trabajar mas en el empeño hacia las tareas encomendadas', '', 'Poca proactividad. Los lideres observan poco compromiso con sus tareas. (en dp sobrecarga a sus compañeras por no encajar al ritmo de la linea. En tomate marcan lo mismo)\r\nEn salsa y tomate el desempeño no es el esperado. Debe trabajar mas en el compromiso. ', '', ''),
(2282, '2021', 1, 5, 675, 0, 'MB', 'Se observa un muy buen desempeño. Debe seguir manteniendo el mismo y trabajar mas para seguir desarrolandose.', '', '', '', ''),
(2283, '2021', 1, 5, 609, 0, 'NM', 'No se observa un desempeño esperado para el puesto ocupado en linea Dp1. ', '', '', '', ''),
(2284, '2021', 1, 5, 610, 0, 'MB', 'Se observa un desempeño muy bueno en los puestos ocupados como DP2 y Tomate.', '', '', '', ''),
(2285, '2021', 1, 5, 661, 0, 'B', 'Se observa un buen desempeño para el puesto ocupado en DP2. Debe trabajar mas en orientacion a los resultados y proactividad.', '', 'Debe trabajar en proactividad.\r\n', '', ''),
(2286, '2021', 1, 5, 674, 0, 'MB', 'Excelente desempeño en todos los puestos ocupados(Salsa, Tomate y Envolvedor.', '', '', '', ''),
(2287, '2021', 1, 5, 641, 0, 'B', 'Se observa un buen desempeño. Debe conversar menos y enfocarse en sus tareas. Se observa un desempeño adecuado en Dp1', '', '', '', ''),
(2288, '2021', 1, 5, 286, 0, 'B', 'Se observa un desempeño adecuado para el puesto de envasadora, pero decrece en comparacion con otras temporadas. Debe redoblar los esfuerzos ya que ocupa un puesto sumamente critico.', '', 'Trabajar mas en calidad y segurida. En ocaciones no utiliza EPPs. Utilizacion excesiva de celular. Se observa dese la consola la utilizacion y se desconcnetra en sus tareas. ', '', ''),
(2289, '2021', 1, 5, 604, 0, 'B', '', '', '', '', ''),
(2290, '2021', 1, 5, 561, 0, 'B', 'Se observa un desempeño regular, debiendo mejorar el mismo en las competencias con menor puntaje como lo son la orientación a los resultados y el trabajo en equipo', '', '', '', ''),
(2291, '2021', 1, 5, 611, 0, 'B', '', '', '', '', ''),
(2292, '2021', 1, 5, 618, 0, 'B', '', '', '', '', ''),
(2293, '2021', 1, 5, 596, 0, 'B', '', '', '', '', ''),
(2294, '2021', 1, 5, 185, 0, 'B', 'Buen deempeño en los puestos ocupados. El desempeño es adecuado. Se desafia a seguir mejorando.', 'Flexibilidad y calidad.', 'Trabajar en proactividad. NO esperar ordenes de lideres o superiores. Evitar tiempos ociosos. Porponer mejoras en el sector. \r\nEn autonomia trabajar mas en el desarrollo de opoeracion y deteccion de anormalidades en armadora.\r\n', '', ''),
(2295, '2021', 1, 5, 188, 0, 'B', 'Se observa un desempeño adecuado para los pestos coupados. Se debe trabajar mas en las competencias con menos desarrollo para lograr un desempeño mejor.', 'Flexibilidad\r\nCalidad', 'Debe trabajar mas en proactividad. Evitar tiempos ociosos y demoras en el refrigerio. Anticiparse a necesidades operativas. Estar mas pendiente de fomentar mejoras en la linea. \r\nAutonomia debe trabajar en sistema, apreder a resolver mas por su propia cuenta y depender menos del lider o mecanico.', '', ''),
(2296, '2021', 1, 5, 267, 0, 'B', '', 'Flexibilidad.', 'Debe trabajar mas en el compromiso y trabajo en equipo. Se observa en ocasiones que no se trabaja al ritmo de la linea. Los lideres marcan esta situacion en la temporada. \r\nEsto perjudica tambien al trabajo en equipo.\r\nDebe evitar tiempos ociosos y respetar los tiempos en desayunador.\r\nDebe trabajar en proactividad. No esperar ordenes de superiores. Si la linea se detiene, debe buscar una nueva tarea.\r\nTambien se ve la calidad afectada, ya que no trabaja al ritmo de lo que la linea necesita.', '', ''),
(2297, '2021', 1, 5, 186, 47.5, 'NM', 'No se observa un desempeño adecuado para los puestos ocupados. Debe esforzarse mas.\r\nLe cuesta ser flexible. Se observa ante los cambios de puesto. Siempre busca el puesto de menor esfuerzo. El lider de salsa observa un desempeño bajo.', '', 'Debe trabajar mas en el compromiso y trabajo en equipo. Se observa en varias ocasiones que no se trabaja al ritmo de la linea. Los lideres marcan esta situacion en la temporada. Esto perjudica tambien al trabajo en equipo.Debe evitar tiempos ociosos y respetar los tiempos en desayunador.\r\nDebe trabajar en proactividad. No esperar ordenes de superiores. Si la linea se detiene, debe buscar una nueva tarea.Tambien se ve la calidad afectada, ya que no trabaja al ritmo de lo que la linea necesita.\r\n', '', ''),
(2301, '2021', 1, 5, 182, 0, 'B', 'Se observa un desempeño relativamente adecuado para los puestos ocupados. Debe esforzarse mas.\r\nLe cuesta ser flexible. Se observa ante los cambios de puesto incomodidad ', '', 'Debe trabajar mas en el compromiso y trabajo en equipo. Se observa en varias ocasiones que no se trabaja al ritmo de la linea. Los lideres marcan esta situacion en la temporada. Esto perjudica tambien al trabajo en equipo. Debe evitar tiempos ociosos y respetar los tiempos en desayunador.', '', ''),
(2302, '2021', 1, 5, 184, 0, 'B', 'Se obseva un desempeño aceptable para los puestos ocupados. Debe trabajar mas el las competencias detalladas.', '', 'Proactividad debe mejorar. Debe respetar tiempos en refrigerios. Debe evitar tiempos ociosos buscando tareas de 5S o reproceso. No esperar a un superior para que le de la orden. Se necesita mas compromiso. ', '', ''),
(2303, '2021', 1, 46, 15, 0, 'NM', 'Silvia es una colaboradora respetuosa. Se le pidió en varias oportunidades buscar un valor agregado para el puesto, trabajar con sistema y colaborar con las actividades de jornada y estándares, pero no fue satisfactorio', 'Respetuosa. En general acepta cambios de puesto pero no con plena predisposición. Experiencia en el puesto asignado que le alcanzaba para cumplir con su trabajo, pero se le solicitaba un cambio de actitud que no fue satisfactorio', 'Debe desarrollar su capacidad de comunicación de inconvenientes de la línea, participar en jornadas de autónomo y grupos de mejora. Faltó desarrollar trabajo con sistema, generación de OT. Puede mejorar su capacidad de resolución de problemas y orientar su actitud en el puesto hacia la proactividad', 'No mostró el compromiso hacia lo solicitado en anteriores evaluaciones', ''),
(2305, '2021', 1, 46, 33, 0, 'B', 'Rafael es un colaborador respetuoso, pero que puede mejorar su capacidad de comunicación y escucha. Debe desarrollar mucho su capacidad para reconocer errores u oportunidades de mejora, y así poder enfocarse en ese crecimiento. No trabaja con sistema, no aporta valor agregado para el puesto con su amplia experiencia técnica.', 'Respetuoso. Se observó leve mejora en trabajo en equipo y se lo vio con ganas de aprender nuevos conocimientos al cambiarlo de puesto. En general correcto en su trabajo con Calidad y Seguridad. En general acepta con predisposición nuevas asignaciones', 'Dificultad para aceptar errores y enfocarse en aspectos a mejorar. Sin compromiso para actividades de limpieza o estándares de fin de semana. No trabaja con sistema, no aporta valor agregado para el puesto con su amplia experiencia técnica.', '', ''),
(2306, '2021', 1, 46, 17, 0, 'B', 'Barbarita es una colaboradora que cumple con lo mínimo solicitado para el puesto, con algunos aspectos positivos en cuanto a resolución de problemas por sí misma y trabajo en equipo', 'En general correcta para trabajar con Calidad y Seguridad. Se observa que se destaca de sus compañeras al momento de tener que solucionar un problema en su sector.', 'Puede aprovechar mejor los tiempos con línea detenida, y agregar valor organizando ágilmente las tareas de reproceso con sus compañeras. Dificultad para reconocer errores y enfocarse en aspectos de mejora', '', ''),
(2308, '2021', 1, 46, 50, 0, 'B', 'Eduardo es un colaborador muy bien orientado a resultados, interesado en cumplir con los objetivos de producción. Tiene dificultades para comunicar inconvenientes y se hace más difícil su resolución. Esto puede deberse a que en situaciones bajo presión se torna ansioso/nervioso. Se observa un muy buen compromiso, predisposición y trabajo en equipo', 'Siempre bien orientado a resultados, aunque eso a veces lo torne ansioso e impaciente, con dificultades para comunicar inconvenientes. Bien gestionando pedido de insumos y químicos de limpieza. Se lo observa colaborar con el trabajo de sus compañeros. Excelente predisposición y compromiso', 'Puede mejorar su capacidad de comunicación y escucha. Se torna ansioso e impaciente trabajando bajo presión (cuando ocurren problemas). ', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2309, '2021', 1, 46, 70, 0, 'MB', 'Margarita es muy respetuosa y sabe comunicar los inconvenientes que se presentan. Le gusta mucho su trabajo y eso se nota. Impacta positivamente en el grupo de trabajo ya que siempre trata de congeniar con sus compañeros', 'Muy respetuosa y sabe comunicar los inconvenientes que se presentan. Buen trabajo en equipo. Buena orientación a resultados e interesada por cumplir los objetivos que se le solicitan. Excelente predisposición, compromiso y flexibilidad para adaptarse a todas las actividades que se le asignan', 'Puede mejorar su temple cuando se genera alguna diferencia con algún compañero, ya que impacta negativamente sobre ella y no le permite subsanarla. Puede sobrellevar mejor las frustraciones. ', '', ''),
(2311, '2021', 0, 0, 82, 0, 'NM', 'Daniel es un colaborador respetuoso, que trabaja en equipo si tiene un compañero que lo impulsa. Caso contrario no tiene una actitud proactiva y de mejora. Posee algunas dificultades para solucionar problemas de su sector por sí mismo', 'Respetuoso. Sólo agrega valor si algún compañero, Líder o Supervisor le indica alguna actividad. En general buena predisposición para aceptar oportunidades de mejora señaladas.', 'Poco comprometido con los resultados y objetivos de producción. En general no participa de actividades de limpieza y mantenimiento autónomo. Debe desarrollar trabajo con sistema, autonomía para resolver problemas por sí mismo, y proactividad para agregar valor cuando la línea está detenida. Debe mejorar su trabajo con Calidad y BPM, se le llamó la atención por estos aspectos.', '', ''),
(2312, '2021', 1, 46, 82, 0, 'NM', 'Daniel es un colaborador respetuoso. En general requiere de algún compañero que lo impulse para agregar valor cuando la línea está detenida. No tiene actitud proactiva', 'Respetuoso. En general correcta predisposición para llevar a cabo las tareas pero requiere de algún compañero que lo impulse y que le ayude a solucionar los problemas.', 'Poco comprometido con las actividades de limpieza y mantenimiento autónomo. Debe desarrollar trabajo con sistema. No resuelve problemas de su sector con autonomía, requiere siempre de la asistencia de alguien más. Debe mejorar aspectos de Calidad y BPM, se le llamó la atención en dos oportunidades respecto a eso.', '', ''),
(2313, '2021', 1, 46, 207, 72.5, 'B', 'Luis es un colaborador muy observador. Siempre señala desvíos o realiza comentarios de cuestiones que podrían mejorarse. ', 'Buen observador de desvíos y aspectos a solucionar. Buena autonomía para solucionar problemas. Cuando se tiene un inconveniente se suma al análisis para encontrar una solución y emite sugerencias.', 'Poca participación en actividades de limpieza y mantenimiento autónomo. Puede mejorar su capacidad de comunicación y escucha. No trabaja con sistema. Posee ciertas dificultades para aceptar errores y nuevas asignaciones/cambios de puesto', '', ''),
(2314, '2021', 1, 46, 67, 80, 'MB', 'Daniel es un colaborador con gran autonomía. Resuelve problemas por sí mismo. Buena capacidad de gestión de la disciplina. Siempre interesado por mantener orden y limpieza de los sectores a cargo. Excelente orientación a resultados. Puede mejorar en el uso de EPP y en el liderazgo ejemplar', 'Buena capacidad de gestión de la disciplina del personal a cargo. Buena autonomía. Excelente compromiso y predisposición con las líneas que lidera y el equipo de trabajo. Excelente orientación a resultados', 'Puede mejorar comunicación con sus pares. Posee dificultades para aceptar errores u oportunidades de mejora que se señalan. Debe desarrollar capacidad de seguimiento y revisión de Plan Maestro. Puede mejorar algunos aspectos de Seguridad.', '', ''),
(2316, '2021', 1, 46, 223, 0, 'MB', 'Daniel es un colaborador referente para las líneas en Seguridad, y además trabaja muy bien con aspectos de Calidad. En general buena gestión de la disciplina del personal a cargo, puede mejorar en materia de 5S. Muy buena orientación a resultados, compromiso y predisposición con los objetivos de producción.', 'Daniel es un colaborador referente para las líneas en Seguridad, y además trabaja muy bien con aspectos de Calidad. En general buena gestión de la disciplina del personal a cargo. Muy buena orientación a resultados, compromiso y predisposición con los objetivos de producción.', 'Puede mejorar en materia de 5S y su aplicación en las líneas que lidera. Debe continuar aprendiendo en su desarrollo en Doypack. Puede mejorar la comunicación con sus pares. No ha logrado insertarse en la implementación y seguimiento del Plan Maestro. A veces, cuando se generan conflictos, se dificulta la comunicación, el entendimiento de algunas situaciones y cómo resolverlas', '', ''),
(2317, '2021', 1, 46, 148, 0, 'NM', 'Dante es un colaborador que debe mejorar mucho en la mayoría de los aspectos evaluados. En general poca preocupación para con el cumplimiento de objetivos y sobre todo ningún compromiso en las actividades de limpieza y mantenimiento autónomo. Rígido, incapaz de reconocer errores. Muy poco proactivo y no resuelve problemas con autonomía', 'En general se lo observa respetuoso y acepta las tareas que se le asigna', 'En general poca preocupación para con el cumplimiento de objetivos y sobre todo ningún compromiso en las actividades de limpieza y mantenimiento autónomo. Cuando se le marcaron oportunidades de mejora no presentó capacidad de comunicación y escucha, y se lo observó rígido, incapaz de reconocer errores. Se le llamó la atención en un evento que atentaba contra la Seguridad y la Calidad. Muy poco proactivo y no resuelve problemas con autonomía', '', ''),
(2318, '2021', 1, 46, 272, 83.75, 'MB', 'Daniel es un colaborador con muy buena orientación a resultados, compromiso y predisposición para el cumplimiento de objetivos de producción. Muy buen comunicador cuando debe señalar algún inconveniente a resolver. Respetuoso', 'Daniel es un colaborador con muy buena orientación a resultados, compromiso y predisposición para el cumplimiento de objetivos de producción. Muy buen comunicador cuando debe señalar algún inconveniente a resolver. Respetuoso. ', 'Puede mejorar en la detección de desvíos de 5S y su correcta implementación. Puede continuar mejorando en intervenciones con Seguridad y en la detección de desvíos a mejorar. Cuando la línea funciona sin inconvenientes podría agregar aún más valor trabajando en alguna actividad de Plan Maestro o manteniendo 5S del Sector. ', '', ''),
(2319, '2021', 1, 46, 94, 0, 'MB', 'Deolinda es una colaboradora bien orientada a resultados y cumplimiento de objetivos. Participa en jornadas de limpieza. Es polifuncional a varios sectores. Puede continuar mejorando su capacidad de aprendizaje y adaptación a nuevas asignaciones.', 'Bien orientada a resultados y cumplimiento de objetivos. Es polifuncional a varios sectores. Es respetuosa y sabe comunicar. Correcto desempeño con Calidad y Seguridad.', 'Puede continuar mejorando su capacidad de aprendizaje y adaptación a nuevas asignaciones. Puede mejorar su capacidad de resolución de problemas del sector y saber aprovechar los tiempos con línea detenida para organizar de forma ágil las tareas de reproceso.', '', ''),
(2320, '2021', 1, 46, 89, 0, 'B', 'Claudia es una colaboradora respetuosa, aunque reservada. En general se observa buena orientación a resultados y relación cordial con sus compañeras', 'Respetuosa. En general se observa buena orientación a resultados y relación cordial con sus compañeras. Correcto desempeño con Calidad y Seguridad', 'Puede mejorar el aprovechamiento del tiempo con línea detenida. Es importante capitalizar ese tiempo para organizar en forma ágil las tareas de reproceso, o bien orden y limpieza del sector. Puede desarrollar su capacidad para resolución de problemas del sector por sí misma.', '', ''),
(2321, '2021', 1, 46, 71, 80, 'B', 'Roxana es una colaboradora respetuosa, con buena comunicación. ', 'Relación cordial con sus pares. En general buena observadora y correcto anticipo a necesidades futuras. Correcto desempeño con Calidad. ', 'Se le marcó algunos aspectos de Seguridad a mejorar (actos inseguros). En ocasiones tuvo objeciones cuando se le asignó un cambio de puesto, no se mostró flexible.', '', ''),
(2322, '2021', 1, 46, 122, 0, 'B', 'Sonia es una colaboradora con buena orientación a resultados. Correcto desempeño con Calidad y Seguridad', 'Buena orientación a resultados. Correcto desempeño con Calidad y Seguridad. En general buena aceptación a nuevas asignaciones', 'Puede mejorar su capacidad de resolución de problemas y el aprovechamiento de tiempo cuando la línea está detenida (organización de tareas de reproceso). Puede desarrollar la comunicación de aspectos de su sector que pueden mejorarse', '', ''),
(2323, '2021', 1, 46, 97, 56.25, 'B', 'Marisa es una colaboradora que debe mejorar su capacidad para reconocer oportunidades de mejora y enfocarse en ese crecimiento personal. ', 'En general correcto desempeño con Calidad y Seguridad', 'En general no flexible para adaptarse a todas las asignaciones. Poca autonomía para resolución de problemas. Debe mejorar su actitud para agregar valor cuando la línea está detenida. Poco compromiso con tareas de limpieza y mantenimiento autónomo. Debe desarrollar capacidad de comunicación para tratar los problemas desde un punto de vista constructivo', '', ''),
(2324, '2021', 1, 46, 300, 0, 'MB', 'Oscar es un colaborador bien orientado a resultados, aunque no participe de algunas actividades que se le solicitaron. Mejoró su capacidad de comunicación y escucha. Buen compromiso en tareas de limpieza y mantenimiento autónomo.', 'Bien orientado a resultados. Mejoró su capacidad de comunicación y escucha. En general correcto desempeño con Calidad y Seguridad. Buen compromiso en tareas de limpieza y mantenimiento autónomo.', 'Puede mejorar su conocimiento de CFA para colaborar con su compañero cuando la línea está detenida. Puede aprovechar mejor los tiempos cuando la línea se encuentra en perfecto funcionamiento (agregando valor para el sector). En ocasiones no acepta fácilmente oportunidades de mejora señaladas.', '', ''),
(2325, '2021', 1, 46, 210, 0, 'MB', 'Oscar es un ejemplo como colaborador de la planta en muchos aspectos. A su edad, cuenta con un espíritu incansable, muy dedicado. Excelente compromiso y predisposición para cumplimiento de objetivos de producción.', 'Excelente compromiso y predisposición para cumplimiento de objetivos de producción. Excelente trabajando con Calidad. Excelente anticipándose a necesidades futuras y correcto trabajo en equipo. Siempre intentando resolver problemas por sí mismo', 'Al ser tan dedicado y orientado a resultados, a veces se torna ansioso para resolver los problemas que se le presentan. Eso hace que no pueda comunicarlo con claridad y que a veces incurra en un acto inseguro. En ocasiones no recibe de forma correcta las oportunidades de mejora señaladas', '', ''),
(2326, '2021', 1, 46, 221, 0, 'B', 'Raul es un colaborador que, a pesar de ser reservado, en general comunica desvíos y cuestiones a resolver. En general, se desarrolla con muy poca autonomía y es un poco resistente a los cambios de puesto. En general bien orientado a resultados, aunque en ocasiones se le ha solicitado ayuda con algunas tareas sin mostrarse interesado.', 'Comunica desvíos y cuestiones a resolver. Respetuoso. En general bien orientado a resultados.', 'Debe mejorar su capacidad de resolución de problemas de su sector. No se muestra abiertamente predispuesto a nuevas asignaciones, puede mejorar su flexibilidad.', '', ''),
(2327, '2021', 1, 46, 279, 0, 'MB', 'Ariel es un colaborador con muy buenas habilidades técnicas, con gran capacidad de resolución de problemas del equipo que opera. Excelente compromiso y predisposición para cumplir objetivos de producción, tareas de limpieza y mantenimiento autónomo.', 'Muy buenas habilidades técnicas, con gran capacidad de resolución de problemas del equipo que opera. Excelente compromiso y predisposición para cumplir objetivos de producción, tareas de limpieza y mantenimiento autónomo. Respetuoso. Relación cordial con sus compañeros.', 'Puede mejorar su relación con el resto del equipo de tomate. Debe estar comprometido con los objetivos globales, no sólo de producción de pasta, si no también de consumo y de producción de latas. Puede mejorar la comunicación acerca de inconvenientes o cuestiones a mejorar', '', ''),
(2328, '2021', 1, 46, 53, 86.25, 'MB', 'Olga es una colaboradora muy respetuosa, siempre bien predispuesta a nuevas asignaciones. Debe desarrollar su capacidad para resolver nuevos problemas por sí misma', 'Muy respetuosa, siempre bien predispuesta a nuevas asignaciones. Correcto desempeño con Seguridad y Calidad. Interesada por el cumplimiento de objetivos y con buen trabajo en equipo. Muy positivo su trabajo de administración en el grupo base', 'Debe desarrollar su capacidad para resolver nuevos problemas por sí misma. En ocasiones un poco resistente a nuevas asignaciones. Debe desarrollar su capacidad de generación de sugerencias de mejora y aprendizaje sobre el grupo base del cual es parte.', '', ''),
(2329, '2021', 1, 46, 250, 88.75, 'MB', 'Marcelo formó un gran equipo con su dupla en temporada. Se combinaron y adaptaron muy bien. Buenas habilidades técnicas y buena transferencia de conocimiento hacia sus pares.', 'Respetuoso y sincero al expresarse. Buena capacidad de adaptación al equipo de trabajo. En general muy bien trabajando con Calidad y Seguridad. Buena predisposición y compromiso para con el cumplimiento de objetivos de producción, actividades de limpieza y mantenimiento autónomo.', 'Puede mejorar su capacidad de trabajo en equipo para relacionarse mejor con el operador de Consola, líderes de Molienda y Playa. Puede continuar desarrollando su trabajo con sistema. En varias ocasiones se le marcó que debía involucrarse más con los problemas de las líneas y prestar colaboración para cubrir el refrigerio.', '', ''),
(2331, '2021', 1, 46, 216, 71.25, 'B', 'Oscar es un colaborador en general bien orientado a resultados, con posibilidades de mejora en la comunicación con sus pares y el trabajo en equipo.', 'En general, bien orientado a resultados. Correcto desempeño con Calidad y Seguridad. Buena colaboración en reemplazo del chofer. Buena participación en el grupo base', 'Debe mejorar su capacidad de trabajo en equipo y su comunicación con sus pares. En general no resuelve con autonomía y requiere de otras personas para resolver problemas de su sector. Puede mejorar su proactividad para aprovechar los tiempos con línea detenida para agregar valor. Debe poner más atención en la operación para evitar cometer errores graves. Puede mejorar en su trabajo con sistema, generación de OT. No se muestra con amplia predisposición a nuevas asignaciones', '', ''),
(2335, '2021', 1, 46, 274, 0, 'B', 'David no ha tenido buen desempeño como Líder de línea, pero como operador de puesto crítico alcanza los requerimientos. Deberá mejorar mucho los aspectos señalados.', 'Buenas habilidades técnicas (Doypack), faltó aprender en otros sectores. En general bien orientado a resultados. Buen compromiso y predisposición en actividades de limpieza y mantenimiento. Correcto trabajo en equipo y comunicación con sus pares. Buen trabajo con sistema. Resuelve con autonomía (Doypack), faltó desarrollar en otros sectores.', 'Cuando se le marca oportunidades de mejora no siempre se encuentra ampliamente predispuesto. A veces rígido para aceptar errores y aspectos a mejorar. Puede seguir mejorando su desempeño con Seguridad y Calidad. Como líder faltó capacidad de gestión de la disciplina del personal a cargo, foco en actividades productivas y no productivas, visión de mejora continua, afianzarse en la parte técnica', '', ''),
(2336, '2021', 1, 5, 73, 72.5, 'B', 'Se observa un desepeño adecuado para las tareas desempeñadas.', 'Flexibilidad y calidad son aspectos destacables.\r\nSe nota un cambio en la forma de trabajar en equipo, cambiando de manera positiva a lo largo del año.', 'Debe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera improductiva. \r\nTrabajar mas en equipo para lograr resultados mancomunados. \r\nUtiliza auriculares. Esta prohibido usarlos. \r\nElevar autonomía según requerimientos del puesto. No resuelve problemas.\r\nDebe trabajar mas en sistema. Trabajar  con Participación activa en generación de propuestas.', '', ''),
(2337, '2021', 1, 5, 18, 77.5, 'B', 'Es una operaria muy responsable. Su desempeño es bueno para los puestos que ha ocupado', 'Responsabilidad, Flexibilidad y calidad son aspectos destacables', 'Trabajar mas en equipo para lograr resultados mancomunados.\r\nElevar autonomía según requerimientos del puesto. Debe trabajar mas en sistema. Debe tener participación activa en propuestas de mejora de los puestos de trabajo.\r\n', '', ''),
(2338, '2021', 1, 5, 30, 76.25, 'B', 'Se observa un buen desempeño, acorde a los puestos ociados. \r\nDebe trabajar mas en sistema, no debe depender a esta altura del lider para las tareas asignadas. \r\nDebe tener participación activa en el GB y generar lups y ots.\r\nDebe dejar de utilizar en exceso el celular. ', 'Trabajo en equipo y flexibilidad son aspectos destacables. \r\nTambién lo son el compromiso y la responsabilidad.', 'Debe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera improductiva. \r\nDebe trabajar mas en autonomía según requerimientos de los puestos ocupados. Se observa un buen desempeño pero condicionado por conocimientos técnicos no asimilados.', '', ''),
(2339, '2021', 1, 5, 36, 0, 'MB', '', 'Sumado al buen desempeño deben sumarse la responsabilidad y el compromiso como fortalezas destacables', 'Debe seguir trabajando en el aprendizaje del sistema y elevar la autonomía en cuadros de reemplazo en puesto de administrador de oficina de producción', '', ''),
(2340, '2021', 1, 5, 72, 65, 'B', 'Se observa un desempeño adecuado para los puestos en los que ha trabajado.\r\nSe observa mejoría en su desempeño respecto a la seguridad.', 'Responsabilidad y calidad son aspectos destacables en su desempeño.', 'Debe trabajar mas en orientación a los resultados. En el global hay mucho para trabajar.\r\nDebe mejorar las formas en el trato hacia su superior directo. No se dirige de manera respetuosa, por lo tanto cuesta ver el trabajo en equipo de manera natural y espontanea.\r\nLa proactividad es un punto a trabajar. Se notan desvíos en situaciones que no se deberían darse por que espera una orden y no aprovecha los tiempos de manera efectiva para obtener resultados positivos.\r\nSe observa una autonomía condicionada. ', 'No se compromete con el autónomo en el puesto. Debe trabajar mas en esta competencia. El operador es el responsable de mantener en condiciones básicas su equipo.\r\nProactividad: Producto no retornado.\r\nNo trabaja con el sistema. Baja generacion de lups y ots.', ''),
(2341, '2021', 1, 5, 78, 72.5, 'B', 'Se observa un desempeño adecuado para los puestos en los que ha trabajado.', 'seguridad y calidad son aspectos destacables', 'Debe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera improductiva. \r\nTrabajar mas en equipo para lograr resultados mancomunados. \r\nElevar autonomía según requerimientos del puesto.', '', ''),
(2342, '2021', 1, 5, 84, 0, 'MB', '', 'Gran preocupacion por alcanzar los resultados. \r\nFlexibilidad es un aspecto muy destacable.', 'Debe trabajar mas en la comunicación. Se nota que cuesta tener charlas difíciles tanto con el personal a cargo y pares como con el superior a cargo, generando interferencia para poder trabajar en equipo y lograr resultados de manera mancomunada.\r\nDebe trabajar mas en seguridad. Se observan desvios con el personal a cargo no detectados por el lider. \r\n ', '', ''),
(2343, '2021', 1, 5, 87, 75, 'B', 'Se observa un buen desempeño, adecuado para los puestos en los que ha trabajado. Se observa el esfuerzo por querer seguir mejorando.\r\nDebe trabajar mucho en sistema. Debe tener participación activa en el GB, generar ot y trabajar sobre los preventivos, mejorando su capacidad técnica.', 'Flexibilidad es un aspecto sumamente destacable.\r\nTrabajo em equipo y proactividad', 'Debe trabajar mas en autonomía para lograr resultados de alto desempeño. Ocupa puestos de reemplazo pero técnicamente faltan conocimientos por adquirir.\r\nDebe trabajar mas en seguridad. Si bien se nota una preocupación por lo mencionado, debe ser constante en el trabajo con seguridad respecto de los epp y las condiciones de los puestos en los que se desempeña.\r\nDebe dejar de utilizar en exceso el celular.', '', ''),
(2344, '2021', 1, 5, 95, 77.5, 'B', 'Se observa un desempeño adecuado para los puestos en los que ha trabajado. \r\n', 'Se destaca el compromiso, la responsabilidad y la flexibilidad como aspectos positivos de su desempeño', 'Debe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera productiva. \r\nTrabajar mas en equipo para lograr resultados mancomunados. \r\nDebe trabajar mas sobre su autonomía, adquiriendo conocimientos en profundidad para poder elevar sus conocimientos técnicos y así poder desempeñarse de manera idónea en los puestos ocupados.', '', ''),
(2345, '2021', 1, 5, 98, 68.75, 'B', 'Se observa un desempeño adecuado para los puestos ocupados. \r\nDebe trabajar mas en el compromiso de los puestos. No viene los fines de semana.', 'Se destaca la flexibilidad y seguridad como aspectos positivos en su desempeño', 'Ingreso a planta con bolsa. No se puede ingresar a planta con ningún tipo de bolsa o bolso.\r\nDebe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera productiva. \r\nTrabajar mas en equipo para lograr resultados mancomunados. \r\nElevar autonomía según requerimientos del puesto.\r\nDebe trabajar mas en la comunicación efectiva.\r\nDurante el año se solicita sacar anillo.', '', ''),
(2346, '2021', 1, 5, 99, 68.75, 'B', 'Se observa un desempeño adecuado para los puestos en los que se ha desempeñado.\r\nDebe trabajar en flexibilidad. Se observa negación al recibir orden de lider para rotar en remachadora.', 'Compromiso con la calidad y seguridad son un aspectos a destacar', 'Debe trabajar mas en proactividad. Espera orden de superior directo, Utilizar los tiempos ociosos de manera improductiva. \r\nTrabajar mas en equipo para lograr resultados mancomunados. \r\nElevar autonomía según requerimientos del puesto. Se nota un buen desempeño en FEM, pero debe seguir trabajando.', '', ''),
(2347, '2021', 1, 5, 138, 0, 'B', '', 'Responsabilidad, calidad, flexibilidad y compromiso son aspectos destacables.\r\nSe observa un cambio positivo en la seguridad, pero debe seguir trabajando.', 'Se observa una orientación a los resultados alta, pero se ve empañada por la proactividad. Espera orden de los superiores sabiendo cuales son sus obligaciones y pierde tiempo en situaciones ociosas.\r\nDebe trabajar sobre la autonomía. Le cuesta resolver por si solo.\r\nDebe trabajar mas en comunicaciones. Situaciones de comunicación innecesarias. Exceso de comunicación no efectiva.\r\n', '', ''),
(2348, '2021', 1, 5, 141, 70, 'B', 'Se observa un desempeño adecuado para los puestos en los que se ha desempeñado. ', 'Trabajo en equipo, seguridad y calidad son aspectos destacables. ', 'Debe trabajar mas en proactividad. Se observan tiempos ociosos mal aprovechados. Espera orden de superior para realizar una tarea que ya sabe que le van a asignar.\r\nDebe trabajar mas en autonomía. No trabaja con sistema. No genera Lups ni ots. \r\nDebe trabajar en el compromiso. No viene los fines de semana, aunque sepa que nadie puede cubrirlo.', '', ''),
(2349, '2021', 1, 5, 146, 70, 'B', 'Se observa un desempeño adecuado para los puestos en los que ha trabajado. \r\nUso excesivo del celular. Se desconcentra de las tareas que esta realizando, generando situaciones propicias para tener accidentes, además de no cumplir con sus obligaciones. ', 'Trabajo en equipo, flexibilidad\r\nSe destaca la autonomía, pero se ve empañada por la proactividad, además de que la misma se observa estancada, costando adquirir nuevas habilidades requeridas para el puesto ocupado.', 'Debe trabajar mas en comunicación efectiva. Se observan desvíos no comunicados.\r\nDebe trabajar en proactividad. Muchos tiempos ociosos mal utilizados. Espera ordenes del superior para mantener sector y buscar tareas alternativas.\r\n', '', ''),
(2351, '2021', 1, 5, 173, 78.75, 'B', 'Se observa un buen desempeño, adecuado para el puesto ocupado. Debe trabajar en proactividad respecto de 5S en planta y observado de la mano de calidad. ', 'Responsabilidad, proactividad, trabajo en equipo, flexibilidad y calidad son aspectos destacables.', 'Debe trabajar mas en comunicación fluida con los superiores. Se observan desvíos no mencionados.\r\nLa autonomía es destacable, pero no se observa que trabaje con sistema. No hay propuestas de mejora en lo que respecta a su puesto de trabajo. No hay lups ni ots\r\n', 'Debe trabajar mas en el compromiso. Se observa que solo si se viene a trabajar en el autoelevador el operario viene. De lo contrario no se ofrece para colaborar en otros puestos.', ''),
(2352, '2021', 1, 5, 179, 70, 'B', 'Se observa un desempeño relativamente adecuado para el puesto asignado\r\nDentro de orientación a los resultados, le cuesta trabajar con los estándares a nivel general, por ej, no llena planillas de manera correcta..\r\nPor otro lado debe trabajar mas en el compromiso. Habiendo muchas tareas por hacer y mejorar, el operario se va temprano o no viene cuando le toca. ', '', 'Si bien existe la comunicación, se observan desvíos que no son mencionados para su resolución. Esto también impacta en la autonomía hacia la resolución de los problemas por si solo, ya que en general depende de otro para resolver, pero no ha sido comunicado.\r\nLe cuesta trabajar en equipo. Le cuesta adaptarse a distintos perfiles, pero se destaca el esfuerzo al trabajar con personal no idóneo.\r\n', 'Debe trabajar mas en calidad. En muchas ocasiones se observan desvíos engomadora que pueden solucionarse trabajando de manera proactiva. No avisa cuando tiene desvíos en los contadores de tapas.\r\nDebe trabajar mas en autonomía. Se nota mejoría a lo largo del año, pero la situación es cíclica. \r\nDebe trabajar en conjunto con los pares al momento de tener que resolver situaciones en los equipos, y no quedarse de lado. ', ''),
(2353, '2021', 1, 5, 199, 0, 'B', '', 'Calidad  son aspectos destacables. ', 'Debe trabajar mas en equipo. Se observa la linea detenida en equipos que ha manejado y no se aporta para encontrar la solución de manera mancomunada. Debe dejar de lado las diferencias.\r\nDebe trabajar mas en proactividad. No esperar ordenes del superior.\r\nDebe trabajar mas en flexibilidad. Se observa que si no se trabaja a su forma o manera esta mal. Debe lograr acuerdos y estar abierto a nuevas propuestas y estándares diferentes.\r\nDebe trabajar mas en comunicación efectiva del puesto con el lider. (desvíos', '', ''),
(2354, '2021', 1, 5, 215, 50, 'B', 'Se observa un desempeño relativamente adecuado para los puestos en los que se ha desempeñado.\r\nDebe trabajar en seguridad. Se observa en reiteradas ocasiones desvíos en la no utilización de EPP.\r\nDebe dejar de utilizar el celular de manera excesiva.', 'Comunicación es un aspecto a destacar en el operario.', 'En orientación a los resultados se observa poco interés en alcanzar los resultados preestablecidos. Llega tarde a la linea, pero se observa una mejoría con el correr del tiempo. Debe trabajar mas en autonomía. Espera ordenes del lider sabiendo cuales son sus obligaciones. Debe ser mas proactivo. Tiempos ociosos mal utilizados. De todas maneras se observa una leve mejoría. \r\nDebe trabajar en calidad. Utiliza mal el barbijo\r\nDebe trabajar en el llenado correcto de los registros.', '', ''),
(2357, '2021', 1, 46, 58, 0, 'B', 'Patricia es una colaboradora siempre interesada en producir con Calidad y Seguridad. Con buena presencia en actividades de limpieza y mantenimiento autónomo. En general no se muestra tan flexible a nuevas asignaciones. Al no rotar genera complicaciones con el resto de sus compañeras. Falta mejorar la organización de forma ágil de las tareas de reproceso para agregar valor en momentos con línea detenida.', 'Marcado perfil orientado hacia la Calidad. Desempeño correcto con Seguridad. En general buena presencia en actividades de limpieza y mantenimiento autónomo. Interesada en producir con Calidad y Seguridad', 'Genera inconvenientes al no rotar con sus compañeras. En general no se muestra abierta a nuevas asignaciones. Falta desarrollar proactividad para que las tareas de reproceso realmente agreguen valor (organización en forma ágil). Se observan limitaciones para la resolución de problemas', '', ''),
(2358, '2021', 1, 46, 246, 68.75, 'NM', 'Carlos deberá mejorar de ahora en más en su rol como Líder de línea, y participante importante en la coordinación de tareas de producción y mantenimiento autónomo. Su desempeño ha bajado en los últimos 6 meses.', 'En general fluida comunicación y permanente escucha. Respetuoso. Ha dado muestras de compromiso e interés por el cumplimiento de objetivos. En general correcto desempeño para trabajar con Calidad. En general flexible para aceptar cambios de decisiones y nuevas asignaciones, aunque debe trabajar en la adaptación a esos cambios.', 'Se observan dificultades para trabajar en equipo con sus pares (líderes y mecánicos). Eso hace que se generen complicaciones para desarrollar el sistema de mejora continua (planificación, jornadas de mantenimiento autónomo, grupos de mejora). Debe aportar más desde su posición para mejorar aspectos de Seguridad de las líneas. Puede mejorar gestión de la disciplina y orientación a la mejora del personal a su cargo. Debe enfocarse en el seguimiento y ejecución de las tareas de mantenimiento autónomo; en ocasi', '', ''),
(2359, '2021', 1, 46, 291, 60, 'B', 'Andrés debe mejorar en la resolución de problemas y aprender a adaptarse mejor a nuevas asignaciones', 'Respetuoso. En general buena predisposición para aceptar cambios de decisiones y nuevas asignaciones. Correcto desempeño con Seguridad, puede mejorar en la detección y comunicación de desvíos.', 'Debe desarrollar la capacidad de resolución de problemas por sí mismo y su capacidad de aprendizaje. Acepta bien nuevas asignaciones pero le cuesta adaptarse. En ocasiones se le marcaron desvíos de Calidad de ingredientes dosificados que no supo plantear para mejorar. ', '', ''),
(2363, '2021', 1, 5, 203, 43.75, 'NM', 'Se observa un desempeño no satisfactorio para los puestos en los que se ha desempeñado.\r\nLe cuesta trabajar en equipo. Le cuesta adaptarse a distintos perfiles y puestos. Sobrecarga a los compañeros. Se demora en el desayunador.\r\nDebe dejar de utilizar de manera arbitraria el celular. \r\nLlega tarde al puesto de trabajo.', '', 'Dentro de orientación a los resultados, le cuesta trabajar con los estándares a nivel general, por ej, no llena planillas de estándares ni las de detenciones.\r\nPor otro lado debe trabajar mas en el compromiso. Habiendo muchas tareas por hacer y mejorar el operario se va temprano o no viene cuando le toca. \r\n\r\n', 'Sale afuera a hablar por teléfono dejando la linea sin su atención. \r\nSe le da la orden de pailar tapas y no lo hace cuando esta del lado del Blc.\r\nNo se preocupa por las 5S del sector. Siempre trabaja de manera desordenada y con el sector sucio. ', ''),
(2364, '2021', 1, 5, 205, 67.5, 'B', 'Se observa un desempeño relativamente adecuado para el puesto en el cual se desempeña.\r\nUtilización incorrecta de alhajas. Usa cadena. Mangas arremangadas.\r\nDebe respetar cadenas de mando. Debe trabajar en comunicación fluida con el lider. Mejor respecto de evaluación anterior.', 'Flexibilidad, compromiso, responsabilidad son algunos aspectos destacables.', 'Debe trabajar en comunicación efectiva.\r\nDebe trabajar mas en autonomía. No posee los conocimientos necesarios para desenvolverse solo y resolver situaciones del día a día. No se observa mejoría, amen de haber dado los espacios de aprendizaje. Debe redoblar los esfuerzos.\r\nDebe trabajar mas en seguridad. Se observa en reiteradas ocasiones la falta o el no uso de EPPs.', '', 'Debe trabajar mas en sistema. No hay propuestas. No se observa mejoría respecto del año anterior en manejo de PC,(spc)'),
(2365, '2021', 1, 5, 211, 80, 'MB', 'Se observa un muy buen desempeño,\r\nDebe trabajar fuertemente en el sistema. No se observa el manejo fluido de gestión de repuestos, necesario para el sector en el que trabaja.\r\nDebe trabajar en la polifuncionalidad. Debe aprender en la envasadora. Ya fue marcado en su momento. No se observa la intención de generarla.', 'Se destaca la orientación a los resultados, el compromiso y el trabajo en equipo como grandes fortalezas.', 'Debe trabajar mas en comunicación. Muchas veces se observa resolviendo desvíos, pero no se comunican en tiempo y forma.\r\nDebe trabajar mas en proactividad. Uso de celular mientras trabaja, cosa que también afecta a la seguridad, por que se desenfoca de las tareas.', '', ''),
(2366, '2021', 1, 5, 380, 0, 'B', 'Se observa un buen desempeño para el puesto en el que se ha desempeñado.', 'Calidad, seguridad, flexibilidad y responsabilidad son aspectos a destacar.', 'Trabajar en comunicación efectiva.\r\nDebe trabajar mas en proactividad. Adelantarse a los desvíos. Tiempos ociosos mal utilizados.\r\nDebe trabajar mas en autonomía. La misma es baja dada la falta de experiencia.', '', ''),
(2367, '2021', 1, 5, 214, 70, 'B', 'Se observa un desempeño adecuado para los puestos ocupados.\r\nMejorar la proactividad. Tiempos ociosos mal utilizados. \r\nFin se semana no estaba autorizado y se fue. ', 'Responsabilidad, compromiso y flexibilidad son competencias destacables. ', 'Debe trabajar mas en autonomía. Debe resolver mas por si solo. Debe completar correctamente los registros. No llena planillas, HR y Registros diarios. Se saco producto no conforme por esta situación en DP.\r\nDebe trabajar mas en sistema. Participar activamente en los Gb.\r\nDebe trabajar en seguridad. Se observan reiterados desvíos en el uso de los Epps.\r\n', '', ''),
(2368, '2021', 1, 48, 304, 96.25, 'E', 'Andrés es un excelente líder. Una persona que aplica sus conocimientos técnicos de muy buena manera, sin dejar de lado el sentido común. Autónoma, trabaja en equipo y con gran adaptabilidad a cambios.', 'Conocimientos técnicos\r\nFlexibilidad.\r\nAdaptabilidad.\r\nTrabajo en equipo.', '', '', 'Siempre predispuesto a ampliar sus conocimientos técnicos y a mejorar.'),
(2370, '2021', 1, 48, 86, 68.75, 'B', 'Hector es una persona participativa, que cumple con las colaboraciones que se le pide, pero puede mejorar mucho más en el puesto, proponiendo ideas y levantando la mano en distintas anormalidades que se presenten.', '', '', '', ''),
(2373, '2021', 1, 5, 699, 76.25, 'B', '', '', '', '', ''),
(2374, '2021', 1, 5, 642, 0, 'B', '', '', '', '', ''),
(2375, '2021', 1, 5, 662, 0, 'B', '', '', '', '', ''),
(2376, '2021', 1, 5, 663, 0, 'B', '', '', '', '', ''),
(2378, '2021', 1, 5, 305, 81.25, 'MB', 'Se observa un muy buen desempeño. Debe trabajar en los comentarios mencionados. ', 'Son muchas fortalezas, pero se destacan el trabajo en equipo, la responsabilidad, el compromiso.', 'Debe trabajar en orientación a los resultados. No por producir debe dejar de lado las demás competencias, como por ejemplo la seguridad. Se observan algunos desvíos no detectados propios de la inexperiencia. \r\nDebe trabajar mas en la comunicación efectiva y la misma debe realizarse en tiempo y forma.\r\nDebe seguir trabajando en la autonomía, generando conocimientos para tomar decisiones concretas. \r\nDebe trabajar en la formación de carácter para el manejo de situaciones de gestión dura.', '', ''),
(2379, '2021', 1, 5, 222, 81.25, 'MB', 'Se observa un muy buen desempeño. Debe trabajar en las competencias mencionadas.', '', 'Debe trabajar en orientación a los resultados, no dejando de lado las demás competencias por producir.\r\nDebe trabajar en calidad. Se observan desvíos de maquina sucia en ocasiones, haciendo foco en producir.\r\nDebe trabajar en seguridad. Se observan desvíos de EPP en algunas ocasiones, como así también intervenciones en maquina sin seguridad. \r\nDebe completar los registros en tiempo y forma. Se observan desvíos que luego no coinciden con los tiempos de detención. \r\nEn los arranques debe ingresar al horario e', '', ''),
(2380, '2021', 1, 5, 567, 0, 'B', '', '', '', '', ''),
(2381, '2021', 1, 5, 240, 75, 'B', 'Se observa un desempeño adecuado para los puestos ocupados', 'Se observan como fortalezas la responsabilidad, el compromiso, el trabajo en equipo y la proactividad.', 'Debe trabajar en comunicación efectiva. Se observan desvíos ya sabidos pero no mencionados.\r\nDebe trabajar en flexibilidad. Le cuestan las nuevas asignaciones de tareas dentro de los procesos que participa. (nuevos ensayos y planillas)\r\nDebe trabajar en autonomía y el llenado de planillas. Va de la mano con el autónomo.\r\nDebe trabajar en calidad. Diferencias de criterio en decisiones de detener la linea.\r\nDebe trabajar en seguridad. Se observan desvios en utilizacion de EPP y mantenimiento de 5S', '', ''),
(2382, '2021', 1, 5, 266, 0, 'MB', 'Se observa un muy buen desempeño.', 'Son varias las fortalezas, pero se destacan la responsabilidad, el compromiso, la seguridad personal, la comunicacion.', 'Debe trabajar mas en orientación a los resultados. Debe seguir desarrollando la gestión dura con el personal a cargo.\r\nDebe seguir trabajando en la autonomía. De todas maneras se observa un gran avance en la absorción de conocimientos.\r\nDebe trabajar mas en aspectos de seguridad del personal a cargo.', '', ''),
(2383, '2021', 1, 5, 273, 83.75, 'MB', 'Se observa un muy buen desempeño ', 'Son varias las mismas, pero se destacan la responsabilidad, orientación a los resultados, el compromiso, el trabajo en equipo y la calidad.', 'Debe trabajar mas en autonomía, absorbiendo mas conocimientos para dar resolución a los problemas suscitados. Tiene todas las herramientas a su alcance. Trabajar mas en sistema sobre todo en los aportes al GB. Se observa mejoría a lo largo del año, pero debe seguir trabajando en ello.\r\nDebe trabajar mas en proactividad y los tiempos ociosos aprovecharlos de manera productiva.\r\nUso excesivo del celular. Debe trabajar concentrado en sus tareas.', '', ''),
(2384, '2021', 1, 46, 258, 80, 'B', 'Ricardo es un colaborador que se interesa por el cumplimiento de objetivos de producción, pero a veces los objetivos personales le hacen  perder de vista los objetivos grupales o del equipo. Le faltó relacionarse más con sus compañeros de Tomate y Playa, y gestionar su equipo para coordinar tareas entre todos', 'Bien orientado a resultados. Muy buena capacidad técnica y de análisis. Tiene la capacidad para resolver problemas por sí mismo. Buena participación en producción de fin de semana, limpieza y mantenimiento autónomo. En general se muestra flexible a nuevas asignaciones', 'Falta desarrollar mayor comunicación, coordinación y trabajo en equipo con sus pares. ', '', ''),
(2385, '2021', 1, 46, 261, 0, 'B', 'Osiris es un colaborador en general respetuoso. Acepta con buena predisposición nuevas asignaciones. Buen comunicador de situaciones a resolver, pero le falta desarrollar mayor capacidad de resolución de problemas de su sector. En general interesado por el cumplimiento de objetivos de producción, en ocasiones ausente en tareas de fin de semana.', 'En general respetuoso. Acepta con buena predisposición nuevas asignaciones. En general buen desempeño con Calidad y Seguridad, pero debe trabajar en focos de mejora de esos pilares en su sector de trabajo. Comunicar mejoras o desvíos.', 'Falta desarrollar mayor capacidad de resolución de problemas de su sector. En momentos con línea detenida debe mejorar su capacidad para agregar valor realizando alguna tarea de reproceso, orden y/o limpieza.', '', ''),
(2386, '2021', 1, 46, 90, 0, 'B', 'Ivana es una colaboradora que acepta bien los cambios de puesto. En general respetuosa y con capacidad de comunicación y escucha. Puede seguir aprendiendo de su puesto en SIG para colaborar con su compañero. En general buen desempeño con Calidad y Seguridad.', 'En general buen desempeño con Calidad y Seguridad. Acepta bien los cambios de puesto. En general respetuosa y con capacidad de comunicación y escucha', 'Puede mejorar su proactividad. En momentos con línea detenida organizar en forma ágil un reemplazo o una actividad de reproceso. En ocasiones se contó con ella para alistamiento de línea y no asistió.', '', ''),
(2387, '2021', 1, 46, 269, 48.75, 'NM', 'Pablo es un colaborador con humor cambiante en la línea, sus compañeros a menudo han tenido reclamos acerca de su comportamiento cuando la línea no anda correctamente. Se observan dificultades para trabajar en equipo, para comunicarse y escuchar a sus compañeros.', 'Su experiencia hace que algunos conceptos técnicos los tenga claros. En general buena presencia en actividades de mantenimiento autónomo, pero cuando se le pidió colaboración para actividades puntuales, no se tuvo respuesta positiva. En general desempeño correcto con Calidad y Seguridad', 'Debe profundizar qué aspectos de su carácter controlar mejor para que no impacte negativamente en sus relaciones con el equipo de trabajo. Debe profundizar conocimientos para resolver problemas del equipo con mayor autonomía. Puede mejorar en el uso de EPP, desarrollar la capacidad para detectar y comunicar mejoras en Seguridad. En general rígido para aceptar cambios de decisiones', '', ''),
(2392, '2021', 1, 46, 587, 0, 'MB', 'Kevin es un colaborador con buen manejo del autoelevador. Supo adaptarse rápidamente a los requerimientos para los choferes de producción e incluso aprendió sobre operación de equipos.', 'Buen rendimiento orientado a resultados, interesado por el cumplimiento de objetivos de producción. Buena participación en jornadas de mantenimiento autónomo. En general buen comunicador de desvíos a mejorar, debe seguir trabajando en ello. Correcta capacidad de resolución de problemas, puede mejorar. Bien aprovechando tiempos con línea detenida para agregar valor en otros sectores.', 'Debe mejorar su desempeño con Seguridad, evitando actos inseguros y siempre utilizando los EPP correspondientes para cada tarea. Debe continuar aprendiendo sobre Calidad y BPM', '', ''),
(2393, '2021', 1, 46, 178, 0, 'B', 'Marcelo debe mejorar su capacidad de comunicación y escucha para poder relacionarse mejor con sus pares. En ocasiones su carácter le impide mantener relaciones cordiales y de mejora con el equipo.', 'En general correcto compromiso para el cumplimiento de objetivos. Buen manejo del autoelevador. Buena capacidad para resolución de problemas, especialmente aquellas que tienen que ver con autoelevadores y tareas del chofer. Buen desempeño con Calidad, especialmente marcando desvíos que atentan contra la Seguridad Alimentaria y BPM. Bien aprovechando el tiempo con línea detenida, puede mejorar', 'Debe desarrollar su capacidad de comunicación y escucha con sus pares, promoviendo el respeto y trabajo en equipo. Surgen reclamos cuando se le asigna un puesto diferente. En materia de Seguridad se observan mejoras pero puede seguir mejorando en el uso de EPP.', '', ''),
(2395, '2021', 1, 48, 294, 0, 'MB', 'Juan Pablo es un colaborador sumamente autónomo. Tiene una gran predisposición con el equipo y cualidades de líder.', 'Predisposición y voluntad.\r\nResponsable.\r\nCapacidad de trabajo en equipo', '', '', ''),
(2396, '2021', 1, 48, 270, 0, 'E', 'Javier es un excelente líder. Con autonomía, predisposición para cumplir los objetivos establecidos. Tiene la capacidad de desempeñarse bien en diferentes puestos de trabajo.', 'Capacidad de trabajo en equipo\r\nBuen liderazgo.\r\nPredisposición y compromiso.', '', '', ''),
(2397, '2021', 1, 48, 171, 0, 'MB', 'Alejandro es un muy buen operador en su puesto de trabajo. Puede mejorar en capacidad de trabajo en equipo y autonomía.', '', '', '', ''),
(2398, '2021', 1, 48, 174, 80, 'NM', 'Luís es un colaborador sumamente autónomo, que colabora en la línea, pero tiene que empezar a ceder algunos conocimientos y desempeñarse más como líder. También fomentar el trabajo en equipo.', '', '', '', ''),
(2400, '2021', 1, 48, 303, 0, 'MB', 'El colaborador Ángel Gonzalez es una persona muy responsable en el trabajo que realiza. Muestra autonomía y criterio personal. Además es muy proactivo y con gran capacidad de trabajo en equipo. Presenta cualidades de líder.', '', '', '', ''),
(2402, '2021', 0, 0, 303, 0, 'MB', 'El colaborador Ángel Gonzalez es una persona muy responsable en el trabajo que realiza. Muestra autonomía y criterio personal. Además es muy proactivo y con gran capacidad de trabajo en equipo. Presenta cualidades de líder.', '', '', '', ''),
(2403, '2021', 1, 48, 260, 47.5, 'NM', 'Daniel es un operador colaborativo y predispuesto para realizar algunas tareas extras que se le asignan pero necesita mejorar en el trabajo en equipo, comunicación con sus compañeros del otro turno. Tener mayor flexibilidad, autonomía y compromiso con calidad.', '', '', '', ''),
(2404, '2021', 1, 48, 247, 92.5, 'MB', 'Carlos es un colaborador muy participativo, autónomo y con gran capacidad de trabajo en equipo. Persona que siempre levanta la mano y podes contar con su ayuda. Un gran brigadista.', '', '', '', ''),
(2405, '2021', 1, 48, 271, 0, 'MB', 'Ricardo es una persona participativa, que tiene gran capacidad de trabajo en equipo, siempre levanta la mano. Autónoma. Puede mejorar en muchos aspectos como flexibilidad, comunicación.', '', '', '', ''),
(2407, '2021', 1, 48, 345, 0, 'B', 'Leandro es una persona muy participativa, con gran flexibilidad a la hora de trabajar en diversos puestos. \r\nCon capacidad de trabajo en equipo, pero puede mejorar mucho en la comunicación con sus pares', '', '', '', ''),
(2409, '2021', 0, 0, 248, 0, 'B', 'Julio es una persona colaborativa, polifuncional, pero con que puede mejorar en trabajo en equipo, autnonomia.', '', '', '', ''),
(2410, '2021', 1, 48, 248, 0, 'B', 'Julio es una persona muy colaborativa. Puede trabajar en diversos puestos pero necesita buscar más la autonomía. ', '', '', '', ''),
(2411, '2021', 1, 48, 25, 0, 'MB', 'Stella es una persona muy predispuesta, autónoma, con gran capacidad de comunicación, muy buena brigadista. Presenta una gran capacidad de trabajo en equipo.', '', '', '', ''),
(2413, '2021', 1, 48, 47, 0, 'MB', 'Patricia es una persona muy colaborativa, que siempre levanta la mano para las tareas que hay que realizar. Presenta una gran capacidad de trabajo en equipo y es autónoma. Necesita involucrase más en el SGI y carga de detenciones.', '', '', '', ''),
(2415, '2021', 1, 48, 236, 67.5, 'NM', 'Ariel es una persona que necesita mejorar en trabajo en equipo, comunicación con sus compañeros y autonomía en la resolución de distintas actividades.', '', '', '', ''),
(2416, '2021', 1, 48, 60, 0, 'MB', 'Sonia es una persona muy participativa en las diversas actividades que se le asignan. Autónoma. Con gran capacidad de trabajo en equipo. ', '', '', '', ''),
(2417, '2021', 1, 48, 80, 0, 'MB', 'María es una persona muy proactiva. Presenta una gran capacidad de trabajo en equipo. Desempeña actividades de calidad de manera excelente. ', '', '', '', ''),
(2418, '2021', 1, 48, 88, 0, 'B', 'Miguel es una persona colaborativa. Que tiene mucho potencial para mejorar en comunicación, trabajo en equipo y aumentar su polifuncionalidad.', '', '', '', ''),
(2419, '2021', 1, 48, 151, 0, 'NM', 'Antonio es una persona que presenta mucha voluntad para realizar las diversas actividades, muy predispuesto pero  necesita mejorar en comunicación, autonomía y conocimientos técnicos.', '', '', '', ''),
(2420, '2021', 1, 48, 218, 0, 'NM', 'Daniel es una persona que necesita mejorar en varios aspectos. No presenta disponibilidad los fines de semana, como tampoco cuando hay que realizar alguna tarea extra. ', '', '', '', ''),
(2421, '2021', 1, 2, 347, 0, 'MB', 'Colaborador muy comprometido con el día a día. Muy buena orientación a los resultados y a cumplir objetivos del sector. Importante seguir aprendiendo de sistema, ampliar puestos que puede ocupar para ganar polifuncionalidad', 'Seguridad, Proactivo. ', '', '', ''),
(2422, '2021', 1, 2, 290, 0, 'E', 'Como oportunidad de mejora es integrar más a todos los sectores, trabajar de manera complementaria. Seguir siempre con la dinámica de recordar insumos obsoletos, próximos a vencer, sin aprobación, etc', 'Aportes muy importantes al sector: marcar debilidades del sector, como falta de espacio, temas pendientes (glucosa). Seguridad.', '', '', ''),
(2423, '2021', 1, 2, 142, 0, 'MB', 'Colaborador con gran experiencia y aporte al sector. Trabaja en equipo y ayuda a quien necesita de el para avanzar. Es comunicador para marcar desvíos y debilidades y se preocupa en mejorar las metodologías del área', 'Comunicación, trabajo en equipo. Excelente autonomía', 'Oportunidad de mejora: liderazgo a partir de la experiencia. Seguir mejorando en mantener al día cargas en colabora, 5s, etc. Desafiar grupos de mejora.', '', ''),
(2424, '2021', 1, 2, 462, 0, 'E', 'Colaborador resuelve con autonomía y guía al equipo con que tiene que trabajar, buen liderazgo', 'Siempre busca la forma de lograr objetivos, se muestra flexible por lograr cumplir actividades habituales y no habituales.', 'Oportunidad de mejora: liderazgo a partir de la experiencia. Seguir mejorando en mantener al día cargas en colabora, 5s, procedimientos, etc. Desafiar grupos de mejora.', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2425, '2021', 1, 2, 297, 0, 'MB', 'Colaborador muy aplicado y metódico. Le da mucha importancia a los objetivos propuestos y cada vez tiene mayor experiencia para resolver solo las distintas situaciones que se presentan', 'Marca ritmo con 5s, no debe bajar los brazos. Muy buen comunicador. Muy flexible y bien predispuesto e interesado en que todos aprendan', 'Oportunidad de mejora: liderazgo a partir de la experiencia. Seguir mejorando en mantener al día cargas en colabora, 5s, procedimientos, etc. Desafiar grupos de mejora.', '', ''),
(2426, '2021', 1, 2, 206, 0, 'NM', 'Colaborador demuestra poca orientación a resultados, no muestra interés en cumplir o no una meta, en alcanzar o no objetivos. Viene a cumplir 8hs. No toma comentarios, es poco autocritico a las debilidades ya marcadas. No siempre cumple con EPP ni con informar condiciones de autoelevador. Se necesita más aporte en 5s y condiciones del sector', '', 'Trabajo en equipo, al no trabajar recarga al resto del equipo, sea del sector o de otras áreas. No se adelanta a problemas futuros, no resuelve con autonomía en el sector. Muchos puntos bajos en su rendimiento repetidamente, se necesita más regularidad.', '', ''),
(2427, '2021', 1, 2, 217, 0, 'NM', 'Se observa poco interés para trabajar en equipo, no busca objetivos conjuntos. No sigue ritmo de trabajo de aduaneros, no toma tareas por parte de ellos. No aporta propuestas al sector. No siempre usa EPP ni informa correctamente desvíos de autoelevador\r\n', '', 'Comunicación: no muestra respeto en varias ocasiones con personal de otras áreas. No muestra capacidad de autocrítica ante desvío marcados y evaluaciones de desempeño con bajos valores.', '', ''),
(2428, '2021', 1, 2, 249, 0, 'B', 'Sabe resolver con autonomía, proactividad puede mejorarse, a veces no surge de el mismo traccionar en pos de objetivos del sector. Poca participación y responsabilidad en inventarios. Se marcan puntos a mejorar y no se observa la flexibilidad de tomarlo y aplicar lo que se pide', 'Colaborador tiene en claro como trabajar, sabe las transacciones correspondientes a su puesto a la perfección. Si se lo propone, tiene capacidades para ser el mejor en lo que hace', 'Comunicación y trabajo en equipo: no demuestra trabajo en equipo ni buscando objetivo en común', '', ''),
(2429, '2021', 1, 41, 263, 80, 'MB', 'Orientación a los resultados: Análisis de los datos de análisis, Falta de carga de datos, incoherencia en algunos datos cargados.\r\n', 'Proactividad: Se observa una importante evolución en la resolución de problemas, seguimientos de temas, involucración en el proceso\r\nIdeas creativas y asertivas\r\nRespeto y escucha', 'Capacidad de comunicación - Trabajar la comunicación con supervisores, no por que sea mala, si no animarse a romper barreras para lograr la autonomía en los procesos, evitando generar la comunicación con intermediarios como el analista o jefe que puede llevar a demoras en la resolución.\r\nTrabajo en equipo: Involucración en trabajos en conjunto con Mto, si bien el trabajo en equipo existió se evidencio de algunas actividades que se espero hasta q el trabajo estuviera terminado para consultar de que se tratab', '', ''),
(2430, '2021', 1, 41, 325, 75, 'B', 'Orientación a los resultados: Falta de análisis de los datos de muestreos, Falta de carga de datos, incoherencia en algunos datos cargados.\r\n', 'Muy buena interacción con pares y mandos medios.\r\nSe destaca el conocimiento e involucración en querer aprender y generar nuevas soluciones.\r\nParticipación e involucración en cuestiones de seguridad de planta', 'Trabajar en el convencimiento de las acciones que se definen, ya sean propias, de pares o responsables del área. Evitar cambiarlas o objetarlas antes de la ejecución. Esto genera demoras en la resolución.\r\nTrabajo en equipo: Involucración en trabajos en conjunto con Mto, si bien el trabajo en equipo existió se evidencio de algunas actividades que se espero hasta q el trabajo estuviera terminado para consultar de que se trataba', '', ''),
(2431, '2021', 1, 48, 264, 80, 'NM', 'Daniel es una persona muy participativo, siempre dice presente para realizar actividades extras. Tiene capacidad de trabajo en equipo.', '', '', '', ''),
(2432, '2021', 1, 48, 92, 0, 'B', 'Nancy es una persona muy predispuesta, colaborativa. Presenta capacidad de trabajo en equipo. Necesita mejorar en la participación de  actividades extras que se le asignan.', '', '', '', ''),
(2433, '2021', 1, 48, 126, 0, 'B', 'Adolfo es una persona que maneja sus tiempos. No presenta muy buena predisposición a la hora de realizar dos actividades en simultaneo o tareas extras fuera de su puesto. No realiza horas extras.', '', '', '', ''),
(2436, '2021', 1, 2, 676, 0, 'B', 'Esta fue la primer temporada de Jorge en el deposito, su desempeño en línea generales fue bueno, tuvo buena adaptación con el grupo y tareas encomendadas.', '', 'Oportunidad de mejoras: tratar de incorporar mayor conocimiento del sistema en lo referido a todo el proceso de carga. ', '', ''),
(2437, '2021', 1, 2, 667, 0, 'B', 'Esta fue su primer temporada, le costo un poco conocer la actividad del deposito, pero con el correr de la temporada se supo acomodar y se integro muy bien al equipo.  ', 'Se lo noto muy responsable y flexible para los cambios imprevistos.', 'Con el afán de poder cumplir y estar al ritmo del resto del equipo descuido parte la seguridad, es algo que debemos trabajar y reforzar.\r\nDebe comprometerse totalmente con la seguridad.', '', ''),
(2438, '2021', 1, 2, 577, 0, 'B', 'Silvana tuvo buena adaptación al equipo, logro incorporar conocimientos de la operación de bascula.\r\nDebe apoderarse de procesos claves de la bascula, (GCG, cubicación de camiones, altura de carga, viajes internos).', 'Tiene buena predisposición y buena escucha para aprender nuevas tareas.', 'Debe fortalecer la comunicaciones.', '', ''),
(2439, '2021', 1, 2, 397, 0, 'B', 'Sebastián a lo largo de estas temporadas a tenido un crecimiento constante, es muy responsable y respetuoso, es unos de los referentes para la contención y capacitación de choferes nuevos en el sector. ', 'Tiene muy buena comunicación y ante cualquier duda o desvió levanta la mano. ', 'O;M: debe seguir creciendo en conocimientos, involucrarse  en inventarios, 5S.', '', ''),
(2457, '2021', 1, 5, 302, 76.25, 'B', 'Se observa un desempeño adecuado para los puestos en los que ha trabajado. \r\nDebe llegar al puesto de trabajo en los tiempos establecidos según la responsabilidad. Llega tarde.\r\nDebe dejar de utilizar el celular en exceso. \r\nSe observa que trae productos a planta y que no están permitidos, como meriendas. Esas cosas deben quedar en enfermería o desayunador. No debe ingresar a planta. Tampoco se puede ingresar con bolsos. ', '', 'Comunicación, debe trabajar mas en comunicación efectiva y comunicación con los lideres, que son su superior directo. Respetar cadena de mando.\r\nDebe crecer mas en autonomía y debe aprender a analizar situaciones antes de tocar las regulaciones de los equipos. Debe trabajar mas en calidad, enfocándose en siempre tratar de no generar PNC.\r\n', '', ''),
(2469, '2021', 1, 48, 195, 0, 'MB', 'Marcelo es una persona muy colaborativa y predispuesta. Realiza actividades que se le pide colaboración fuera de su puesto. Participa, levanta la mano. Autónomo. Presenta capacidad de trabajo en equipo.', '', '', '', ''),
(2470, '2021', 1, 48, 172, 0, 'MB', 'Jose Luís es una persona que busca mejorar todo el tiempo, colaborativa y predispuesta. Tiene una gran capacidad de trabajo en quipo. Busca la autonomía y tiene buena comunicación con sus compañeros.', '', '', '', ''),
(2471, '2021', 1, 46, 213, 0, 'MB', 'Luis es un colaborador muy bien orientado a resultados, siempre interesado por el cumplimiento de objetivos de producción con la Calidad que requiere. Muy respetuoso, acepta sugerencias de mejora en su desempeño y es bien predispuesto a nuevas asignaciones. Puede mejorar en Seguridad. Puede mejorar en su trabajo con sistema', 'Muy bien orientado a resultados, siempre interesado por el cumplimiento de objetivos de producción con la Calidad que requiere. Muy respetuoso, acepta sugerencias de mejora en su desempeño y es bien predispuesto a nuevas asignaciones. Buena participación en mantenimiento autónomo. Buen conocimiento técnico para resolver con autonomía', 'Puede mejorar en su desempeño con Calidad. Uso de EPP; mejorar en mantener él y su equipo todas las normas de Seguridad en su sector de trabajo y en su línea. Puede mejorar en su trabajo con sistema', '', ''),
(2472, '2021', 1, 46, 145, 0, 'B', 'Ricardo mejoró en cierta medida su capacidad de comunicación y escucha, debe continuar en ese proceso. Se observan mejoras en su compromiso por el mantenimiento autónomo y la responsabilidad del puesto de trabajo', 'Buen conocimiento técnico para resolver problemas por sí mismo. Buen manejo del autoelevador. Mejor compromiso en mantenimiento autónomo', 'En general correcto desempeño con Calidad y Seguridad, puede mejorar. Debe continuar mejorando su capacidad de trabajo en equipo. En ocasiones se vio a su compañero complicado con alguna tarea y a él se lo vio relajado desarrollando otra. Debe estar más abierto a aspectos a mejorar que se le puedan indicar. Le cuesta aceptar nuevas asignaciones.  ', '', ''),
(2473, '2021', 1, 46, 59, 0, 'MB', 'Liliana es una colaboradora con interés en el cumplimiento de objetivos, mostrando compromiso cuando se la necesita. En general respetuosa pero al ser introvertida, esto le dificulta interactuar para comunicar desvíos a resolver', 'Correcto desempeño con Calidad y Seguridad. Interés en el cumplimiento de objetivos, mostrando compromiso cuando se la necesita. Buena autonomía para resolver problemas de su sector. En general se observa cordialidad en el trato con sus compañeras, y en cierta forma, por su experiencia, lidera el grupo. Buena participación en arranques de línea y tareas de limpieza de fin de semana. ', 'Puede mejorar en la capacidad de comunicación de desvíos o fallas. En general bien organizando en forma ágil tareas de reproceso y limpieza que sumen valor con línea detenida, puede mejorar. ', '', ''),
(2474, '2021', 1, 46, 156, 0, 'B', 'José es un colaborador con buena capacidad técnica, que a veces ha cometido errores por falta de concentración o exceso de confianza. ', 'Muy buen desempeño con Seguridad (uso de EPP, verificación de cumplimiento de normas). Correcto desempeño con Calidad. Buena participación en mantenimiento autónomo, limpiezas y arranque de línea (compromiso y responsabilidad del puesto). Muy bien mejorando autonomía, pedido de insumos y armado de novedades (puede mejorar). En general bien predispuesto a nuevas asignaciones.', 'Debe estar más enfocado en las tareas que realiza para evitar cometer errores, y además poder comunicar cuestiones a mejorar o desvíos que deben ser solucionados. Debe mejorar su actitud en momentos con línea detenida para enfocarse en agregar valor con alguna actividad. Debe acercarse más a sus compañeros para incorporar conocimientos y poder ayudar en caso de que tengan inconvenientes', '', ''),
(2475, '2021', 1, 46, 65, 57.5, 'B', 'Walter es un colaborador que debe desarrollar mucho su capacidad de resolución de problemas, necesita soporte de sus pares en la mayoría de las situaciones. Debe enfocarse en trabajar más proactivamente, agregando valor cuando la línea se encuentra detenida. En varias ocasiones se le marcó aspectos a mejorar de BPM.', 'Respetuoso, acepta sugerencias de mejora. Buena predisposición para aceptar nuevas asignaciones. En general correcto con Seguridad, puede mejorar. Buena presencia en tareas de limpieza y arranques de línea (compromiso y responsabilidad del puesto)', 'Debe desarrollar mucho su capacidad de resolución de problemas. Debe enfocarse en trabajar más proactivamente, agregando valor cuando la línea se encuentra detenida. Debe mejorar su desempeño respetando normas de BPM y 5S. Puede mejorar su capacidad de comunicación de problemas a resolver o desvíos a atacar', '', ''),
(2476, '2021', 1, 46, 118, 0, 'B', 'Rafaela es una colaboradora respetuosa, que mostró compromiso cuando se la necesitó. Pudo observarse cierta dificultad para trabajar con sus compañeras, se generaron algunos conflictos que complicaban la rotación higiénica.', 'Respetuosa. Mostró compromiso cuando se la necesitó. En general bien predispuesta a nuevas asignaciones. Correcto desempeño con Calidad y Seguridad. ', 'Debe continuar incorporando conocimientos sobre los equipos que opera para mejorar su capacidad de resolución de problemas. Puede mejorar su enfoque en agregar valor cuando la línea está detenida (organizar en forma ágil las tareas de reproceso). Debe recuperar la cordialidad con sus compañeras para lograr trabajar en equipo.', '', ''),
(2492, '2021', 1, 5, 288, 0, 'MB', 'Se observa un muy buen desempeño para los puestos ocupados.', 'Se destaca la autonomía y la responsabilidad.', 'Debe trabajar mas en comunicación efectiva. \r\nDebe trabajar mas en proactividad. Tiempos ociosos mal utilizados. Se debe buscar el reproceso, no esperar a que lo traigan. \r\nDebe trabajar en seguridad. Se marcaron varios desvios de EPP a lo largo del año.', '', ''),
(2493, '2021', 1, 5, 152, 0, 'MB', '', '', '', '', ''),
(2494, '2021', 1, 5, 308, 0, 'B', 'Se observa un desempeño adecuado para los puestos ocupados, pero se ve muy empañado por las competencias que han bajado en su rendimiento.\r\nDebe trabajar fuertemente en revertir estas situaciones. El operario presenta gran potencial, pero es muy mal utilizado.\r\nDebe trabajar en comunicación. Muchas veces se encuentra la linea detenida y no es avisado.\r\nDebe trabajar en proactividad. Permanente hay que solicitar que eleve la capacidad productiva de los equipos pudiendo hacer en equipo con el operador de conc', 'Calidad, flexibilidad y autonomía son fortalezas en su desempeño.', 'Debe trabajar fuertemente en proactividad. No se anticipa a las necesidades la linea. Además hubieron muchísimos tiempos ociosos mal utilizados de manera improductiva.\r\nDebe trabajar en seguridad. Se observan actos inseguros y reiterados llamados de atención por el no uso de EPP.\r\nDebe dejar de utilizar en exceso el celular. Pierde de foco las tareas y genera situaciones propicias para cometer errores o tener accidentes.', 'Debe trabajar mas en equipo. No se observa gran ayuda a los operarios que tiene en el sector teniendo muchas oportunidades para hacerlo', ''),
(2495, '2021', 1, 5, 310, 0, 'MB', 'Se observa un gran compromiso y desempeño en las tareas que se le han encomendado. ', 'Se destacan muchas fortalezas, pero la calidad y autonomía son muy altas.', 'Debe trabajar en comunicación. Si bien siempre comunica, en ocasiones la comunicación llega mas tarde y el supervisor se entera por otros supervisores.\r\nDebe trabajar en flexibilidad. Debe entender que hay decisiones que deben tomarse y muchas veces se puede o no estar de acuerdo con las mismas.', 'Debe trabajar mas en seguridad. El supervisor detecta desvíos en seguridad como el no uso de EPP en los operarios y el Lider no lo ve.', ''),
(2497, '2021', 1, 46, 123, 53.75, 'B', 'Rosa es una colaboradora que no destaca en ninguna de las competencias evaluadas. En términos generales debe desarrollar los ítems evaluados.', 'Respetuosa, acepta bien nuevas asignaciones pero sólo estuvo en puestos de selección de tomate.', 'Poca comunicación. Debe desarrollar mayor autonomía, proactividad. Respecto a Calidad y Seguridad, si bien no se le llamó la atención por estos aspectos, no aporta con identificación de desvíos o mejoras. ', '', ''),
(2498, '2021', 1, 46, 161, 55, 'B', 'Ana es una colaboradora que no destaca en ninguna de las competencias evaluadas. En términos generales debe desarrollar los ítems evaluados.', 'Respetuosa, acepta bien nuevas asignaciones pero sólo estuvo en puestos de selección de tomate.', 'Poca comunicación. Debe desarrollar mayor autonomía, proactividad. Respecto a Calidad y Seguridad, si bien no se le llamó la atención por estos aspectos, no aporta con identificación de desvíos o mejoras. ', '', ''),
(2499, '2021', 1, 2, 284, 80, 'MB', 'Cabe destacar el gran compromiso que de ella hubo ya que estuvo a la altura de la circunstancias en todo momento que se la necesito ya que ella estuvo durante la primera y gran parte de la pandemia reemplazando a una enfermera que estaba dispensada y durante ese periodo estuvo a la par de los otros enfermeros que llevan años efectivos en el puesto. Muy comprometida con el desarrollo de su trabajo siendo que estuvo reemplazando a un enfermero efectivo. ', 'colaboradora que trabaja con total respeto con sus compañeros de trabajo y con todo el área del depto. médico y además vuelca ese respeto con los clientes internos que el depto tiene en la planta. Muy educada y correcta con el trabajo que se le asigna', 'Debido a que es una colaboradora que no es efectiva del puesto que cubrió durante toda la pandemia y en base a que debía reemplazar a una enfermera que estaba dispensada presenta algunas debilidades propias de un puesto de reemplazante y que no permite que se pueda proyectar en un futuro', '', ''),
(2509, '2021', 1, 41, 664, 0, 'MB', 'Buen desempeño, rápidamente se adapto a planta y en trabajo en conjunto con supervisores y equipo MAHPI logro resultados y mejoras. Ante la necesidad de cubrir op. de efluentes estuvo dispuesto a hacerlo, y fue con resultados satisfactorios. La visión del supervisor de producción y mantenimiento concuerda con MAHPI', '', '', '', ''),
(2510, '2021', 1, 48, 105, 90, 'MB', 'Gerónimo es una persona autónoma, con una gran predisposición para realizar diversas tareas. Siempre levanta la mano, es colaborativo, con gran capacidad de trabajo en equipo y disposición para cualquier actividad extra a realizar. ', '', '', '', ''),
(2512, '2021', 1, 48, 180, 0, 'B', 'Juan es autónomo. Se interioriza en los equipos que se encuentra operando pero debe cambiar su actitud frente a sus compañero, teniendo una mayor capacidad de trabajo en equipo y tratar de encontrar soluciones a los problemas. Necesita mejorar en su puesto.', '', '', '', ''),
(2513, '2021', 1, 48, 287, 0, 'NM', 'Sergio es una persona responsable, honesta y participativa. Necesita mejorar en su autonomía en las actividades que desarrolla y buscar aprender, nuevos conocimientos, interiorizarse en otras actividades y profundizar las que desarrolla.', '', '', '', ''),
(2514, '2021', 1, 48, 224, 0, 'B', 'Fabian es una persona colaborativa, que desempeña bien su trabajo pero podría brindar soporte en otras actividades extras que se le asignan. No suele realizar horas extras los fines de semana. No maneja SGI.', '', '', '', ''),
(2515, '2021', 1, 48, 196, 86.25, 'MB', 'José es un colaborador muy proactivo, participativo, siempre predispuesto a realizar actividades, levanta la mano. En los diversos puestos que ha estado, ha  llevado una actividad muy buena en los mismos. Siempre establece alguna recomendación o mejora en el puesto o sobre algo puntual. No participa mucho en SGI pero podría involucrarse.', '', '', '', ''),
(2517, '2021', 1, 48, 200, 0, 'B', 'Lopez Jorge es una persona participativa para distintas actividades que se le asignan. Puede mejorar en el cumplimiento de las normas de calidad (BPM). Es una persona muy autónoma y con gran iniciativa.', '', '', '', ''),
(2518, '2021', 1, 48, 237, 80, 'MB', 'Oscar Atampiz es una persona muy proactiva, despierta, que da alertas frente al no cumplimiento de especificaciones en productos. Maneja muy bien los tiempos de la línea de producción. Podría involucrarse más en el SGI.', '', '', '', ''),
(2520, '2021', 1, 48, 245, 0, 'B', 'Oscar es una persona que cumple con los requerimientos de su puesto. Es participativo en diversas actividades que se le asignan extras al trabajo de su puesto. Es respetuoso, puntual.', '', '', '', ''),
(2525, '2021', 1, 2, 96, 0, 'B', 'Colaboradora con buena predisposición para trabajar en los puestos que ocupa, busca adaptarse y muestra flexibilidad. Trabaja con sistema. ', 'Flexibilidad', '(Oportunidad de mejora) Aprender más sobre puestos específicos par acrecer en autonomía y en resolución de problemas por sí misma', '', ''),
