(2600, '2021', 1, 2, 204, 0, 'B', 'Colaborador muy flexible y bien predispuesto para todo tipo de tareas. Como oportunidad de mejora seguir trabajando en calidad, trazabilidad de las cargas, teniendo en cuenta reemplazo de bultos rotos y del pk. Control de cargas, entendiendola como responsabilidad primaria', 'Colabora en todo el sector, sin importar si es la tarea diaria o algo diferente', 'Es importante que siempre marque ritmo de trabajo y dé resultados, sin importar con que persona le toca trabajar', '', ''),
(2601, '2021', 1, 2, 234, 0, 'B', 'Colaborador está muy consolidado en el puesto de trabajo. Es muy responsable y comprometido. Dada su experiencia debe confiar más en su criterio. Además, puede proponer mejoras para el sector. ', 'Colaborador muy preocupado por alcanzar resultados, siempre comprometido con el puesto de trabajo', 'Importante en el trabajo en equipo la interacción con todas las áreas. No pensar el sector como algo aislado, sino como un conjunto, donde nos ayudamos entre todos.', '', ''),
(2602, '2021', 1, 2, 238, 0, 'B', 'Buen desempeño, puede seguir mejorando en el puesto y siempre buscar puntos de mejora', 'Adepto de seguridad, siempre muy atento. Buscar que las Observaciones Preventivas sumen valor al sector, y no sean repetitivas.', 'Siempre velar por la calidad y trazabilidad de las cargas. También siempre estar atentos a control de cargas y revisión de camiones ante diferencia de peso', '', ''),
(2603, '2021', 1, 2, 20, 0, 'B', 'Colaborador con buena predisposición y gran compromiso con el puesto cuando se solicitó.  Es importante seguir ganando autonomía en el puesto para resolver problemas.', 'Flexible y con gran compromiso', 'Siempre velar por la trazabilidad de nuestras cargas, los lotes y las cantidades. Es muy importante la revisión de cargas, de ellos dependen los reclamos. Verificación y chequeo ante diferencias de peso.', '', ''),
(2604, '2021', 1, 38, 275, 0, 'MB', 'Lorena se sostiene como referente en el área de producción, coordinando actividades vinculadas a la gestión de los recursos humanos, con buen manejo de la dotación. Con el paso del tiempo, Lore visualiza que el eje de polifuncionalidad y formación es uno de los caminos para evolucionar con los colaboradores, lo que requiere es ir mejorando la herramienta año tras año, trabajando de forma aún más cercana con el Pilar G. de las Personas.', 'Clima. Manejo de dotación del turno.Trabajo en equipo. ', 'Si bien el año pasado se marcó sobre las oportunidades de mejora referido a proactividad y flexibilidad para adelantarse a los sucesos/escenarios futuros, se evidencia mejora respecto al 2020, además de revisar los pendientes que nos van quedando y buscar proyectar a lo que se nos viene a futuro. Resta continuar trabajando con con las herramientas del Sistema de gestión integral que permitan agregarnos valor en vías a solucionar problemas, Ej: Gestión del Pilar Mto. Autónomo: plan maestro, indicadores, segu', 'Lorena siempre presentó compromiso para el desarrollo de tareas solicitadas, deberá adaptarse/evaluar las prioridades de actividades que se le presenten con los plazos estipulados, eje que se ve una mejora respecto la última evaluación. ', 'Metodologías (herramientas) del sistema de gestión integral. Conocimiento de indicadores operativos y el impacto de las acciones sobre los mismos. GGFF'),
