(2620, '2021', 1, 2, 251, 0, 'B', 'Colaborador tiene buena predisposición con el trabajo. En ocasiones se ve que se limita a cumplir las 8 hs, sin pensar en que actividades más se podría aportar ni en contribuir para mejorar procesos del sector. Puede mejorar su proactividad y su autonomía, y seguir aprendiendo. Debe involucrarse más con el sector', 'Flexible y respetuoso', 'En seguridad se debe hacer más hincapié, siempre usar EPP y siempre priorizar la seguridad en toda actividad', '', ''),
(2621, '2021', 1, 2, 278, 0, 'B', 'Colaboradora conoce ampliamente el puesto, sin embargo no se nota siempre el poder de resolución que se espera de ella. Debe marcar liderazgo, entendiendo que cuando tiene personal a cargo se guía con el ejemplo.', 'Colaboradora con capacidad y potencial', 'Comunicación para con los choferes y con sus pares. El trato debe ser siempre con respeto y buscando soluciones en común. Debe mejorar su proactividad y aprovechamiento de tiempos. Se espera que de los errores y puntos marcados la colaboradora tome comentarios para mejorar desempeño', '', ''),
(2622, '2021', 1, 2, 337, 83.75, 'MB', 'Colaboradora con muy buena predisposición y gran capacidad de resolución. Tuvo una muy buena temporada y se le ve potencial para seguir aprendiendo, buscando nuevos desafíos y alcanzando cada vez más objetivos', 'Autonomía, comunicación con todas las partes involucradas. Compromiso.', 'Como oportunidad de mejora se puede buscar la manera de adaptarse a las situaciones que no salen como se espera', '', ''),
(2623, '2021', 1, 2, 383, 83.75, 'MB', 'Se adapta muy bien a los diferentes puestos, siempre propone ideas y suma en cada sector al que va. Tiene mucho potencial', 'Colaborador con muy buena predisposición y proactividad. Se destaca su participación en inventarios y en organización del sector ', 'Como oportunidad de mejora se espera una mayor comunicación y coordinación entre los distintos sectores', '', ''),
(2624, '2021', 1, 6, 22, 0, 'B', 'Martha trabaja con total esfuerzo por cumplir con los objetivos.\r\nSu fortaleza es el compromiso y comunicación.\r\nDebe trabajar en desempeñarse con total autonomía con las herramientas del sistema y mayor proactividad en la aplicación de las metodologías de Gestión temprana.', 'Comunicación y respeto.\r\nCompromiso', 'TRabajo con sistema, proactividad para ser administradora del pilar Gestión temprana', '', ''),
(2625, '2021', 1, 6, 582, 0, 'MB', 'Romina se desempeña con compromiso por su trabajo. A pesar de ser nueva, dispuesta en todo momento a aprender así como a tomar decisiones importantes.', 'Compromiso y comunicación.\r\nProactividad y aporte de ideas al equipo.', 'Autonomía propia de encontrarse en etapa de aprendizaje', '', ''),
(2627, '2021', 1, 2, 394, 0, 'B', 'Colaborador puede dar más. Se nota que puede mejorar en proactividad y en autonomía, seguir aprendiendo del puesto de trabajo. ', '', 'No se observa que el colaborador ponga demasiado empeño en las tareas del día a día, ni que entienda la importancia del puesto que ocupa. Es imprescindible para su puesto la comunicación y el trabajo en equipo, dos cualidades que no está demostrando.', '', ''),
(2628, '2021', 1, 2, 386, 57.14, 'B', 'Colaborador no siempre se adapta a las formas de trabajo del sector, no aporta lo mejor en cada tarea, y no se muestra flexible a las distintas necesidades', 'Se ve que Braian tiene grandes capacidades y potencial de aprendizaje ', 'Comunicación y escucha, trabajo en equipo, proactividad, versatilidad', '', ''),
(2630, '2021', 1, 2, 148, 0, 'B', 'Debe buscarse mayor proactividad y aportar al sector liderazgo', 'Buena capacidad de aprendizaje y de adaptación a nuevas actividades en puesto', 'Compromiso. Se entiende su disponibilidad, pero el cumplimiento de los objetivos del sector es necesario', '', ''),
(2631, '2021', 1, 47, 575, 50, 'B', 'Cumple con el puesto', '', '', '', ''),
(2632, '2021', 1, 2, 329, 0, 'B', 'Colaborador con muy buena predisposición y compromiso con el puesto de trabajo. Aporta al depósito y aprovecha tiempos', 'Proactivo. Comunicación. Puede seguir creciendo, aporta buenas ideas', 'Tener en cuenta BPM y no tener acciones que van en contra de calidad de planta', '', ''),
(2633, '2021', 1, 2, 147, 0, 'MB', 'Referente en sector, conocimientos y maneras de trabajar correctas. Es importante resaltar que las necesidades que el nota para el sector son importantes para darle seguimiento. Siempre formar y orientar a personal nuevo. ', 'Flexibilidad, comunicador, orientado a la calidad y y a la seguridad', 'Como oportunidad de mejora colaborar siempre entre sectores, y velar por trazabilidad de cargas, avisando cuando algo en movimientos no sea claro, entendiendo el impacto en indicadores', '', ''),
(2634, '2021', 1, 2, 319, 0, 'B', 'Colaborador con compromiso y buena predisposición. Ayuda en actividades de horas extras, pero se debe regular el cansancio y rendimiento cuando se sostiene el ritmo en el tiempo', 'Compromiso y flexibilidad', 'Se requiere mayor proactividad, evitar tiempos ociosos y velar por cumplir los objetivos del sector. Debe adelantarse a las necesidades del puesto y del proceso, y no esperar a que se le marque que hacer próximamente. Es importante entender el impacto en trazabilidad del puesto', '', ''),
(2635, '2021', 1, 2, 301, 0, 'B', 'Colaborador con experiencia y conocimientos en el puesto de trabajo. Encender que el sector incluye más que lo que es estrictamente pesadas, apuntar a mejoras de gestión. ', 'Es muy respetuoso y flexible', 'Proactividad y actitud. Es importante animarse a proponer mejoras, y a tomar mayor protagonismo. Es muy importante mejorar la iniciativa de trabajo en sistema', '', ''),
(2636, '2021', 1, 2, 435, 0, 'MB', 'Colaborador con proactividad y autonomía', 'Flexibilidad, capacidad de aprendizaje, acepta desafíos, siempre busca cumplir metas', 'Como oportunidad de mejora (no debilidad) buscar siempre integrar entre sectores. Aprovechar conocimientos para lograr una colaboración y apoyo entre los mismos', '', ''),
(2637, '2021', 1, 2, 395, 0, 'B', 'Colaborador con gran potencial, tiene oportunidades de mejora, crecer y aportar en sistema, en metodologías, no limitarse a mover pl, sino buscar aportar y aprender en el puesto que ocupe', 'Flexible, respetuoso', '', '', ''),
(2638, '2021', 1, 2, 584, 34, 'NM', 'Colaborador no se adapta al puesto de trabajo. No muestra flexibilidad a la hora de recibir comentarios sobre metodologías de trabajo. No aporta al trabajo en equipo, y por ello sobrecarga a quienes trabajan en el sector con el. Poca autonomía y capacidad de resolver problemas por falta de conocimiento y falta de capacidad de escucha ', '', '', '', ''),
(2640, '2021', 1, 2, 548, 55, 'B', 'Colaboradora tiene en claro como trabajar con sistema. Es importante trabajar en proactividad, continuar creciendo en el sector y buscar proponer ideas y mejoras', 'Velocidad de aprendizaje', 'Debe mejorar la comunicación, las formas y la fluidez, tanto con pares como con terceros. Debe mejorar el trabajo en equipo, tanto en el mismo turno como en los traspasos', '', ''),
(2641, '2021', 1, 2, 416, 0, 'B', 'Colaborador muestra mejoras en el desempeño y se ve que puede continuar creciendo. Debe seguir aprendiendo, no quedarse con hacer lo que ya se sabe, sino desafiarse a hacer más.', 'Comunicación y respeto. Trabaja con seguridad. ', 'No dejar de lado las BPM', '', ''),
(2642, '2021', 1, 2, 689, 0, 'NM', 'Colaborador con poca experiencia, tiene algunas dificultades para adaptarse al puesto. Debe cambiarse de puesto de trabajo, tiene sus tiempos debido a la falta de experiencia', '', 'Comunicación y respeto, formas y compromiso.', '', ''),
(2644, '2021', 1, 48, 252, 0, 'E', 'Diego es un colaborador con gran autonomía, trabajo en equipo y predisposición. Es una persona con gran comunicación y flexibilidad. ', '', '', '', ''),
(2645, '2021', 1, 48, 134, 0, 'B', 'Carlos es una persona que tiene capacidad de trabajo en equipo, comunicación con sus compañeros y líder, flexible, pero debe mejorar en el orden de su puesto de trabajo, calidad, en realizar tareas sin que se le este comunicando todo lo que debe realizar, y mejorar en la seguridad, tal como uso de EPP.', '', '', '', ''),
(2646, '2021', 1, 48, 44, 62.5, 'B', '', '', '', '', ''),
(2647, '2021', 1, 2, 578, 0, 'B', 'Colaborador debe aprovechar al máximo cada oportunidad y buscar aprender más del puesto. Desarrollar autonomía y aportar más al equipo', '', 'Poco proactivo, necesita aprovechar mejor tiempos y buscar como aportar al sector.', '', ''),
(2648, '2021', 1, 2, 666, 0, 'B', 'Primer temporada de colaborador, quien logró adaptarse bien. Es muy respetuoso y puede seguir aprendiendo del puesto de trabajo. Es importante tener la seguridad en cuenta siempre en el puesto y la calidad con la que se trabaja', '', 'Importante el aprovechamiento de tiempos.', '', ''),
(2649, '2021', 1, 46, 348, 0, 'MB', 'Enrique es un colaborador muy bien predispuesto a nuevas asignaciones. Flexible. Aspectos de su personalidad (tímido, introvertido) a veces no le permiten comunicar situaciones a resolver de la mejor manera, puede mejorar. Buen compromiso y presencia en tareas de limpieza y mantenimiento autónomo', 'Muy bien predispuesto a nuevas asignaciones. Flexible. Muestra ganas de aprender y mejorar. Muy bien su desempeño con Seguridad y Calidad. Buena participación en tareas de limpieza y mantenimiento autónomo. Buena capacidad de trabajo en equipo, colaborador.', 'Puede mejorar la comunicación de situaciones a resolver. Puede mejorar su desarrollo con autonomía para resolver situaciones problemáticas por sí mismo. Puede continuar mejorando su capacidad de aprovechar aquellos momentos en que la línea está detenida o una actividad está finalizada, para continuar agregando valor.', '', ''),
(2650, '2021', 1, 2, 690, 0, 'B', 'Para Sergio fue su primer temporada, pudo adaptarse al equipo y capacitarse en las tareas que se le encomendaron.', '', '', '', ''),
(2651, '2021', 1, 2, 692, 0, 'B', 'Para Agustin fue su primer temporada, pudo adaptarse al equipo y capacitarse en las tareas que se le encomendaron.', '', '', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2652, '2021', 1, 2, 691, 0, 'B', 'Para Jonathan fue su primer temporada, pudo adaptarse al equipo y capacitarse en las tareas que se le encomendaron.', '', '', '', ''),
(2653, '2021', 1, 5, 390, 0, 'B', '', '', '', '', ''),
(2654, '2021', 1, 5, 259, 0, 'NM', 'Se observa un desempeño insuficiente para el puesto ocupado. \r\nNo cumple con las expectativas esperadas de acuerdo a los resultados obtenidos. \r\nPoca capacidad de resolución de problemas, Le cuesta mucho trabajar con estandarización. \r\nLe cuesta el manejo de personal y las charlas difíciles y resolución de conflictos con el personal. \r\nLe cuesta organizarse con los tiempos y tareas. No busca alternativas.', 'Compromiso y responsabilidad son dos características fuertes en su desempeño.', 'Seguridad. Principio de incendio y muchos actos inseguros. Puenteado de sensores. Falta de uso de epp.\r\nErrores operativos ocurridos por falta de proactividad.\r\nErrores de comunicación. Debe trabajar mas con los demás pilares.', '', ''),
(2655, '2021', 1, 45, 617, 0, 'B', '', '', '', '', ''),
(2656, '2021', 1, 45, 542, 0, 'B', '', '', '', '', ''),
(2657, '2021', 1, 45, 600, 0, 'B', '', '', '', '', ''),
(2658, '2021', 1, 48, 177, 0, 'MB', 'Juan Carlos es una persona autónoma, con gran capacidad de trabajo en equipo, predispuesta y colaborativa.', '', '', '', ''),
(2659, '2021', 1, 48, 76, 0, 'B', 'David es una persona que le falta predisposición a la hora de realizar las tareas que se le asignan. Cumple con sus actividades pero tiene mucho por mejorar.', '', '', '', ''),
(2660, '2021', 1, 37, 606, 82.5, 'MB', '', '', '', '', ''),
(2663, '2021', 1, 46, 281, 0, 'B', 'Se la considera una colaboradora con capacidad para realizar algunas tareas más demandantes, pero no aprovecha las oportunidades ', 'Bien en Calidad y Seguridad', 'Debe mejorar su orientación a resultados. Debe enfocarse en generar valor agregado cuando solicita horas extras. Debe mejorar proactividad y demostrar mayor compromiso. Tiempos ociosos mal utilizados', '', ''),
(2664, '2022', 1, 5, 380, 0, 'B', 'Se observa poco compromiso con el puesto esta temporada. Se observa poco interés en asistir sobre todo los fines de semana. Inclusive hubo situaciones donde pide HHEE y luego no viene. \r\nSe observa perdida de tiempo durante tareas productivas y tiempos ociosos mal utilizados.\r\nDebe trabajar mas en orientación a los resultados. La linea SIG necesita un alto compromiso y autonomía para lograr los objetivos.', 'Facilidad para adquirir conocimientos y buena performance de operación.\r\n', 'La comunicación no es buena por que se observa perdida de tiempo con charlas no laborales.\r\nSe observa una proactividad baja, que luego de la devolución de desempeño mejora, pero que esta aun lejos de lo esperado para un puesto como el que ocupo en temporada.', '', ''),
(2665, '2022', 1, 5, 349, 0, 'MB', '', '', '', '', ''),
(2666, '2022', 1, 5, 628, 67.5, 'B', 'Se observa un cumplimiento de tareas sin mostrar mucho mas interés en aprender solo lo que se le asigna. No se observan grandes aportes en los sectores donde se ha desempeñado. Hace \"lo justo y necesario\"', '', 'Debe trabajar en comunicación. Debe ser mas efectiva y fluida.\r\nDebe trabajar mas en equipo. Se observa falta de integración en empaque de tetra. \r\nEn seguridad no usa protectores auditivos.\r\nDebe trabajar en el desarrollo de su autonomía. No se observan grandes intervenciones en las maquinas ni mucho interés en aprender. (tetra) \r\n', '', ''),
(2668, '2022', 1, 5, 333, 0, 'MB', 'Se observa un muy buen desempeño en las tareas asignadas. Además se observa un compromiso alto para cumplir con los objetivos. ', '', 'Se observan desvíos en la no utilización de los Epp en el autoelevador. Se le marca en reiteradas ocasiones. \r\nDebe trabajar mas en sistema. No se observa gran avance en asimilar conocimientos de esta índole, cada vez mas necesarios.', '', ''),
(2669, '2022', 1, 5, 115, 75, 'B', 'Se observa un buen desempeño en las tareas realizadas en control de remache. \r\nSe observa incomodidad en situaciones de reemplazo, dejando expuesto que debe trabajar mas en flexibilidad, adaptándose a los cambios de puestos, sobre todo en baja temporada en situaciones de reemplazos para refrigerio o ausentismo.\r\n', 'Proactividad, responsabilidad, compromiso y seguridad son competencias destacables.', 'Falta de comunicación al momento de tomar decisiones de hacer pruebas o detener la linea por problemas en Tomate. No fluye la comunicación hacia los lideres del sector.\r\nDebe trabajar mas en resolución de situaciones conflictivas con sus compañeras para poder lograr establecer relaciones laborales solidas, que lleguen a mejorar el trabajo en equipo.  \r\nDebe trabajar en calidad. Se detecta desvío con ingreso de productos no autorizados a planta.\r\n', 'Debe respetar los horarios de ingreso . Se detectan desvíos de tiempo en el ingreso al turno.', ''),
(2670, '2022', 1, 5, 117, 76.25, 'B', 'Se observa un buen desempeño, adecuado para las tareas asignadas. Debe trabajar mas en las competencias que se marcan a continuacion.\r\nSe lleva turron a planta', 'Proactividad, autonomía, calidad, responsabilidad y compromiso son competencias destacables. ', 'Se observan situaciones de conflicto que denotan la falta de trabajo en equipo con sus compañeras. \r\nSe observan formas no adecuadas de comunicar o reclamar situaciones cotidianas de la linea.\r\nDebe seguir trabajando en flexibilidad ante los cambios de tareas, por ejemplo ir a trabajar a las otras maquinas se observa molestia. \r\nDebe trabajar mas en seguridad. Se observan actos inseguros como destrabar DA sin guantes y riesgos de contacto con producto caliente en dosificadora. ', '', ''),
(2671, '2022', 1, 5, 185, 75, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.', 'Seguridad, calidad y flexibilidad son aspectos destacables.', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. ', '', ''),
(2673, '2022', 1, 5, 108, 76.25, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\n\r\nSe observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender. Se observa mayor autonomía en armadora y empaque.', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2675, '2022', 1, 5, 109, 67.5, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su sup', 'Seguridad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar mas en calidad. Hubieron muchos eventos en la temporada de atascos con objetos provenientes de la molienda que se deberían haber evitado, ya que su puesto justamente es el ultimo filtro para eliminar objetos extraños.', '', ''),
(2676, '2022', 1, 5, 139, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\n\r\n\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nSe observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender. Se observa mayor autonomía en armadora y empaque.\r\nDebe esforzarse en seguridad. Se le marca un desvío en pasando por debajo d', '', ''),
(2677, '2022', 1, 5, 140, 70, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n\r\nDebe respetarse el horario del desayunador.\r\n', 'Seguridad, calidad, trabajo en equipo y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2678, '2022', 1, 5, 169, 76.25, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\n', '', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2679, '2022', 1, 5, 267, 77.5, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nSe observa un buen desempeño en tomate en el despalletizador.', 'Debe trabajar mas proactividad. De todas maneras se observa un cambio interesante en su desempeño respecto de la proactividad en salsa. Se marca como un aspecto positivo, al igual que la comunicación.\r\n\r\nSeguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n\r\n', '', ''),
(2680, '2022', 1, 5, 322, 0, 'B', 'Se observa un desempeño adecuado para el puesto ocupado. Se destaca la preocupación, el compromiso, la dedicación y el esfuerzo por seguir asimilando conocimientos e ir mejorando en su desarrollo como operador. ', 'Compromiso con el puesto. Muy preocupado por la calidad. Muy buen trabajo en equipo y comunicación con calidad. ', 'Debe seguir trabajando fuertemente en el desarrollo de su autonomía, Se observa un gran avance, pero todavía no se encuentra en un nivel adecuado para resolver problemas por si solo Debe elevar sus conocimientos técnicos\r\nDebe seguir trabajando en seguridad. Se le observan varios desvíos, pero también se nota preocupación por la seguridad y muy receptivo a generar un cambio sobre la misma. ', '', ''),
(2681, '2022', 1, 5, 342, 80, 'MB', 'Se observa un muy buen desempeño para el puesto ocupado. Se observa un gran compromiso. ', '', 'Debe trabajar mas en autonomía, asimilando mas conocimientos sobre los equipos, pero también resolviendo conflictos con el personal a su cargo. Se observa que le cuesta la gestión dura.\r\nDebe trabajar mas en equipo. Debe aprender a resolver las diferencias con sus compañeros y pares para lograr los objetivos de manera mancomunada. Se observan fallas en la comunicación por diferencias personales.\r\nDebe seguir trabajando en seguridad. Se le llama la atención por actos inseguros y se le observan situaciones de', '', ''),
(2682, '2022', 1, 5, 439, 83.75, 'MB', 'Se observa un muy buen desempeño para el puesto ocupado', 'Sumamente proactivo. Responsable. Comprometido. Disciplinado,', 'Debe trabajar mas en comunicación. Se observan desvíos no comunicados a tiempo o directamente no comunicados.\r\nDebe trabajar mas en 5S del sector a cargo. \r\nDebe trabajar mas en asimilación de tareas y su concreción. Se le marcan las mismas y muchas veces en varias oportunidades y no se realizan.', '', ''),
(2683, '2022', 1, 5, 335, 0, 'B', 'El operario alcanza las necesidades del puesto, pero debe esforzarse mas, trabajando en lo detallado.', 'Flexibilidad, comunicación, compromiso con la calidad son fortalezas asimiladas.', 'Debe trabajar mas en proactividad. No debe esperar ordenes de lider o superiores. Debe desenvolverse de manera autónoma, tratando siempre de resolver los problemas por si solo. Debe trabajar mas en el GB, de manera activa, generando propuestas de mejora, y llevándose tareas para trabajar en la maquina que tiene a su cargo. \r\nDebe trabajar mas en seguridad. Se observan actos inseguros y desvíos que a esta altura deberían estar mas que superados. (pasar por debajo de cinta)', 'Debe replantearse su compromiso. En reiteradas ocasiones se le solicita colaboración para trabajar en otros sectores o areas y nunca ha podido.', ''),
(2684, '2022', 1, 5, 622, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', ' Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.', '', ''),
(2685, '2022', 1, 5, 641, 77.5, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nDebe concentrarse en sus tareas para no afectar el trabajo en equipo. Debe evitar perder el foco generando conversaciones en su puesto con terceros.\r\n\r\n', '', ''),
(2687, '2022', 1, 5, 642, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', '', ''),
(2688, '2022', 1, 5, 722, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\n', '', ''),
(2689, '2022', 1, 5, 723, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nDebe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\n', '', ''),
(2690, '2022', 1, 5, 730, 78.75, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\nEl operario realiza sus tareas de manera idonea', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', '', ''),
(2692, '2022', 1, 5, 732, 0, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\nEl operario realiza sus tareas de manera idónea\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2693, '2022', 1, 5, 736, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nDebe concentrarse en sus tareas para no afectar el trabajo en e', '', ''),
(2694, '2022', 1, 5, 588, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nSe observa mejoría respecto de evaluación anterior en seguridad.', 'Trabajo en equipo, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. Debe trabajar sobre todo en el orden de la planta y las 5s de la misma sin que un superior se lo marque.\r\n', '', ''),
(2695, '2022', 1, 5, 535, 0, 'MB', 'El operario manifiesta un muy buen desempeño para el puesto ocupado.\r\n', '', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\nDebe trabajar mas en calidad, preocupándose por alcanzar los estándares requeridos por la linea.', 'Seguridad, proactividad y flexibilidad son aspectos destacables.\r\nTrabajo en equipo es uno de los aspectos mas logrados.', ''),
(2696, '2022', 1, 5, 433, 48.75, 'B', 'El operario no demuestra un desempeño adecuado para el puesto ocupado. \r\nDebe trabajar en flexibilidad. le cuesta realizar las tareas en las cuales no se encuentra cómodo(jornada en engomadoras. Solo quiere trabajar en Blc)\r\nSe observa un muy bajo compromiso hacia la linea. Se le debe pedir por favor que se quede para trabajar en mejoras o tareas distintas a las cuales no se siente comodo.', 'Alta autonomía opacada por la falta de trabajo en equipo. ', 'Debe trabajar fuertemente en trabajo en equipo. Le cuesta dejar de lado los objetivos personales por el mancomunado. \r\nDebe mejorar la comunicación. Se observan maneras incorrectas de referirse a los compañeros (gritos)\r\nNo respeta la figura del Lider. Debe trabajar en mejorar la relacion con sus superiores directos(no avisa y se va de la linea)\r\nDemoras en el desayunador. Debe respetar los horarios preestablecidos.', '', ''),
(2697, '2022', 1, 5, 681, 75, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado. Trabaja en balancines y Dorado.\r\nDebe trabajar mucho en comunicacion.', 'Muy predispuesto para aprender.\r\nDemuestra alta autonomía pero solo en balancines. Debe trabajar mucho en Conservas.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nDebe trabajar mas en comunicacion. ', 'Se observa poco compromiso para las oportunidades que se le dio.', ''),
(2698, '2022', 1, 5, 674, 0, 'MB', 'Excelente operaria. Predispuesta a aprender en todos los sectores a los cuales se le ha enviado. ', 'En general su desempeño es bueno en todas las competencias. ', 'Se observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender. \r\n', '', ''),
(2699, '2022', 1, 5, 613, 0, 'MB', 'El operario manifiesta un muy buen desempeño para los puestos ocupados.\r\nEl operario realiza sus tareas de manera idónea. Se observa un cambio positivo con respecto a la evaluación anterior.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\nSe le brinda la posibilidad de capacitarse en otros equipos por su buen desempeño. El mismo responde de manera idónea y comprometida con sus nuevas tareas asignadas. ', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\n', '', ''),
(2700, '2022', 1, 5, 567, 73.75, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado. De todas maneras debe esforzarse mas para mejorar dicho desempeño´.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nDebe utilizar el teléfono de manera mesurada.', '', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2703, '2022', 1, 5, 440, 0, 'B', 'Se observa un desempeño adecuado para el sector, pero debe trabajar mucho en su modo de conducir. \r\nSe charla con el operario en varias ocasiones, e incluso el Lider de manera particular lo hace. En el transcurso de la temporada se observa una mejoría en su desempeño. Debe seguir esforzándose.', '', 'Se observa velocidad excesiva en el sector. Mala manipulación de pallets. Choques a estructuras y equipos.\r\nDebe mejorar la comunicación con el equipo de trabajo y el lider. La bocina es solo para informar que el autoelevador va circulando. \r\nMuchos pallets rotos y uñeteados. Debe trabajar con mucho mas cuidado. Se observa un andar muy rustico para tratar un producto delicado.', '', ''),
(2706, '2022', 1, 5, 341, 66.25, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado, pero debe esforzarse para mejorar. \r\nDebe trabajar mas en equipo y en comunicación. Debe ser mas fluida con el Lider. Le cuesta reconocer errores.', 'Autonomía es una competencia muy destacable. De todas maneras debe trabajar en sistema, generación de OT, carga, etc.', 'Debe trabajar en flexibilidad. No se adapta a los cambios profundos de tareas.\r\nDebe trabajar mas en seguridad. Se observa la no utilización de EPPs en varias ocasiones.\r\nDebe preocuparse mas por la calidad y los estándares definidos sobre en etiquetadora.', 'Debe trabajar en proactividad. Para las tareas que le agradan trabaja bien, pero para tareas que no le agradan no se observa el mismo ímpetu.', 'Se le deniega la capacitación de Soudronic por el bajo desempeño demostrado. '),
(2708, '2022', 1, 5, 630, 80, 'MB', 'El operario manifiesta un muy buen desempeño para el puesto ocupado.\r\n', 'Mucha predisposición para aprender.\r\nMucha proactividad. \r\nBuena autonomía', '', '', ''),
(2710, '2022', 1, 5, 662, 0, 'MB', 'La operaria manifiesta un muy buen desempeño  para el puesto ocupado.\r\n', 'Calidad, flexibilidad y seguridad son aspectos destacables.', 'Debe concentrarse en sus tareas para no afectar el trabajo en equipo. Debe evitar perder el foco generando conversaciones en su puesto con terceros.\r\n', '', ''),
(2711, '2022', 1, 5, 168, 0, 'MB', 'La operaria manifiesta un muy buen desempeño para los puestos ocupados.', '', '\r\nDebe trabajar mas en autonomía. Debe seguir absorbiendo conocimientos técnicos para elevar sus habilidades.', '', 'Debe trabajar mas en sistema. Debe capacitarse en carga de datos, ots, etc.'),
(2712, '2022', 1, 5, 184, 0, 'NM', 'La operaria no manifiesta un desempeño adecuado para el puesto ocupado. Necesita mejorar.\r\nEl desempeño en la mayoría de las competencias no alcanza para los requerimientos del puesto. ', 'Seguridad y flexibilidad son competencias destacables.', 'Sobre todo en calidad. Se le llama la atención en reiteradas ocasiones por no seleccionar, conversa mucho y deja de trabajar, se demora en el desayunador. Tampoco se hacían los controles de calidad y no se avisaba cuando se detectaba un desvío.', '', ''),
(2713, '2022', 1, 5, 186, 0, 'NM', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\nEl desempeño en la mayoría de las competencias no alcanza para los requerimientos del puesto. \r\n', 'Flexibilidad es una competencia destacable.', 'Sobre todo en calidad. Se le llama la atención en reiteradas ocasiones por no seleccionar, conversa mucho y deja de trabajar, se demora en el desayunador. Tampoco se hacían los controles de calidad y no se avisaba cuando se detectaba un desvío.\r\n\r\n', '', ''),
(2714, '2022', 1, 5, 229, 0, 'NM', 'La operaria no manifiesta un desempeño adecuado para el puesto ocupado. Necesita mejorar.\r\nEl desempeño en la mayoría de las competencias no alcanza para los requerimientos del puesto. \r\n', '', 'Sobre todo en calidad. Se le llama la atención en reiteradas ocasiones por no seleccionar, conversa mucho y deja de trabajar, se demora en el desayunador. Tampoco se hacían los controles de calidad y no se avisaba cuando se detectaba un desvió.\r\nAdemás en reiteradas ocasiones se la encuentra dormitando en el puesto. \r\nDebe respetarse el horario de ingreso al puesto de trabajo', '', ''),
(2715, '2022', 1, 5, 649, 0, 'MB', 'El operario manifiesta un muy desempeño para los puestos ocupados.\r\n', 'Muy proactivo. Muy buena comunicacion. Muy buen trabajo en equipo.', '', '', ''),
(2716, '2022', 1, 5, 665, 0, 'NM', 'El operario demuestra un desempeño regular. Si bien no alcanza, el reconoce que debe mejorar. Se le llama la atención en varias ocasiones por su desempeño. ', '', 'Debe trabajar mejor en equipo. Debe trabajar en seguridad. Rotura de manguera de gas. Debe trabajar mucho en proactividad. Debe llegar temprano a la linea. Debe respetar los horarios del desayunador. ', '', ''),
(2717, '2022', 1, 5, 654, 71.25, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', 'Seguridad, calidad  son aspectos destacables.\r\n', '', '', ''),
(2718, '2022', 1, 5, 661, 0, 'NM', 'La operaria no manifiesta un desempeño adecuado para el puesto ocupado. Necesita mejorar.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nSe molesta cuando se le asigna otra tarea en otro sector. Trabajar en flexibilidad.', '', 'El desempeño en la mayoría de las competencias no alcanza para los requerimientos del puesto. \r\nSobre todo en calidad. Se le llama la atención en reiteradas ocasiones por no seleccionar, conversa mucho y deja de trabajar, se demora en el desayunador. Tampoco se hacían los controles de calidad y no se avisaba cuando se detectaba un desvío.\r\n', '', ''),
(2719, '2022', 1, 5, 663, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', '', '', ''),
(2721, '2022', 1, 5, 610, 0, 'MB', 'La operaria manifiesta un muy buen desempeño adecuado para los puestos ocupados.\r\n', '', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', '', ''),
(2722, '2022', 1, 5, 286, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', '', 'Utilización excesiva del celular. \r\nDebe trabajar mas en flexibilidad. Debe dejar de cuestionar decisiones del los lideres y generar conflictos innecesarios que no generan trabajo en equipo.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', '', ''),
(2723, '2022', 1, 5, 385, 0, 'MB', 'Se observa un muy buen desempeño, adecuado para los puestos ocupados.', 'Se observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender. Se observa mayor autonomía en peladoras. \r\n', 'Debe trabajar mas en sistema. Carga de detenciones.\r\nDebe dejar de lado las especulaciones con los tiempos y trabajar en equipo sin pensar lo que sus pares harán luego.', 'Poco compromiso para participar en otros sectores y así generar polifuncionalidad. Debe dejar de ver la comodidad del puesto a desempeñar.', ''),
(2724, '2022', 1, 5, 406, 0, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. Debe mejorar en 5S. Tiempos muertos mal utilizados.\r\n', 'Calidad y flexibilidad son aspectos destacables.', 'Debe trabajar mucho en seguridad. Actos inseguros realizados. \r\nDebe trabajar mucho en sistema. No se observa gran generación de OTs ni participación activa en el GB.', '', ''),
(2725, '2022', 1, 5, 428, 0, 'NM', 'El operario no manifiesta un desempeño adecuado para el puesto ocupado. Necesita mejorar. \r\nDebe trabajar en flexibilidad aprendiendo a reconocer errores y modificando sus conductas cuando se le marcan.\r\nDebe trabajar mucho en autonomía. Es un puesto muy básico y no se observa interés en mejorar.', '', 'Debe trabajar en proactividad. Tiempos ociosos mal utilizados y tiempos de limpieza mal administrados. Se le llama la atención en varias ocasiones por este tema. Debe dejar de lado las especulaciones con los tiempos y trabajar en equipo sin pensar lo que sus pares harán luego.\r\n', '', 'Se le ofrece capacitarse en salsa 2 y no se observa interés en aprender. Se le deja de dar la posibilidad por falta de compromiso. '),
(2726, '2022', 1, 5, 603, 0, 'MB', 'El operario manifiesta un muy desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, comunicación y flexibilidad son competencias destacables.\r\n', 'Se observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender.\r\nSe observa mayor autonomía en cubeteado.', '', ''),
(2727, '2022', 1, 5, 598, 0, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe trabajar mas en equipo con el sector de etiquetado.', '', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. Mucho tiempo ocioso mal utilizado. Excesivo uso de celular.\r\n', '', ''),
(2728, '2022', 1, 5, 465, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en flexibilidad, aprendiendo a reconocer errores y modificando conductas y adaptándose a nuevas asignaciones o cambios profundos de tareas.\r\n', 'Calidad, seguridad y trabajo en equipo son competencias destacables.', 'Debe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\n', '', ''),
(2729, '2022', 1, 5, 469, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\nSe destaca la proactividad también.', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en sistema. Debe aportar de manera proactiva también al GB.\r\n', '', ''),
(2730, '2022', 1, 5, 470, 0, 'MB', 'La operaria manifiesta un muy buen desempeño adecuado para el puesto ocupado.\r\nDebe trabajar en orientación a los resultados. Se observa un avance en autonomía. Si bien debe seguir trabajando, se observa preocupación y ganas de aprender. Se observa mayor autonomía', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nDebe concentrarse en sus tareas para no afectar el trabajo en equipo. Debe evitar perder el foco en conversaciones en su puesto con terceros.\r\n\r\n', '', ''),
(2731, '2022', 1, 5, 472, 0, 'MB', 'La operaria manifiesta un muy buen desempeño adecuado para el puesto ocupado.\r\nSi bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola. De todas maneras se observa preocupación y ganas de aprender.', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva. Se observa mucha molestia ante situaciones normales de la temporada. \r\n\r\n', '', ''),
(2732, '2022', 1, 5, 493, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe respetarse el horario de ingreso al puesto de trabajo. La linea debe entregarse andando y para eso se debe entrar 5 min antes al puesto para enterarse de las novedades.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\n', 'Seguridad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su superiores. \r\nEn calidad debe trabajar mucho. Se observa perdida de tiempo. Debe trabajar con ambas manos. Es importante entender que este puesto es muy importante para lograr la calidad del producto.', '', ''),
(2735, '2022', 1, 5, 182, 0, 'B', 'La operaria manifiesta un desempeño adecuado para el puesto ocupado.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', 'Seguridad es un aspecto destacable de la operaria. Siempre dispuesta y aportando al sector.', 'Debe trabajar mas en equipo. Se observa que deja su puesto de trabajo en reiteradas ocasiones sin avisar al Lider u operador del sector.\r\nDebe trabajar mas en proactividad. No debe esperar ordenes de su sup. Debe utilizar los tiempos ociosos de manera provechosa.\r\nDebe trabajar mas en calidad. Hubieron muchos eventos en la temporada de atascos con objetos provenientes de la molienda que se deberían haber evitado, ya que su puesto justamente es el ultimo filtro para eliminar objetos extraños.\r\n', '', ''),
(2736, '2022', 1, 5, 317, 0, 'MB', 'El operario manifiesta un muy buen desempeño en los puestos ocupados.', 'Autonomia, calidad y flexibilidad son aspectos muy destacables. Ademas tiene un compromiso intachable.', 'Debe trabajar en comunicacion proactiva. COmunica pero tarde. \r\nDebe trabajar en proactividad. Se observan situaciones ociosas en las cuales se puede trabajar y mejorar.\r\nDebe trabajar mas en las 5S del sector sin que se lo marquen, de manera proactiva.', '', ''),
(2737, '2022', 1, 5, 408, 0, 'B', 'El operario manifiesta un desempeño adecuado para los puesto ocupados.', 'Trabajo en equipo y comunicacion son aspectos destacables.', 'Debe trabajar mas en proactividad. Se observan muchos momentos ociosos mal utilizados.\r\nDebe aprender a resolver conflictos con los compañeros. Debe trabajar mas en flexibilidad ante estas situaciones.', 'El operario manifiesta un alto compromiso en el sector.', 'Se le dio la oportunidad de aprender en el Conc. Rossi y tuvo un buen desempeño.'),
(2738, '2022', 1, 5, 540, 0, 'NM', 'El operario no cumple con el desempeño esperado. Si bien se nota una mejoria al final de la temporada, debe seguir esforzandose. Debe trabajar mucho en autonomia, dejando de depender del Lider o supervisor para resolver situaciones del sector.', 'Preocupacion por la seguridad y comunicacion son aspectos destacables.', 'Debe trabajar en flexibilidad. Si bien se observa predisposicion y escucha, al momento de mostrar los cambios no son rotundos.\r\nDebe trabajar sobre todo en proactividad. Demasiados tiempos ociosos mal utilizados.', 'El operario manifiesta un buen compromiso, pero debe comprometerse a mejorar su desempeño de manera global.', ''),
(2739, '2022', 1, 5, 550, 0, 'B', 'El operario manifiesta un buen desempeño para el puesto ocupado.\r\nSe observa un gran trabajo en autonomia. Debe seguir trabajando pero ha mejorado en esta competencia. \r\n', 'Trabajo en equipo, calidad y flexibiidad son aspectos destacables.', 'Se observan tiempos ociosos mal utilizados y uso excesivo del celular. \r\nEl equipo debe manejarse desde el sector y no trabajar desde la consola central. Se pierde autonomia para resolver problemas de manera proactiva.', 'El operario manifiesta un gran compromiso con el puesto ocupado.', ''),
(2741, '2022', 1, 5, 305, 80, 'MB', 'El operario ha mostrado un desempeño muy bueno a lo largo de la temporada. ', 'Se observan varias fortalezas, pero el compromiso, la responsabilidad, orientación a los resultados y la ganas de superarse día a día son situaciones que lo describen.', 'Debe trabajar mas en comunicación. Si bien no es malo comunicando, muchas veces por resolver los problemas no comunica las situaciones en tiempo y forma para acompañarlo en caso de ser necesario.\r\nSe observa una alta autonomía, pero por la criticidad del puesto debe seguir aprendiendo en los equipos a cargo para lograr una autonomía plena y la posibilidad de enseñar a los nuevos perfiles del sector.', '', ''),
(2742, '2022', 1, 5, 591, 0, 'MB', 'El operario manifiesta un muy buen desempeño en los puestos ocupados', 'Calidad, Seguridad, comunicacion son algunas ', 'Debe trabajar mas en el concepto de seguridad. Hubieron situaciones con limpiezas de filtro y la situacion particular con riesgo en el homogenizador.\r\nDebe trabvajar fuertemente en proactividad, Muchos tiempos ociosos mal utilizados. \r\nDebe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.', '', 'Carga SPAC\r\nJDE\r\nCarga de Ots'),
(2743, '2022', 1, 5, 685, 0, 'B', 'El operario manifiesta un desempeño adecuado para los puestos ocupado.\r\n', 'Flexibilidad y calidad son competencias destacables.', 'Debe trabajar en seguridad. Hubieron algunas situacones como las del homogenizador que generaron situaciones riesgosas no tenidas en cuenta.\r\nDebe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo\r\nDebe trabajar fuertemente en proactividad. Se observan tiempos ociosos mal utilizados.', 'El operario manifiesta un alto compromiso.', ''),
(2744, '2022', 1, 5, 694, 0, 'B', 'El operario manifiesta un desempeño adecuado para los puestos ocupado.\r\n', 'Comunicacion, trabajo en equipo y flexibilidad son competencias destacables.', 'Debe trabajar en seguridad. Hubieron algunas situacones como las del homogenizador que generaron situaciones riesgosas no tenidas en cuenta.\r\nDebe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo\r\nDebe trabajar fuertemente en proactividad. Se observan tiempos ociosos mal utilizados. No debe esperar ordenes de su supervisor o Lider del sector\r\n', '', ''),
(2746, '2022', 1, 5, 319, 0, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad, flexibilidad y proactividad son aspectos destacables.', 'Debe aprender a trabajar mejor en equipo. Debe revisar las formas de dirigirse.\r\nDebe respetar las normas de BPM respecto de los alimentos. Se observa ingresar a planta alimentos. \r\nDebe respetar los horarios del desayunador. Se observa ingreso fuera de horario y demoras en el mismo.', '', ''),
(2747, '2022', 1, 5, 339, 0, 'MB', 'El operario manifiesta un muy buen desempeño para los puestos ocupados.', '', 'Debe trabajar mas concentrado en sus tareas. Debe dejar de distraerse y perder tiempo ocioso.\r\nDebe trabajar mas en autonomía para resolver problemas por si solo.', '', ''),
(2748, '2022', 1, 5, 607, 72.5, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\nDebe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\n\r\n', '', ''),
(2750, '2022', 1, 5, 680, 0, 'B', 'El operario manifiesta un desempeño adecuado para el puesto ocupado.\r\n', 'Seguridad y flexibilidad son competencias destacables.\r\n', 'Debe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\nDebe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo.\r\n', '', ''),
(2751, '2022', 1, 49, 176, 83.75, 'MB', 'Se observaron mejoras desde la devolución anterior ', 'Proactividad en adelantarse a posibles inconvenientes del sector y su ordenamiento', 'Dificultad en terminar todas las tareas por asumir compromisos hacia todas las areas lo cual se vio mejorado en el ultimo año', 'Seguir mejorando en su debilidad y a la vez en aportar nuevas cosas a otras areas tales como mejoras enfocadas y participacion de grupos', 'Excel avanzado '),
(2752, '2022', 1, 49, 713, 48.75, 'NM', 'Dificultad en comprender tareas del sector', 'Capacidad de admitir errores mejorarlos y pedir ayuda', 'Trabajo en equipo con turno y velocidad en resolucion de tareas ', '', 'Excel'),
(2753, '2022', 1, 49, 24, 75, 'B', '', 'Capacidad de comunicación con el grupo de trabajo', 'Algunos conocimientos de manejo de pc y mayor participacion en tareas de grupo base y del sector', 'Mayor participación en tareas extras de la operación del puesto ', 'Excel Básico y avanzado '),
(2754, '2022', 1, 49, 27, 80, 'MB', 'Muy buena forma de trabajo en su turno y manejo de pendientes', 'Mucha capacidad de deteccion de desvios en planta y trabajo con su turno', 'Carga de algunos procesos por sistema y comunicacion con resto de turnos.', 'Mejora en comunicación y trabajo en equipo con sus compañeros', 'Excel basico y avanzado'),
(2755, '2022', 1, 49, 253, 80, 'B', 'Mucha capacidad para mejorar procesos largos', 'Velocidad en tareas de sistema, comunicación de problemas o mejoras', 'Falta de participación en cualquier tarea distinta de lo operativo del sector', 'Mejoras en el trabajo en equipo y en proactividad de participaci+on en sgi', 'Autoelevador excel avanzado'),
(2756, '2022', 1, 49, 268, 85, 'MB', 'Gran predispocisión para tareas', 'Polifuncional a todas las aduanas y con voluntad de tareas que no le corresponden pero siempre realiza aun si no son asignadas', 'Participación en sgi y grupo base ', 'Mayr participación desde lo constructivo', 'Excel avanzado- Autoelevador. Soldadura'),
(2757, '2022', 1, 49, 315, 67.5, 'B', 'Dificutad en comunicación respecto a responsabilidades del puesto', 'Resolución de tareas siempre que el objetivo y el proceso este claro', 'Falta de trabajo en equipo, dificutad a la hora de pedir ayuda  o reconocer errores. No respeta jerarquías ( jefe), no acata de manera directa ordenes de trabajo', '', 'Excel avanzado Spac'),
(2758, '2022', 1, 49, 413, 81.25, 'MB', 'Proactividad para proponer mejoras en sector y resolver mas eficazmente  tareas diarias', 'Disponibilidad de trabajo en cualquier sector, proactividad, trabajo ene quipo', 'Dificultad en comunicacion con otras areas, particiación ', '', 'Autoelevador'),
(2759, '2022', 1, 49, 635, 72.5, 'B', 'Flexibiidad en horarios de trabajo', ' Flexibiidad en tareas a realizar y disponibilidad', 'Comunicación de problemas y anticipo a los mismos', '', 'Excel básico y avanzado'),
(2760, '2022', 1, 49, 715, 73.75, 'B', 'Gran capacidad en tareas nuevas, ', 'Velocidad de resolución de problemas, flexibilidad de puestos ', 'Trabajo en equipo y comunicación', '', 'Excel básico y avanzado'),
(2761, '2022', 1, 49, 737, 71.25, 'B', 'Trabajo en equipo ', 'Trabajo con equipo de aduana y flexibilidad de tareas y tiempos. Particiáción en grupos de mejoras', 'Trabajo con autoelevadores, comunicación formas de dirigirse al resto de piso de planta', '', 'Excel avanzado autolevador'),
(2762, '2022', 1, 1, 244, 93.75, 'MB', 'Es evidente el Compromiso de Jorge para con el Sector y la Empresa', 'COMPROMISO', 'AUTONOMIA', '', 'OFFICE'),
(2763, '2022', 1, 48, 401, 100, 'E', 'Es una persona sumamente autónoma. Muestra predisposición y voluntad en cualquiera de las actividades que se le demande. ', 'Capacidad de trabajo en equipo\r\nPerseverancia\r\nVoluntad y predisposición\r\nCompañerismo\r\nPolifuncionalidad ', '', 'En cada una de las actividades en las que se lo demanden\r\nCon el puesto de trabajo que ocupa', 'En todo momento busca aprender y demuestra esa aprendizaje.\r\n'),
(2764, '2022', 1, 48, 321, 0, 'E', 'Colaborador que muestra predisposición en todo momento, para cualquier actividad o responsabilidad se le demante, en su puesto de trabajo o para ayudar a sus compañeros', 'Voluntad\r\nCapacidad de trabajo en equipo\r\nAdaptación y flexibilidad en diversas actividades que realizan\r\n', 'Colaborador que debe comenzar a saber delegar actividades a sus demás compañeros, como así también tener una actitud de mayor liderazgo.', 'En cada una de las actividades que se le demandan', 'En todo momento muestra voluntad de aprendizaje, ya sea para aprender cosas nuevas en el puesto, como en nuevos puestos de trabajo.'),
(2765, '2022', 1, 5, 18, 0, 'MB', 'Se observa un muy desempeño por parte de la colaboradora.', 'Alto compromiso con la calidad. Gran orientación a los resultados.', '', '', ''),
(2766, '2022', 1, 5, 78, 0, 'B', 'Se observa un desempeño adecuado para el puesto ocupado y las tareas desempeñadas.', 'Calidad, flaxibilidad, compromiso.', 'Debe trabajar mas en sistema. Debe realizar Lups, tarjetas , etc. Debe mejorar los indicadores personales que aportan al trabajo en equipo de la linea y el cumplimiento de los estandares asociados.', '', ''),
(2767, '2022', 1, 5, 179, 0, 'B', 'Se observa un buen desempeño, adecuado para el puesto en el que se desempeña. Se observa un gran cambio en la manera de trabajar, mucho mas comprometido en la resolución de problemas y el aporte hacia el grupo base. ', '', 'Revisar cuestiones personales respecto de la responsabilidad con su equipo. Buscar reemplazo o planificar con tiempo.\r\nDebe trabajar mas en calidad. Debe trabajar mas con los estándares asociados al producto. Se observan desvíos.\r\nDebe trabajar mas en autonomía desarrollando conocimientos y habilidades.', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2768, '2022', 1, 5, 214, 0, 'B', 'Se observa un desempeño adecuado para el puesto en el que ha trabajado. Debe trabajar mas en Calidad, autonomía y Seguridad. En este ultimo se observa en varias oportunidades desvíos.', 'Trabajo en equipo, flexibilidad y comunicación son competencias destacadas.', 'Debe trabajar mas en calidad. Se observan desvíos en el proceso como manchadas, mal engomadas. Se debe resolver el problema para seguir trabajando, además de que se debe aprender a resolver el problema y estandarizar para que no ocurra Nuevamente. Debe trabajar mas en sistema para lograr esto.', '', ''),
(2769, '2022', 1, 5, 240, 0, 'MB', 'Se observa un muy buen desempeño en el puesto ocupado. Debe trabajar mas en las competencias mencionadas.', 'Autonomía, orientación a los resultados y trabajo en equipo son competencias destacables.', 'Debe trabajar mas en flexibilidad y compromiso con la calidad. Se deben resolver los problemas antes de producir. Debe aprender a ser mas flexible en situaciones de conflicto y resoluciones aunque no este de acuerdo.', 'Se observa un muy alto compromiso con su puesto de trabajo.', ''),
(2770, '2022', 1, 6, 22, 81.25, 'B', 'Martha trabaja esforzándose constantemente por alcanzar los resultados. Se destaca su comunicación y respeto y en este período se mostró muy bien trabajando en equipo e integrando al equipo a nuevos compañeros.', 'Sus fortalezas son el compromiso con los objetivos y con la calidad. \r\nLa predisposición para capacitar e integrar a compañeros al área.', 'En proyectos de este año mostró gran mejora en Autonomía y Proactividad, siendo éstos igual los aspectos a seguir mejorando principalmente como administradora de pilar GT.', '', ''),
(2771, '2022', 1, 46, 5, 0, 'B', 'Sandra es una colaboradora que debe desarrollar la proactividad y mejorar su autonomía', 'Respetuosa', 'Poco proactiva, no se anticipa a los problemas. Poco autónoma, dependiente de otras personas para solucionar problemas. No es buena comunicando, y se torna confuso el manejo de la información. A una persona comunica algo y a otra persona le da información similar tergiversada. No es prudente al circular, debe mejorar su visión de la Seguridad', '', ''),
(2772, '2022', 1, 46, 559, 0, 'B', '', 'Bien orientado a resultados. Destaco su predisposición para cambiar de asignación', 'Puede mejorar autonomía para resolver problemas por sí mismo, sin depender de otras personas. También puede mejorar proactividad y anticiparse a situaciones futuras. Puede mejorar su perspectiva hacia aspectos de Calidad y Seguridad', '', ''),
(2773, '2022', 1, 46, 527, 0, 'B', '', 'Se ve una intención de mejorar su desempeño. En general flexible para adaptarse a cambios', 'Debe mejorar el nivel de conocimientos de balancines para poder ser más autónomo y resolver problemas por sí mismo. Debe desarrollar la capacidad para detectar mejoras y aportar más al grupo base. Debe mejorar su actitud con Seguridad ', '', ''),
(2774, '2022', 1, 46, 330, 0, 'NM', '', 'Mostró interés por aprender y crecer. Por su bajo desempeño no se le dio oportunidad de cambiar de puesto y luego fue desvinculado por una falta de respeto a un superior', 'Mucho uso del celular, y aunque se le marcó, no mostró intenciones de mejorar. Uso del celular mientras manejaba el autoelevador. Poco sentido de la seguridad. Poco amable al recibir asignaciones. Poca capacidad de análisis de problemas y autonomía. Muy baja proactividad', '', ''),
(2775, '2022', 1, 46, 547, 0, 'B', '', 'Bien trabajando con sus compañeros y bien predispuesto a cambio de asignaciones. Puede mejorar su proactividad cuando la línea está detenida, para sumar valor.', 'Debe mejorar su capacidad de análisis y comunicación de problemas', '', ''),
(2776, '2022', 1, 46, 159, 0, 'B', '', 'Teresa mejoró desempeño en cuanto a trabajo en equipo y comunicación con sus compañeros/as. Debe seguir mejorando', 'Debe seguir mejorando proactividad, comunicación con líder y compañeros/as. En general no acepta con buena predisposición nuevas asignaciones, debe trabajar la flexibilidad y la empatía. Debe desarrollar la capacidad para agregar valor en momentos de línea detenida y la capacidad para resolver problemas por sí misma', '', ''),
(2777, '2022', 1, 46, 56, 0, 'NM', '', '', 'Baja orientación a resultados. Poco trabajo en equipo. Muchas ausencias. Solicitaba permisos sin anticipación y sin pensar en cómo afectaba a sus compañeros. Muy poca proactividad y nula autonomía. Muy baja capacidad para resolver problemas por sí misma. Muy dependiente de otras personas', '', ''),
(2778, '2022', 1, 46, 381, 0, 'MB', '', 'Bien predispuesta a cambio de asignaciones. Bien trabajando en equipo (rotación). Bien con la Calidad y la Seguridad. Comunicativa. Sabe explicar los problemas y colabora en la resolución', 'Puede seguir mejorando su capacidad de resolución de problemas en forma autónoma y la proactividad (aportar valor en tiempos de línea detenida)', '', ''),
(2779, '2022', 1, 46, 392, 0, 'B', '', 'Acepta bien cambio de asignaciones. En general resuelve por sí misma. Colabora con la rotación. Buena participación en jornadas de autónomo', 'Le cuesta mucho expresarse por su timidez. Debe mejorar su capacidad de comunicación para explicar problemas y participar del análisis. Debe mejorar su actitud ante momentos de línea detenida (sumar valor)', '', ''),
(2780, '2022', 1, 46, 70, 0, 'MB', '', 'Muy orientada a resultados y siempre enfocada en el cumplimiento de objetivos. Muy bien con Calidad. Debe mejorar algunos aspectos de Seguridad (gafas, manipulación de pl). Proactiva. Activa en 5S', 'Debe perder timidez para resolver conflictos que surgen con sus compañeros varones y poder trabajar en equipo. Le cuesta comprender algunos cambios de asignaciones, debe mejorar empatía. Le es difícil reconocer errores', '', ''),
(2781, '2022', 1, 46, 89, 0, 'B', '', 'En general bien orientada a resultados. Bien con Calidad y Seguridad', 'Mal predispuesta a nuevas asignaciones y cambios de puesto. Debe desarrollar la empatía. Al ser inflexible también perjudicó el trabajo del equipo porque no quería rotar. Puede mejorar su capacidad de comunicación y escucha', '', ''),
(2782, '2022', 1, 46, 647, 0, 'MB', '', 'Bien orientado a resultados. Trabaja muy bien con el sistema, debe seguir así. Siempre respetuoso y buena comunicación. Siempre enfocado en aspectos de Calidad y Seguridad. Supo adaptarse a cambio de asignaciones nuevos puestos)', 'Le costó trabajar en equipo con su par. A veces debe cruzar información con otros sectores para tomar decisiones y esto no ocurre en forma fluida. Debe desarrollar empatía para entender decisiones y realidades de otros sectores (Calidad, Programación). Le es difícil reconocer errores. Debe aprender a dominar la frustración y mejorar la toma de decisiones bajo presión. Analizar las situaciones en forma lógica, cruzando información con las áreas soporte.', '', ''),
(2783, '2022', 1, 46, 93, 0, 'B', '', 'En general respetuosa y buena comunicadora de situaciones a resolver. Buena participación en jornadas de autónomo (interés económico)', 'Uso del teléfono en horario laboral (distracciones). Muy interesada en cambio de puesto por el aspecto económico, no tanto por el aprendizaje o el interés en sumar valor. Baja autonomía y baja proactividad. A veces predispuesta a nuevas asignaciones y otras veces no (interés personal)', '', ''),
(2784, '2022', 1, 46, 658, 0, 'NM', '', 'Colaboración en jornadas de autónomo', 'En general muy baja proactividad y autonomía. Se tuvo que reasignar puesto (doypack) porque no quiso aprender en el puesto asignado (salida de remachadora). En general tímida, lo que dificulta la comunicación.', '', ''),
(2785, '2022', 1, 46, 625, 0, 'MB', '', 'Muy buena capacidad de aprendizaje. Bien predispuesto a cambios de puesto. Muchas ganas de aprender. Respetuoso, buen comunicador. Buen pensamiento lógico de resolución de problemas', 'Mucho uso del teléfono. Se habló con él y mejoró al final de temporada. Puede seguir mejorando aspectos de Seguridad. Debe mejorar la proactividad (se charló con él y se observaron mejoras)', '', ''),
(2787, '2022', 1, 48, 270, 0, 'E', 'Es un colaborador sumamente autónomo. ', 'Capacidad de trabajo en equipo.\r\nPerseverancia \r\nBusca mejorar en todo momento.\r\n', 'Saber escuchar a los demás y tomar lo positivo de ellos.', '', 'Se interioriza todo el tiempo en mejorar, mediante capacitaciones en su puesto de trabajo.'),
(2788, '2022', 1, 48, 80, 0, 'E', 'Es una colaboradora sumamente proactiva y autónoma. Tiene muchos conocimientos sobre el puesto que realiza.', 'Proactividad\r\nCapacidad de trabajo en equipo\r\nResponsabilidad laboral', '', '', ''),
(2789, '2022', 1, 46, 94, 0, 'B', '', 'En general buena comunicadora. Flexible a nuevas asignaciones. En general bien enfocada en Calidad y Seguridad', 'Puede mejorar mucho la proactividad. Foco en realizar actividades que agreguen valor cuando la línea está detenida. Debe mantener y mejorar su desempeño ahora que se le otorgó la categoría que ella estaba pidiendo', '', ''),
(2790, '2022', 1, 46, 565, 0, 'MB', '', 'Muy bien orientado a resultados. Buena participación en tareas extra. Flexible, acepta bien nuevas asignaciones. Buen comunicador y escuchador. Acepta errores. Trabaja en equipo', 'Debe seguir mejorando autonomía para resolver problemas por sí mismo. Debe seguir trabajando en proactividad. Objetivo: enfocarse en Seguridad y Calidad para igualar en conocimientos a los choferes más experimentados', '', ''),
(2791, '2022', 1, 46, 556, 0, 'B', '', 'Muy enfocado en Calidad de tomate. En general bien con Seguridad. Buena participación en tareas extra. Respetuoso. ', 'Puede seguir desarrollando autonomía para resolver problemas por sí mismo. Puede mejorar proactividad para aportar valor en tiempos de línea detenida. Debe aprender a coordinar acuerdos Producción/Calidad que no afecten la continuidad de la línea. Debe mejorar comunicación y trabajo en equipo con líderes de envasado y playa', '', ''),
(2792, '2022', 1, 46, 326, 0, 'B', '', ' Bien aprendiendo sobre los equipos de su alcance y empezando a resolver con autonomía. Interés por aprender y mejorar. Respetuoso. ', 'Mejoró proactividad y autonomía pero queda mucho por desarrollar. Debe mejorar comunicación de problemas y participación de análisis', '', ''),
(2793, '2022', 1, 46, 683, 0, 'MB', '', 'Muy enfocado en resultados. Bien predispuesto a cambio de asignaciones. Buena participación en tareas extras. Respetuoso. Excelente comunicador y participante activo de análisis de problemas', 'Debe aprender a respetar posiciones y reportar al líder sin saltearlo en la resolución o análisis de problemas. Puede mejorar autonomía, se tiene que animar. Debe comprender mejor el funcionamiento de planta para mejorar proactividad', '', ''),
(2794, '2022', 1, 46, 429, 0, 'MB', '', 'Muy buen comunicador. Muy buena orientación a resultados y participación en jornadas de autónomo. Mejoró mucho la autonomía, debe seguir aprendiendo y desarrollando', 'Debe comprender la importancia de respetar al líder y no saltearlo para resolver un problema. Debe hacerlo parte del análisis antes de contactar al Supervisor', '', ''),
(2795, '2022', 1, 46, 90, 0, 'B', '', 'Muy bien en tareas de limpieza. Bien coordinando tareas con sus compañeros/as. En general bien con Calidad y Seguridad', 'Se ausentó en alistamientos sin aviso, habiéndose comprometido previamente. Debe mejorar proactividad (aportar valor en tiempos de línea detenida). En general autónoma en las tareas habituales, y menos autónoma fuera de la zona de confort. Resistencia a cambio de asignaciones', '', ''),
(2796, '2022', 1, 46, 300, 0, 'B', '', 'Buen conocimiento técnico que permite mejor comprensión del problema. Buena participación en tareas de mantenimiento, jornadas de autónomo y reuniones de grupo base (presencia)', 'A veces difícil la comunicación por su personalidad retraída. Muy poco foco en Calidad, tuvo varios eventos de PNC. Baja orientación a resolver los problemas que él mismo generó. Le es difícil aceptar errores y oportunidades de mejora. Visión negativa de las cosas, aportes que no suman en reuniones de grupo base (quejas, reclamos, muy pocas cuestiones para sumar)', '', ''),
(2797, '2022', 1, 46, 371, 0, 'B', '', 'Se adaptó fácilmente a nuevas asignaciones, buena predisposición. Muy buena predisposición en tareas extra y producción en fines de semana', 'Puede mejorar la comunicación. Debe mejorar proactividad y foco en 5S sin que nadie se lo esté pidiendo. Cambiar actitud reactiva por actitud proactiva. Puede mejorar capacidad de resolución de problemas que están a su alcance', '', ''),
(2798, '2022', 1, 46, 50, 0, 'B', '', 'Muy buen compromiso, participación en jornadas de autónomo. Muy buena aceptación a cambio de asignaciones. Muy buen foco en Calidad y Seguridad, aportando mejoras. Buena participación en grupo base. Buena colaboración con sus compañeros en otros puestos', 'Le es difícil comunicar problemas y participar del análisis. Conocimiento básico de los equipos que opera aún habiendo pasado mucho tiempo en el puesto. Poco tolerante a situaciones bajo presión, se nubla y anula pensamiento lógico. Baja proactividad y baja autonomía, depende mucho del Líder para resolver problemas. Le es difícil reconocer errores e identificar oportunidades de mejora propias', '', ''),
(2799, '2022', 1, 46, 340, 0, 'MB', '', 'Buena aceptación de cuestiones a mejorar. Buena predisposición a cambios de asignaciones. Muy buen compromiso y orientación a resultados. Interés por trabajar en equipo. Muy buena autonomía', 'Debe mejorar aspectos de Seguridad en el accionar diario (uso de EPP, arreglos improvisados, detección de necesidades de mejora, actos inseguros). Debe mejorar criterios de Calidad. Producir sin descuidar pilares importantes', '', ''),
(2800, '2022', 1, 46, 269, 0, 'NM', '', 'Cumple con participación en reuniones de grupo base y jornadas de autónomo (siempre interés económico por sobre compromiso). ', 'Rechazó hacer tareas que habitualmente hacía anteponiendo excusas (desarme de matricería). Es una persona negativa, que no aporta cosas constructivas y se lo ve habitualmente de mal humor. Una persona experimentada como él debería estar motivando a gente más joven pero eso no ocurre (todo lo contrario). Le es díficil aceptar nuevas asignaciones o cambio en las mismas', '', ''),
(2801, '2022', 1, 46, 370, 0, 'MB', '', 'Muy buen comunicador. Siempre con ganas de aprender, trabajar en equipo y con buena predisposición a cambios de puesto. Flexible. Muy buen compromiso con la Calidad. ', 'Puede seguir mejorando el foco en Seguridad por sobre la Producción. Puede seguir desarrollando conocimientos para resolver problemas por sí mismo. Puede seguir mejorando el foco en optimización de recursos', '', ''),
(2802, '2022', 1, 46, 95, 0, 'MB', '', 'En general muy bien orientada a resultados. Buena participación en jornadas de autónomo. Bien predispuesta a cambios de puesto, cambios de turno y nuevas asignaciones. Su experiencia le permite resolver problemas por sí misma', 'Puede mejorar la comunicación de problemas a resolver', '', ''),
(2803, '2022', 1, 46, 303, 0, 'MB', '', 'Muy bien gestionando a su equipo. Observó posibilidades de polifuncionalidad. Siempre atento a mejoras. Señala desvíos y ofrece soluciones. No le gusta trabajar desordenado y sucio, foco en Calidad y 5S. En general flexible a nuevas asignaciones', 'Puede desarrollar aspectos técnicos para resolver problemas más complejos en forma autónoma, sin necesidad de que venga el mecánico. O en forma simultánea problemas diferentes.', '', ''),
(2804, '2022', 1, 46, 279, 0, 'MB', '', 'En general muy respetuoso, muy buenas habilidades técnicas. Muy autónomo. Foco en Calidad. Ganas de seguir aprendiendo. Aprovecha los tiempos libres para seguir perfeccionándose', 'Debe aprender a transmitir un poco más de emociones, problemas a resolver. No encerrarse en sí mismo y dejar que lo ayuden. Puede mejorar la coordinación con sus compañeros de equipo', '', ''),
(2805, '2022', 1, 46, 190, 0, 'NS', '', '-', 'Se duerme en el puesto de trabajo, por lo que se tuvo que reubicar a un puesto donde no represente un riesgo para su integridad física. Le es difícil aceptar oportunidades de mejora. Sus respuestas y actitud para afrontar tareas es el de una persona con aparente depresión, negativa, con nulo foco en construir o aportar valor. Actitud muy pasiva. Se enoja si la cambian de puesto. Sólo quiere estar en aquellos lugares donde pueda realizar HHEE el fin de semana. Eso generó problemas con sus compañeras de traba', '', ''),
(2806, '2022', 1, 46, 183, 0, 'NS', '', '-', 'En general actitud ociosa, durmiendo en el puesto de trabajo. Sobrecarga a sus compañeras en la selección de tomate. No trabaja con foco en Calidad, parece no importarle. Se ausenta al puesto de trabajo sin avisar. Muy poco proactiva y no acepta bien cambios de puesto.', '', ''),
(2807, '2022', 1, 46, 246, 61.25, 'NM', '', 'Tiene mucho conocimiento de FEM. En general respetuoso. Predisposición para nuevas asignaciones y cambios. En general mostró compromiso cuando se lo necesitó', 'Ha bajado mucho su desempeño. Aún teniendo mucha experiencia, no tiene la capacidad para resolver problemas complejos por sí mismo. Requiere permanentemente la ayuda del mecánico o de otra persona (Aduana PT, Supervisor). No comunica en forma asertiva detenciones y problemas a resolver. Le es difícil gestionar la disciplina del personal. En varias ocasiones ha expuesto de mala manera a algunos de sus compañeros, evidenciando que tiene problemas para hablar con ellos y plantear un plan de acción para mejorar', '', ''),
(2808, '2022', 1, 46, 287, 0, 'B', '', 'En general muy respetuoso. En general bien respetando estándares de Calidad y Seguridad. Buen compromiso en tareas de limpieza y autónomo', 'Ha bajado mucho su desempeño. Mucho uso del celular, se le llamó la atención en varias oportunidades por ese motivo. Debe ser más proactivo y aportar valor en la resolución de problemas. Debe seguir desarrollando la capacidad para resolver problemas por sí mismo. Ya dejó de ser nuevo en el puesto pero aún no se observa un crecimiento real en cuanto a conocimientos', '', ''),
(2809, '2022', 1, 46, 587, 0, 'MB', '', 'Flexible. Buena predisposición a cambio de asignaciones. Buena participación en limpieza, autónomo y tareas extras. Colaborador con sus compañeros. Aporta valor en otras tareas cuando tiene tiempo libre sin que nadie se lo pida. Muy bien orientado a resultados', 'Debe evitar el uso del teléfono en horario laboral. Debe desarrollar el foco en Seguridad (uso de EPP, actos inseguros, relevamiento de condiciones inseguras)', '', ''),
(2810, '2022', 1, 46, 66, 38.75, 'NM', '', 'Es eficaz en lo que hace (paletizador) pero lo que ofrece está muy por debajo de lo que él puede dar', 'Muy bajo compromiso para toda tarea que no sea la básica asignada (paletizar). Tiene muy buenas habilidades técnicas pero no las pone a disposición del equipo. Se ubica en una posición de nula autonomía, y podría dar mucho más. No tiene ganas de aprender. En general le es difícil aceptar nuevas asignaciones. Está cómodo donde está y no aspira a dar mucho más. No aporta observaciones de Calidad o Seguridad. Depende de otras personas para la resolución de problemas de su sector', '', ''),
(2811, '2022', 1, 46, 156, 0, 'B', '', 'Buenas habilidades técnicas que le permiten tener autonomía. Buena participación y compromiso en limpieza y autónomo.', 'Le es muy difícil aceptar oportunidades de mejora. Resistente a cambio de asignaciones. Puede mejorar el trabajo en equipo y analizar cómo aportar valor al grupo base y la mejora continua. En general bien con Seguridad y Calidad, puede mejorar aportando observaciones. Tuvo participación en reiteradas roturas de fotocélulas de TBA8.', '', ''),
(2812, '2022', 1, 46, 223, 77.5, 'B', '', 'Buena gestión de la disciplina del personal a cargo. Ha mejorado la autonomía. En general intenta ser proactivo, se valora. Muy buena perspectiva en Calidad y Seguridad. Ha mejorado la flexibilidad y aceptación de nuevas asignaciones', 'Le es difícil comunicarse cuando las cosas no salen como a él le gustaría. Se bloquea y no transmite correctamente la información. No debe descuidar su rol como referente MAHPI de la línea que lidera. Debe aportar más al grupo base y colaborar con sus compañeros activamente en procesos de mejora y auditoría (SGI). Puede seguir desarrollando conocimientos técnicos para resolver problemas por sí mismo, sin necesidad de depender del mecánico', '', ''),
(2813, '2022', 1, 46, 178, 0, 'B', '', 'Es el mejor resolviendo problemas de tótems caídos o por caerse. En general resuelve muy bien y con autonomía problemas que están a su alcance. A veces bien predispuesto para tareas extra', 'Le es difícil aceptar oportunidades de mejora. Tiene que mejorar la comunicación con algunos de sus compañeros. Ser más colaborativo. Debe aprender a aportar valor en aquellas actividades que son prioritarias cuando tiene tiempo libre (siempre consultar). Resistente a cambios de puesto (doypack, paletizado). Debe mejorar la perspectiva de Seguridad (uso de EPP, análisis de actos y condiciones inseguras)', '', ''),
(2814, '2022', 1, 46, 148, 0, 'NM', '', 'Ha mejorado su desempeño de tareas básicas. Cumple con lo que se le pide, pero está muy por debajo de lo que podría aportar. En general acepta bien nuevas asignaciones. ', 'Muy bajo compromiso para algo más que cumplir con las tareas básicas asignadas (paletizar). Nulo aporte de sus habilidades técnicas y de gestión. Muy baja autonomía, podría aportar a su equipo mucho más. Bajo compromiso en jornadas de autónomo y limpieza. Le es muy difícil aceptar oportunidades de mejora señaladas. En ocasiones priorizó su otro trabajo por sobre este y así lo expresó.', '', ''),
(2815, '2022', 1, 46, 348, 0, 'MB', '', 'Respetuoso, acepta nuevas asignaciones. Ganas de aprender y mejorar. Buen foco en Calidad y Seguridad, aportando cuestiones a mejorar.', 'Debe continuar aprendiendo para poder resolver en forma más autónoma. Puede seguir desarrollando proactividad. Análisis de situaciones para aportar valor cuando tiene tiempo libre', '', ''),
(2816, '2022', 1, 46, 67, 0, 'MB', '', 'Muy buena autonomía. Buenas habilidades técnicas. Buena gestión de la disciplina, enfocado en 5S. Detecta oportunidades de mejora, realiza observaciones.', 'Le es difícil reconocer oportunidades de mejora. Puede mejorar trabajo en equipo y tener una perspectiva constructiva hacia el grupo base. Debe trabajar más con el SGI en plan maestro y grupos de mejora. Puede seguir mejorando su perspectiva de la Seguridad (uso de EPP)', '', ''),
(2819, '2022', 1, 48, 271, 64.29, 'B', 'Es un operador que necesita de motivación. No tiene participación por interés propio.', 'Capacidad de escuchar a los demás.\r\n', 'Falta de comunicación con los demás compañeros y con el líder.\r\nFalta de compromiso', '', 'Falta de iniciativa para mejorar día a día.\r\n'),
(2820, '2022', 1, 48, 499, 0, 'MB', 'Es un colaborador sumamente responsable con cada una de las actividades que se le otorga. ', 'Capacidad de trabajo en equipo\r\nComunicación\r\nAutonomía\r\nFlexibilidad', '', '', ''),
(2821, '2022', 1, 48, 177, 83.75, 'MB', 'Es un colaborador que se compromete a aprender cosas nuevas, tiene entusiasmo y compromiso con las tareas que se le asignan', 'Adaptabilidad \r\nFlexibilidad\r\n', 'Comunicación con el resto de los colaboradores de otros turnos. \r\nFalta de trabajo en equipo', '', ''),
(2822, '2022', 1, 46, 163, 0, 'B', '', 'Cuenta con experiencia en el equipo que opera, y resuelve en forma bastante autónoma. Respetuosa. Buena presencia en tareas de limpieza y autónomo. Mostró interés para trabajar en equipo en rotación', 'Un poco tímida, puede mejorar su capacidad de comunicación de problemas a resolver. Puede ser más proactiva para aportar valor en momentos de línea detenida', '', ''),
(2823, '2022', 1, 46, 539, 0, 'MB', '', 'Ha superado las expectativas en su puesto actual de temporada, y se le debe dar la oportunidad de aprender en otros puestos. Muy bien orientado a resultados. Trabaja en equipo con el resto de los integrantes de LTP. Buena participación en limpieza y autónomo. Bien predispuesto a nuevas asignaciones', 'Puede empezar a trabajar más con el sistema de gestión. Carga de OT, participación en planificación, aportes al grupo base.', '', ''),
(2824, '2022', 1, 46, 33, 0, 'B', '', 'Ha mejorado su orientación a resultados, comprendiendo la necesidad de planta y comprometiéndose en varias ocasiones a tareas asignadas. Bien trabajando en equipo, falta comprender las necesidades del equipo independientemente de la vida personal de cada uno. Acepta bien nuevas asignaciones', 'Debe resolver con mayor autonomía. Tiene buenas habilidades técnicas pero deja que el mecánico resuelva problemas que él mismo podría solucionar. Le es difícil aceptar oportunidades de mejora. Debe mejorar su capacidad de análisis para aportar valor en momentos que tiene tiempo libre', '', ''),
(2825, '2022', 1, 46, 627, 0, 'MB', '', 'En general autónomo, puede seguir mejorando. Buen comunicador. Trabaja en equipo. Muy bien orientado a resultados. Acepta nuevas asignaciones', 'Puede seguir desarrollando conocimientos técnicos para comunicar problemas a resolver y acelerar la resolución. Debe disminuir el uso del teléfono en horario laboral. Puede desarrollar más el foco en Calidad y Seguridad', '', ''),
(2826, '2022', 1, 46, 629, 0, 'MB', '', 'Bien orientado a resultados. Buen compromiso con el equipo. Buena presencia durante toda la temporada. Respetuoso. Capacidad de aprendizaje (potencial). Siempre flexible a nuevas asignaciones', 'Debe mejorar el foco en Calidad (cómo impactan nuestras decisiones en la calidad del producto y en la integridad del equipo). Puede mejorar la capacidad de análisis para agregar valor en situaciones de tiempo libre. Debe continuar incorporando conocimientos para resolver con mayor autonomía', '', ''),
(2827, '2022', 1, 46, 264, 0, 'NM', '', 'No ha perdido el foco en la Calidad y la Seguridad, pero tampoco genera observaciones de mejora', 'Bajo compromiso con el equipo y baja orientación a resultados. Por su experiencia podría resolver con mayor autonomía pero no lo hace. Demostró que no tiene ganas de trabajar en el sector. Expresó que quiere estar en Ingredientes. Nulas observaciones de mejora. En lugar de ser un motivador por su experiencia, promueve condiciones y pensamientos negativos. No trabaja con sistema (gestión de OT, aportes al GB)', '', ''),
(2828, '2022', 1, 46, 343, 0, 'B', '', 'Acepta bien nuevas asignaciones y acepta las oportunidades de mejora señaladas en varias oportunidades. Desarrolló autonomía en el puesto, pero está lejos de lo que puede dar. Buenas habilidades técnicas que no utiliza', 'Mucho uso del teléfono celular. Actitud ociosa. Se le llamó la atención reiteradas veces por el mismo motivo. Debido a esto se incurre en fallos de equipo y PNC, evitables con ayuda del operador. Debe enfocarse en Seguridad (uso de EPP, actos inseguros) y Calidad (PNC). En lugar de motivar a su compañero, influyó negativamente', '', ''),
(2829, '2022', 1, 46, 207, 0, 'B', '', 'Sabe anticiparse para resolver situaciones futuras. Realiza aportes y conocimientos de su experiencia. Espíritu colaborador con el equipo si no interfiere con sus intereses personales. En general autónomo, puede resolver problemas a su alcance por sí mismo. Sabe aportar valor en tiempos libres, proactivo', 'Le es difícil aceptar oportunidades de mejora. A veces inflexible a cambios de asignaciones. No disponible para producir o en actividades de limpieza los fines de semana', '', ''),
(2830, '2022', 1, 46, 191, 0, 'MB', '', 'Bien orientada a resultados. Dinámica. Trabaja en equipo. Buena participación en tareas de limpieza y autónomo. Simpática, aporta al buen clima. Respetuosa. Flexible a nuevas asignaciones', 'Puede mejorar su capacidad para resolver problemas que están su alcance, por sí misma. Puede ser más proactiva (aportar valor en tiempos muertos)', '', ''),
(2831, '2022', 1, 48, 25, 0, 'E', 'Es una colaboradora sumamente autónoma, con mucho conocimiento en carga de datos al sistema y excelente administradora de grupo base. ', 'Responsable\r\nCapacidad de trabajo en equipo', '', '', ''),
(2833, '2022', 1, 48, 44, 0, 'B', 'Es un colaborador que necesita mejorar en el compromiso con las actividades que realiza.', '', 'Falta de proactividad con las tareas que desempeña.\r\nFalta de autonomía.\r\nNo escuchar a sus compañeros.', '', ''),
(2836, '2022', 1, 46, 282, 0, 'MB', '', 'En general bien orientada a resultados, enfocada en sus actividades y en como sumar valor. Flexible a nuevas asignaciones y cambios de puesto. Bien trabajando en equipo. En general resuelve por sí misma. Aprendió mucho del mecánico', 'Puede mejorar la comunicación de problemas a solucionar. Deberá hacerlo desarrollando conocimientos. ', '', ''),
(2837, '2022', 1, 46, 669, 0, 'MB', '', 'Flexible a nuevas asignaciones y cambios de puesto. En general resuelve por sí mismo. Buen pensamiento lógico. Muy bien orientado a resultados. Buena comunicación.', 'Debe mejorar el foco en la Seguridad. Uso de EPP, análisis de condiciones y actos inseguros. Puede mejorar la capacidad para aportar valor en tiempos libres. Debe continuar desarrollando conocimientos en el puesto actual que le permitan mejorar autonomía', '', ''),
(2838, '2022', 1, 5, 36, 0, 'MB', 'El desempeño de la colaboradora es muy bueno. Debe trabajar mas en autonomía.', '', '', '', ''),
(2839, '2022', 1, 5, 43, 0, 'B', 'El desempeño de la colaboradora es bueno. Debe trabajar en las competencias con desvíos marcadas.', '', '', '', ''),
(2840, '2022', 1, 5, 211, 0, 'MB', 'El operario tiene un muy buen desempeño, pero debe trabajar mas en sistema. No se generan las OT por los trabajos que se realizan en la linea. \r\nDebe trabajar mas en orientación a los resultados. Se observa que trabaja de manera relajada y un uso excesivo de celular. Debe optimizar los tiempos muertos mal utilizados. Debe trabajar mas en autonomía. Debe aprender a gestionar los repuestos de su sector.', 'Flexibilidad, calidad y trabajo en equipo son muy destacables. ', 'Debe trabajar mas en seguridad. En set up no utiliza protección para manipular sustancias calientes. \r\nDebe trabajar mas en proactividad.', 'Se observa un alto compromiso con su puesto de trabajo.', ''),
(2841, '2022', 1, 5, 273, 0, 'MB', 'Se observa un muy buen desempeño.\r\nSe observa un alto compromiso con su puesto de trabajo.  ', 'Se observa una adaptación importante a como van variando las necesidades de la linea. \r\nSe observa una alta proactividad.\r\n', 'Utilizar el celular de manera racional.', '', ''),
(2842, '2022', 1, 5, 30, 0, 'B', 'Se observa un desempeño adecuado para los puestos en los que se ha desempeñado. Debe trabajar mas en las competencias en las cuales no se observa un desempeño adecuado', 'Seguridad, flexibilidad y calidad son competencias destacables. ', 'Debe trabajar mas en orientación a los resultados autonomía. Debe seguir adaptándose a las nuevas exigencias de los equipos mas modernos, tratando de nivelarse para generar un posible cuadro de reemplazo.\r\nDebe trabajar fuertemente en proactividad. Se observa mucho tiempo perdido en FEM con el celular habiendo tareas de reproceso de tapas para recuperar, Se observa mucho tiempo ocioso mal utilizado ', '', ''),
(2843, '2022', 1, 46, 71, 0, 'B', '', 'En general autónoma, resuelve problemas que están a su alcance por sí misma. En general acepta bien cambio de asignaciones. Bien predispuesta a cambios de puesto.', 'Debe enfocarse más en aspectos de Seguridad (análisis de condiciones y actos inseguros). Puede desarrollar aún más la proactividad para aportar valor en tiempos libres.', '', ''),
(2844, '2022', 1, 46, 280, 0, 'MB', '', 'Muy bien orientada a resultados. Respetuosa. Siempre interesada en comunicar desvíos o problemas a resolver. En general autónoma. Muy enfocada en Calidad', 'Debe enfocarse más en complementarse con el equipo de trabajo (líderes y mecánico). Puede seguir desarrollando proactividad para aportar valor', '', ''),
(2845, '2022', 1, 5, 138, 0, 'B', 'Se observa un buen desempeño. Se observa preocupación por cumplir con sus tareas. \r\nHa mejorado también en seguridad. Solo 1 observación negativa.', 'Compromiso, calidad y responsabilidad son destacables en su desempeño. ', 'Se observa desmejora en la forma de comunicarse. Se debe seguir trabajando según lo marcado en otras evaluaciones de desempeño.\r\nDebe trabajar en proactividad. En baja temporada se trabaja de manera distinta. No se observa el mismo desempeño. Se debe apuntar a trabajar de la misma manera el ata y baja temporada.', '', ''),
(2846, '2022', 1, 5, 196, 80, 'MB', 'Se observa un desempeño muy bueno. Se debe seguir trabajando en las competencias mencionadas. \r\n. Debe trabajar mas en autonomía para resolver por si solo los problemas. \r\nTrabajar mas en el GB. Se observa poca participación. ', 'Trabajo en equipo, comunicación, responsabilidad, flexibilidad son competencias destacables. ', 'Debe trabajar mas en proactividad. Tiempos ociosos mal utilizados. Demoras que se pueden aprovechar para atacar problemas del sector que son muchos.\r\nHubieron un par de detenciones por falla en la comunicación. Se le avisa tarde al sup para llamar al mecánico y se genera detención de la linea. Otra por demoras en preparar para salsa por falta de proactividad.', '', ''),
(2848, '2022', 1, 5, 288, 0, 'MB', 'Poca participación en GB. NO participa de TSP Hace lo justo y necesario. No se observa iniciativa para mejorar el puesto. Le cuesta enseñar. Debe aprender a transmitir conocimientos. \r\nLe cuesta adaptarse a nuevas asignaciones o cambios profundos de tareas en el sector. Solo hace lo necesario. \r\nDebe trabajar en autonomía. No se observa que se trabaje con Ots ni sistema. Debe mejorar el compromiso en el GB. ', 'Resolución de problemas. Calidad, seguridad.', 'Debe trabajar en orientación a los resultados. Solo se observa en el día a día, pero si se le pide una tarea que demande un poco mas de esfuerzo no hay buena predisposición.  Debe trabajar en flexibilidad y en sistema. En ocasiones se le ha pedido colaborar para terminar de lavar un equipo y luego otro y la respuesta fue yo lavo el ing. y me voy.', 'No se observa un compromiso alto con la linea. No quiere hacer extras incluso cuando el puesto lo demanda.', ''),
(2849, '2022', 1, 5, 173, 0, 'B', 'El operario manifiesta un buen desempeño, adecuado para le puesto ocupado.\r\nDebe trabajar mas en autonomía. Debe trabajar para resolver los problemas por si solo. Debe trabajar mas con 5S. Si bien hace 5S, muchas veces se lo marca el superior. Debe ser mas proactivo. No esperar ordenes. Debe aprovechar los tiempos muertos de manera productiva. ', 'Responsabilidad. Trabajo en equipo. Comunicación, son competencias destacables.', 'Debe seguir mejorando en autonomía y proactividad.  ', 'Se observa un compromiso alto por parte del colaborador.', ''),
(2850, '2022', 1, 5, 266, 85, 'MB', 'El operario manifiesta un muy buen desempeño. ', 'Calidad, comunicación y proactividad son competencias ampliamente destacables.', 'Debe seguir apostando al trabajo en equipo dejando de lado las diferencias sobre todo entre pares de su turno y de GB. Si bien se observa un gran avance en autonomía, debe seguir esforzándose para seguir asimilando conocimientos técnicos para resolver cada vez mas problemas por si solo.', '', ''),
(2851, '2022', 1, 5, 295, 80, 'MB', 'Se observa un muy buen desempeño pero debe trabajar en lo mencionado a continuación.\r\nDebe mejorar la forma en la que se comunica. Se observan situaciones problemáticas que dejan de lado el trabajo en equipo y la flexibilidad y que afectan el clima de trabajo. Debe tomarse las cosas de una manera menos problemática.\r\nDebe mejorar las formas de comunicarse para mejorar el trabajo en equipo y el clima laboral. El personal de la linea informa algunos desvios en el trato o las formas. \r\n', 'Seguridad, autonomía y calidad son aspectos destacables.', 'Se lo debe empujar mucho para que se trabaje con 5S en el sector a su cargo. También ocurre lo mismo con PM. Siempre la excusa en falta de tiempo pero existiendo la posibilidad de hacer extras no lo hace.\r\nDebe dejar de lado cuestiones personales sobre el personal. Se le escucha decir la frase mándamelo a la linea que me hace falta un palletizador. Le gusta usar el poder de lider para poner a la gente a prueba en el paletizado. Disfruta de la situación y lo usa como revancha.', '', ''),
(2853, '2022', 1, 5, 152, 0, 'MB', 'Se observa un muy buen desempeño, pero debe trabajar en los mencionado.\r\nSe observan situaciones de im proactividad. Si bien se le da una orden y se cumple, hay situaciones que no era necesario marcarlas. Debe trabajar de manera proactiva sin que se le pida. Debe mejorar la comunicación con sus compañeros. En situaciones se le pide al supervisor dar algún tipo de indicación cuando el mismo puede comunicarla. ', 'Seguridad, calidad y autonomía son aspectos destacables.\r\nEs buen formador de personal, potenciando a sus colaboradores.  ', '', 'Cubre en calderas y SIG sin problemas. ', ''),
(2854, '2022', 1, 5, 310, 0, 'MB', 'El operario manifiesta un muy buen desempeño. Debe trabajar mas en lo mencionado.  \r\nDebe trabajar mas en sistema como formador. Debe gestionar a sus colaboradores para generar autonomía y trabajo con sistema.  ', 'Calidad, autonomía, proactividad y trabajo en equipo son competencias Destacables.', 'Debe trabajar mas en comunicación con sus pares. Hay situaciones que el supervisor debe informar pero el Lider puede hacerlo sin problemas.  \r\nDebe trabajar en las formas en que se comunica con su personal a cargo. Se observan situaciones en las cuales si bien puede haber justificación, la forma no es la adecuada. Debe reprender a la persona pero siempre de manera singular, no en frente de otros. Evitar ese conflicto.', 'El operario manifiesta un compromiso muy altos con sus responsabilidades.', ''),
(2855, '2022', 1, 5, 87, 0, 'B', 'Se observa un buen desempeño pero debe trabajar en lo mencionado en los comentarios.\r\nSe observa en muchas ocasiones falta de EPP en Tetra con manipulación de químicos y en el autoelevador gafas y auditivos. Debe trabajar mas en seguridad.\r\nDebe trabajar mas en sistema. No se autorizan lups y no se registran ots ni en tetra ni playa. ', 'Flexibilidad y trabajo en equipo son destacables.', 'Trabajar en calidad. Se le debe repetir en reiteradas ocasiones que debe cerrar el portón por problema de ingreso de plagas. \r\nTrabajar en Proactividad. Si bien en playa se observa mas proactividad, luego en el autoelevador se observa muchos tiempos ociosos mal utilizados y perdida de tiempo con el celular. Al igual que el tiempo que estuvo en Tetra. Usar ese tiempo de manera productiva y trabajando en 5s', 'Se observa un alto compromiso y predisposición.', ''),
(2856, '2022', 1, 5, 84, 0, 'MB', 'El operario manifiesta un muy buen desempeño. Debe trabajar en las competencias con debilidad. Debe trabajar en seguridad. Se observan desvíos de personal a cargo que el mismo no advierte, pero en líneas generales se preocupa mucho por la seguridad.\r\nDebe trabajar mas en autonomía. Planificación de jornadas y llevarlas a cabo es una responsabilidad primaria.\r\n', 'Flexibilidad ha sido una competencia que ha mejorado, adaptándose a cambios profundos de tareas.\r\nCalidad es un aspecto también destacable.', 'Debe trabajar mas en sistema. No se observa generación de lups ni ots. No sabe manejar aun el JD. El puesto lo requiere como responsabilidad primaria.', 'Se observa un muy alto compromiso. Cubre en calderas sin problema. De todas maneras debe seguir trabajando en la autonomía en dicho sector.', ''),
(2857, '2022', 1, 5, 467, 0, 'B', 'Se observa un buen desempeño para los puestos ocupados. Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si sola.\r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar mas en comunicación. La misma debe ser fluida con el Lider del sector, generando asertividad para evitar errores en el sector. Debe trabajar en comunicación efectiva.\r\n', '', ''),
(2858, '2022', 1, 5, 569, 0, 'MB', 'Se observa un muy buen desempeño para los puestos en los que se ha desempeñado. \r\n', 'Seguridad, calidad y flexibilidad son aspectos destacables.\r\n', 'Debe trabajar en orientación a los resultados. Si bien cumple con sus tareas, debe trabajar mas en autonomía, debe desarrollar una mayor independencia para poder resolver problemas por si solo, sobre todo en consola como en la realización de HR del sector a su cargo(peladora)\r\nEl operario realiza sus tareas de manera idonea\r\n', '', ''),
(2859, '2022', 1, 5, 617, 0, 'NM', 'El desempeño del operario en líneas generales es malo. NO mejora con el correr de la temporada. Se solicita a RRHH no volver a tomar a este operario.', '', '', '', ''),
(2860, '2022', 1, 46, 274, 63.75, 'B', '', 'Muy buen conocimiento técnico del equipo que está operando. Resuelve con autonomía. En general comprometido con actividades de limpieza y mantenimiento autónomo, con intereses personales. Algunas veces ausente ', 'Poco proactivo, mucho uso del teléfono. En más de una ocasión se produjeron detenciones de línea por estar mirando el teléfono, con riesgo de generación de PNC o accidentes. Debe hacer más foco en Calidad (desinfección de picos en cambio de bobina y estándares en general descuidados)', '', ''),
(2861, '2022', 1, 46, 59, 0, 'B', '', 'En general bien enfocada en Calidad y Seguridad. Se la vio trabajando bien en equipo. En general acepta bien nuevas asignaciones', 'Debe adoptar actitud proactiva en tiempos de línea detenida y aportar valor. Puede mejorar la comunicación de problemas a resolver (tímida, poco comunicativa). ', '', ''),
(2862, '2022', 1, 46, 65, 0, 'NM', '', 'Acepta bien nuevas asignaciones. En general buena presencia en actividades de limpieza y lubricación', 'En general muy poco proactivo para aportar valor en tiempos libres. El Líder debe generar la reactividad. No resuelve en forma autónoma, depende mucho de sus compañeros. Dificultades para expresar problemas a resolver. En general debe enfocarse más en Calidad y Seguridad', '', ''),
(2863, '2022', 1, 46, 250, 0, 'B', '', 'Buen conocimiento técnico de líneas de tomate y buena autonomía. Logró adaptarse bien con su compañero nuevo y transmitir conocimientos. Buen compromiso para asistir a tarea de limpieza, autónomo y producción en HHEE.', 'Le fue difícil comprender la nueva dinámica de temporada baja, y no pudo adaptarse. Se le dio oportunidades de aprendizaje y no aprovechó ninguna (Calderas, Remanejo). Le fue difícil aceptar oportunidades de mejora. Debe enfocarse en generar buen clima dentro del equipo en el que participa. Puede seguir mejorando su enfoque en Calidad desde el rol de gestión', '', ''),
(2864, '2022', 1, 46, 199, 0, 'B', '', 'En general buen compromiso. Sabe trabajar en equipo. Buena participación en actividades de limpieza. Acepta bien cambios de puesto y nuevas asignaciones. Bien enfocado en Calidad y Seguridad', 'Debe mejorar su capacidad de comunicación al momento de resolver problemas. Ser más claro en el análisis y ser más autónomo. Debe desarrollar la capacidad de análisis para saber aportar valor en tiempos muertos.', '', ''),
(2865, '2022', 1, 46, 272, 0, 'MB', '', 'En general bien orientado a resultados. Resuelve con autonomía. En general bien enfocado en Calidad y Seguridad. Buena comunicación de problemas a resolver', 'Deberá seguir desarrollando conocimientos técnicos para mantener autonomía en SIG. Mucho uso del teléfono, puede seguir desarrollando proactividad para aportar valor en tiempos ociosos', '', ''),
(2866, '2022', 1, 46, 405, 0, 'B', '', 'En general bien enfocado en aspectos de Calidad. En general bien orientado a resultados y comprometido. Acepta bien cambios de puesto y nuevas asignaciones. Se interesó por seguir aprendiendo.', 'Debe enfocarse más en aspectos de Seguridad (uso de EPP, análisis de condiciones y actos inseguros). Debe enfocarse en que actos o hechos de su vida personal no afecten en mayor medida su desempeño laboral. Mucho uso del teléfono, debe desarrollar proactividad para sumar valor en tiempos ociosos. Puede seguir desarrollando aspectos técnicos para mejorar autonomía', '', ''),
(2867, '2022', 1, 46, 216, 0, 'B', '', 'En general bien enfocado en Calidad y Seguridad. Se anticipa a situaciones futuras (necesidades, problemas). Muy bien orientado a resultados y comprometido con los objetivos del equipo. Buena participación en grupo base', 'Distraído. Debe prestar mayor concentración a los procesos para no incurrir en errores. En general depende de otras personas para resolver problemas técnicos.', '', ''),
(2868, '2022', 1, 46, 213, 0, 'MB', '', 'Muy bien orientado a resultados y comprometido con los objetivos del equipo. Bien comunicando problemas a resolver. En general resuelve problemas que están a su alcance y aporta valor.  ', 'Debe seguir profundizando conocimientos técnicos para optimizar resolución de problemas. Debe animarse más a resolver en forma autónoma sin intervención del mecánico. Debe enfocarse en aspectos de Seguridad (uso de EPP, análisis de actos y condiciones inseguras)', '', ''),
(2869, '2022', 1, 46, 382, 0, 'MB', '', 'Muy buen compromiso y orientación a resultados.  Mejoró su foco en Seguridad y Calidad considerablemente. Muy bien predispuesto a cambio de asignaciones. En general autónomo, puede seguir mejorando. Muy bien trabajando en equipo con sus pares de línea Tomate', 'Debe desarrollar habilidades de gestión y trabajar con el sistema de gestión integral. Puede seguir mejorando su enfoque en Calidad y Seguridad.', '', ''),
(2870, '2022', 1, 46, 276, 0, 'B', 'Puede mejorar en trabajo con sistema y propuestas de mejora en aspectos de Calidad y Seguridad. Puede mejorar comunicación de problemas a resolver', 'Bien predispuesta a nuevas asignaciones y cambios de puesto. En general bien orientada al cumplimiento de objetivos y trabajo en equipo, sin destacar por sobre el resto de sus compañeros/as', 'Debe mejorar la capacidad de análisis para aportar valor en tiempos en que la línea está detenida (tiempos libres). Actitud proactiva en lugar de reactiva. En general bien en la operación, falta desarrollar capacidad de resolución de problemas en forma autónoma.', '', ''),
(2871, '2022', 1, 46, 398, 0, 'MB', '', 'Muy buena orientación a resultados y compromiso por el cumplimiento de objetivos. Muy bien predispuesto a cambios de puesto y nuevas asignaciones. Muy abierto a indicaciones de aspectos a mejorar. Respetuoso. Sabe trabajar en equipo', 'Puede enfocar más sus acciones en propuestas de mejora. Debe trabajar más con el sistema de gestión (generación de OT, participación en grupo base y grupos de mejora). Mucho uso del teléfono, debe ser más proactivo. Debe continuar desarrollando aspectos técnicos', '', ''),
(2872, '2022', 1, 46, 221, 0, 'B', '', 'En general buena orientación a resultados y compromiso con actividades de limpieza y lubricación, con algunos intereses personales. Bastante autónomo, limitado a su sector (paletizador de Doypack). Muy enfocado en Calidad y Seguridad', 'Debe mejorar su capacidad de comunicación general con todo el equipo de trabajo (muy tímido y reservado). No aprovecha correctamente los tiempos con línea detenida (no le gusta reprocesar). No le fue tan fácil reconocer oportunidades de mejora. Debe aprender a respetar el rol del líder y no saltearlo', '', ''),
(2873, '2022', 1, 46, 671, 0, 'NM', '', '', 'Mucho uso del teléfono. lo cual trajo aparejado detenciones de línea y PNC. Se trató en reiteradas ocasiones, no mejorando. En lugar de sobresalir se puso a la par de Enzo Alaniz. No mostró ganas de aprender ', '', ''),
(2874, '2022', 1, 46, 468, 0, 'MB', '', 'Bien predispuesta a cambios de puesto y nuevas asignaciones. Trabaja en equipo (rotación en línea tomate). Buena participación en actividades de fin de semana', 'Debe enfocarse más en aspectos de Seguridad (circulación, uso de EPP, análisis de actos y condiciones inseguras)', '', ''),
(2875, '2022', 1, 46, 98, 0, 'NM', '', 'En general respetuosa al comunicarse.', 'Habitualmente se duerme en el puesto de trabajo. Eso afecta posibles detenciones, PNC, riesgos de accidentes. Se tuvo que reubicar en otro puesto de trabajo por su Seguridad. Sobrecarga a sus compañeros.', '', ''),
(2876, '2022', 1, 2, 347, 93.75, 'MB', 'Raul es un colaborador que conoce completamente sus objetivos, tareas, funciones, obteniendo grandes resultados, muy predispuesto a colaborar donde le toque estar.', 'Es un colaborador muy comprometido con el equipo, de muy buena comunicación y muy comprometido con la seguridad.', '', '', ''),
(2877, '2022', 1, 2, 20, 0, 'MB', 'Colaborador con mucho compromiso, con mucha experiencia lograda con sus años de trabajo', 'Trabajo en equipo, muy respetuoso', '', '', ''),
(2879, '2022', 1, 2, 142, 0, 'MB', 'Nestor es el facturador con mas experiencia, esto le permite adelantarse a los problemas y buscar soluciones.', 'trabajo en quipo,', '', '', ''),
(2880, '2022', 1, 2, 290, 0, 'E', 'Javier es muy importante para el equipo de insumos, se anticipa y comunica posible problemas a futuro, buscando la solución anticipada, tiene mucha experiencia y dinamismo. Como oportunidad de mejora debe intentar mayor sinergia con el resto de los sectores.', 'Autonomía, trabajo en equipo, comunicación.', '', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(2881, '2022', 1, 2, 147, 0, 'MB', 'Dante es uno de los choferes con mayor experiencia en el sector, es muy seguro en sus tareas, buscando siempre la mejor calidad, como OM es incorporar conocimiento para buscar polifuncionalidad  en el sector.', 'Muy buena comunicación, por cualquier tema lo levanta y en ocasiones propone soluciones o alternativas, muy involucrado con la seguridad', '', '', ''),
(2882, '2022', 1, 2, 383, 0, 'MB', 'Emanuel es un colaborador que se adapta muy rápido a sus nuevas funciones, esta capacitado para estar en bascula e insumos. como OM debe afinar su mirada enfocándose en seguridad en todas las tareas. ', 'Tiene muy buena comunicación, mucha autonomía y es muy solidario con los distintos sectores.', '', '', ''),
(2883, '2022', 1, 2, 198, 0, 'B', 'Miguel tiene mucha experiencia en manejo en insumos, es muy prolijo en la manera de trabajar.', '', 'Como OM debería involucrarse mas en trabajar en equipo.', '', ''),
(2884, '2022', 1, 2, 204, 0, 'MB', 'José es un colaborador que muy flexible, se adapta rápido a los nuevos pedidos o tares nuevas', 'Comunicación, trabajo en equipo.', 'Como OM creo debería intentar ser mas expeditivo con algunos procesos para incrementar su productividad.', '', ''),
(2885, '2022', 1, 2, 206, 0, 'NS', 'Daniel es un colaborador que se diferencia mucho del resto por su poco involucramiento con el equipo, cuando se le asigna alguna tarea no la cumple y tampoco lo comunica, se lo nota con muy poco interes en cambiar su actitud, sigue cometiendo los mismo errores. Necesita que se lo este controlando permanentemente, además de tener muchos reclamos de sus compañeros de turno por el poco compromiso que asume en el día a día.', '', 'Comunicación, trabajo en equipo, autonomía, ', '', ''),
(2886, '2022', 1, 46, 400, 0, 'MB', '', 'Muy bien orientado a resultados. Muy buen compromiso. Buena autonomía y proactivo en la resolución de problemas. Trabaja muy bien en equipo', 'Debe continuar aprendiendo para mejorar en la resolución de problemas, desarrollar conocimiento técnico. Debe mejorar en desarrollo de sistema de gestión. Puede mejorar comunicación de problemas a resolver. Puede mejorar participación en grupos de mejora', '', ''),
(2887, '2022', 1, 5, 205, 0, 'B', 'Se observa un desempeño regular, alcanzando justo para el puesto actualmente  \r\nNo se observa gran preocupación por ir mas allá de lo que las tareas del puesto le demandan. Falta de interés, si bien cumple sus tareas.', 'Comunicación y flexibilidad se destacan.', 'Calidad. Mangas y cadenas se le han marcado en varias ocasiones. \r\nPoca proactividad. Se le deben dar las ordenes. Si no no aplica de manera autónoma.', '', ''),
(2888, '2022', 1, 5, 302, 0, 'B', 'Debe afianzarse en el puesto. Debe generar mas confianza de poder dejar que se desarrolle su autonomía, pero debe trabajar mucho en elevar sus conocimientos técnicos.\r\nSe observan desvíos en seguridad en no utilización de EPP y además uso muy excesivo de celular.\r\nDebe generar autonomía en carga de OT y SPAC.', 'Flexibilidad y calidad son competencias destacables.', 'En trabajo en equipo debe trabajar mas en la solidaridad con los compañeros. Se aísla. Debe ser mas colaborativo. (colocar pallets a los paletizadores, reemplazos)\r\nDebe trabajar mas en proactividad. No debe esperar a que le den una orden. \r\nDebe trabajar mucho en autonomía.\r\nDebe estar pendiente de su equipo y las necesidades del mismo. Debe aportar mas en el GB respecto de mejoras, 5S en el sector, preventivos. Debe mejorar el compromiso con el GB y la linea.', '', ''),
(2889, '2022', 0, 0, 47, 0, 'MB', 'Patricia es una colaboradora con gran capacidad de trabajo en equipo. Responsable con su puesto de trabajo y muy comprometida con la calidad', 'Capacidad de trabajo en equipo\r\nResponsable\r\nRespetuosa', '', '', ''),
(2890, '2022', 1, 48, 47, 0, 'MB', 'Patricia es una colaboradora responsable con su puesto de trabajo. Predispuesta\r\n', 'Responsable\r\nCapacidad de trabajo en equipo\r\nCompañerismo', '', '', ''),
(2891, '2022', 1, 48, 76, 0, 'NM', 'Es una persona que no presenta entusiasmo para realizar las tareas. ', '', 'Falta de capacidad de trabajo en equipo\r\nFalta de Compromiso', '', ''),
(2892, '2022', 1, 48, 247, 0, 'MB', 'Carlos es una persona con gran capacidad de trabajo en equipo, pero tiene que mejorar en su proactividad ', 'Capacidad de trabajo en equipo \r\n', 'Falta rapidez en resolver las actividades \r\n', 'Falta compromiso en las actividades que desarrolla', ''),
(2893, '2022', 1, 48, 260, 0, 'B', 'Es un colaborador que debe mejorar en la proactividad para realizar sus actividades', 'Capacidad de trabajo en equipo\r\nComunicación\r\n', '', '', ''),
(2894, '2022', 1, 48, 218, 66.25, 'B', 'Es un operador que debe mejorar en la actitud frente a las actividades que realiza', 'Comunicación\r\nAdaptabiliadad', 'Trabajo en equipo\r\nFalta de proactividad', '', ''),
(2895, '2022', 1, 48, 294, 0, 'E', 'Es un colaborar que siempre trata de mejorar, se esfuerza permanentemente. Busca su autonomía al máximo.', 'Autonomía\r\nCapacidad de trabajo en equipo\r\nPerseverancia\r\nProactividad', '', '', ''),
(2896, '2022', 1, 48, 619, 0, 'MB', '', '', '', '', ''),
(2897, '2022', 1, 48, 86, 0, 'B', '', '', '', '', ''),
(2898, '2022', 1, 48, 354, 0, 'MB', '', '', '', '', ''),
(2899, '2022', 1, 48, 352, 0, 'MB', '', '', '', '', ''),
(2900, '2022', 1, 46, 122, 0, 'B', '', 'En general respetuosa. Se la vio trabajar en equipo', 'Tímida, con dificultades para expresar aspectos de mejora y situaciones a resolver. En general baja autonomía y proactividad. Debe enfocarse más en agregar valor en tiempos libres. Poco trabajo con sistema de gestión', '', ''),
(2901, '2022', 1, 46, 390, 0, 'MB', '', 'Bien enfocado en Calidad. Compromiso con el equipo y objetivos a cumplir. Orientado a resultados. Trabaja en equipo', 'Puede mejorar el análisis de aspectos de Seguridad (uso de EPP, análisis de actos y condiciones inseguras). Puede seguir profundizando conocimiento técnico para desarrollar autonomía. Puede seguir mejorando la capacidad de comunicación de situaciones a resolver', '', ''),
(2902, '2022', 1, 46, 150, 0, 'B', '', 'Bien enfocada en Calidad y Seguridad. ', 'En general le es difícil aceptar oportunidades de mejora. Con su experiencia podría haber generado mucha más autonomía de la que hoy aplica en sus puestos de trabajo habituales. Debe aprender a aportar valor en tiempos de línea detenida, aprovechar tiempos ociosos. No aporta aspectos constructivos al clima laboral (comentarios, teléfono descompuesto)', '', ''),
(2903, '2022', 1, 46, 123, 0, 'B', '', 'En general flexible a nuevas asignaciones. En general bien enfocada en Calidad y Seguridad', 'Debe desarrollar autonomía y proactividad. Debe mejorar la capacidad de comunicación de situaciones a resolver. Participación en gestión de mejoras y sistema de gestión integral', '', ''),
(2904, '2022', 1, 5, 72, 0, 'B', 'Se observa un desempeño regular del colaborador. Si bien cumple con sus tareas, le cuesta mucho respetar las decisiones de su lider y de la empresa. Se observan malas contestaciones.', '', 'Debe trabajar mas en flexibilidad. Se observan comportamientos inadecuados (contestar mal) en ocasiones por situaciones cotidianas de la linea en las que no esta de acuerdo. Debe trabajar en adaptarse a nuevas asignaciones o cambios de tarea relacionados con el puesto de trabajo. \r\nDebe trabajar mas en autonomía. No se observa preocupación por la mantención de su equipo en cuanto condiciones básicas. No participa de jornadas de jornadas ni hay propuestas de su parte. Solo informa para que otros lo solucione', 'El compromiso existe pero se ve opacado en situaciones los fines de semana. El puesto demanda un esfuerzo distinto, relacionado con la la responsabilidad y acorde a su categoría. Debe mejorar en este aspecto si quiere permanecer en el puesto.\r\nDebe trabajar mas en 5S. Su puesto de trabajo permanece muy sucio y no se observa preocupación por generar un cambio. Siempre pide que alguien mas lo haga y no se compromete el con su puesto para solucionar desvíos en condiciones básicas.', ''),
(2905, '2022', 1, 2, 217, 50, 'NM', '', '', 'De be comprometerse con el trabajo en equipo, es muy individualista, cumple su tarea pero no se integra.', '', ''),
(2906, '2022', 1, 2, 234, 0, 'MB', 'Gustavo tiene mucha experiencia en el puesto, lleva mucho tiempo en su función, debe intentar hacer sinergia con el resto de las areas, (aduana y expedición).', 'Autonomia, respeto con sus colegas, flexibilidad.', '', '', ''),
(2907, '2022', 1, 2, 238, 0, 'B', 'Marcelo esta muy comprometido con la seguridad, el desde hace tiempo participa del proyecto compromiso, con respecto a su función debe intentar consolidarse para poder asumir nuevas funciones.', '', '', '', ''),
(2908, '2022', 1, 2, 249, 0, 'B', 'Edgar conoce muy bien sus funciones, noto que si se lo propone puede alcanzar mejores resultados para el sector, le cuesta trabajar en equipo y debe involucrarse mas con lo inventarios.', '', 'Trabajo en equipo, proactividad', '', ''),
(2909, '2022', 1, 46, 189, 0, 'B', '', 'Bien en Calidad y Seguridad. Acepta bien nuevas asignaciones. Respetuosa. ', 'Debe desarrollar proactividad y autonomía. Aportar valor en tiempos libres y desarrollar capacidad de resolución de problemas a resolver que están a su alcance. Puede mejorar comunicación', '', ''),
(2911, '2022', 1, 2, 251, 0, 'B', 'Gabriel puede tener un mejor desempeño si se lo propone, solo depende de el, debe consolidarse en su puesto e integrarse al equipo.', '', 'Tener un mirada mas comprometida con la seguridad, con el afán de hacer las cosas descuida la seguridad.', '', ''),
(2912, '2022', 1, 46, 161, 0, 'B', '', 'Acepta bien nuevas asignaciones. Bien en Calidad y Seguridad', 'Debe desarrollar proactividad y autonomía para resolución de problemas que están a su alcance. Baja comunicación de situaciones a resolver y baja participación en sugerencias de mejora', '', ''),
(2913, '2022', 1, 2, 278, 0, 'B', 'Cintia tiene muchas experiencia en su función, tiene mucho para dar, los limites se los pone ella, debe involucrarse para trabajar en equipo.', '', 'Comunicación y respeto, debe dominar sus emociones.', '', ''),
(2914, '2022', 1, 46, 541, 0, 'MB', '', 'Muy buen compromiso y orientación a resultados. Buen aceptación a nuevas asignaciones. Ganas de mejorar. Trabaja en equipo', 'Debe seguir desarrollando conocimiento técnico para mejorar autonomía y desarrollar capacidad de gestión. Debe trabajar más con sistema de gestión', '', ''),
(2915, '2022', 1, 46, 552, 0, 'MB', '', 'En general buen compromiso y orientación a resultados. Trabaja en equipo. Ganas de crecer y mejorar (aprender). Buena predisposición a cambios de puesto y nuevas asignaciones', 'Puede mejorar el foco en Calidad y Seguridad (propuestas y participación en mejoras del Sector). Debe continuar desarrollando conocimiento para mejorar autonomía y habilidades de gestión. Debe trabajar más con sistema', '', ''),
(2917, '2022', 1, 2, 293, 90, 'MB', 'Eduardo a lo largo de estos años ha logrado grandes resultado en logística de materia prima, es un colaborador que que se integra fácilmente, puede asumir nuevas responsabilidades.', 'Trabajo en equipo, autonomía, proactivo.', 'Debe trabajar en el control de emociones.', '', ''),
(2919, '2022', 1, 2, 297, 0, 'MB', 'Adrian es un colaborador muy importante para el equipo, es muy voluntarioso y sabe adaptarse a nuevas funciones o desafios.', 'Trabajo en equipo, comunicación, respecto, autonomía, productivo.', '', '', ''),
