(2932, '2022', 1, 2, 435, 0, 'MB', 'José alcanzo grandes resultados en temporada, se le asigno la administración de los deposito de desborde y se cumplieron los objetivos. Esta capacitado para ser un colaborador polifuncional.', 'Autonomía, trabajo en equipo', 'debe trabajar en el control de emociones.', '', ''),
(2933, '2022', 1, 2, 318, 0, 'B', 'Sebastián es un colaborador con condiciones para para tener un desempeño mas alto, depende de el, debe enfocarse en sus tareas y dar lo máximo.', 'Flexibilidad, comunicación.', 'Debe intentar involucrarse mas con la seguridad, debe analizar los riesgos cuando hará tareas que no son habituales.', '', ''),
(2934, '2022', 1, 2, 329, 0, 'B', 'Diego va creciendo año tras año, tiene todas las condiciones para aprender nuevas funciones y transformarse en un jugador polifuncional, solo depende que se lo proponga.', 'Trabajo en equipo y flexibilidad.', '', '', ''),
(2935, '2022', 1, 48, 171, 0, 'B', 'Es un colaborador que tiene muchos conocimientos en su puesto de trabajo pero no los comparte.', 'Conocimientos técnicos.', 'Falta de capacidad de trabajo en equipo', '', ''),
