(2937, '2022', 1, 48, 126, 0, 'B', 'Adolfo necesita tener mayor proactividad con las actividades que realiza. Mejorar en el trabajo en equipo.', '', '', '', ''),
(2938, '2022', 1, 2, 337, 0, 'B', 'Mariana sabe adaptarse a nuevas tareas que se le asignan, es muy responsable, debe consolidar sus conocimiento en LMP.', 'Trabajo en equipo, autonomía', 'Debe trabajar en el control de sus emociones', '', ''),
(2939, '2022', 1, 2, 386, 0, 'B', 'Braian despues de dos temporada logro integrarse al equipo de expedición, es un colaborador que suma, debe seguir creciendo, solo depende de el.', '', '', '', ''),
(2940, '2022', 1, 2, 394, 0, 'B', 'Sergio lleva muchos años en la bascula, conoce muy bien su función, esta capacitado para estar en aduana también, es muy capaz.', '', 'Debe intentar adueñarse de los problemas y darle el tratamiento que corresponda, debe involucrarse mas.', '', ''),
(2941, '2022', 1, 2, 395, 0, 'B', 'Roberto es un colaborador muy flexible, que se adapta rápidamente a tareas nuevas, debe animarse a buscar nuevos desafíos.', 'Trabajo en equipo, comunicación.', '', '', ''),
(2942, '2022', 1, 2, 397, 86.25, 'MB', 'Sebastian es un colaborador que suma en todo momento, siempre esta disponible ante cambios.', 'Comunicación, trabajo en equipo, proactividad.', '', '', ''),
