(2944, '2022', 1, 2, 416, 0, 'MB', 'Ariel tiene mucha experiencia en su puesto, tuvo un buen desempeño en el deposito de desborde, es muy flexible y se adapta a nuevas tareas.', 'Flexibilidad', '', '', ''),
