(2947, '2022', 1, 2, 490, 0, 'B', 'Martin debe seguir aprendiendo en lo que respecta a su puesto, es un colaborador con buena predisposición.', 'Flexibilidad, trabajo en equipo', 'Debe focalizarse en la seguridad.', '', ''),
(2948, '2022', 1, 2, 548, 0, 'B', 'Micaela debe consolidarse en las funciones de bascula.', '', 'Comunicación, control de emociones.', '', ''),
(2949, '2022', 1, 41, 325, 83.75, 'MB', 'Orientación a los resultados: Falta de análisis de los datos de muestreos, Falta de carga de datos, incoherencia en algunos datos cargados. Este es un punto que debemos trabajar, y que viene repetitivo en los años.\r\nLos puntos que definimos trabajar el año pasado fueron tomados y el resultado fue positivo \r\n2021 - Trabajar en el convencimiento de las acciones que se definen, ya sean propias, de pares o responsables del área. Evitar cambiarlas u objetarlas antes de la ejecución. Esto genera demoras en la res', 'Muy buena interacción con pares y mandos medios. Los supervisores lo identifican como un referente en el área\r\nSe destaca el conocimiento e involucración en querer aprender y generar nuevas soluciones.\r\nParticipación e involucración en cuestiones de seguridad de planta, siempre atento a detectar e informar desvíos que pueden ', '', '', 'Sergio además de llevar adelante tareas de efluentes contribuye al area en la realizacion de controles operativos. Dentro de ellos control de equipos de izajes. Durante el 2023 avanzaremos en capacitacion sobre este aspecto.'),
(2950, '2022', 1, 2, 577, 0, 'B', 'Silvana es muy responsable, asume con compromiso nuevas tareas. Debe empoderarse de algunos procesos fundamentales en LMP', 'trabajo en equipo, flexibilidad.', '', '', ''),
(2951, '2022', 1, 2, 666, 0, 'B', 'Dario es un colaborador muy responsable, tiene que dar el salto para poder afianzar su desempeño en el sector.', '', 'Autonomía', '', ''),
(2952, '2022', 1, 2, 676, 0, 'B', 'Jorge es un colaborador que se adapta muy bien a cualquier sector del deposito, es muy flexible ante cambio de tareas.', 'Flexible, trabajo en equipo.', '', '', ''),
(2953, '2022', 1, 41, 263, 80, 'MB', 'Orientación a los resultados: Análisis de los datos de análisis, Falta de carga de datos, incoherencia en algunos datos cargados. Este es un punto que debemos trabajar y que se repite año tras años', 'Respeto y escucha, Responsabiliad\r\nProactividad: Se observa una importante evolución en la resolución de problemas, seguimientos de temas, involucración en el proceso, esto ya se destacó el año pasado y sigue en evolución constante.\r\nPedro ha demostrado que tiene la capacidad para proponer ideas creativas y que han sido asertivas al momento de resolver problemas\r\n', 'Capacidad de comunicación - Trabajar la comunicación con supervisores, no por que sea mala, si no animarse a romper barreras para lograr la autonomía en los procesos, evitando generar la comunicación con intermediarios como el analista o jefe que puede llevar a demoras en la resolución. Este punto se identificó el año pasado, si bien hubo evolución es importante seguir trabajándolo.\r\n', '', 'Este año hubo intención de participar en una actividad de procesos de efluente espero no pudo llevarse adelante. Intentaremos 2023 avanzar con alguna actividad'),
(2954, '2022', 1, 2, 690, 0, 'B', 'Sergio tuvo buena temporada, debe seguir aprendiendo, debe consolidarse en el sector, buscando la polifuncionalidad, depende de su voluntad.', 'Comunicación, flexibilidad.', '', '', ''),
(2955, '2022', 1, 2, 691, 60, 'B', 'Jonathan dede seguir aprendiendo, tiene que involucrarse mas en sus tareas, se tiene que adueñar y buscar la polifuncionalidad en el sector.', '', '', '', ''),
(2957, '2022', 1, 41, 664, 0, 'B', 'Leonardo rápidamente se interiorizo en el proceso de planta, lo que le permitió gestionar y obtener resultados', 'Rápidamente logro la comunicación y realización de acuerdos con el supervisor referente del sector. Esto permitió el cierre de muchos riesgos relevados. Llevo a cabo muchos relevamientos dejando informacion para tratar en baja temporada', '', '', ''),
