(2966, '2022', 1, 5, 237, 0, 'B', 'El operario manifiesta un buen desempeño. Adecuado para los puestos ocupados.', 'Flexibilidad, calidad y seguridad son aspectos destacables.', 'Debe trabajar mas en autonomía, desarrollando mas habilidades para poder resolver problemas por si solo. Si bien en su puesto tiene una gran autonomía, debe apuntar a trabajar sobre el sistema, generando OTs, Lups y demás, de las cuales se observa un bajo cumplimiento.', 'El operario muestra un gran compromiso en su trabajo, sobre todo en el puesto de chofer en remanejo.', ''),
(2967, '2022', 1, 5, 200, 0, 'B', 'Se observa un buen desempeño. Debe trabajar mas en las competencias que se le marcan. ', 'Si bien trabaja con una alta autonomía de manera técnica, no se observa avance en sistema, en llenado de planillas, en realización de ots, lups, etc.\r\nTrabajo en equipo y proactividad son aspectos que destacan.', 'Debe trabajar mas en seguridad. Se observa la no utilización de guantes para tareas de autónomo y en varias ocasiones no usa protección auditiva.\r\nDebe seguir trabajando en BPM de manera personal. Ha mejorado, pero debe seguir trabajando. Pero si trabaja con calidad sobre la producción.', 'Se observa un alto compromiso con su puesto de trabajo.', ''),
(2968, '2022', 1, 5, 215, 0, 'NM', 'Se observa un bajo desempeño. No se observa compromiso y es baja la orientación a los resultados. \r\nLlega tarde a la linea. Espera ordenes del Lider o supervisor. No hay proactividad. Dicho desempeño afecta de manera negativa al trabajo en equipo.', 'Se observa que cumple con los estándares de seguridad.', 'Debe trabajar mas concentrado en sus tareas respecto de calidad. Comete errores en el ingreso de pallets a la linea en Mectra.\r\nDebe trabajar en autonomía. No se observa que resuelva problemas por si solo, además de que por el tiempo en el puesto ya podría haber adquirido habilidades em Mectra.\r\nDebe trabajar en proactividad. Siempre espera ordenes. Solo la hay cuando es supervisado. ', 'Se observa un bajo compromiso con la linea. En la anterior evaluación hubo una mejoría en su desempeño, pero este año se nota muy poca preocupación por lograr los objetivos.', ''),
(2969, '2022', 1, 5, 471, 0, 'B', 'Se observa un buen desempeño bueno, adecuado para los puestos en los que se ha desempeñado la operaria.', 'Calidad, seguridad y proactividad son competencias destacables. ', 'Debe trabajar en la comunicación. Debe respetar la cadena de mando y resolver las diferencias el lider sin necesidad de hablar con el supervisor. Se observan saltos en la cadena de mando de la comunicación. \r\nSe observa dificultad para adaptarse a cambios de tareas o turno según la necesidad de la linea. Debe trabajar mas en flexibilidad.', 'Debe mirar su propio desempeño y debe dejar de medir el suyo con de los demás. Se observan comentarios respecto de los demás compañeros. Estas situaciones no suman para el trabajo en equipo. (Situaciones de conflicto cuestionando decisiones respecto de cambios de puesto. Por que yo y no otra persona)', 'Debe seguir trabajando en desarrollar conocimientos en Mectra para poder resolver los problemas por si sola. Si bien hay bastante autonomía, debe seguir construyendo conocimientos para elevar el nivel técnico.'),
