(2986, '2022', 1, 5, 308, 0, 'B', 'Se observa un desempeño bueno pero ha desmejorado en comparación con el desempeño anterior. ', 'Es muy destacable la autonomía del operador y el trabajo con calidad.', 'Debe trabajar mucho en proactividad. Demasiados momentos ociosos ocupados en ninguna tarea productiva ni tampoco en tareas de 5S, normalización de desvíos o capacitación a sus compañeros.\r\nSe observan desvíos en seguridad como actos inseguros y además una excesiva utilización de celular. ', 'Hubieron compromisos de cambio que no se dieron. Deberá revisar el mismo ya que no se observa mejoría para un puesto tan critico como en el cual se desempeña.\r\nEl trabajo en equipo también se ve afectado por el desempeño regular observado. Se observa gran flexibilidad para reconocer errores pero no modificación de conductas.', ''),
(2987, '2022', 1, 46, 275, 0, 'MB', 'Muy buena orientación a resultados y compromiso por el cumplimiento de objetivos. Muy buena coordinando actividades vinculadas a la gestión de los recursos humanos. Gran desafío mejorar la gestión y seguimiento de indicadores del área', 'Trabaja muy bien en equipo con los supervisores. Genera muy buen clima laboral con el equipo. Muy buen aprendizaje y manejo de dotación', 'Puede mejorar aún más el foco de seguimiento de indicadores. Trabajar activamente y proactivamente en seguimiento de indicadores mediante tableros en conjunto con todo el equipo. ', 'Se le presenta un gran desafío, que es el de capacitar a quién la reemplace durante el plazo de su licencia por maternidad', 'Metodología (herramientas) del SGI. Profundizar en conocimientos de indicadores operativos'),
