(3013, '2022', 1, 48, 304, 0, 'E', 'Es colaborador excelente. Que busca siempre la autonomía. ', 'Capacidad de trabajo en equipo\r\nAutonomía\r\nBusca aprender todo el tiempo\r\n', '', '', ''),
