(3016, '2022', 1, 51, 252, 0, 'B', 'Continuar mejorando. ', 'Predisposición. Compromiso. ', 'Poco integración con Jefes. ', '', ''),
(3017, '2022', 1, 51, 258, 0, 'MB', 'Alto compromiso y alta orientación a resultados. Excelente nivel de gestión. ', 'Respeto y responsabilidad. ', 'Incrementar sus conocimientos técnicos. ', 'Mantener resultados y desafiarse en seguir fortaleciéndose en cuestiones técnicas. ', ''),
(3018, '2022', 1, 51, 344, 0, 'B', 'Debe mejorar el compromiso y orientación a resultados. Este año se han dilatado mucho los tiempos de finalización de los trabajos asignados. ', 'Capacidad técnica. ', 'Organización de trabajos. 5S en el sector de trabajo. ', 'Incrementar la gestión y organización de los trabajos. ', ''),
(3019, '2022', 1, 51, 702, 0, 'MB', 'Excelente desempeño operativo y de gestión. Ha mostrado muy buenos resultados trabajando bajo presión. ', 'Capacidad técnica y resolución de problemas. ', 'Liderazgo en grupos de trabajo. Marcar desvíos. ', 'Seguir trabajando en el liderazgo del equipo de trabajo. ', ''),
(3020, '2022', 1, 51, 712, 0, 'MB', 'Gran flexibilidad y altísimo nivel de compromiso con los resultados. ', 'Capacidad técnica y resolución de problemas. ', 'Poca comunicación con superiores. ', 'Seguir trabajando en la organización del sector a cargo. Trabajar preventivamente. ', ''),
(3021, '2022', 1, 5, 203, 0, 'NM', 'Se observa un desempeño no adecuado para los puestos en los que se ha desempeñado.\r\nSe observa que no trabaja al ritmo de la linea. Deja de encajar, afectando el trabajo en equipo y el clima laboral de empaque. Se han recibido quejas por este tema. ', 'Comunicación es una de sus fortalezas. ', 'utiliza de manera excesiva el celular. En muchísimas ocasiones se lo observa no trabajando y usando el celular en la linea y en reproceso.\r\nDemora excesiva en el refrigerio y el baño. No dan tiempo los reemplazos.', 'No se observa compromiso. No se observa orientación a los resultados. No hay preocupación por alcanzar los resultados de la linea. Detiene la linea en vez de buscar alternativas como sacar cajas en un costado. \r\nLlega tarde a la linea en algunas ocasiones. ', ''),
(3022, '2022', 1, 5, 222, 0, 'MB', 'El operario manifiesta un muy buen desempeño.\r\nNo debe descuidar las BPM.', '', 'Debe trabajar en comunicación, comunicando en tiempo y en forma los desvíos.\r\nSe nota en ocasiones rigidez ante algunas situaciones de cambio de tarea(ir a remanejo). De trabajar la flexibilidad y adaptarse a los cambios en situaciones de necesidad.', '', ''),
(3023, '2022', 1, 5, 146, 0, 'B', 'El operario tiene un desempeño adecuado para los puestos ocupados. ', 'Calidad, flexibilidad y trabajo en equipo son competencias destacables- ', 'Debe trabajar mucho en proactividad. Demasiados tiempos ociosos mal utilizados y continua esperando ordenes. \r\nDebe trabajar en seguridad y orientación a los resultados. Muchísima utilización de celular en tetra y no se presta atención a sus tareas. \r\n Debe trabajar en autonomía en salsa para poder empezar a resolver los problemas por si solo. ', 'Se observa un compromiso aceptable para con el puesto ocupado actualmente.', ''),
(3024, '2022', 1, 5, 245, 0, 'B', 'El operario manifiesta un desempeño adecuado para los puestos ocupados. Debe trabajar en las competencias mocionadas-', 'Flexibilidad y calidad y seguridad son competencias destacables. De todas maneras en calidad trabajar en no equivocarse con ingresar mal los pallets en Mectra.', 'Debe trabajar en autonomía. No se observa avance en resolución de problemas sobre todo en Mectra.\r\nProactividad es importante que se trabaje. No se observa que el operario trabaje sin esperar la orden del superior.', 'Debe seguir trabajando en orientación a los resultados. Se observa poco preocupación por el funcionamiento de la linea. ', ''),
(3025, '2022', 1, 5, 259, 82.5, 'B', 'Se observa un muy buen desempeño por parte del operario. Debe seguir trabajando de esa manera.', '', '', '', ''),
(3026, '2022', 0, 0, 97, 0, 'B', 'La operaria manifiesta un desempeño regular. Debe trabajar en lo marcado. \r\nDebe trabajar mucho en autonomía. Todavía le cuesta resolver problemas por si sola.\r\nDebe trabajar en orientación a los resultados. No se observa gran preocupación por alcanzar los resultados preestablecidos.', 'Seguridad y calidad son competencias destacables.', 'Debe trabajar mucho en trabajo en equipo. Se observa dificultad para dejar de lado intereses personales. Se reciben quejas de la gente que trabaja con ella. \r\nDebe trabajar en comunicación: Se reciben quejas del personal y los lideres que trabajaron con ella sobre las formas y tratos recibidos.\r\nDebe trabajar en proactividad. Espera ordenes del lider cuando ya sabe como trabajar en tiempos ociosos', '', ''),
(3027, '2022', 1, 5, 97, 53.75, 'B', 'La operaria manifiesta un desempeño regular. \r\nDebe trabajar mas en equipo. Muchos conflictos con el lider y compañeras de trabajo en general. \r\nDebe trabajar mas en autonomía. Resuelve pero aun le cuesta reconocer muchos fallos. \r\nDebe trabajar mas en orientación a los resultados. No se observa gran preocupación por alcanzar los resultados preestablecidos. ', 'Seguridad y calidad son aspectos destacables en su desempeño', 'Debe mejorar la comunicación. Se reciben muchas quejas por las formas y tratos al lider y compañeras. \r\nDebe trabajar mucho en proactividad. Espera orden es del lider o superior para realizar tareas que debería hacerlas de manera proactiva en tiempos ociosos. Demoras en el desayunador. Demoras en llegar al puesto de trabajo. El turno debe dejarse una vez cumplido el horario de salida y no antes.', 'Se observa poco  compromiso con el puesto. Se queja en algunas ocasiones de que no se le dieron horas extras y luego cuando se le brinda la oportunidad de hacerlas por necesidad de la linea no accede.', ''),
(3030, '2022', 1, 45, 298, 0, 'B', '', 'Se destaca en él sus conocimientos y tareas realizadas en el mantenimiento del toma y su colaboración en capacitar al personal nuevo que ingresa ', 'Omar necesita trabajar en su predisposición para generar propuestas de mejoras para el sector, como así también, adaptarse a las necesidades y cambios de la planta', '', ''),
(3031, '2022', 1, 45, 600, 0, 'B', 'Diego debe mejorar su atención y concentración en la tareas que se encuentra realizando para evitar errores de clasificación y carga de datos al sistema', '', '', '', ''),
(3032, '2022', 1, 45, 711, 0, 'B', 'Juan debe mejorar su atención y concentración en la tareas que se encuentra realizando para evitar errores de clasificación y carga de datos al sistema', '', '', '', ''),
(3033, '2022', 1, 45, 710, 0, 'B', 'Fabio se mostro muy predispuesto a aprender rápidamente como así también, siempre propuso mejoras al sector. Siempre estuvo disponible ante las diferentes necesidades de planta.\r\nSe desafiará a llevar un turno y capacitar a nuevo personal', '', '', '', ''),
(3034, '2022', 1, 45, 3, 0, 'B', '', 'Siempre demuestra respeto y buena comunicación con los sectores con los que comparte tareas. \r\nSe observó mayor confianza para moverse con autonomía en su labores diarias', 'Se observa una oportunidad de mejora en anticiparse a los hechos y proponer mejoras  para agilizar los tiempos de aprobación de insumos', '', ''),
(3035, '2022', 1, 45, 532, 0, 'B', '', 'Se destaca su interés por optimizar procesos, contribuir en grupos bases y mejoras tanto en el laboratorio como en las líneas\r\nBuena predisposición ante las tareas asignadas', 'Debe focalizarse en la investigación microbiológica y priorizar los sucesos de planta de acuerdo a las necesidades y rol del puesto ', '', ''),
