(3107, '2022', 1, 41, 706, 0, 'B', 'Si bien el trabajo de German se desempeño en líneas generales bien demostró baja flexibilidad o imposibilidades para poder cubrir necesidades extras al turno.\r\nTal vez ante algún problema que se presentaba no era expeditivo en la resolución. ', '', '', '', ''),
(3108, '2022', 1, 41, 652, 0, 'B', 'Gonzalo se adapto rápidamente a los requerimientos del puesto. El ya había transitado una temporada y media en planta productiva. Logro integrarse al equipo y obtuvo resultados en su gestión. Es necesario reforzar uso de sistema y SGI. ', '', '', '', ''),
(3109, '2022', 1, 41, 717, 0, 'B', 'Mauro logro adaptarse rápidamente al puesto, se destaco entre sus compañeros. Resolvió problemas de manera autónoma, y logro llevar adelante los análisis correctamente', '', '', '', ''),
(3110, '2022', 1, 38, 705, 93.75, 'MB', 'Juan Marcos ha sido evaluado desde su perfil como axuliar de Ing. en proceso y conjunto con su rol anterior como auxiliar de proceso en Calidad FEM. ', 'Tiene una capacidad importante en análisis técnico y la intención de alentarse a los sucesos', 'Juan deberá en su nuevo rol generar acuerdos y establecer reuniones y vinculos fuertes con sus pares y no bajonearse cuándo las situaciones no salgan como lo planificó. ', '', 'Comunicación asertiva, herramientas de análisis de causa, aspectos vinculados a seguridad, liderazgo,  '),
