(3116, '2022', 1, 45, 212, 0, 'B', '', 'Flexibilidad ante las necesidades de la planta\r\nCompromiso con sus compañeros\r\n\r\n', 'Trabajar con mayor autonomía\r\nProponer mejoras \r\nSolucionar problemas del sector de manera autónoma', '', ''),
(3117, '2022', 1, 45, 256, 0, 'B', '', 'Conocimientos técnicos tanto de calidad como mecánico\r\n', 'Trabajar en equipo con sus compañeros del sector\r\ntransmisión de conocimientos a sus compañeros\r\nAdaptarse a los cambios propuestos o requeridos por clientes\r\n', '', ''),
(3118, '2022', 1, 45, 709, 0, 'B', 'Iniciandose en el rol, en curva de aprendisaje.', 'Conocimientos, actitud, toma los desafios', 'Apropiarse del rol, agregar valor, desafiar y buscar respuestas para generar la experiencia', '', 'Procesos\r\nSeguridad alimentaria\r\nLiderazgo'),
(3119, '2022', 1, 45, 542, 0, 'B', 'Buen perfil para seguir desarrollando y sando mas desafios', 'Predisposición, versatilidad, gran capacidad ', 'Autonomía, seguridad, exponsición', '', 'Liderazgo\r\nProcesos'),
(3120, '2022', 1, 45, 296, 0, 'B', '', 'Flexibilidad ante cambios\r\nPolifuncionalidad\r\nRespeto, compromiso y compañerismo \r\n', 'Autonomía en la toma de decisiones \r\nMejorar su seguridad para tomar decisiones sobre el proceso y producto\r\n', '', ''),
(3121, '2022', 1, 45, 366, 0, 'MB', 'Romina tiene gran capacidad potencial, resta que canalice, genere mas autonomia y proactividad en su rol. \r\nQue se anime a salir del rol y ampliar sus conocimientos, tiene antiguedad suficiente y resta que lo ponga en campo', 'Templanza, ordenada, capacidad', 'es acotada a su sector , hay oportunidades para expandirse e interactuar', '', ''),
(3122, '2022', 1, 45, 402, 0, 'MB', 'German año tras año progresa y empodera su lugar en el area y frente a todos los departamentos.', 'Templanza, conocimientos', 'Nexo industrial, liderazgo', '', ''),
(3123, '2022', 1, 45, 307, 0, 'B', '', 'Responsabilidad en los controles que realiza \r\nPredisposición para solucionar problemas', 'Autonomía para proponer mejoras en su labor diario y falta de profundidad en el análisis de causas de los desvíos de proceso', '', ''),
(3124, '2022', 1, 45, 423, 0, 'B', 'Maxi tiene experiencia en el puesto, es el temporario de mayor antiguedad, fue su primer año haciéndose cargo del turno, desafio que s ele dio intensionalmente y destacamos su colaboración. Consideramos que tiene que tomar mas un papel protagónico y desenvolverse / agregar valor en otros aspectos, por ej grupos de mejora, tsp, tratamientos varios, investigación, etc.', 'conocimientos del puesto', '', '', ''),
(3125, '2022', 1, 45, 311, 0, 'B', 'Se destaca su performance en la investigación asignada referida a envases necking ', 'Proactividad en proponer mejoras en su labor diaria y el proceso\r\n\r\n', 'Mejorar la comunicación con los demás sectores y lograr acuerdos ', '', ''),
(3126, '2022', 1, 45, 582, 0, 'B', 'Cursa su primer año en el puesto, puesto nuevo que esta moldeando, ella tiene sobre todo gran predisposición para tomar los temas, y en un punto le juega en contra porque comete errores por la ansiedad de resolverlos, nos encontramos trabajando este aspecto. El resto se lo dará el entrenamiento.', 'Predisposición', 'Ansiedad', '', 'Procesos\r\nSeg ALIM\r\ntrab equipo\r\nliderazgo'),
(3127, '2022', 1, 45, 369, 0, 'B', 'Se destaca su integración y trabajo en equipo con líder y operadores de producción, lo que llevo a resolver de manera efectiva y dinámica PNC acumulado y 5S del sector', 'Flexibilidad a los diferentes cambios de roles. \r\nProactividad para mejorar condiciones del sector y controles asociados a mejorar la calidad del producto', 'Debe mejorar la profundidad en el análisis de los desvíos de manera de encontrar y solucionar causas raiz ', '', ''),
(3128, '2022', 1, 45, 357, 0, 'B', '', 'Conocimientos y experiencia en el sector y procesos que maneja\r\nCuando toma decisiones, lo hace con buen criterio \r\n', 'Debe trabajar en la comunicación y generación de acuerdos con supervisor de turno para resolver nuevas dificultades de manera más autónoma.\r\nDebe enfocarse en proponer mejoras para ante desvíos de proceso enfocándose en la causa raíz \r\n', '', ''),
(3129, '2022', 1, 45, 460, 0, 'MB', '', 'Proactividad \r\nCompromiso por mejorar controles, indicadores y desvíos de proceso\r\n', 'Necesita trabajar en la flexibilidad y tener una mirada más global a la hora de tomar decisiones o presentarse un desvío en el proceso para lograr acuerdos con otros sectores', '', ''),
(3131, '2022', 1, 45, 291, 0, 'B', '', 'La autonomía con la que logra manejarse en el sector ', 'Necesita mejorar la comunicación con sus pares y superior\r\nDebe mejorar su predisposición para adaptarse a los cambios y necesidades de la empresa\r\nMejorar el trabajo en equipo', '', ''),
