(3162, '2023', 1, 52, 559, 0, 'B', 'Nelson esta temporada enfrento el desafío de estar en un nuevo puesto de mayor criticidad y tiene que seguir desarrollando sus habilidades de autonomía y comunicación.', 'Capacidad de adaptarse a un nuevo puesto y enfrentar nuevos desafíos. \r\nBuen trabajo en equipo y compañero (Capacitador de su puesto anterior.', 'Comunicación y autonomía. Falta de habilidades técnicas en equipos.', '', ''),
(3163, '2023', 1, 52, 499, 73.75, 'MB', 'Marcelo es candidato a poder crecer en el sector en el que se encuentra. Necesita enfocarse y capacitarse en sistema y gestión de personas para poder ser considerado.', 'Actitud positiva, proactivo y autonomo.', 'Comunicacion.', '', ''),
(3164, '2023', 1, 52, 289, 76.25, 'B', 'Las fortalezas y debilidades estan muy marcadas, conoce de sistema y es muy autonomo en cuanto a habilidades tecnicas. Debe trabajar en su comunicacion y mejorar el trabajo en equipo.', '', '', '', ''),
(3165, '2023', 1, 52, 716, 0, 'B', 'Gran capacidad de adaptarse a nuevos puestos. Necesita de supervisión para realizar las tareas, falta proactividad.', '', '', '', ''),
(3166, '2023', 1, 52, 33, 0, 'B', 'Rafael tiene muy buena predisposición y proactividad en los puestos que se le asigna. Siempre esta comprometido en 5S y gestión segura. Falta autonomía para resolver problemas técnicos.', '', '', '', ''),
(3167, '2023', 1, 52, 67, 0, 'MB', 'Daniel debe cambiar la forma de comunicarse con las personas que tiene que liderar y mejorar su forma de trabajar en equipo.', '', '', '', ''),
(3168, '2023', 1, 52, 70, 0, 'B', 'Tiene que ser mas abierta a criticas y saber comunicarse con sus compañeros para mejorar su rendimiento. Es muy comprometida con 5S y gestión segura en planta.', '', '', '', ''),
(3169, '2023', 1, 52, 199, 0, 'B', 'Tiene que mejorar sus capacidades de comunicación y explotar sus capacidades técnicas para mejorar su autonomía.', '', '', '', ''),
(3170, '2023', 1, 52, 216, 0, 'MB', 'Oscar tiene un gran conocimiento del equipo y lo transmite a sus compañeros sin problemas. Es autónomo y tiene gran capacidad técnica pero en ocasiones le falta proactividad.', '', '', '', ''),
(3171, '2023', 1, 52, 250, 83.75, 'MB', 'Muy autónomo y comprometido a mejorar la linea. Debe mejorar en cuestiones de seguridad y en la comunicación con sus pares.', '', '', '', ''),
(3172, '2023', 1, 52, 556, 0, 'MB', 'Esteban pudo adaptarse muy bien a nuevos desafíos, si bien todavía tiene que seguir desarrollando habilidades técnicas pudo aprender de sistema y gestión. ', '', '', '', ''),
(3173, '2023', 1, 52, 539, 0, 'MB', 'Alfredo mostro gran capacidad de operación en equipos críticos pero debe aprender a adaptarse a todo tipo de tareas sean criticas o no. También necesita aprender a manejar situación bajo presión.', '', '', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(3174, '2023', 1, 52, 629, 0, 'B', 'Daniel tiene la capacidad técnica para manejar problemas en los equipos pero muchas veces no actúa sobre ellos. Tiene proyeccion para ser operador de equipos criticos pero debe desarrollar mejor comunicación y comprensión global del proceso.', '', '', '', ''),
(3175, '2023', 1, 52, 279, 0, 'MB', 'Autónomo, con gran manejo técnico y conomiento del proceso. Tiene que manejar mejor las tareas bajo presión y aprender a delegar.', '', '', '', ''),
(3176, '2023', 1, 52, 352, 0, 'MB', 'Tiene que mejorar la gestión y la comunicación con las personas como líder. Debe hacer foco en gestión de condición segura y el control de la misma.', '', '', '', ''),
(3177, '2023', 1, 52, 398, 0, 'MB', 'Tiene que mejorar su proactividad en tiempos de ocio.', '', '', '', ''),
(3178, '2023', 1, 52, 803, 0, 'MB', 'Muy eficiente y bien predispuesto, tiene que mejorar sus conomientos en cuanto a calidad, seguridad e higiene para poder completar su perfil.', '', '', '', ''),
(3179, '2023', 1, 52, 805, 0, 'NM', 'Falta de proactividad e interés por mejorar en las tareas propuestas. No se adapto a los puestos de trabajo como se le pedía.', '', '', '', ''),
(3180, '2023', 1, 52, 771, 0, 'B', 'Sebastian tiene debe mejorar sus capacidades técnicas para ser tenido en cuenta en puestos críticos o como ayudante de los mismos. Tiene buena actitud ante ordenes pero necesita mas autonomía y proactividad para resolver problemas.', '', '', '', ''),
(3181, '2023', 1, 52, 565, 0, 'B', 'Jose tiene que mejorar la comunicacion con sus compañeros. Tiene que ser mas flexible cuando se le asignen tareas por fuera de lo que el esta acostumbrado.', '', '', '', ''),
(3182, '2023', 1, 52, 405, 0, 'B', 'Jorge necesita mayor proactividad en su puesto de trabajo, es un operador que cumple siempre y conoce a la perfección las tareas que debe hacer pero puede mejorar buscando avanzar con tareas alternativas en tiempos de ocio.', '', '', '', ''),
(3183, '2023', 1, 52, 5, 0, 'B', '', '', '', '', ''),
(3184, '2023', 1, 52, 50, 0, 'B', 'Eduardo demostró mejoría en su comunicación y flexibilidad para aceptar nuevos puestos. Tiene conocimientos técnicos de equipos pero muchas veces no actúa sobre los problemas por lo que debe mejorar su autonomía y proactividad.', '', '', '', ''),
(3185, '2023', 1, 52, 65, 0, 'B', 'Debe mejorar su proactividad para realizar tareas en tiempos muertos y tomar mas protagonismo en los puestos de trabajo que se le asignan.', '', '', '', ''),
(3186, '2023', 1, 52, 66, 0, 'NM', 'Oscar tiene que ser mas proactivo y autonomo a la hora de resolver problemas en su puesto de trabajo.', '', '', '', ''),
