(3200, '2023', 1, 41, 706, 0, 'B', 'German se desempeño con mejor preformance en el sector que ocupo este año. Logro buena integracion con el equipo y resolver problemas por su cuenta. ', '', '', '', ''),
(3201, '2023', 1, 41, 746, 0, 'MB', 'Se destaca de Agostina su alta participación en el proceso previo en la auditoria. Por querer lograr obtener los resultados que desde el área nos estábamos planteando. Su paso por la planta marco diferencial en la gestión de medio ambiente pudiendo avanzar con distintos relevamientos. Pudo adecuarse a las necesidades de seguridad. ', 'Escucha, empatía y forma de comunicarse. Logro generar acuerdos en niveles superiores y con sus pares', '', '', ''),
(3202, '2023', 1, 41, 744, 0, 'B', 'Oscar busco dar respuesta a varios problemas que se iban presentando. Al compartir el turno con el mecánico del sector, ayudo a que sea el nexo en la resolución de algunas condiciones perdidas.\r\nSería importante trabajar más en la involucración en los procesos y la comunicación. \r\nAl principio de la temporada hubo algunos problemas de comunicación con uno de sus compañeros que luego se pudieron ajustar y transitar la temporada sin inconveniente.', '', 'Carga de datos y análisis de los datos cargados', '', ''),
(3203, '2023', 1, 52, 770, 0, 'B', 'Al ser la primer temporada de Luciano debe continuar aprendiendo a trabajar con calidad y seguridad, pero su actitud es muy positiva y proactiva demostrando querer aprender en varios puestos.', '', '', '', ''),
(3204, '2023', 1, 52, 274, 0, 'B', 'David tiene mucha experiencia en su puesto de trabajo lo que le permite trabajar de forma autonoma y poder resolver problemas por si mismo. Tiene una oportunidad de mejora en cuanto a su proactividad a la hora de analizar los problemas y trabajar con sistema.', '', '', '', ''),
(3205, '2023', 1, 52, 760, 0, 'B', 'Manuel demostro mucha iniciativa para aprender en varios puestos y en participar en mejoras para la linea. Siempre estuvo disponible cuando se lo necesito con una buena actitud. Debe continuar aprendiendo a trabajar en condiciones seguras y bajo las normas de calidad.', '', '', '', ''),
(3206, '2023', 1, 52, 300, 0, 'B', 'Oscar tiene gran conocimiento técnico de los equipos que opera pero debe aprender a ser mas proactivo para solucionar problemas.', '', '', '', ''),
(3207, '2023', 1, 52, 343, 0, 'B', 'Necesita mejorar en 5S del sector y su autonomía. Depende mucho de la ayuda de los talleres mecánicos y eléctricos o de los mismos lideres para solucionar problemas y muchas veces no actúa de forma proactiva a los problemas.', '', '', '', ''),
(3208, '2023', 1, 52, 287, 0, 'B', 'Sergio mostro compromiso con la linea y el sector de trabajo. Tiene que seguir mejorando en su autonomia y proactividad. ', '', '', '', ''),
(3209, '2023', 1, 52, 272, 0, 'B', 'Daniel es un operador que siempre tiene buena predisposición y trabaja en equipo para solucionar los problemas. Puede desarrollar mas aun sus habilidades técnicas y su capacidad de comunicación con compañeros y superiores.', '', '', '', ''),
(3210, '2023', 1, 41, 428, 0, 'B', 'Se destaca de Martin la comunicación, y el respeto. Lograron formar un buen equipo de trabajo con sus compañeros. \r\nCon el paso del tiempo fue aprendiendo del proceso y logro integrarse muy bien con Sergio García de modo que lo acompañara en este proceso de aprendizaje.', '', 'Es importante trabajar en el analisis y carga de datos, que fue una falencia de esta temporada.', '', ''),
(3211, '2023', 1, 41, 717, 0, 'B', 'Mauro está transitando su segunda temporada en el mismo sector y puesto. Lo cual dejo evidencia de un turno más organizado y con diferencias con respecto a los otros de manera de tomarlo como referencia hacia donde ir.\r\nLograron formar un equipo de trabajo con el resto de los compañeros. Es destacable la comunicación y respeto.', '', 'Carga y análisis de datos. ', '', ''),
