(3271, '2023', 1, 6, 22, 81.25, 'MB', 'Martha se enfrentó este año a un escenario de cambio de actividades y roles, un nuevo equipo de trabajo y muchos cambios en los proyectos en curso, desempañándose con gran compromiso y flexibilidad.', 'La orientación a los resultados en tiempo y forma así como la comunicación con sus pares y superiores son las competencias fuertes de Martha. En este escenario particular de este año mostró muy buena flexibilidad para adaptarse a dichos cambios y la proactividad necesaria para acompañar con su experiencia y conocimiento al equipo.', 'Martha trabaja con autonomía en el puesto de trabajo, pero esta competencia es aún mayor cuando se encuentra sin sus supervisores, es una oportunidad fortalecer esto durante el resto del año.', '', ''),
(3272, '2023', 1, 48, 401, 0, 'E', '', 'Entusiasmo \r\nVoluntad \r\n', 'Mejorar en la comunicación asertiva con las demás personas.', 'Buscar formar los aspectos que contribuyen a un líder.', ''),
