(3320, '2023', 1, 57, 256, 62.5, 'NM', '', 'Conocimientos de procesos de fábrica de envases y defectos asociados', 'Flexibilidad para adaptarse a cambios\r\nPropuestas para mejorar condiciones de trabajo, controles, trazabilidad y orden\r\nFlexibilidad para adaptarse a otros puestos del área y entender la criticidad de los planes de control\r\nIncumplimiento de planes de control con frecuencias establecidas\r\nFalta de participación y compromiso en actividades del área (grupos de trabajo, reunión de pilar)', '', ''),
(3322, '2023', 1, 57, 582, 88.75, 'MB', '', 'Autonomía a la hora resolver problemas e inconvenientes que surgen en las tareas de su rol\r\nProactividad para participar de actividades del área y de la empresa en general\r\nExcelente comunicación con las personas con las que debe interactuar \r\nFlexibilidad y adaptabilidad a la hora de cubrir tareas extras solicitadas y cubrir ausentismos de otros puestos\r\nPropuestas de mejoras en su puesto de trabajo y en otros puestos dentro del área', 'Adquirir mayor conocimiento de procesos productivos\r\nGestión de analisis de datos, sacar conclusiones, participar en grupos orientados a los resultados, exponer conclusiones.', '', ''),
(3324, '2023', 0, 0, 572, 0, 'MB', 'Romina tiene un potecial inmenso para desarrollarse, es muy practica, ordenada y sencilla, aplica la lógica ante todo y todo lo resuelve con una templanza que la distingue. Su perfil tiende a desempeñarse en ambientes acotados, y es necesario que amplie para enriquecer su propio desempeño, y el del resto de los equipos de trabajo. \r\nEn esta evaluación Romi esta dejando su rol, y se le reconoce la manera responsable de como lo esta haciendo y el enorme beneficio que le ha dado al area tenerla, es excelente p', 'Capacidad de planificación y orden\r\nTemplanza\r\nAplica muy bien el sentido común, es practicaa y sencilla par resolver problemas.', 'Es acotada a su rol, tiende a encasillarse y es necesario que interactúe, intercambie con procesos para mejorar su propio rol, en la gestión que realiza.\r\nConocimientos de proceso.', '', ''),
