(3344, '2023', 1, 57, 366, 87.5, 'MB', 'Romi tiene un gran potencial, su conducta ordenada, organizada, planificada, simple, practica y con la templanza que trabaja hace que se desempeñe muy bien en lo que hace. Por su perfil tiende a moverse en una zona acotada, esto la ha dejado sin tantas herramientas para aveces responder a algun problema, pero de todas maneras encuentra la manera acertada de hacerlo, pero creo que la beneficiaria mas en sus conocimientos y asi poder abordar de mejor manera las dificultades.\r\nEn esta evaluación ella deja el ', 'Capacidad de planificación y orden\r\nTemplanza\r\nSencilla, resuelve de manera simple y siempre aplica el sentido logico y comun de las cosas', 'Participación en grugos\r\nCapacidad para inovar y generar mejoras\r\nEs acotada a su sector\r\nCapacidad de mostrarse y exponer ', '', ''),
