(3472, '2023', 1, 59, 361, 0, 'MB', 'David es muy proactivo y técnicamente muy capaz, respetuoso y colaborativo.', 'Proactividad, guiar a sus compañeros y responsable en las actividades del area eléctrica.', 'Baja auto estima y tiene ganas de liderar un grupo de trabajo, pero no se anima. ', 'Este proximo año se le dará la oportunidad de liderar su turno como herramienta para mejorar esa competencia de liderazgo, con lo cual se compromete a poder llevarlo a cabo.', 'Externa de PLC Siemens y de Programacion.'),
(3473, '2023', 1, 59, 356, 0, 'MB', 'Jose si bien trabaja callado, es un colaborador con gran capacidad técnica y capaz de resolver problemas complejos.', 'Capacidad técnica y es capaz de explicar problemas a sus compañeros sin dificultad y con convicción.', 'Su personalidad es callada lo cual no permite a simple vista ver su potencial con lo cual si uno no le pregunta no es capaz de introducirse en el tema técnico.', 'Este año 2024 se le dará la oportunidad de liderar su turno como herramienta para mejorar esa competencia de liderazgo y poder transmitir toda su capacidad técnica a sus compañeros.', 'Externa de PLC Siemens y programación'),
(3474, '2023', 1, 59, 257, 0, 'MB', 'Gustavo tiene una forma de trabajar solitaria, con mucho conocimiento técnico y experiencia en el rubro que lo hace muy capaz.', 'Su capacidad técnica y conocimiento de los equipos que tiene que mantener según su puesto laboral.', 'Deberá desarrollar más trabajar en equipo que con la experiencia de su puesto podría capacitar a sus compañeros para nivelar competencias.\r\nTiene problemas para complementarse con otros compañeros que no poseen un ritmo de trabajo estable.', 'Transmitir su conocimiento a sus compañeros sin prejuicios y sin que se lo pidan.', 'Programación de PLC.'),
