INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(3606, '2023', 1, 5, 43, 0, 'B', '', '', 'Trabajar mas en equipo. \r\nTrabajar en proactividad.\r\nTrabajar mas en el empaque en colocación de cajas para no parar\r\n', '', ''),
(3607, '2023', 1, 5, 72, 0, 'NM', 'No se queda a las reuniones. \r\nNo resuelve situaciones de su sector. Se reciben quejas pero no genera soluciones.\r\nNo aporta mejoras en el puesto. \r\nSe nota falta de compromiso con el puesto', '', 'Necesita trabajar mas en equipo. No ayuda al de envasado cuando se le pide. (ej, no identifica los tambores cuando se le pide)\r\nNo reconoce autoridad del Líder. \r\nNo ayuda en otros sectores que no sea el suyo\r\nSe queja siempre que debe venia a realizar extras, ', '', ''),
(3608, '2023', 1, 5, 302, 0, 'B', '', '', 'Trabajar en comunicación. Saltea la cadena de mando\r\nSeguir trabajando en autonomía para seguir desarrollando conocimientos en los puestos ocupados\r\n\r\n', 'Le cuesta venir o quedarse en extras. ', ''),
(3609, '2023', 1, 5, 139, 0, 'B', '', 'Flexibilidad', 'Trabajar mas en proactividad. \r\nTrabajar en seguridad. No pasar por debajo de cintas.\r\n', '', ''),
(3610, '2023', 1, 5, 108, 0, 'B', '', '', 'Trabajar mas proactividad y autonomía. Seguir desarrollando conocimientos. ', '', ''),
