(3613, '2023', 1, 5, 211, 0, 'MB', '', '', 'Trabajar en polifuncionalidad.\r\nTrabajar mas en sistema. Generar autonomía en pedido de repuestos\r\nUtilizar menos el celular\r\n', '', ''),
