(3618, '2023', 1, 5, 152, 0, 'MB', '', '', 'Trabajar en Flexibilidad:\r\nComunicación. Debe ser mas proactiva\r\nAutonomía con bascula\r\n', '', ''),
(3619, '2023', 1, 5, 168, 0, 'MB', '', '', '', '', ''),
(3620, '2023', 1, 5, 385, 0, 'MB', '', '', '', '', ''),
(3621, '2023', 1, 41, 263, 76.25, 'MB', 'Orientación a los resultados: Es importante seguir trabajando en el análisis de los datos y ensayos realizados, es frecuenta la falta de carga de datos, y a veces algunos resultan incongruentes.\r\nEl mto realizado en la planta durante el 2023 nos deja en otro estadio para afrontar la temporada 2024, lo cual debería ayudarnos a poder lograr mayor análisis de los datos.', 'Respeto y escucha, Responsabiliad\r\nProactividad: Se sigue observando una importante evolución en la resolución de problemas, seguimientos de temas, involucración en el proceso, \r\nDurante el mantenimiento de los reactores (MMBR, LLAA se uso a la par del personal de clines, buscando poder resolver lo mas rapido posible las fallas del sistema, realizar las pruebas necesarias.\r\nPedro ha demostrado que tiene la capacidad para proponer ideas creativas y que han sido asertivas al momento de resolver problemas. \r\nA', 'Capacidad de comunicación - El año pasado se habia marcado trabajar la comunicación con supervisores, no por que sea mala, si no animarse a romper barreras para lograr la autonomía en los procesos, evitando generar la comunicación con intermediarios como el analista o jefe que puede llevar a demoras en la resolución. Si bien hubo evolución es importante seguir trabajándolo.\r\n', '', ''),
(3622, '2023', 0, 0, 275, 0, 'MB', '', 'Lorena tiene muy buen a predisposición para el trabajo en equipo, siempre atenta a trabajar colaborativamente con sus compañeros. Siempre respetuosa y generando buen ambiente laboral. En general flexible para adaptarse a cambios.', 'Puede mejorar su proactividad, anticipándose a situaciones problemáticas que pudieran sucederse a futuro. Si bien resuelve de forma autónoma en varios contextos, podría aportar para la generación de autonomía del equipo, también relacionado a anticiparse a los problemas. Representa el desafío para el 2024: el aporte constructivo de manera proactiva y generando autonomía junto al equipo.', 'Importante además contemplar la totalidad de la dotación MOD, teniendo en cuenta personal MOD en áreas como MAHPI y Calidad. ', ''),
(3624, '2023', 1, 41, 325, 80, 'MB', 'Orientación a los resultados: Falta de análisis de los datos de muestreos, Falta de carga de datos, incoherencia en algunos datos cargados. Este es un punto que debemos trabajar, y que viene repetitivo en los años.', 'Se destaca el conocimiento e involucración en querer aprender y generar nuevas soluciones. Es destacable como conoce cada uno de los equipos, status, que falta de la condición básica. y como alerta ante desvíos o faltantes.\r\nParticipación e involucración en cuestiones de seguridad de planta, siempre atento a detectar e informar desvíos que pueden generar algún accidente', 'Es importante seguir reforzando el trabajo en equipo, sobre todo en la integración con el área de mantenimiento aprovechando el gran conocimiento que se tiene del sector .', '', ''),
(3626, '2023', 1, 46, 275, 0, 'MB', 'Desafío 2024: anticiparse a situaciones críticas y problemáticas que afectan los indicadores del área. Continuar desarrollando autonomía para resolver en conjunto con los supervisores, de forma anticipada.', 'Lorena es una persona con muy buena predisposición al trabajo en equipo y genera buen ambiente laboral. En general intenta estar comunicada con sus compañeros. Siempre respetuosa en la comunicación. En general buena predisposición para adaptarse a cambios.', 'Puede mejorar la proactividad, anticipándose a situaciones problemáticas que pudieran sucederse a futuro. Si bien trabaja con autonomía en varios contextos, puede continuar mejorando la generación de autonomía en relación al equipo. Esto último está relacionado a lo comentado sobre anticiparse a situaciones futuras.', 'Es importante que Lorena se enfoque no sólo en la dotación MOD de Producción, si no también tener en cuenta el personal MOD asignado a áreas como MAHPI y Calidad', ''),
(3627, '2023', 1, 46, 280, 0, 'MB', 'Yanina tuvo muy buen desarrollo en un nuevo rol. Esta devolución es un reconocimiento al esfuerzo que representó el cambio de rol y la importancia del desafío asumido con resultados satisfactorios', 'Muy buena predisposición para el trabajo en equipo. Siempre respetuosa. Fue mejorando su comunicación en la medida que se fue desarrollando en el nuevo rol. Fue adquiriendo confianza con el paso del tiempo. Se sumó de manera voluntaria al Programa Compromiso', 'Cuestiones propias del proceso de aprendizaje que tuvo que transcurrir hacen que el nivel de autonomía baje, pero en la medida que pasó el tiempo, su autonomía fue incrementándose de manera muy positiva. También como parte del proceso de aprendizaje fue mejorando su proactividad.', '', ''),
(3628, '2023', 1, 5, 229, 0, 'B', '', '', '', '', ''),
(3629, '2023', 1, 5, 567, 0, 'B', '', '', 'Trabajar en flexibilidad. Dificultado para reconocer errores y adaptarse a nuevas asignaciones\r\nTrabajar en proactividad. \r\nTrabajar mas en autonomía. Debe aprender a resolver situaciones en el equipo que se desempeña.', '', ''),
(3630, '2023', 1, 5, 169, 0, 'B', '', '', 'Trabajar mas en autonomía. Debe resolver problemas por si sola.\r\nTrabajar mas en proactividad. No debe esperar ordenes\r\n', '', ''),
(3631, '2023', 1, 5, 801, 0, 'B', '', '', '', '', ''),
(3632, '2023', 1, 5, 440, 0, 'B', '', '', 'Trabajar en seguridad. No debe realizar Maniobras bruscas como golpear uñas de auto elevador. \r\nDebe trabajar con mas cuidado. Se observan golpes contra objetos. ', '', ''),
(3633, '2023', 1, 5, 286, 0, 'B', '', '', 'Uso excesivo de celular\r\nSe duerme en el puesto\r\nDebe trabajar en flexibilidad para reconocer errores \r\n', '', ''),
(3634, '2023', 1, 5, 465, 0, 'MB', '', '', 'Debe trabajar mas en autonomía. Debe resolver mas problemas por si sola. \r\nDebe trabajar mas en proactividad, No debe esperar ordenes. \r\n', '', ''),
(3635, '2023', 1, 5, 319, 0, 'B', 'Su desempeño es bueno, pero se observan situaciones de autonomía sin una orden o coordinación de tarea con el Líder o supervisor (ej, riego con bins)', '', 'Debe trabajar en comunicación. Se observan situaciones de toma de decisiones de manera unilateral sin comunicar al Líder. (dejar envases dentro de planta sin coordinar) Es fundamental al comunicación con el mismo. \r\nProblemas para trabajar en equipo, No entrega turno, no habla con su compañero. No lo incluye en la decisión de cambiar el auto elevador.', '', ''),
(3636, '2023', 1, 5, 550, 0, 'B', 'Desempeño regular. Se observa presentación de muchos partes de enfermo.\r\nSe observa poco compromiso en el puesto de balancinero.  Desaprovecha la posibilidad de ser llamado en baja temporada.\r\n', '', 'Debe esforzarse en proactividad. Los lideres marcan mucho este punto. \r\nDebe trabajar mas en autonomía. Se observa que ha decaído mucho sobre todo en FEM. \r\n\r\n', '', ''),
(3637, '2023', 1, 5, 295, 0, 'MB', 'La orientación a los resultados no solo depende de producir, si no también de trabajar con los estándares de la línea. \r\nLe cuesta asociarse con sus pares. Se resiste a las reuniones en grupo con los lideres, sabiendo que son laborales y no sociales. En las mismas muchas veces se bajan lineamientos ', 'Tiene mucha autonomía, resuelve por si solo, pero no comunica. Trabaja bien enseñando, pero pierde la paciencia rápidamente. Debe trabajar el manejo de las emociones y ser mas empático y paciente con el personal que se le asigna a la línea. No siempre se va a poder trabajar con perfiles altamente capacitados.\r\nDebe dejar de hablar mal de sus compañeros, como cuando se dirige al personal de SIG de manera despectiva por alguna situación que no es de su agrado. Deja expuesto que tiene rechazo hacia trabajar co', 'Debe trabajar mucho en comunicación. No quiere usar los canales informales como ws, pero tampoco quiere usas el formal como el handie. Cuesta mucho comunicarse con el por celular y además trabaja de manera muy autónoma, tanto que no comunica muchas veces, y además no pasa información de eficiencias, siendo que muchas veces se le ha solicitado la misma como algo estandarizado. Además la comunicación se torna difícil por que le cuesta cambiar la forma de trabajo y nuevas asignaciones o cambios profundos de ta', 'Se observa al líder en muchas ocasiones fuera de la línea conversando. Se pueden optimizar mejor los tiempos para trabajar con sistema, en cuanto a cierre de HR, cumplimiento de tareas de PM y demás obligaciones. ', 'En ocasiones se puede observar que se comporta mas como un operador que como un líder de línea. \r\nDebe cambiar la forma de trabajar que afecta su desempeño en algunos aspectos. '),
