(3656, '2023', 1, 38, 742, 88.75, 'MB', 'Ana ingresó a planta a cubrir posición de aux de proceso, lo cuál lo desarrollo en una primera etapa de conocimiento, para luego fortalecer su liderazgo, comunicación y dirección técnica para con sus equipos y sus pares ', 'Conocimiento técnico y compromiso', 'Desarrollo de comunicaciones en todos niveles. ', '', 'En equipos de concentrado y proceso generales. '),
(3658, '2023', 1, 8, 815, 98.75, 'E', 'Juan participo activamente en el pilar Gestión temprana:\r\nPrefactibilidad Sala de sopladores , Participación en proyectos en ejecución:  montaje de rayos X , Nuevo transporte de latas vacías, Elaboración de fichas para subasta de equipos, Comparativa técnica necesaria para la compra de equipos (Envolvedor de pallets y Inspector óptico). Elaboración de pliegos de mantenimiento (krofta, Envasadora de cebolla ,Mejoras en Dosificadora de jugo de tomate, Recuperación de agua).', 'Capacidad tecnica.', '.', '.', 'Sería importante que reciba capacitación de liderazgo, Innovación , trabajo en equipo. '),
(3659, '2023', 1, 6, 814, 0, 'MB', 'Yamila se desempeñó de manera correcta, con mucho compromiso y proactividad. Mostrando siempre entusiasmo por aprender nuevas tareas y aceptando desafíos.\r\n', 'Trabaja con foco en las solicitudes, y monitorea el seguimiento de las actividades.\r\nLa comunicación y el respeto son valores propios de ella.\r\nEs muy proactiva y trabaja en equipo respetando roles y ayudando a sus compañeros.', 'Tiene tendencia a trabajar de manera autónoma, aún falta experiencia para desarrollar esta competencia.\r\nDebe trabajar en regirse con estándares y procedimientos de trabajo.', '', ''),
(3661, '2023', 1, 58, 741, 78.75, 'B', '', '', '', '', ''),
(3662, '2024', 1, 49, 786, 76.25, 'B', 'Fernando es una persona con muchas ganas de aprender que se encuentra constantemente buscando crecer', 'En su primer temporada tuvo una necesidad grande de aprender por lo que se dedico a preguntar sobre cada tarea. Durante su segunda temporada estuvo mucho mas seguro en el quehacer de cada día y tomo un rol de lider de sus compañeros mas nuevos ayudandolos ', 'Aun le restan posiciones por las cuales rotar para conocer mas globalmente todos los temas y buscar ser mas proactivo en las tareas a realizar sin quedarse esperando que hacer. ', '', 'Aduana de conservas '),
(3663, '2024', 1, 49, 635, 68.75, 'B', 'Selene es colaboradora con sus compañeros de turno', 'Trabajo en equipo con el turno y con sus compañeros', 'Requiere más madurez en el área para aumentar autonomía a la hora de toma de decisiones', '', ''),
(3664, '2024', 1, 49, 413, 80, 'MB', 'Leandro es una persona proactiva siempre dispuesta a realizar nuevas tareas y a aprender', 'Es un perfil con velocidad de resolución de problemas, y gran manejo del sistema', 'Incorporar conocimientos de proceso para poder mejorar la gestion en su nueva curva de aprendizaje en cuanto a detenciones y fallos', '', ''),
(3665, '2024', 1, 49, 268, 80, 'MB', 'Edgardo es un perfil que facilmente se adapta a la línea en la que se encuentra operativo lo que ayuda en la gestión y cubrir los puestos en caso de ausencias/vacaciones', 'Su fortaleza radica en el orden y la forma de llevar el sector original que es fem ', 'Frecuentemente es dificil aplicar cambios en algunas formas de proceder ya establecidas por costumbre que se suele oponer a modificarlas. Debe trabajar mas en la gestion de mejoras o a mediano plazo en actividades ', '', ''),
(3666, '2024', 1, 49, 24, 81.25, 'MB', 'Sonia trabaja siempre en equipo, respetando la opinion de cada uno de sus compañeros.', 'Gran capacidad de escucha para la toma de decisiones ', '', '', ''),
(3667, '2024', 1, 49, 25, 0, 'MB', '', '', '', '', ''),
(3668, '2024', 1, 49, 27, 90, 'MB', 'Gran capacidad de toma de decisiones y formar equipo en su turno con sus compañeros. ', 'Atenta siempre a los desvios en proceso, una gran capacidad de detectar cada diferencia en planta y relevarlo buscando corregirlo', '', '', ''),
