(3671, '2024', 1, 49, 176, 86.25, 'MB', 'Carlos es una persona muy comprometida con sus tareas del día a día, y se adelanta en algunos procesos para evitar desvíos.', 'Amplio conocimiento del proceso y capacidad de trabajo en el sistema. ', 'Dificultad de organización y distribución de tiempos para poder trabajar más en la gestión a mediano y largo plazo por sus tareas diarias', '', ''),
(3672, '2024', 1, 49, 253, 81.25, 'MB', 'Lionel es una gran capacitador de los nuevos operadores en el sector, siempre dispuesto a enseñarles y asistirlos. ', 'Capacidad de resolución de problemas rápidamente y colaboración con nuevos compañeros', 'Dificultad de realizar tareas de gestión del sector, así como abstraerse del día a día para generar mejoras o participar del sgi', '', ''),
(3673, '2024', 1, 5, 811, 0, 'B', 'Desempeño adecuado para el puesto ocupado. ', 'Predisposición para aprender', 'Comunicación excesiva. Se pierde tiempo. Regular la comunicación a un nivel expeditivo y preciso. ', '', ''),
(3674, '2024', 1, 5, 657, 72.5, 'B', 'Se observa un desempeño adecuado pero puede mejorar', 'Se desenvuelve de manera autónoma en las cubeteadoras. ', 'Debe trabajar mas en comunicación. La misma debe ser fluida. \r\nDebe trabajar mas en autonomía. Espera ordenes. No muestra actitud de aprender. El Líder si no da ordenes no busca la manera de realizar la tarea. ', '', ''),
(3675, '2024', 1, 5, 807, 0, 'B', 'Desempeño adecuado para los puestos ocupados. ', 'Aprende rápido en los equipos que se le dieron a su cargo para operar. Se observa interés por seguir aprendiendo. ', 'Debe trabajar en proactividad. Se le marca en algunas ocasiones que se ponga a realizar tareas de limpieza o reproceso en tiempos ociosos', '', ''),
(3677, '2024', 1, 5, 806, 0, 'MB', 'Buen desempeño para los puestos ocupados. ', 'Se observa interés para aprender. ', 'Debe trabajar mas en proactividad. En momentos ociosos se queda esperando ordenes. \r\nDebe trabajar mas en autonomía. Debe aprender a resolver problemas por si solo. ', '', ''),
(3678, '2024', 1, 5, 800, 78.75, 'B', 'Buen desempeño para el puesto ocupado', 'Flexibilidad y calidad son competencias destacables', 'Debe trabajar mas en proactividad y comunicación. La misma ser mas fluida. \r\nDebe trabajar mas en la selección de la materia prima. Se observa en ocasiones tomate verde en cubeteadoras. Trabajar mas en conjunto con consola para evitar este desvio', '', ''),
(3679, '2024', 1, 5, 798, 73.75, 'B', 'Desempeño adecuado para el puesto ocupado', 'Flexibilidad y seguridad son competencias destacables', 'Debe trabajar mas en comunicación y proactividad.', '', ''),
(3680, '2024', 1, 5, 797, 83.75, 'MB', 'Muy buen desempeño en el puesto ocupado\r\n', 'Proactividad y flexibilidad son competencias que se destacan en su desempeño', 'Debe trabajar mas en autonomía. Debe aprender a trabajar con el sistema. \r\n', '', ''),
(3681, '2024', 1, 5, 784, 80, 'MB', 'Muy buen desempeño adecuado para el puesto ocupado\r\n', 'Predisposición para aprender\r\nProactividad\r\nFlexibilidad.', 'Debe trabajar mas en autonomía para desarrollar mas conocimientos y aprender a resolver mas problemas por si sola', '', ''),
(3682, '2024', 1, 5, 772, 70, 'B', 'Desempeño adecuado para el puesto ocupado', 'Rápido aprendizaje, trabajo en equipo.', 'Debe trabajar mas en proactividad. Se observan tiempos ociosos que pueden aprovecharse para mejorar el estado del sector. Debe trabajar mas en la autonomía del equipo a su cargo. Debe desarrollar mas habilidades técnicas. \r\nDebe trabajar mas en seguridad. Se observan desvíos en el uso de EPP en limpiezas y operación normal\r\nDebe aprender a trabajar con el sistema.\r\nDebe concentrarse mas en sus tareas. Debe ser mas precavido y menos confiado. Se observa exceso de confianza que puede perjudicar su desempeño', '', ''),
(3683, '2024', 1, 5, 723, 0, 'MB', 'Excelente desempeño en los puestos ocupados', 'Trabajo en equipo, flexibilidad y seguridad', 'Debe seguir trabajando en autonomía y desarrollo de habilidades técnicas, paras mejorar la autonomía.', '', ''),
(3685, '2024', 1, 5, 613, 75.71, 'B', 'Desempeño adecuado para el puesto ocupado. ', 'Aspectos como calidad, comunicación y trabajo en equipo son competencias que se destacan\r\nResponsabilidad en sus tareas. \r\nTransmisión de conocimientos\r\n', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\n', '', ''),
(3686, '2024', 1, 5, 610, 71.25, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado\r\n', 'Orientación a los resultados\r\nTrabajo en equipo', 'Proactividad. Trabajar mucho en los tiempos muertos\r\nAutonomía. Aprender la operación en su totalidad para no depender de nadie al momento de manejar su equipo. Asimilar conocimientos técnicos  para poder tomar decisiones. \r\nDebe dejar de distraerse conversando con los compañeros. Afecta su desempeño por no estar concentrada en sus tareas. Varios llamados de atención por utilización de maquillaje y pestañas. Incumplimiento de BPM\r\nFalta proactividad en la operación (limpieza en tiempos muertos, 5S del secto', '', ''),
(3687, '2024', 1, 57, 754, 0, 'MB', 'Walter durante la temporada 2024comenzó en tomamuestras,y luego  logró desempeñarse satisfactoriamente como control de proceso de hojalateria y luego en conservas\r\nPudo adaptarse rapidamente a los puestos asignados', 'Comprometido, Predispuesto\r\nCapacidad de aprendizaje rápida \r\nTrabajo en equipo\r\n', 'Mejorar autonomia', '', ''),
(3688, '2024', 1, 57, 755, 0, 'B', 'Santiago mostró interes en aprender, se desempeñó bien durante su segunda temporada, cubriendo las necesidades del puesto\r\nSin embargo la relación con sus compañeros no fue del todo satisfactoria ', 'Capacidad de aprendizaje rápida e interes en aprender cosas nuevas', 'Baja capacidad de escucha\r\nLe cuesta recibir solicitudes\r\nPor momentos prepotencia con sus pares', '', ''),
(3689, '2024', 1, 57, 751, 0, 'B', 'Agustina, logró desempeñarse correctamente en su segunda temporada\r\nLogró mayor comunicación con sus pares \r\nSin embargo le cuesta preponer cambios ', 'Capacidad de aprendizaje rápido\r\nse adapta facilmente al grupo de trabajo\r\nPredispuesta cuando se le solicita alguna actividad extra', 'Mejorar autonomia y proactividad\r\n', '', ''),
(3690, '2024', 1, 57, 750, 78.75, 'B', 'Valentina tiene un gran potencial, logró en su segunda temporada desempeñarse con mayor autonomia\r\nSe adapta muy bien al grupo y demuestra interes por seguir aprendiendo\r\nLogra resolver problemas de proceso planteados, mediante investigacion y ensayos', 'Proactiva, aprendizaje rápido, respetuosa, resolutiva', 'Adquirir mayor conocimiento de proceso basado en la experiencia\r\nTrabajar mas en gestión de calidad', '', ''),
(3691, '2024', 1, 57, 714, 77.5, 'B', 'Facundo logró durante la temporada 2024 integrarse mas al sistema, lograr mayor autonomía \r\nSe le asignaron pruebas de seguimiento de diferentes variedades ingresadas a la linea\r\nLogró desempeñarse en algunos momentos en laboratorio de conservas, desempeñándose satisfactoriamente\r\nPropone mejoras, referidas a sistematización de registros para aumentar la efectividad de las tareas', 'Predispuesto, capacidad de aprendizaje muy rápida\r\nDispuesto a los cambios y aprender cosas nuevas\r\nMuy respetuoso ', 'Le cuesta mostrar sus logros y propuestas\r\n', '', ''),
(3692, '2024', 1, 57, 710, 75, 'B', 'Facu ingresa a la temporada 2024 para desarrollar funciones como control de proceso en conservas. Sin embargo no logró adaptarse al ritmo de trabajo\r\nEn sus funciones como control de ingreso de materia prima en toma muestras, se desarrolla satisfactoriamente, trabaja con el sistema, mantiene el sector', 'Capacidad de aprendizaje rápida, se adapta bien al equipo de trabajo', 'Le cuesta adaptarse a los cambios\r\nMejorar autonomia', '', ''),
