(3694, '2024', 1, 5, 603, 81.25, 'MB', 'Se observa un muy buen desempeño en los puestos ocupados', 'Flexibilidad, trabajo en equipo y orientación a los resultados son competencias destacables. \r\nResponsabilidad y compromiso. ', 'Debe aprender a trabajar con el sistema. No se observa avance con lineamientos de SGI', '', ''),
