(3697, '2024', 1, 5, 804, 78.75, 'B', 'Se observa un buen desempeño en general ', 'Trabajo en equipo y orientación a los resultados son competencias destacables', 'Debe trabajar mas en seguridad. Se observan desvíos en utilización de EPP y colocación de calzas de seguridad en camiones.', '', ''),
(3698, '2024', 1, 5, 776, 0, 'B', 'Se observa un desempeño adecuado para los puestos ocupados. ', 'Flexibilidad y calidad son competencias que se destacan', 'Debe trabajar mucho en desarrollar habilidades. Trabajar en autonomía y proactividad ', '', ''),
(3699, '2024', 1, 5, 757, 0, 'B', 'Se observa un desempeño regular', 'Flexibilidad y calidad se destacan', 'Trabajo en equipo, orientación a los resultados  y proactividad son competencias a desarrollar\r\nSe observa mucha predisposición al aprendizaje y se solicita el mismo, pero debe mejorar las competencias con bajo desempeño', '', ''),
(3700, '2024', 1, 5, 547, 77.5, 'B', 'Se observa un buen desempeño en general', 'Calidad y autonomía son competencias que se destacan', 'Debe mejorar la comunicación y sus formas de dirigirse a los lideres. Debe aprender a comunicarse de manera asertiva y positiva con sus pares. Se observan actitudes negativas en cuanto a diferencia de opiniones de como realizar alguna tarea. Debe aprender a aceptar distintas miradas y aprovechar los conocimientos de los demás \r\nDebe trabajar mas en proactividad y seguridad. Se observan desvíos de EPP y desvíos en tiempos ociosos.', '', ''),
(3701, '2024', 1, 52, 559, 0, 'B', 'Nelson es un operador con mucho conocimiento en el puesto de preparación de jugo y siempre mostro buena predisposición en capacitar nuevos operarios. También demostró que quiere seguir aprendiendo en otros puestos para continuar su desarrollo. Tiene que trabajar en sus conocimientos técnicos y mejorar su gestion segura.', '', '', '', ''),
(3702, '2024', 1, 52, 289, 0, 'B', 'Daniel tiene que mejorar su comunicación con los demás sectores y con eso su trabajo en equipo. Tiene mucho conocimientos técnicos y de proceso en playa y los aplica capacitando a los operarios nuevos.', '', '', '', ''),
(3703, '2024', 1, 52, 353, 0, 'B', 'Alejandro tiene potencial para operar equipos críticos como preparación de DP y cubeteado aséptico. Tiene que seguir desarrollando su perfil en la rama de calidad y seguridad y mejorar la comunicación con pares.', '', '', '', ''),
