(3714, '2024', 1, 52, 156, 0, 'B', 'Jose logro establecerse como operador de envasadora en SIG pero tiene que seguir trabajando para estar al nivel de sus compañeros y poder ser considerado en las PMSA. También demostró buena predisposición cuando se le pidió operar el Down line lugar donde tiene que completar sus conocimientos ', '', '', '', ''),
(3715, '2024', 1, 52, 216, 0, 'MB', 'Oscar es un referente en los equipos que opera, y participa en las mejoras y proyectos de la línea. Tiene que participar de forma mas activa en el GB. Ayudo mucho en la gestion de ahorro de pasta controlando el estracto.', '', '', '', ''),
