(3717, '2024', 1, 52, 191, 0, 'B', 'Marcela tiene muchos años operando la envasadora de tomate y tiene gran autonomía, siempre estuvo bien predispuesta a transferir conocimiento y aporto ideas para la mejora.', '', '', '', ''),
