(3719, '2024', 1, 52, 398, 0, 'B', 'Dario tiene muy buena proyección para seguir aprendiendo en equipos nuevos como venus y CFT. Tiene que trabajar en incluir la gestión segura y de calidad.', '', '', '', ''),
