(3723, '2024', 1, 52, 556, 0, 'B', 'Esteban tiene que seguir trabajando el aprovechamiento en sus tiempos de óseo. Necesita que apoyemos su desarrollo en capacidades técnicas para que pueda aportar mas en lo fallos. Trabajo muy bien con los procedimientos de limpieza y operación.', '', '', '', ''),
