(3772, '2024', 1, 5, 406, 78.75, 'B', 'Se observa un desempeño adecuado para el puesto ocupado', 'Trabajo en equipo y flexibilidad son competencias que se destacan en su desempeño', 'Se observan situaciones de actos inseguros como subirse a barandas con riesgo de caídas y aperturas de tableros eléctricos\r\nDebe trabajar mas en autonomía. Debe asimilar mas conocimientos técnicos del equipo donde trabaja para poder resolver los problemas que acontecen\r\n ', '', ''),
(3784, '2024', 1, 5, 472, 0, 'B', 'Se observa un desempeño adecuado para los puestos ocupados.  ', 'Calidad y orientación a los resultados son competencias destacables.', 'Debe mejorar las formas de comunicación. Se observan formas incorrectas de dirigirse a los demás. No debe ser sobrepasada por situaciones limite. Debe aprender a manejar las situaciones con calma. \r\nDebe trabajar en mejorar las relaciones interpersonales con su compañera de equipo. \r\n ', '', ''),
(3785, '2024', 1, 5, 57, 0, 'B', 'Se observa un desempeño adecuado para el sector ocupado ', 'Calidad y seguridad son competencias que se destacan en su desempeño. \r\n', 'Debe mejorar las formas y el trato en la comunicación. Las mismas afectan al trabajo en equipo. Se observa en ocasiones desbordes innecesarios. Debe aprender a manejar con calma las situaciones cuando algo no sale según lo esperado. \r\nDebe trabajar mas en la autonomía de la resolución de los problemas de sus sector. \r\nDebe trabajar en flexibilidad. En general se nota rigidez cambios de tareas o nuevas asignaciones, \r\nDebe trabajar en proactividad. Se observan desvíos en tiempos ociosos mal utilizados.', '', ''),
(3786, '2024', 1, 5, 84, 0, 'MB', 'Se observa un desempeño adecuado para los puestos ocupados. ', 'Trabajo en equipo y calidad son competencias destacables. ', 'Debe trabajar mas en sistema y en el GB. Se observa poca participación para llevar adelante tareas de SGI y planificaciones. \r\nDebe trabajar mas en autonomía. No se observa avance en manejo de HR y carga de ot.  ', '', ''),
(3787, '2024', 1, 5, 396, 0, 'B', 'Se observa un buen desempeño. Adecuado para los puestos ocupados. ', 'Flexibilidad y trabajo en equipo son competencias destacables. ', 'Debe trabajar en aspectos de BPM respecto a calidad. Se observan desvíos en utilización de barbero y mala colocación de cofia. \r\nDebe trabajar mas en proactividad. Se observan tiempos ociosos mal utilizados. No debe esperar ordenes del líder o supervisor. \r\nDebe utilizar los epp según la tarea que se le asigne. Se observa algunos desvíos en seguridad.', '', ''),
(3788, '2024', 1, 5, 370, 0, 'MB', 'Se observa un muy buen desempeño en los puestos ocupados.  ', 'Trabajo en equipo, flexibilidad, responsabilidad y compromiso son competencias destacables. ', 'Debe trabajar mas en seguridad. Se observan desvíos por apresurarse a resolver situaciones, generando posibilidades de tener un accidente.\r\nDebe trabajar mas en autonomía, asimilando conocimientos técnicos para poder mejorar en la toma de decisiones. ', '', ''),
(3789, '2024', 1, 5, 88, 0, 'B', 'Se observa un desempeño adecuado para los puestos ocupados.', 'Flexibilidad y calidad son aspectos destacables', 'Se observan tiempos ociosos mal utilizados. Se pueden realizar distintas tareas en ellos, aprovechando esas instancias para adelantar por ejemplo limpiezas.\r\nSe observa desgano o desinterés en aprender nuevos desafíos.  ', '', ''),
(3790, '2024', 1, 5, 117, 75, 'B', 'Se observa un buen desempeño, adecuado para los puestos en los que se ha desempeñado. ', 'Calidad, seguridad y autonomía son competencias destacables. ', 'Debe trabajar en flexibilidad. Se observan situaciones, tratos o formas incorrectas de referirse a sus compañeras. Esto afecta al trabajo en equipo y hace difícil la buena comunicación, generando situaciones incomodas que generan mal clima laboral. Estas situaciones han sido marcadas por el líder y no son reconocidas', 'Se observa un muy alto compromiso para con su puesto y la línea en la cual se desempeña', ''),
(3791, '2024', 1, 5, 465, 0, 'MB', 'Se observa un muy buen desempeño para los puestos ocupados. ', 'Calidad, flexibilidad y orientación a los resultados son aspectos del desempeño destacables', 'Debe seguir trabajando en autonomía. Debe seguir desarrollando conocimientos técnicos para poder elevar su autonomía y así poder resolver mas problemas por si sola.\r\nDebe trabajar en la polifuncionalidad operativa del sector envasado,', '', ''),
(3792, '2024', 1, 5, 286, 0, 'B', 'Se observa un buen desempeño, adecuado para los puestos en los que se ha desempeñado. \r\n', 'Seguridad, calidad y flexibilidad se han destacado como fortalezas. ', 'Debe seguir trabajando en autonomía. Debe elevar sus conocimientos técnicos para poder resolver problemas por si sola. Debe aprender a trabajar con sistema. Debe trabajar en la polifuncionalidad del sector de envasado.', '', ''),
(3793, '2024', 1, 5, 168, 0, 'MB', 'Se observa un muy buen desempeño para los puestos en los que se ha desempeñado. \r\n', 'Calidad, seguridad y flexibilidad son competencias destacables.', 'Debe seguir trabajando en autonomía. Debe elevar sus conocimientos técnicos para poder resolver problemas por si sola. Debe aprender a trabajar con sistema. Debe trabajar en la polifuncionalidad del sector de envasado.\r\n', '', ''),
(3794, '2024', 1, 5, 138, 80, 'MB', 'Se observa un muy buen desempeño, adecuado para los puestos en los que se ha desempeñado. ', 'Responsabilidad, compañerismo, trabajo en equipo y ganas de seguir aprendiendo son competencias destacables. ', 'Se observa un gran desvío en el horario del refrigerio. Debe trabajar en los tiempos ociosos. Dejar los equipos sin control puede generar inconvenientes operativos. \r\nDebe concentrarse en sus tareas, dejando de lado conversaciones extensas que nada tienen que ver con el trabajo. \r\nDebe trabajar mas con sistema, aprendiendo a trabajar mejor con las HR y generación de OT, mas que nunca ahora que se encuentra trabajando en salsa. Su aporte en el GB debe mejorar. Debe ser mas activo y participativo,', 'Mejorar en seguridad. trabajando tranquilo y con la cabeza fría para evitar accidentes por trabajar de manera insegura.', ''),
(3795, '2024', 1, 5, 333, 0, 'MB', 'Se observa un muy buen desempeño, adecuado para los puestos en los que se ha desempeñado. \r\n', 'trabajo en equipo, responsabilidad y autonomía son competencias destacables. ', 'Debe trabajar mas en proactividad. Debe optimizar los tiempos ociosos. Debe trabajar mucho en 5S y ordenamiento de la planta. No debe esperar a que el supervisor le de ordenes. \r\nDebe trabajar mas en seguridad. Se observa en muchas ocasiones la falta de EPP en el auto elevador. ', '', ''),
(3796, '2024', 1, 5, 266, 81.25, 'MB', 'Se observa un muy buen desempeño. ', 'Proactividad, seguridad y flexibilidad son competencias destacables. \r\nTrabaja muy bien con el desarrollo de las 5S en el sector \r\nTrabaja muy bien con la seguridad.\r\nSe destaca la perseverancia para cumplir con los objetivos y la proactividad de estar siempre atento a las necesidades productivas del sector. ', 'Debe trabajar mas en comunicación sobre desvíos en la línea, sobre todo en problemas de calidad. Se observa situaciones no informadas al supervisor. No se debe perder la confianza.\r\nDebe ser mas correcto con el personal a cargo. Hay desvíos que un líder no debe dejar pasar y debe informar. Es parte de las responsabilidades primarias.\r\nDebe seguir trabajando en el desarrollo de habilidades técnicas del equipo a su cargo, aprendiendo a resolver cada vez mas situaciones problemáticas por si solo sin necesidad ', 'Se observa un muy alto compromiso para con su puesto y la línea en la cual se desempeña.', 'Se sugiere seguir trabajando en la polifuncionalidad de su desempeño, aprendiendo en profundidad los demás sectores de la línea. '),
(3797, '2024', 1, 5, 808, 0, 'B', 'Se observa un buen desempeño, adecuado para los puestos ocupados. ', 'Calidad, flexibilidad y trabajo en equipo son aspectos del desempeño destacables', 'Debe trabajar mas en autonomía. Se observa que para el tiempo que se ha desempeñado en el puesto, aun no resuelve situaciones de manera autónoma. Debe trabajar mas en proactividad. Se observan tiempos ociosos mal utilizados. Debe ser mas productivo en dichos momentos. \r\nDebe madurar el puesto. Debe tener en cuenta que el sector en el cual se desempeña es la línea mas productiva de Arcor. \r\nDebe seguir desarrollando la polifuncionalidad tanto en envasado como esterilización y empaque. Debe seguir desarrollan', '', ''),
(3798, '2024', 1, 5, 795, 0, 'B', 'Se observa un muy buen desempeño para los puestos ocupados. ', 'Calidad, flexibilidad y orientación a los resultados son aspectos del desempeño destacables', 'Debe seguir trabajando en autonomía. Debe seguir desarrollando conocimientos técnicos para poder elevar su autonomía y así poder resolver mas problemas por si sola.\r\nDebe trabajar en la polifuncionalidad ', '', ''),
(3799, '2024', 1, 5, 792, 0, 'B', 'Se observa un buen desempeño para los puestos ocupados. ', 'Calidad y flexibilidad', 'Debe seguir trabajando en autonomía. Debe seguir desarrollando conocimientos técnicos para poder elevar su autonomía y así poder resolver mas problemas por si sola.\r\nDebe trabajar en la polifuncionalidad operativa del sector', '', ''),
(3803, '2024', 1, 57, 3, 0, 'MB', 'Mabel se destaca por su trabajo ordenado, siempre dispuesta realizar lo que se le solicita', 'Templanza, responsabilidad, respeto', 'propuestas de mejora', '', ''),
(3804, '2024', 1, 57, 296, 70, 'B', '', 'Predispuesto, respetuoso, flexible ', 'Proactividad, propuestas de cambios y mejoras', '', ''),
(3805, '2024', 1, 57, 298, 0, 'B', '', 'Conocimientos del sector tomamuestra, predisposición a tareas extras solicitadas', 'Flexibilidad para cubrir otros puestos de calidad\r\nPropuestas de mejoras', '', ''),
(3806, '2024', 1, 57, 307, 0, 'MB', 'Betina es una persona super responsable en su trabajo\r\nSe destaca por su aporte al orden y limpieza tanto del laboratorio como de la planta \r\nTrabaja de manera fluida con el supervisor de turno y demuestra autonomía en sus decisiones', 'Autonomía, proactividad, responsabilidad, predisposición ', 'Trabajar mas en gestión (mqa, auditorias, Nc )', '', ''),
(3807, '2024', 1, 57, 311, 87.5, 'MB', 'Pablo se destacó en este período por su autonomía en sector hojalatería, su capacidad de análisis, sus aportes al sector. Logró tomar el mando del proyecto de autonomía, desde implementación a capacitación de los operadores. Es una persona que presenta mejoras e intenta mejorar el sector permanentemente\r\nParticipa de trabajos de investigación de manera activa', 'Autonomía, proactividad\r\nPropuesta de mejoras\r\nFlexibilidad\r\nConocimientos en procesos de fem y conservas\r\n', '', '', ''),
(3809, '2024', 1, 57, 369, 0, 'B', '', 'Capacidad de decisión frente a un problema en la línea\r\nConocimientos de diversos sectores de calidad\r\nCapacidad de escucha y aprendizaje en procesos productivos', 'Trabajar en sistema con mayor autonomía', '', ''),
(3810, '2024', 1, 57, 357, 78.75, 'B', '', 'Conocimientos en sector calidad, respecto a su puesto\r\nResponsabilidad\r\nDestacar su desempeño en rol microbiología en reemplazos de vacaciones, muy comprometida', 'Capacidad de relacionar los conocimientos que tiene de su rol, con la parte mas operativa de la línea. Poder aportar desde su lugar a otras áreas\r\nTrabajo en gestión con mayor autonomía', '', ''),
(3812, '2024', 1, 57, 402, 90, 'MB', 'Germán responde a la necesidad del puesto aunque debe esforzar su proactividad para anticiparse y adecuarse a los cambios y dinámicas que se requieren. Además de fortalecer los límites y trabajar integrado con la industria/ campo, haciendo parte a todos para un resultado integral asociado al propósito de su rol.', 'Flexibilidad\r\nResponde a todo lo que se le pide \r\nAutonomía\r\nEscucha\r\n', 'Proactividad\r\nLiderazgo\r\nCarácter crítico', '', ''),
(3813, '2024', 1, 57, 532, 82.5, 'MB', 'Carla se destaca por sus aportes en su sector, en su grupo base y en ocasiones en sector de laboratorio de conservas\r\nEs una persona que propone mejoras y que le gusta participar de equipos de trabajo de mejoras\r\n', 'Manejo de sistemas de gestión\r\nAportes al sector\r\nResponsabilidad\r\nPreocupación por alcanzar los resultados', 'Autonomía\r\nProactividad\r\nCapacidad Técnica', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(3814, '2024', 1, 57, 709, 0, 'B', 'Maisa durante su primer año como rol de auxiliar de proceso, se desempeñó de manera adecuada\r\nLogró adaptarse al puesto sin dificultad, y llevar a cabo las tareas asignadas\r\nEn proceso de aprendizaje y de mejorar su autonomía', 'Responsable, capacidad de análisis\r\n', 'Autonomia y proactividad', '', ''),
(3817, '2024', 1, 5, 598, 75, 'B', 'Se observa un buen desempeño, adecuado para los puestos en los que se ha desempeñado. \r\n', 'Flexibilidad y trabajo en equipo son competencias destacables. ', 'Debe trabajar mas en aspectos de BPM. Se le llama la atención por la mala o no utilización de barbero \r\nDebe trabajar mas en seguridad y los estándares de utilización de EPPs. Se observan desvíos en uso de copas. \r\nDebe seguir trabajando en autonomía. Debe elevar sus conocimientos técnicos para poder resolver problemas por si solo. Debe aprender a trabajar con sistema. Debe trabajar en la polifuncionalidad..', '', ''),
(3819, '2024', 1, 5, 302, 0, 'B', 'Se observa un buen desempeño, adecuado para los puestos en los que se ha desempeñado. \r\n', 'Flexibilidad es una competencia que se destaca. Dentro de esta competencia debe aprender a modificar conductitas repetitivitas. Reconoce errores pero el cuesta modificar las conductas marcadas. ', 'Debe trabajar en comunicación. Sigue puenteando los mandos. \r\nDebe mejorar el trabajo en equipo. Debe respetar la posición sin tomar atribuciones.\r\nDebe trabajar en proactividad. Se observan tiempos ociosos mal utilizados.\r\nSe observa mejora en autonomía, pero debe seguir trabajando en adquirir mas conocimientos técnicos para resolver problemas por si solo', 'Se observa un compromiso alto, pero en ocasiones esta atado a la tarea que vaya a realizar, cosa que no debe importar. ', 'Se observa un buen desarrollo del desempeño en el aprendizaje en preparación de DP2'),
(3820, '2024', 1, 5, 245, 0, 'B', 'Se observa un buen desempeño, adecuado para los puestos ocupados.', 'Calidad y flexibilidad son aspectos del desempeño destacables', 'Debe trabajar en proactividad. Se observan momentos ociosos que generan deterioro en el clima laboral. No debe esperar ordenes del líder ni supervisor. \r\nDebe trabajar mas en autonomía para poder resolver problemas por si solo. Debe aprender a trabajar con sistema', 'Se destaca compromiso para cubrir vacaciones en puesto de ingredientes ', ''),
