(3837, '2024', 1, 57, 822, 78.75, 'B', 'Daiana logró adaptarse en su rol en su primer año, manteniendo las actividades y mejoras del puesto, sin embargo se nota resistencia a aportar mejoras constructivas y generar acuerdos con sus pares\r\nSe valora el trabajo realizado en depósitos, cumplimiento de programa de auditoria, su experiencia y aporte de su conocimiento', 'Experiencia, autonomía, proactividad', 'Comunicación, trabajo en equipo, generar acuerdos y consensos \r\nComplejizar situaciones simples', '', ''),
