(3841, '2024', 1, 59, 818, 0, 'E', 'Franco demostró siempre capacidad de adaptación a su tarea asignada y un muy valorable compromiso con los resultados del area de mantenimiento poniendo siempre por encima de sus ambiciones personales. ', 'Capacidad de razonamiento en situaciones límites.\r\nCompromiso con los resultados.\r\nCompañerismo y buena llegada a los colaboradores tanto de su area como de la planta', 'Autonomía en el desarrollo de las tareas, siendo que se lo propone para cubrir a supervisores en épocas de licencias, propio de la falta de instrucción, ya que es un Ingeniero junior.', 'Trabajar en poder fortalecer la oportunidad de poder liderar grupos de trabajo en conjunto con los supervisores de las areas de mantenimiento.\r\nSostener mi desempeño a lo largo del tiempo y proponer mi impronta como integrante del area de mantenimiento.', 'Liderar grupos bases de autónomo para poder integrar conocimientos y ambas areas productivas.\r\nContinuar con el proceso de desarrollo del Modelo Unico Conductual para alinearse con el modelo propuesto por la organización.\r\nRealizar el curso de capacitación de Calderista para poder aportar al area de SSCC conocimientos aprendidos también en la Facultad.\r\n'),
(3842, '2024', 1, 59, 157, 88.75, 'MB', 'Fabio ha transitado el año 2024 rompiendo tanto los esquemas de la planta como los suyos adaptándose a la nueva jefatura por lo que es reconocido por ello.\r\nSe adaptó a los nuevos objetivos del area y proponer mejoras a tal fin.', 'Capacidad de adaptarse a nuevos desafíos entendiendo el objetivo central del area y la planta.\r\nSeguimiento personalizado de sus objetivos y metas.', 'Identificar las prioridades en base a lo planificado que me desenfoca y no me deja focalizar en el día a dia.', 'Desarrollar la forma de poder anticiparme a las solicitudes de las demás areas.', ''),
