(3880, '2024', 1, 57, 858, 0, 'B', '', 'Responsable, se adaptó a los requerimientos del puesto\r\nInquietud de aprender en sector laboratorio', 'Mejorar autonomia y proactividad \r\nProponer mejoras para el sector', '', ''),
(3881, '2024', 1, 57, 828, 0, 'B', '', 'Se adaptó correctamente a los requerimientos del puesto microbiología\r\nPredisposición para realizar lo que se le solicita\r\nLogra adaptarse al equipo de trabajo', 'Proponer cambios o mejoras en el sector\r\nLograr realizar las tareas con mayor proactividad y autonomía\r\nParticipar activamente en investigaciones y gestión', '', ''),
(3882, '2024', 1, 57, 816, 0, 'B', '', 'Mauro logra adaptarse y cubrir diferentes sectores dentro del área calidad sin problemas\r\nEs muy predispuesto, colaborativo\r\nLogró en temporada 2024 cubrir puestos de CP en fem y conservas, adquiriendo nuevos conocimientos y desempeñándose satisfactoriamente', 'Lograr mayor autonomía en sus tareas\r\nInvolucrarse mas en procesos de gestión\r\nProponer mejoras en su sector\r\nAdquirir mayor conocimiento en procesos', '', ''),
(3883, '2024', 1, 57, 832, 0, 'B', '', 'Se logra adaptar a las actividades del sector\r\nPredispuesto a aprender en laboratorio\r\nTrabajo en equipo', 'Mejorar autonomia y proactividad\r\nPropuesta de mejoras en sector\r\nTrabajar con sistema de gestión', '', ''),
(3884, '2024', 1, 57, 859, 0, 'B', '', 'Jorge muestra interés por aprender procesos tanto de su puesto como de laboratorio\r\nEs muy predispuesto y colaborativo\r\n', 'Autonomía y proactividad\r\nProponer mejoras en sector\r\nInvolucramiento en sistema de gestión', '', ''),
(3885, '2024', 1, 57, 850, 0, 'B', '', 'Jeremías se logró adaptar al puesto que se le asignó, Logra al transcurrir las semanas, adaptarse al ritmo de trabajo\r\nDemuestra interés por aprender los procesos\r\nAporta con sus conocimientos a la resolución de problemas', 'Intentar manejar las situaciones complejas con tranquilidad\r\nProponer mejoras en sector y sus tareas\r\nInvolucramiento en gestión \r\nInvolucramiento en investigaciones\r\n', '', ''),
(3886, '2024', 0, 0, 821, 0, 'B', 'Guadalupe esta transitando el inicio del rol, en el cual a mitad de año se conversó sobre sus responsabilidades primarias ya que no lograba desempeñarlas adecuadamente. Desde ese momento se nota un cambio favorable. Destacamos su compromiso y voluntad en aprender', 'Flexibilidad, compromiso, trabajo en equipo, predisposición', 'Comunicación, proactividad', '', ''),
(3887, '2024', 1, 57, 821, 0, 'B', 'Guadalupe esta transitando su primer año en el rol, en el cual a mitad del período se conversó con ella porque no estaba alcanzando el requerimiento de sus responsabilidades primarias. Desde ese momento se consiguió un cambio notorio en su desempeño\r\nValoramos su compromiso y predisposición a aprender', 'Flexibilidad, predisposición, compromiso, trabajo en equipo, comunicación con clientes y visitas externas', 'Proactividad, comunicación, Interactuar con otras áreas', '', ''),
