(3961, '2024', 1, 60, 575, 65, 'B', 'En Cristian encontramos un profesional muy completo técnicamente con buena autonomía en resolución y diagnósticos de fallas, pero un tanto apartado de los lineamientos operativos y compromisos organizacionales con la productividad.', 'Cristian posee gran capacidad técnica y conocimientos ingenieriles.', 'Poco compromiso con el compañero y la orientación en la búsqueda de resultados de la compañía. ', '', ''),
(3962, '2024', 1, 60, 701, 65, 'B', 'En Cristian encontramos un colaborador con buena capacidad técnica obtenida de su amplia experiencia en producción industrial.', 'Predisposición a cambios repentinos de tareas vemos que Cristian posee una frecuente autonomía de ejecución de actividades de variadas índoles que refieren a su labor.', 'Frecuentemente Cristian demuestra respeto por los demás, y buena fluidez comunicativa, aunque su comunicación para la resolución de problemas que se le presentan no es la mejor con sus pares a la hora de intervenir en cualquier situación. ', '', 'Sugiero incluir en capacitaciones técnicas de diagnósticos de falla en automatización industrial.'),
(3963, '2024', 1, 42, 571, 0, 'MB', 'Javier a demostrado estar comprometido con el trabajo, y sus habilidades tanto técnicas como la llegada con sus compañeros le a permitido crecer, teniendo una visión mas global de la fabrica y ya no solo de los equipos a cargo. ', 'Es uno de los mejores técnicos con los que cuenta la empresa, y su capacidad para manejo de situaciones complicadas en el campo, sabiendo identificar las urgencias tomando buenas decisiones, su perfil de liderazgo es notorio ', 'Javier deberá plantearse que quiere para su futuro dentro de la compañía, y en el caso de seguir por la linea de crecimiento que mostro hasta ahora deberá ampliar su alcance de conocimientos técnicos a otros equipos y líneas.\r\nComunicarse con mas fluidez con otras áreas, que también le permitirán el crecimiento.', '', ''),
(3964, '2024', 1, 60, 144, 52.5, 'B', 'Oscar es un colaborador con amplia experiencia en su puesto lo cual le permite ser autónomo en sus actividades rutinarias con poco interés en ejecutar trabajos en equipo.', 'Con buena predisposición para la ejecución de tareas asignadas Oscar prioriza de manera efectiva las condiciones seguras de trabajo.', 'Con poco interés en el trabajo en equipo Oscar es bastante metódico a la hora de realizar cambios en su jornada laboral y poco actualizado con los cambios de la tecnología.', '', 'Necesitamos incluir a Oscar en capacitaciones técnicas de actualización en accionamientos de motores eléctricos.'),
(3965, '2024', 1, 56, 527, 0, 'B', 'Hay una mejora en el segundo semestre del año comprometiéndose con las nuevas funciones de su puesto', 'Flexibilidad', 'Proactividad, debe aportar mas propuestas en general para mejorar las condiciones de trabajo', 'Compromiso fuerte con los aspectos de calidad', 'Necesita conocer mas aspectos técnicos sobre los equipos'),
(3966, '2024', 1, 42, 149, 0, 'MB', 'Miguel es un oficial con mucha experiencia, y conocimiento dentro de nuestro equipo siempre predispuesto a los cambios y a las distintas necesidades que surgen en el dia a dia en la industria', 'Posee un gran conocimiento y destreza en los trabajos de montaje, soldadura etc. la mejora esta muy en su esencia.\r\n', 'Debe capacitarse mas en conceptos mecánicos de regulación que le permitan a su ves un buen diagnostico, para una intervención atinada en cada uno de los casos, como asi también mejorar en la parte de sistema (cierre de ot, tsp, etc).', '', ''),
(3967, '2024', 1, 60, 740, 81.25, 'MB', 'En Diego encontramos un profesional super innovador con orientación a mejoras constantes en su rol como programador. ', 'Diego siempre demuestra interés en el trabajo en equipo y su autonomía prepondera por su capacidad técnica. Tiene buenas aptitudes para reconocer errores y se adapta fácilmente a nuevas asignaciones.', 'Observo en Diego que debe mejorar la proactividad para poder involucrarse en los problemas que surjan en la planta sin necesidad de estar induciendo a la ejecución de las tareas, esperando que ocurra desde su espontaneidad', '', ''),
(3988, '2024', 1, 5, 802, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha desempeñado', 'Aspectos como calidad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Lider o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realizacion de OT, LUPs carga de OT, SPAC, etc. ', '', ''),
(3989, '2024', 0, 0, 725, 0, 'MB', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha desempeñado', 'Aspectos como calidad y trabajo en equipo y seguridad son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Lider o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva.\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. ', '', ''),
(3990, '2024', 1, 5, 725, 0, 'MB', 'Se destaca un muy buen desempeño en los puestos en los que ha trabajado. ', 'Aspectos como calidad, seguridad, flexibilidad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. ', '', ''),
(3991, '2024', 1, 5, 694, 0, 'MB', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como trabajo en equipo, flexibilidad y comunicación son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver mas problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nSe observa comiendo chicle en reiteradas ocasiones. ', '', ''),
(3992, '2024', 1, 5, 685, 76.25, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como flexibilidad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nFalta de utilización de EPP en ocasiones', '', ''),
(3994, '2024', 1, 5, 681, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad, flexibilidad y comunicación son competencias que se destacan.', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe trabajar mas en equipo. Se solicita apoyo en Molienda como cuadro de reemplazo y colaboración de descanso y hubo poca respuesta ', 'Se destaca un muy buen desempeño en FEM. Muchas ganas de aprender y desarrollarse', ''),
(3996, '2024', 1, 5, 339, 0, 'MB', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad y trabajo en equipo, flexibilidad y comunicación son competencias que se destacan\r\n', 'Debe trabajar mas concentrado, sin distraerse o distraer a sus compañeros. \r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir desarrollando conocimientos como aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. ', '', ''),
(3997, '2024', 1, 5, 408, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nFalta de utilización de EPP en ocasiones en Rossi', '', ''),
(3998, '2024', 1, 5, 567, 70, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Seguridad es una competencia que se destaca en su desempeño.', 'Debe trabajar mas en equipo. Debe aprender a resolver los conflictos con madurez. No se puede dejar de comunicar con el Líder, o hacerlo de manera de selectiva. Debe aprender a no llevar al plano personal las situaciones laborales. Estas cosas generan malestar y mal clima laboral. \r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe antic', '', ''),
