(4033, '2024', 1, 57, 882, 78.75, 'B', 'Mauro en su primer semestre cumplió rol de control de proceso en calidad, el cual lo desempeñó satisfactoriamente. Se destaca su compromiso, aportes al sector, involucramiento en gestión y trabajos de mejora.\r\nEn el segundo periodo inicia en su rol de líder de producción en fem, un desafío respecto a su nuevo rol. Se destaca compromiso, forma en que percibe los resultados, su proactividad', 'Compromiso, responsabilidad, flexibilidad, propuestas de mejoras', 'Trabajar en la forma de abordar situación difíciles, buscar apoyo\r\nRelación y escucha con otras áreas', '', ''),
(4035, '2024', 1, 5, 550, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad, autonomía y flexibilidad y comunicación son competencias que se destacan\r\n', 'Debe trabajar mas concentrado, sin distraerse o distraer a sus compañeros. Utiliza mucho el celular. Me llama la atención el Gerente por esa situación y dice que no le corresponde limpiar. \r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir desarrollando conocimientos como aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe trabajar en orientación a los resultados. No se observa un', '', ''),
(4036, '2024', 1, 5, 540, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Calidad y flexibilidad son aspectos destacables en su desempeño.\r\nResponsabilidad también es un aspecto destacable. ', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe trabajar mas concentrado, sin distraerse o distraer a sus compañeros. Debe dejar de usar en exceso el celular. Eso genera riesg', '', ''),
(4037, '2024', 1, 5, 493, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado ', 'Aspectos como calidad y trabajo en equipo, flexibilidad y comunicación son competencias que se destacan\r\n', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir desarrollando conocimientos como aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,', '', ''),
(4038, '2024', 1, 5, 469, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad, seguridad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si sola.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. ', '', ''),
(4039, '2024', 1, 5, 349, 0, 'MB', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha trabajado.', 'Responsabilidad, compañerismo, trabajo en equipo y seguridad son competencias destacables.\r\nEn el reemplazo de Líder se observa un gran compromiso y muchas ganas de aprender. ', 'Debe trabajar en calidad, cumpliendo las BPM. Muchas ocasiones se observa incumplimiento de uso de barbijo.\r\nDebe dejar de lado la utilización excesiva del celular. Debe aprender a trabajar mas con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas, HR. Debe ocupar mas el tiempo ocioso de manera productiva. ', '', ''),
(4040, '2024', 1, 5, 335, 78.75, 'B', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha trabajado ', 'Aspectos como calidad y trabajo en equipo son competencias que se destacan', 'Debe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas estándar, HR. Debe involucrarse mas en el GB, generando mas aportes en el sector a través del análisis de los problemas ', '', ''),
(4041, '2024', 1, 5, 322, 80, 'MB', 'Se destaca un muy buen desempeño, adecuado para los puestos en los que se ha trabajado ', 'Responsabilidad, trabajo en equipo, calidad y seguridad son competencias destacables. ', 'Debe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas estándar, HR. Debe involucrarse mas en el GB, generando mas aportes en el sector a través del análisis de los problemas ', '', ''),
(4044, '2024', 1, 58, 79, 78.75, 'MB', 'Se reconoce que a lo largo del año ha demostrado ser una persona comprometida y dispuesta a cumplir con las responsabilidades que se le asignan. Su disponibilidad y dedicación para cumplir cuando se le requiere son aspectos muy valorados dentro del equipo.\r\n\r\nEs una persona que destaca por su capacidad para integrar a los nuevos compañeros de manera amable y afectiva. Su habilidad para crear un ambiente colaborativo y trabajar en equipo es fundamental para el buen clima laboral, y se aprecia enormemente que', 'Actitud positiva: Siempre mantiene una posición abierta y energía que motiva a los demás, contribuye a un ambiente laboral más productivo y armonioso.\r\n\r\nDisposición y compromiso: siempre disponible cuando se le necesita, lo que demuestra su gran disposición para colaborar y apoyar al equipo.\r\n\r\n', 'Aspectos técnicos: Es importante que trabaje en fortalecer la especialización de tu trabajo, ya que esto le permitirá realizar tus tareas de manera aún más eficiente y le brindará autonomía.\r\n\r\n\r\n', '', ''),
(4045, '2024', 1, 58, 201, 77.5, 'MB', 'Es evidente que posee una sólida capacidad técnica, lo cual le permite desempeñar sus funciones de manera eficiente. Su aptitud en este aspecto es un activo valioso para el equipo y se reconoce ampliamente. Además, se destaca por su gran compromiso con el área, lo que demuestra su dedicación y responsabilidad. Sin embargo, hay áreas en las que podría mejorar para potenciar aún más su desempeño y contribución al equipo. \r\n\r\nEn primer lugar, sería beneficioso que trabajara en fortalecer la comunicación. Mejor', 'Compromiso: Luis demuestra un gran compromiso con el área, lo que se refleja en su dedicación constante y su responsabilidad para cumplir con las tareas asignadas. Este compromiso es un pilar clave que contribuye al éxito del equipo.\r\n\r\nCapacidad técnica: Posee una sólida capacidad técnica, que le permite ejecutar sus tareas de manera eficiente y con gran precisión. Su conocimiento y habilidades en su área de trabajo son altamente valorados y esenciales para el buen desempeño del equipo.\r\n\r\nResponsabilidad:', 'Comunicación: Luis puede mejorar en su comunicación con los superiores. Fortalecer este aspecto le permitirá asegurar que todos estén alineados y facilitará un mejor flujo de información.\r\n\r\nOrganización: Es importante que Luis trabaje en la organización de su tiempo y tareas. Mejorar en este aspecto le permitirá gestionar proyectos de manera más eficiente y asumir un rol más activo en la coordinación del equipo.\r\n\r\n', '', ''),
(4046, '2024', 0, 0, 712, 91.25, 'E', 'Ha demostrado, de manera constante, una gran capacidad para analizar problemas y proponer soluciones lógicas y viables. Su enfoque analítico y práctico es una fortaleza clave que aporta valor al equipo. Además, su compromiso con el trabajo seguro y con su sector es muy destacable, esto no solo refleja su responsabilidad, sino también su dedicación para garantizar un ambiente de trabajo seguro y eficiente. \r\n\r\nEs importante destacar su flexibilidad y su predisposición para trabajar cuando se le necesita. Est', 'Emanuel tiene las siguientes cualidades:\r\n\r\n* Autosuficiencia: capacidad de tomar decisiones de manera independiente y enfrentarse a desafíos con gran confianza en si mismo. Esto no solo le permite trabajar de manera eficiente, sino que también inspira a quienes lo rodean a seguir su ejemplo.\r\n\r\n* Capacidad técnica: Sabe cómo aplicar su conocimiento de manera efectiva, lo que impacta directamente en los resultados.\r\n\r\n*Versatilidad: Se adapta con facilidad a nuevas situaciones y tareas. Tiene capacidad para', 'Sería recomendable que prestara mayor atención a su presencia y cuidado personal, ya que esto contribuiría a una imagen más profesional y adecuada en su entorno laboral.\r\n', '', ''),
(4048, '2024', 0, 0, 741, 0, 'MB', 'Su habilidad técnica es destacable; tiene un dominio muy bueno de las herramientas y procesos en planta, lo cual es un activo valioso para el equipo. Su competencia técnica le permite llevar a cabo sus tareas de manera eficiente y con precisión, lo que es fundamental para el buen desempeño de la planta. \r\n\r\nAdemás, siempre está dispuesto a trabajar cuando se le necesita, lo que demuestra su compromiso y responsabilidad. Este nivel de disposición es muy apreciado y genera un ambiente de confianza dentro del ', 'Habilidad técnica: Juan Carlos posee una habilidad técnica sobresaliente, con un dominio excelente de las herramientas y procesos en planta, lo que es fundamental para el éxito operativo del equipo.\r\n\r\nCompromiso: Siempre muestra un compromiso ejemplar con su trabajo, estando dispuesto a colaborar en cualquier momento cuando se le necesita, lo que fortalece la confianza dentro del equipo.\r\n\r\nResponsabilidad: Su responsabilidad es destacable, ya que cumple con sus tareas de manera eficiente y siempre asegura', 'Podría mejorar su proactividad al tomar la iniciativa en la implementación de mejoras dentro del área, lo que le permitiría contribuir más activamente al desarrollo del equipo.\r\n\r\n', '', ''),
(4049, '2024', 1, 58, 741, 91.25, 'MB', 'Su habilidad técnica es destacable; tiene un dominio muy bueno de las herramientas y procesos en planta, lo cual es un activo valioso para el equipo. Su competencia técnica le permite llevar a cabo sus tareas de manera eficiente y con precisión, lo que es fundamental para el buen desempeño de la planta. \r\n\r\nAdemás, siempre está dispuesto a trabajar cuando se le necesita, lo que demuestra su compromiso y responsabilidad. Este nivel de disposición es muy apreciado y genera un ambiente de confianza dentro del ', 'Habilidad técnica: Juan Carlos posee una habilidad técnica sobresaliente, con un dominio excelente de las herramientas y procesos en planta, lo que es fundamental para el éxito operativo del equipo.\r\n\r\nCompromiso: Siempre muestra un compromiso ejemplar con su trabajo, estando dispuesto a colaborar en cualquier momento cuando se le necesita, lo que fortalece la confianza dentro del equipo.\r\n\r\nResponsabilidad: Su responsabilidad es destacable, ya que cumple con sus tareas de manera eficiente y siempre asegura', 'Podría mejorar su proactividad al tomar la iniciativa en la implementación de mejoras dentro del área, lo que le permitiría contribuir más activamente al desarrollo del equipo.', '', '');
INSERT INTO `desempenio` (`id`, `periodo`, `idempresa`, `idevaluador`, `idevaluado`, `porcentaje`, `resultado`, `observaciones`, `fortalezas`, `debilidades`, `compromiso`, `capacitacion`) VALUES
(4051, '2024', 1, 58, 820, 81.25, 'MB', 'Tiene una buena capacidad técnica que le permite desempeñar sus funciones de manera eficiente, y siempre demuestra una disposición para aprender y superarte. Esta actitud de mejora continua es fundamental y refleja su compromiso con su crecimiento profesional. \r\n\r\nSu compromiso con la planta y con tu sector es muy destacable. Siempre está dispuesto a aportar y cumplir con las responsabilidades que se le asignan, lo que le convierte en un miembro valioso del equipo. Además, su enfoque en trabajar de manera s', 'Disposición para aprender: Claudio demuestra una gran disposición para aprender y superarse, lo que le permite adaptarse rápidamente a nuevos desafíos y seguir creciendo profesionalmente.\r\n\r\nCompromiso: Su compromiso con la planta y su sector es evidente, siempre mostrando dedicación y responsabilidad para cumplir con las tareas asignadas y contribuir al buen funcionamiento del equipo.', 'Proactividad y Comunicación: Claudio podría mejorar en su proactividad al expresar sus ideas y sugerencias de manera más activa. Además, fortalecer un poco más su comunicación con el equipo le permitirá compartir mejor sus opiniones y contribuir al desarrollo y mejora continua de los procesos dentro de la planta.', '', ''),
