(4059, '2024', 1, 5, 310, 87.5, 'MB', 'Se destaca un muy buen desempeño para los puestos en los que se ha trabajado', 'Orientación a los resultados es una competencia muy destacable.\r\nSe destaca la perseverancia para cumplir con los objetivos y la proactividad de estar siempre atento a las necesidades productivas del sector. ', 'Debe trabajar mas en flexibilidad. Debe aprender a trabajar con recursos que en ocasiones no van a ser los mas aptos para la tarea, pero que es parte de la dinámica de trabajo en la empresa. \r\nDebe trabajar mas en el desarrollo de sus colaboradores, aprovechando momentos ociosos para generar la polifuncionalidad necesaria para la línea en la cual se desempeña.', 'Se observa un muy alto compromiso para con su puesto y la línea en la cual se desempeña.', ''),
(4060, '2024', 1, 5, 308, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Autonomía y calidad son competencias destacables. ', 'Debe dejar de lado la utilización excesiva del celular. Debe aprender a trabajar mas con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas estándar, HR. Debe ocupar mas el tiempo ocioso de manera productiva, inclusive enseñando a sus compañeros, generando polifuncionalidad. \r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. De', '', ''),
(4062, '2024', 1, 5, 305, 0, 'MB', 'Se destaca un muy buen desempeño para los puestos en los que se ha trabajado', 'Debe trabajar mas en flexibilidad. Debe aprender a trabajar con recursos que en ocasiones no van a ser los mas aptos para la tarea, pero que es parte de la dinámica de trabajo en la empresa. \r\nDebe trabajar mas en el desarrollo de sus colaboradores, aprovechando momentos ociosos para generar la polifuncionalidad necesaria para la línea en la cual se desempeña.', 'Orientación a los resultados es una competencia muy destacable.\r\nSe destaca la perseverancia para cumplir con los objetivos y la proactividad de estar siempre atento a las necesidades productivas del sector. \r\nDebe seguir aprendiendo en los equipos que tiene a cargo, desarrollando mas habilidades técnicas para poder resolver problemas pro si solo.', '', ''),
(4063, '2024', 1, 5, 288, 80, 'MB', 'Se destaca un muy buen desempeño para los puestos en los que se ha trabajado', 'Aspectos como calidad, flexibilidad y trabajo en equipo son competencias que se destacan.\r\n', 'Debe trabajar en calidad, cumpliendo las BPM. En muchas ocasiones se observa incumplimiento de uso de barbijo.\r\nFalta de utilización de EPP en ocasiones\r\nDebe aprender a trabajar con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe trabajar mas.\r\nDebe trabajar mas en la autonomía de su equipo. Se observa poco interés en seguir aprendiendo conocimientos técnicos que después serán utilizados en el sector para resolver los problemas que acontecen. \r\nExcesivo tiempo en el desayunador.\r\nExcesiv', 'Se observa un alto compromiso con respecto a los equipos y sobre todo en temporada. No asi fuera de temporada. ', ''),
(4064, '2024', 1, 5, 273, 0, 'MB', 'Se destaca un muy buen desempeño para los puestos en los que se ha trabajado', 'Responsabilidad, compañerismo, trabajo en equipo y seguridad son competencias destacables. ', 'Debe trabajar en calidad, cumpliendo las BPM. En ocasiones se observa incumplimiento de uso de barbijo y consumo de chicle\r\nDebe dejar de lado la utilización excesiva del celular. Debe aprender a trabajar mas con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas estándar, HR. Debe ocupar mas el tiempo ocioso de manera productiva. ', 'Se observa un muy alto compromiso para con su puesto y la línea en la cual se desempeña.', 'Se sugiere seguir trabajando en la polifuncionalidad de su desempeño, aprendiendo en profundidad los demás sectores de la línea. '),
(4066, '2024', 1, 5, 259, 0, 'MB', 'Se destaca un muy buen desempeño para los puestos en los que se ha trabajado', 'Orientación a los resultados es una competencia muy destacable.\r\nSe destaca la perseverancia para cumplir con los objetivos y la proactividad de estar siempre atento a las necesidades productivas del sector. ', 'Debe seguir trabajando con el sistema, realización de OT, LUPs carga de OT, SPAC, etc. \r\nDebe trabajar en calidad, cumpliendo las BPM. Muchas ocasiones se observa incumplimiento de uso de barbijo.\r\nDebe seguir trabajando en Autonomía, desarrollando mas conocimientos y habilidades para poder resolver problemas por si solo.', 'Se observa un muy alto compromiso para con su puesto y la línea en la cual se desempeña.', ''),
(4067, '2024', 1, 5, 214, 0, 'B', 'Se destaca un buen desempeño, adecuado para los puestos en los que se ha trabajado', 'Aspectos como calidad y trabajo en equipo son competencias que se destacan', 'Debe aprender a trabajar mas con el sistema, realización de OT, LUPs carga de OT, SPAC, planillas, HR. Debe ocupar mas el tiempo ocioso de manera productiva. \r\nDebe trabajar mas en seguridad. Se observan desvíos en seguridad como pasar por debajo de una cinta o no usar EPP para trasladar químicos.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva,\r\nDebe trabajar mas en la autonomía de su equipo. Se', '', ''),
