(4196, '2024', 1, 56, 535, 0, 'MB', 'Desempeña su puesto con mucha autonomía, logra cumplir con lo que se le solicita y lo mantiene en el tiempo', 'Flexibilidad, compañerismo, trabajo en condiciones de seguridad', 'Mantener 5S', 'Comprometido con los resultados, atento a las necesidades, plantea mejoras', 'reforzar aspectos técnicos en los equipos con mayor detalle para colaborar con una resolución ágil de problemas'),
