(4206, '2024', 1, 12, 814, 91.25, 'MB', 'Yami es una colaboradora muy preocupada por cumplir con lo que se le solicita. Es buena compañera, siempre dispuesta a ayudar. \r\nA podido lograr llevarse gran carga de trabajo sola supliendo mi reemplazo durante la jornada reducida.', 'Su autonomía la caracteriza tratando de dar soluciones.\r\nEl orden y seguimiento de tareas permite que la información este accesible y organizada. \r\n', 'Cuando se hable de trabajo hacer referencia de manera grupal y no individual.\r\nEn ocasiones con personas que tiene menor empatía no resuelve de igual manera que con el resto.\r\n\r\n', 'Siempre dispuesta a trabajar en equipo y comprometida con los resultados.', ''),
(4208, '2024', 0, 0, 320, 0, 'B', 'Efectivo desempeño técnico, ', 'Capacidad Técnica', 'Gestión de tiempo, es importante comenzar a gestionar a mediano - largo plazo. Toma de decisiones', 'Comprometido con desempeño diario de línea', 'Reforzar capacitaciones en conceptos de especificaciones de producto'),
(4209, '2024', 1, 56, 320, 66.25, 'B', 'Posee buena capacidad de análisis de problemas y fallas de equipos. Debe registrar los conocimientos adquiridos en los equipos asignados para poder capacitar al resto del grupo y fortalecer el conocimiento de los operadores', 'Capacidad técnica, gestion de repuestos', 'Gestión de tiempo, planificación de tareas a mediano/largo plazo. Toma de decisiones respecto a detener equipos. ', 'Comprometido con desempeño de linea', 'Reforzar capacitaciones respecto a especificaciones de producto en ambas líneas'),
(4210, '2024', 1, 56, 52, 0, 'MB', 'Gran capacidad para resolver problemas. Plantea nuevas soluciones y las lleva cabo hasta obtener resultados. Siempre disponible cuando se requiere', 'Conocimientos técnicos, predisposición', 'Gestión de repuestos, estandarizar periodos de cambio de repuestos', 'Comprometido con los resultados y el estado de los equipos', 'Reforzar un conocimientos de Línea Cevolani, técnicos y de especificaciones de producto'),
(4211, '2024', 1, 56, 433, 0, 'B', 'Resalta su empeño en aprender, aplica lo aprendido en línea, colabora con sus compañeros', 'Aprendizaje, flexibilidad', 'Gestión de 5S, conceptos de limpieza durante el turno', 'Comprometido con la funcionalidad de su equipo', 'Continuar capacitación en línea Soudronic'),
(4212, '2024', 1, 56, 674, 0, 'B', 'Se acoplo muy bien al equipo de trabajo, logra cierta autonomía en algunas actividades', 'Predisposición, capacidad de aprendizaje y aplicación de conceptos aprendidos', 'Conocimiento técnico para realizar las HR', 'Comprometida con sus pares, participa y da sugerencias', 'Reforzar conceptos de Calidad y Hojas de revisión'),
(4213, '2024', 1, 56, 242, 0, 'B', 'Buen conocimiento de línea Cevolani, conoce el proceso y los requisitos técnicos necesarios. Posee habilidad con el uso de maquinas herramientas lo que aporta mas soluciones al puesto que ocupa', 'Conocimientos técnicos', 'Comunicación y respeto por los demás. Algunas personas pueden sentirse incomodas con la forma en que son tratados ', 'Comprometido con la calidad y la seguridad, alerta ante situaciones fuera de condición', 'Debe continuar con la capacitación en Soudronic, incluidos aspectos de calidad'),
(4214, '2024', 1, 56, 400, 0, 'B', 'Busca aprender y ampliar su conocimiento, aporta ayuda a mtto planificado para mantener los equipos en condiciones', 'Flexibilidad, Aspecto colaborativo', 'Conocimientos técnicos para resolver problemas, aporte de ideas', 'Comprometido en su día a día, hay que mejorar la anticipacion a problemas', 'Reforzar capacitaciones técnicas, continuar con formación de operación de Soudronic'),
(4215, '2024', 1, 56, 319, 0, 'B', 'Cumple su función asertivamente, maneja los tiempos y las necesidades del sectro de manera efectiva', 'Experiencia en el puesto, cumplimiento de las solicitudes', 'Baja participación en necesidades o mejoras de la línea', 'Comprometido con su puesto', 'Mejorar aspectos de comunicación'),
(4216, '2024', 1, 56, 1, 0, 'MB', 'Experiencia múltiple en equipos del sector, sugiere ideas y colabora con personal nuevo. Busca ', 'Conocimiento técnico, registro y resguardo de información relevante del proceso. Forma capacitaciones para operadores de línea para incrementar el conocimiento', 'Mejorar la participación en resolución de problemas en su equipo de trabajo', 'Comprometido con la operación de la línea, atento a eventualidades ', 'Reforzar aspectos de calidad y especificaciones de línea cevolani. Avanzar con proceso de adquirir y compartir conocimiento con el equipo de mecánicos'),
(4217, '2024', 1, 56, 264, 0, 'B', 'Cumple lo solicitado en su jornada de trabajo, notable manejo y agilidad sobre el manejo de tapas', 'Cumplimiento de tareas solicitadas', 'Trabajo en equipo, gestión de tiempo, conocimientos en los equipos', 'Aceptable, pero mejorable', 'Iniciar plan de capacitaciones técnicas y de regulaciones en equipos de línea'),
(4219, '2024', 1, 56, 179, 0, 'B', 'Notoria experiencia en el puesto, comenta problemas que detecta o percibe. ', 'Conocimiento operativo', 'Resolución de problemas y toma de decisiones', 'Comprende su posición y cumple con su tarea. Comprometido con la aplicación de nuevos controles de calidad', 'Reforzar aspectos de resolución de problemas y conocimiento técnico en equipos'),
(4220, '2024', 1, 56, 672, 0, 'B', 'Desempeña funciones activamente en la línea, trata de mitigar detenciones. Solicita ayuda para resolver problemas', 'Predisposición, Respeto', 'Conocimientos técnicos y en Hojas de Inspección', 'Asume el nuevo compromiso de realizar controles de calidad y lo lleva adelante', 'Reforzar conocimientos técnicos para resolución de problemas'),
(4221, '2024', 1, 56, 269, 0, 'B', 'Desempeña tareas de manera correcta, posee experiencia en el puesto y conocimientos que aplica a lo largo de su turno', 'Conocimiento del proceso y aspectos de calidad', 'Trabajo en equipo, proactividad', 'Asume activamente el nuevo requerimiento de control de tapas', 'Reforzar aspectos de trabajo en equipo y proactividad'),
(4222, '2024', 1, 56, 240, 0, 'MB', 'Operador experimentado con conocimientos avanzados en resolución de problemas en linea Soudronic y Cevolani', 'Conocimiento, Colaboración, Actitud', 'Conocimiento PC', 'Compromiso pleno en el proceso que desarrolla', 'Algunas capacitaciones que complementen respecto a Calidad'),
(4223, '2024', 1, 56, 213, 0, 'B', 'Operario conocedor del proceso, polifuncional, cumple sus tareas tratando de cumplir con los objetivos planteados', 'Predisposición, Flexibilidad', 'Resolución de problemas', 'Gran compromiso con la calidad y seguridad monitoreando constantemente el proceso', 'Fomentar el análisis de situaciones y actuación en resolución de problemas'),
(4224, '2024', 1, 56, 246, 75, 'B', 'Basta experiencia en el sector lo posicionan como referente para consultas cotidianas. Abierto a compartir conocimiento y advertir sobre situaciones para anticiparse a problemas', 'Conocimiento del sector', 'Perseverancia para resolver problemas culturales', 'Comprometido con resultados, aplica conocimiento y trata de colaborar activamente', 'Conocimientos de procesos de control de calidad en linea Soudronic'),
(4225, '2024', 1, 56, 80, 0, 'MB', 'Conocimiento claro del proceso, gran capacidad para identificar anormalidades. Actitud positiva y colaborativa, cumple los estándares establecidos y mantiene en el tiempo ', 'Conocimiento del sector, Actitud', 'Conocimientos informaticos', 'Muy comprometida con la calidad', 'Iniciar proceso de controles de calidad de línea Soudronic'),
(4226, '2024', 1, 56, 229, 0, 'B', 'Cumple funciones asigandas', 'Polifuncionalidad y adaptación a las necesidades', 'Conocimientos técnicos', 'Comprometida con los resultados', 'Mejorar aspectos técnicos para HR'),
(4227, '2024', 1, 56, 647, 0, 'B', '', '', '', '', ''),
(4228, '2024', 1, 41, 834, 0, 'B', 'A pesar de que el resultado indica que alcanza los requerimientos del puesto, no fue suficiente para una recontratación, no fue una persona que demostrara autonomía ni orientación a los resultados. Se solicito en varias oportunidades que realizara las actividades planificadas', '', '', '', ''),
(4229, '2024', 1, 41, 744, 0, 'B', 'Oscar demostró una evolución en los conceptos y en la forma de trabajar. Los resultados en el sector fueron con una tendencia positiva.', 'Comunicación y respeto', '', '', ''),
(4230, '2024', 1, 41, 263, 0, 'MB', 'Año tras año demuestra evolución en los resultados y en el area. Se destaco a todo el equipo que durante la temporada 2023-2024 los resultados fueron positivos vs temporada anteriores. A pesar de no lograr el objetivo 100%. ', 'Ganas de querer aprender contantemente. Respeto y comunicación.\r\nProactividad: Se sigue observando una importante evolución en la resolución de problemas, seguimientos de temas, involucración en el proceso, \r\nPedro ha demostrado que tiene la capacidad para proponer ideas creativas y que han sido asertivas al momento de resolver problemas. ', '', 'A medida que podamos mejorar la condición básica del sector y aumentar la eficiencia del sector, poder evaluar y tomar decisiones con los resultados de los análisis\r\nPoder proponer acciones de mejora para la temporada de mantenimiento 2025 en base a lo aprendido en el curso dictado por INTA', ''),
(4231, '2024', 1, 41, 325, 0, 'MB', ' Se destaco a todo el equipo que durante la temporada 2023-2024 los resultados fueron positivos vs temporada anteriores. A pesar de no lograr el objetivo 100%. ', 'Conocimiento tecnico, involucración en el proceso y en aspectos de seguridad', 'Continuar trabajando en lograr un Trabajo mancomunado con el resto del equipo, sobretodo mantenimiento', 'A medida que podamos mejorar la condición basica del sector y aumentar la eficiencia del sector, poder evaluar y tomar decisiones con los resultados de los analisis', ''),
(4232, '2024', 1, 41, 717, 0, 'B', 'Se destaco a todo el equipo que durante la temporada 2023-2024 los resultados fueron positivos vs temporada anteriores. A pesar de no lograr el objetivo 100%. La performance del pretratamiento de playa supero las expectativas. ', 'Involucración en el proceso de efluentes físico - químico y biológico para aprender', '', 'Autonomía en la limpieza y orden del sector.\r\nContinuar con el aprendizaje del área, carga de datos y análisis', ''),
(4233, '2024', 1, 41, 428, 0, 'B', 'Se destaco a todo el equipo que durante la temporada 2023-2024 los resultados fueron positivos vs temporada anteriores. A pesar de no lograr el objetivo 100%. La performance del pretratamiento de playa supero las expectativas. ', 'Integración en el área y con sus equipos.', '', 'Autonomía en la limpieza y orden del sector.\r\nContinuar con el aprendizaje del área, carga de datos y análisis', ''),
(4234, '2024', 1, 41, 706, 0, 'B', 'Se destaco a todo el equipo que durante la temporada 2023-2024 los resultados fueron positivos vs temporada anteriores. A pesar de no lograr el objetivo 100%. La performance del pretratamiento de playa supero las expectativas. ', '', 'Proactividad en la resolución de los temas por si solo', 'Autonomía en la limpieza y orden del sector.\r\nContinuar con el aprendizaje del área, carga de datos y análisis', ''),
(4235, '2024', 1, 41, 835, 0, 'B', 'Agostina logro adaptarse rápidamente a la dinámica de la planta. Se integro con Vivian cumpliendo con los requerimientos y actividades planificadas. \r\nAntes necesidades de cambios de horario no tuvo problemas.', 'Capacidad de escucha y proactividad', '', '', ''),
(4236, '2024', 1, 5, 896, 0, 'B', '', '', '', '', ''),
(4237, '2024', 1, 5, 72, 0, 'NM', 'Se destaca un bajo desempeño para el puesto ocupado. Debe seguir trabajando en lo marcado en ésta y las devoluciones anteriores. \r\nEl colaborador entiende la devolución y la escucha atentamente, pero debe tomar lo hablado y trabajarlo para poder elevar su desempeño. ', 'Aspectos como calidad es una competencias que se destaca en su desempeño. Siempre ha trabajado muy bien en este aspecto. H mejorado el compromiso de las limpiezas los fines de semana, pero va atado a una mejoría en los tiempos de limpieza y funcionamiento del equipo y personal capacitado para cubrirlo', 'Debe trabajar mas en equipo. Debe aprender a resolver los conflictos. No se puede dejar de comunicar con el Líder, o hacerlo de manera de selectiva. Debe aprender a no llevar al plano personal las situaciones laborales. Estas cosas generan malestar y mal clima laboral. Debe tratar a los demás como le gustaría que lo traten a si mismo Debe dejar de lado la utilización excesiva del celular. Debe aprender a trabajar mas con el sistema, realización de OT, LUPs carga de OT, planillas estándar, HR. Debe ocupar ma', 'Debe trabajar mas en la autonomía de su equipo. Se observa poco interés en seguir aprendiendo conocimientos técnicos que después serán utilizados en el sector para resolver los problemas que acontecen.\r\n ', 'Debe trabajar mas activamente el GB.\r\nDebe seguir trabajando en proactividad. No se debe esperar ordenes del Líder o supervisor. Debe anticiparse y utilizar los tiempos ociosos de manera productiva.\r\nDebe trabajar mas en seguridad. Se observan desvíos en seguridad como no utilización de copas protectoras y guantes. Se le marca en reiteradas ocasiones '),
(4238, '2024', 1, 54, 833, 0, 'B', 'Emiliano es un colaborador activo que demuestra una actitud proactiva que le permite integrarse rápidamente al equipo. Su capacidad técnica es sólida, lo que le permite abordar tareas complejas.', ' Su predisposicion por aprender es una de sus principales fortalezas, ya que no solo busca mejorar constantemente, sino que también se adapta con facilidad a nuevos desafíos y herramientas.', 'Debe crear el espacio para registrar y documentar todas las tareas realizadas durante el mantenimiento anual de cada equipo a su cargo.', '', '');
